(102, 1, 'Фильтр гидравлический DELSA JCB 32/925346', '&lt;p&gt;&lt;b&gt;Фильтр гидравлический DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/92534&lt;/p&gt;&lt;p&gt;Гидравлический фильтр, произведённый фирмой DELSA, для спецтехники марки JCB. DELSA –фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения эффективности. Гидравлический фильтр необходим, чтобы защищать компрессорное масло и другие виды масел от ненужных примесей. Фильтроэлемент важно регулярно менять согласно регламенту изготовителя, чтобы не образовывались засоры и не падала работоспособность техники.&lt;/p&gt;', '', 'Фильтр гидравлический DELSA JCB 32/925346', '', ''),
(103, 1, 'Фильтр масляный DELSA JCB 320/04134', '&lt;p&gt;&lt;b&gt;Фильтр масляный DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 320/04134&lt;/p&gt;&lt;p&gt;Масляный фильтр, произведённый фирмой DELSA, для спецтехники марки JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения продуктивности. Масляный фильтр защищает и очищает компрессорное масло от различных частиц, которые могут повредить спецтехнике, ухудшив качество масла. Масло, в котором находятся твёрдые частицы, нарушает работу охлаждения и вредит винтовому блоку. Фильтр масляный DELSA защитит вашу технику от подобных неполадок. Масляный фильтр необходимо регулярно менять согласно регламенту изготовителя. Фильтры, представленные на нашем сайте, обладают высокой термостойкостью, устойчивы к компрессорному маслу, перепадам давления, задерживают большое количество вредных частиц, а также изготовлены из материала, который не боится коррозии.&lt;/p&gt;', '', 'Фильтр масляный DELSA JCB 320/04134', '', ''),
(104, 1, 'Фильтр трансмиссионный DELSA для КПП JCB 581/18076, 32/915500', '&lt;p&gt;&lt;b&gt;Фильтр трансмиссионный DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 581/18076, 32/915500&lt;/p&gt;&lt;p&gt;Трансмиссионный фильтр, произведённый фирмой DELSA для КПП JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения эффективности. С помощью трансмиссионного фильтра DELSA для КПП JCB возможно удаление пыли в виде металлической стружки, которая образуется от трения деталей, подверженных износу. Фильтр необходимо менять согласно регламенту, так как халатное отношение к замене фильтра ведёт к дорогостоящему ремонту. Мы предлагаем фильтры высокого качества, механически прочные и показывающие отличный результат в очистке масла от самых мелких частиц.&lt;/p&gt;', '', 'Фильтр трансмиссионный DELSA для КПП JCB 581/18076, 32/915500', '', ''),
(105, 1, 'Фильтр масляный DELSA JCB 02/100073', '&lt;p&gt;&lt;b&gt;Фильтр масляный DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 02/100073&lt;/p&gt;&lt;p&gt;Масляный фильтр, произведённый фирмой DELSA, рассчитан на защиту от ненужных элементов рабочего масла двигателя, изготовленного британской компанией JCB, серии Perkins моделей АА, АВ, AK, RG. Продукция этих компаний никогда не вызывает нареканий, является лучшей на рынке спецтехники и специального оборудования. Устраняя засоры и пыль, фильтр масляный DELSA JCB способствует легкому прохождению масла в мотор, что помогает маслу прекрасно смазывать поршни и другие части мотора. Производить замену масляного фильтра следует каждые 500 м/ч, долгая эксплуатация масляного фильтра ведёт к износу детали и потере маслом своей изначальной чистоты.&lt;/p&gt;', '', 'Фильтр масляный DELSA JCB 02/100073', '', ''),
(106, 1, 'Фильтр топливный DELSA на JCB 32/925856', '&lt;p&gt;&lt;b&gt;Фильтр топливный DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925856&lt;/p&gt;&lt;p&gt;Фильтр топливный, произведённый фирмой DELSA, для спецтехники марки JCB. Топливный фильтр удерживает ржавчину, вредные примеси и ненужные частицы из топлива, которые могут привести к износу топливного насоса. Является важным очистительным элементом топливной магистрали. Мощность двигателя может повышаться за счет топливного фильтра, который обеспечивает защиту от загрязнения. Фильтр рекомендуется менять согласно регламенту производителя.&lt;/p&gt;', '', 'Фильтр топливный DELSA на JCB 32/925856', '', ''),
(107, 1, 'Фильтр воздушный внутренний DELSA на JCB 32/915702', '&lt;p&gt;&lt;b&gt;Фильтр топливный DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925856&lt;/p&gt;&lt;p&gt;Воздушный фильтр внешний, произведённый маркой DELSA, для спецтехники британской марки JCB. DELSA, зарекомендовавшая себя компания на мировом рынке, изготавливает детали для спецтехники. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения продуктивности. Внешний воздушный фильтр является важным компонентом системы, очищающей воздух от механических примесей, сора и грязи. Фильтр даёт возможность винтовому блоку компрессора работать без перебоев, что ведет к увеличению эффективности работы компрессора и всей техники. Важно своевременно менять воздушный фильтр, так как несвоевременная замена ведёт к износу и поломке', '', 'Фильтр воздушный внутренний DELSA на JCB 32/915702', '', ''),
(108, 1, 'Фильтр воздушный внутренний DELSA на JCB 580/12021', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внутренний DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 580/12021&lt;/p&gt;&lt;p&gt;Воздушный фильтр внешний, произведённый маркой DELSA, для спецтехники британской марки JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения эффективности. Внешний воздушный фильтр является важной деталью, очищающей воздух от вредных примесей. Фильтр обеспечивает исправную работу винтового блока компрессора, что увеличивает эффективность работы компрессора и всей техники в целом. Очень важно вовремя менять воздушный фильтр, так как несвоевременная замена ведёт к износу и поломке.&lt;/p&gt;', '', 'Фильтр воздушный внутренний DELSA на JCB 580/12021', '', ''),
(109, 1, 'Фильтр воздушный внутренний DELSA на JCB 32/920401', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внутренний DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/920401&lt;/p&gt;&lt;p&gt;Воздушный фильтр внешний, произведённый маркой DELSA, для спецтехники британской марки JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения эффективности. Внешний воздушный фильтр является важным компонентом системы, очищающей воздух от механических примесей. Фильтр даёт возможность винтовому блоку компрессора работать без перебоев, что ведет к повышению эффективности работы компрессора и всей техники в целом. Очень важно вовремя менять воздушный фильтр, так как несвоевременная замена ведёт к износу и поломке', '', 'Фильтр воздушный внутренний DELSA на JCB 32/920401', '', ''),
(110, 1, 'Фильтр воздушный внешний DELSA на JCB 580/12020', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внешний DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 580/12020&lt;/p&gt;&lt;p&gt;Воздушный фильтр, произведённый маркой DELSA, для спецтехники марки JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения продуктивности. Воздушный фильтр – это часть системы воздухоочищения, защищающая от пыли, стружки, а также помогает избежать износа деталей и их повреждения. Представленный фильтр задерживает в себе ненужные элементы, которые могут проникнуть в узлы и агрегаты экскаваторов погрузчиков JCB 3CX и 4 CX. Прекрасно защищает от влаги, а также продлевает время работы масляного фильтра, маслоотделителя, масла. Менять фильтр необходимо в соответствии с регламентом производителя. &lt;/p&gt;', '', 'Фильтр воздушный внешний DELSA на JCB 580/12020', '', ''),
(111, 1, 'Фильтр воздушный внешний DELSA на JCB 32/903601', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внешний DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/903601&lt;/p&gt;&lt;p&gt;Воздушный фильтр внешний, произведённый маркой DELSA, для спецтехники британской марки JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения эффективности. Воздушный фильтр – это часть системы, очищающей воздух от вредных частиц. Воздушный фильтр создаёт прекрасные условия для работы агрегата, фильтруя воздух от вредных элементов, грязи и пыли разного вида. Также обеспечивает защиту от влаги. Менять фильтр следует в соответствии с регламентом изготовителя.&lt;/p&gt;', '', 'Фильтр воздушный внешний DELSA на JCB 32/903601', '', ''),
(112, 1, 'Фильтр воздушный внешний DELSA на JCB 32/917804', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внешний DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/917804&lt;/p&gt;&lt;p&gt;Воздушный фильтр внешний, произведённый маркой DELSA, для спецтехники британской марки JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения эффективности. Внешний воздушный фильтр является важным компонентом системы, очищающей воздух от механических примесей. Фильтр даёт возможность винтовому блоку компрессора работать без перебоев, что ведет к повышению эффективности работы компрессора и всей техники в целом. Очень важно вовремя менять воздушный фильтр, так как несвоевременная замена ведёт к износу и поломке.&lt;/p&gt;', '', 'Фильтр воздушный внешний DELSA на JCB 32/917804', '', ''),
(113, 1, 'Фильтр воздушный внутренний DELSA на JCB 32/917805', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внешний DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/917805&lt;/p&gt;&lt;p&gt;Воздушный фильтр внешний, изготовленный  DELSA, для спецтехники британской марки JCB. DELSA – компания, зарекомендовавшая себя на мировом рынке, изготавливает детали для спецтехники и автомобилей. Приобретая детали данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения продуктивности. Воздушный фильтр применяется в системе воздухочищения, он защищает компрессор от износа и преждевременного разрушения, преграждая путь вредным элементам, таким как: механическая пыль, грязь и тому подобное. Важно периодически производить замену фильтра, так как от этого зависит работа спецтехники.&lt;/p&gt;', '', 'Фильтр воздушный внутренний DELSA на JCB 32/917805', '', ''),
(114, 1, 'Колба топливного фильтра на JCB 32/400301', '&lt;p&gt;&lt;b&gt;Колба топливного фильтра&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/400301&lt;/p&gt;&lt;p&gt;Колба топливного фильтра для спецтехники британской марки JCB. Колба топливного фильтра является незаменимым компонентом топливного фильтра. Топливный фильтр обеспечивает чистоту топлива, защищая его от вредных примесей. Топливные фильтры, размещённые на нашем сайте, обладают достаточной ёмкостью, чтобы накапливать в себе большое количество частиц, пытающихся проникнуть в топливо. Как только фильтр засоряется, мощность двигателя снижается, поэтому необходимо периодически производить замену фильтра. Колба износостойкая и является высококлассным составляющим топливного фильтра. &lt;/p&gt;', '', 'Колба топливного фильтра на JCB 32/400301', '', ''),
(115, 1, 'Фильтр салона DK 8274 на JCB 30/925759', '&lt;p&gt;&lt;b&gt;Фильтр салона DK&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 30/925759&lt;/p&gt;&lt;p&gt;Фильтр салона DK на JCB – это фильтр печки, размещённой в салоне экскаватора погрузчика JCB 3CX, 4CX.  Фильтр обеспечивает защиту воздуха, циркулирующего по салону, от пыли и грязи. Подобная защита всегда необходима, особенно при работе на строительных площадках. Салонный фильтр следует периодически менять, так как халатное отношение к процессу замены фильтра ведет к дискомфорту водителя, а, следовательно, и к нарушению рабочего процесса. &lt;/p&gt;', '', 'Фильтр салона DK 8274 на JCB 30/925759', '', ''),
(116, 1, 'Фильтр воздушный наружный DELSA на JCB 32/905001', '&lt;p&gt;&lt;b&gt;Фильтр воздушный наружный DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/905001&lt;/p&gt;&lt;p&gt;Наружный воздушный фильтр для специальной техники, произведённой зарекомендовавшей себя на рынке компанией DELSA для британской спецтехники JCB. Наружный воздушный фильтр – это значимый элемент воздухоочистительной системы. Качественный фильтр увеличивает эффективность спецтехники, так как обеспечивает чистую работу винтового блока компрессора. Фильтр не даёт пыли и другим ненужным примесям попадать в камеру всасывания винтового блока. Требуется вовремя менять воздушный наружный фильтр, так как несвоевременная смена фильтра ведёт к выходу из строя оборудования.&lt;/p&gt;', '', 'Фильтр воздушный наружный DELSA на JCB 32/905001', '', ''),
(117, 1, 'Фильтр воздушный внутренний DELSA на JCB 32/905002', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внутренний DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/905002&lt;/p&gt;&lt;p&gt;Воздушный фильтр внутренний, произведённой зарекомендовавшей себя на рынке компанией DELSA для британской спецтехники JCB. Фильтр обеспечивает работу двигателя внутреннего сгорания без перебоев. Внутренний воздушный фильтр очищает воздух от пыли, влаги и других примесей, наносящих вред двигателю. Воздушный фильтр необходимо менять хотя бы раз в полгода. Ни в коем случае нельзя доставать старый фильтр, прочищать его и дальше использовать, это категорически запрещённое действие, которое может нанести урон всей системе. Фильтр сохраняет мощность техники и влияет на расход топлива.&lt;/p&gt;', '', 'Фильтр воздушный внутренний DELSA на JCB 32/905002', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(118, 1, 'Фильтр гидравлический DELSA на JCB 581/18020, 32/909200', '&lt;p&gt;&lt;b&gt;Фильтр трансмиссионный DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/909200, 581/18020&lt;/p&gt;&lt;p&gt;Фильтр гидравлический DELSA на спецтехнику британской марки JCB для моделей экскаваторов погрузчиков 3CX и 4CX. Гидравлический фильтр важный компонент защиты компрессорного масла и других видов масел от ненужных примесей, вредоносной пыли и продуктов отработки. Качественный фильтр обеспечивает высокую работоспособность техники и отличное состояние топлива. Фильтроэлемент важно регулярно менять согласно регламенту изготовителя, дабы избежать возможного образования засоров и падения работоспособности техники.&lt;/p&gt;', '', 'Фильтр гидравлический DELSA на JCB 581/18020, 32/909200', '', ''),
(119, 1, 'Фильтр воздушный внешний DELSA на JCB 32/915701', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внешний DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/915701&lt;/p&gt;&lt;p&gt;Внешний воздушный фильтр DELSA для спецтехники британской марки JCB. Внешний воздушный фильтр является важной частью очистительной системы. Фильтр очищает воздух от механических примесей, пыли и сора разного вида. Фильтр даёт возможность винтовому блоку компрессора работать без перебоев, что ведет к повышению эффективности работы компрессора и всей техники в целом. Очень важно вовремя менять воздушный фильтр, так как несвоевременная замена ведёт к износу и поломке.&lt;/p&gt;', '', 'Фильтр воздушный внешний DELSA на JCB 32/915701', '', ''),
(120, 1, 'Фильтр воздушный внутренний DELSA на JCB 32/915801', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внутренний DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/915801&lt;/p&gt;&lt;p&gt;Воздушный внутренний фильтр DELSA для спецтехники британской марки JCB. Воздушный внутренний фильтр гарантирует исправное функционирование двигателя внутреннего сгорания. Внутренний воздушный фильтр защищает воздух от пыли, влаги и других примесей, наносящих вред двигателю. Фильтр обладает эффективным влагоотделением, абсолютно непроницаем, фильтрует воздух на 100%, сохраняет мощность техники и влияет на расход топлива. Фильтр необходимо менять раз в полгода. Строго воспрещается использовать один фильтр несколько раз, так как это ведёт к неисправностям', '', 'Фильтр воздушный внутренний DELSA на JCB 32/915801', '', ''),
(121, 1, 'Фильтр воздушный ORIGINAL JCB 32/917301', '&lt;p&gt;&lt;b&gt;Фильтр воздушный ORIGINAL JCB&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/917301&lt;/p&gt;&lt;p&gt;Воздушный фильтр для британской спецтехники JCB. Оригинальное название: Element air filter main. Воздушный фильтр предохраняет двигатель от загрязнения вредоносными элементами, соли, сажи и пыли. Необходимо периодически проводить смену фильтрующего элемента согласно регламенту изготовителя. Компания СпецТехРус предлагает широкий ассортимент высококлассных фильтров отменного качества. Наши менеджеры с радостью проинформируют вас о любой понравившейся вам детали.&lt;/p&gt;', '', 'Фильтр воздушный ORIGINAL JCB 32/917301', '', ''),
(122, 1, 'Фильтр трансмиссионный DELSA JCB 581/18063, 581/M8563, 581/M7012, 32/915500', '&lt;p&gt;&lt;b&gt;Фильтр трансмиссионный DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 581/18063, 581/M8563, 581/M7012, 32/915500&lt;/p&gt;&lt;p&gt;Воздушный фильтр, произведённый маркой DELSA, для спецтехники марки JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения продуктивности. Воздушный фильтр – это часть системы воздухоочищения, защищающая от пыли, стружки, а также помогает избежать износа деталей и их повреждения. Представленный фильтр задерживает в себе ненужные элементы, которые могут проникнуть в узлы и агрегаты экскаваторов погрузчиков JCB 3CX и 4 CX. Прекрасно защищает от влаги, а также продлевает время работы масляного фильтра, маслоотделителя, масла. Менять фильтр необходимо в соответствии с регламентом производителя.  &lt;/p&gt;', '', 'Фильтр трансмиссионный DELSA JCB 581/18063, 581/M8563, 581/M7012, 32/915500', '', ''),
(123, 1, 'Фильтр гидравлический original JCB 32/925346, 32/913500', '&lt;p&gt;&lt;b&gt;Фильтр гидравлический оригинал&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925346, 32/913500&lt;/p&gt;&lt;p&gt;Гидравлический фильтр на спецтехнику британской марки JCB. Гидравлический фильтр важный компонент защиты компрессорного масла и других видов масел от примесей, вредоносной пыли и продуктов отработки. Качественный фильтр обеспечивает высокую работоспособность техники и отличное состояние топлива. Гидравлический фильтр обычно представляет собой сменный элемент, а поэтому необходимо проводить периодическую замену данного элемента согласно регламенту изготовителя, дабы избежать возможного образования засоров и падения работоспособности техники.&lt;/p&gt;', '', 'Фильтр гидравлический original JCB 32/925346, 32/913500', '', ''),
(124, 1, 'Фильтр топливный DELSA на JCB 32/912001', '&lt;p&gt;&lt;b&gt;Фильтр топливный DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/912001&lt;/p&gt;&lt;p&gt;Фильтр топливный DELSA на британскую спецтехнику JCB, подходит для экскаваторов погрузчиков старого образца с двигателями Perkins, выпущенных до 2005 года. Топливный фильтр – это элемент, который функционирует в качестве фильтра и находится в топливной магистрали. Топливный фильтр защищает форсунки, поршни, гильзы цилиндрового двигателя, а также увеличивает срок действия катализатора. Главная задача топливного фильтра – очищать топливо от всяких загрязнений, с чем фильтр, представленный на нашем сайте, справляется прекрасно. Важно менять фильтр в соответствии с регламентом производителя.&lt;/p&gt;', '', 'Фильтр топливный DELSA на JCB 32/912001', '', ''),
(125, 1, 'Фильтр топливный грубой очистки DELSA на JCB 32/925915, 32/925694', '&lt;p&gt;&lt;b&gt;Фильтр топливный грубой очистки DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925915, 32/925694&lt;/p&gt;&lt;p&gt;Фильтр топливный на британскую спецтехнику JCB, а именно для экскаваторов погрузчиков 3CX, 4CX. Данный фильтр используется для очистки топлива от крупных частиц размером до 0,1 миллиметра. Топливный фильтр является фильтрующим элементом, защищающим форсунки, поршни, гильзы цилиндрового двигателя, а также увеличивающим срок действия катализатора. Важно менять топливный фильтр в соответствии с регламентом производителя, дабы избежать засоров и поломки техники.&lt;/p&gt;', '', 'Фильтр топливный грубой очистки DELSA на JCB 32/925915, 32/925694', '', ''),
(126, 1, 'Фильтр трансмиссионный DELSA на JCB 02/100284', '&lt;p&gt;&lt;b&gt;Фильтр трансмиссионный DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 02/100284&lt;/p&gt;&lt;p&gt;Фильтр трансмиссионный для коробки переключения передач на спецтехнику британской марки JCB. Фильтр подходит для экскаваторов погрузчиков JCB 3CX, 4CX старых моделей, выпущенных до 2003 года. Деталь изготовлена американской компанией Donaldson, которая многиедесятилетия выпускает лучшее воздухоочистительное оборудование, используемое в разных отраслях промышленности. Трансмиссионный фильтр защищает рабочую жидкость, находящуюся в коробке передач, от вредоносных элементов. Необходимо регулярно проводить замену фильтра, каждые 500 м/ч, это способствует продуктивной работе спецтехники. Мы предлагаем фильтры высокого качества, механически прочные и показывающие отличный результат в очистке рабочих жидкостей от самых мелких частиц.&lt;/p&gt;', '', 'Фильтр трансмиссионный DELSA на JCB 02/100284', '', ''),
(127, 1, 'Фильтр воздушный внутренний DELSA на JCB 32/925683', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внутренний DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925683&lt;/p&gt;&lt;p&gt;Внутренний воздушный фильтр для британской спецтехники JCB. Является очистительным элементом, фильтрующим пыль и вредные элементы, тем самым защищая воздух, проникающий в систему. Фильтр обладает высокой прочностью и большой вместимостью. Для защиты двигателя от поломки необходимо вовремя менять внутренний воздушный фильтр, каждые 1000 м/ч. Мы предлагаем фильтры высокого качества, которые показывают отличный результат и способствуют эффективности работы.&lt;/p&gt;', '', 'Фильтр воздушный внутренний DELSA на JCB 32/925683', '', ''),
(128, 1, 'Фильтр воздушный внешний DELSA на JCB 32/925682', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внешний DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925682&lt;/p&gt;&lt;p&gt;Наружный воздушный фильтр для британской спецтехники JCB в виде экскаваторов погрузчиков нового поколения, оснащенных двигателем DieselMax 444, выпущенного с 2005-2018 года. Внешний воздушный фильтр – это значимая часть очистительной системы, главной функцией которой является очищение воздуха от механических примесей, пыли и сора разного вида. Фильтр даёт возможность винтовому блоку компрессора работать без перебоев, что ведет к повышению эффективности работы компрессора и всей техники в целом. Очень важно вовремя менять воздушный фильтр, так как несвоевременная замена ведёт к износу и поломке.&lt;/p&gt;', '', 'Фильтр воздушный внешний DELSA на JCB 32/925682', '', ''),
(129, 1, 'Фильтр трансмиссионный (КПП) AND FILTRE на JCB 581/M8564, 581/18076', '&lt;p&gt;&lt;b&gt;Фильтр трансмиссионный AND FILTRE&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; PRC&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 581/M8564, 581/18076&lt;/p&gt;&lt;p&gt;Фильтр трансмиссионный AND FILTRE на британскую технику JCB. Деталь предназначена для моделей JCB 3CX, JCB 4CX, JCB 5CX, выпущенных в период с 2005-2015 годы. Трансмиссионный фильтр защищает рабочую жидкость, находящуюся в коробке передач, от вредоносных элементов и пыли. Необходимо регулярно проводить замену фильтра, это способствует долгому сроку работы важных частей спецтехники. Наша компания предлагает высококлассные фильтры отменного качества, механически прочные и показывающие отличный результат в очистке рабочих жидкостей от самых мелких частиц.&lt;/p&gt;', '', 'Фильтр трансмиссионный (КПП) AND FILTRE на JCB 581/M8564, 581/18076', '', ''),
(130, 1, 'Фильтр гидравлический всасывающий DELSA JCB 32/920300', '&lt;p&gt;&lt;b&gt;Фильтр гидравлический всасывающий DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/920300&lt;/p&gt;&lt;p&gt;Всасывающий гидравлический фильтр для спецтехники британской марки JCB. Всасывающий гидравлический фильтр – важный элемент очистительной системы, который защищает гидравлические масла всех типов от возможных загрязнений. Качественный фильтр гарантирует долгую работу оборудования и предотвращает внезапную поломку. Важно регулярно производить замену фильтра в соответствии с регламентом производителя. Наша компания предлагает высококлассные фильтры отменного качества, механически прочные и показывающие отличный результат в очистке рабочих жидкостей от самых мелких частиц.&lt;/p&gt;', '', 'Фильтр гидравлический всасывающий DELSA JCB 32/920300', '', ''),
(131, 1, 'Фильтр воздушный внутренний DELSA на JCB 32/915801', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внутренний DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/915801&lt;/p&gt;&lt;p&gt;Внутренний воздушный фильтр для британской спецтехники JCB. Фильтр устанавливается на модели JCB 3CX,4CX, выпущенные в период с 1991 - 2004. Предназначен для защиты двигателя Perkins. Внутренний воздушный фильтр предохраняет двигатель от загрязнения вредоносными элементами, от соли, сажи, пыли. Важно регулярно производить замену фильтра в соответствии с регламентом производителя. Наша компания предлагает высококлассные фильтры отменного качества, механически прочные и показывающие отличный результат в очистке рабочих жидкостей от самых мелких частиц.&lt;/p&gt;', '', 'Фильтр воздушный внутренний DELSA на JCB 32/915801', '', ''),
(132, 1, 'Фильтр трансмиссионный DELSA на JCB 32/915500', '&lt;p&gt;&lt;b&gt;Фильтр трансмиссионный DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/915500&lt;/p&gt;&lt;p&gt;Трансмиссионный фильтр, произведённый фирмой DELSA, для спецтехники марки JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения эффективности. Фильтр устанавливается на трансмиссию экскаватора погрузчика JCB 3CX, 4CX. С помощью трансмиссионного фильтра DELSA для коробки переключения передач JCB удаляется пыль и металлическая стружка, образуемая трением изношенных деталей. Фильтр необходимо менять согласно регламенту, так как халатное отношение к замене фильтра ведёт к дорогостоящему ремонту. Мы предлагаем фильтры высокого качества, механически прочные и показывающие отличный результат в очистке масла от самых мелких частиц.&lt;/p&gt;', '', 'Фильтр трансмиссионный DELSA на JCB 32/915500', '', ''),
(133, 1, 'Фильтр воздушный внешний DELSA на JCB 32/915802', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внешний DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/915802&lt;/p&gt;&lt;p&gt;Внешний воздушный фильтр на спецтехнику британской марки JCB. Внешний воздушный фильтр – это важный компонент очистительной системы, основное предназначение которого является очищение воздуха от механических примесей, пыли и разнообразного сора. Фильтр обеспечивает бесперебойное функционирование винтового блока компрессора, что увеличивает эффективности работы компрессора, а значит и всей техники в целом. Очень важно вовремя менять воздушный фильтр, так как несвоевременная замена ведёт к износу и поломке.&lt;/p&gt;', '', 'Фильтр воздушный внешний DELSA на JCB 32/915802', '', ''),
(134, 1, 'Фильтр топливный DELSA 32/401102', '&lt;p&gt;&lt;b&gt;Фильтр топливный DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/401102&lt;/p&gt;&lt;p&gt;Топливный фильтр, произведённый фирмой DELSA, для экскаваторов погрузчиков британской марки JCB. Подходит для моделей 3CX, 4CX старого образца, в комплект которых входит двигатель Perkins. DELSA – фирма, зарекомендовавшая себя на мировом рынке, изготавливает детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения продуктивности. Топливный фильтр является фильтрующим компонентом топливной магистрали. Топливный фильтр защищает форсунки, поршни, гильзы цилиндрового двигателя, а также увеличивает срок действия катализатора. Главная задача топливного фильтра – очищать топливо от всяких загрязнений, с чем фильтр, представленный на нашем сайте, справляется прекрасно. Не забывайте во время менять фильтр в соответствии с регламентом производителя.&lt;/p&gt;', '', 'Фильтр топливный DELSA 32/401102', '', ''),
(135, 1, 'Фильтр воздушный кабины DELSA на JCB 332/A9113, 331/25629', '&lt;p&gt;&lt;b&gt;Фильтр воздушный кабины DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 332/A9113, 331/25629&lt;/p&gt;&lt;p&gt;Фильтр воздушный для кабины экскаватора погрузчика британской марки JCB моделей 3CX, 4CX. Фильтр необходимо устанавливать справа над задним крылом. Воздушный фильтр не даёт пыли, влаге, грязи и саже проникать внутрь кабины экскаватора погрузчика JCB. Периодически меняйте фильтр в соответствии с регламентом изготовителя. Наша компания предлагает высококлассные фильтры отменного качества, прочные и показывающие отличный результат.&lt;/p&gt;', '', 'Фильтр воздушный кабины DELSA на JCB 332/A9113, 331/25629', '', ''),
(136, 1, 'Фильтр печки и кондиционера салонный JCB 30/926362, 332/F8191, 580/12175', '&lt;p&gt;&lt;b&gt;Фильтр печки и кондиционера салонный DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 30/926362, 332/F8191, 580/12175&lt;/p&gt;&lt;p&gt;Фильтр произведён для экскаваторов погрузчиков британской марки JCB. Фильтр изготовлен из синтетических волокон, обладает прочностью и стойкостью к износу. Данный фильтр является компонентом системы охлаждения и обогрева, защищает воздух, проникающий в кабину, и является гарантом комфорта оператора экскаватора погрузчика. Необходимо регулярно проводить замену фильтра согласно регламенту производителя. Мы предлагаем фильтры высокого качества, способные очищать воздух даже от самых мелких частиц.&lt;/p&gt;', '', 'Фильтр печки и кондиционера салонный JCB 30/926362, 332/F8191, 580/12175', '', ''),
(137, 1, 'Фильтр топливный (картридж) DELSA JCB 32/925423', '&lt;p&gt;&lt;b&gt;Фильтр топливный (картридж) DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB, Hidromek, Terex&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925423&lt;/p&gt;&lt;p&gt;Топливный фильтр подходит для спецтехники британской марки JCB, а также для марок Terex и Hidromek, оснащённых двигателем Рerkins. Данная деталь является элементом топливного электрического насоса. Топливный фильтр удерживает в себе грязь, пыль и другие вредоносные элементы, тем самым сохраняя в безопасности двигатель внутреннего сгорания. Меняйте топливный фильтр через одинаковые отрезки времени, указанного производителем.&lt;/p&gt;', '', 'Фильтр топливный (картридж) DELSA JCB 32/925423', '', ''),
(138, 1, 'Фильтр топливный тонкой очистки ORIGINAL JCB 320/07394, 320/07155, 320/07057', '&lt;p&gt;&lt;b&gt;Фильтр топливный тонкой очистки ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 320/07394, 320/07155, 320/07057&lt;/p&gt;&lt;p&gt;Оригинальный топливный фильтр тонкой очистки для спецтехники британской компании JCB, а именно для экскаваторов погрузчиков JCB 3CX, 4CX. Топливный фильтр гарантирует чистоту топлива от различной пыли, сора и ржавчины, он улавливает даже мельчайшие примеси. Фильтр рекомендуется менять с интервалом 500 м/ч. Если вы вовремя замените фильтр, это продлит срок службы вашего оборудования, а также повысит мощность двигателя. На нашем сайте вы найдёте топливные фильтры высшего качества, которые мало подвержены износу и обладают большой вместимостью.&lt;/p&gt;', '', 'Фильтр топливный тонкой очистки ORIGINAL JCB 320/07394, 320/07155, 320/07057', '', ''),
(139, 1, 'Фильтр топливный грубой очистки ORIGINAL JCB 32/925915, 32/925694', '&lt;p&gt;&lt;b&gt;Фильтр топливный грубой очистки ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925915, 32/925694&lt;/p&gt;&lt;p&gt;Оригинальный топливный фильтр грубой очистки, изготовлен фирмой J.C.Bamford Ltd, для спецтехники британской марки JCB. J.C.Bamford Ltd не последнее имя на мировом рынке, данная компания производит надёжные фильтры, обладающие высокой прочностью и большой вместимостью. Фильтр используется во время предварительной очистки топлива от вредных для двигателя элементов, таких как грязь, влага, пыль. Фильтр улавливает частицы размером в 0,1 миллиметра. Процесс замены стоит производить с интервалом в 500 м/ч.&lt;/p&gt;', '', 'Фильтр топливный грубой очистки ORIGINAL JCB 32/925915, 32/925694', '', ''),
(140, 1, 'Фильтр топливный тонкой очистки DELSA на JCB 320/07394', '&lt;p&gt;&lt;b&gt;Фильтр топливный тонкой очистки DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 320/07394&lt;/p&gt;&lt;p&gt;Качественный аналог топливного фильтра на спецтехнику британской марки JCB. Обладает высокой прочностью и большой вместимостью, гарантирует чистоту топлива от различной пыли, сора и ржавчины, он улавливает мельчайшие примеси. Топливный фильтр удерживает в себе грязь, пыль и другие вредоносные элементы, тем самым сохраняя в безопасности двигатель внутреннего сгорания. Меняйте топливный фильтр через одинаковые отрезки времени, это ведёт к увеличению эффективности.&lt;/p&gt;', '', 'Фильтр топливный тонкой очистки DELSA на JCB 320/07394', '', ''),
(141, 1, 'Фильтр печки и кондиционера салонный DELSA JCB 30/9263621, 332/F8191, 580/12175', '&lt;p&gt;&lt;b&gt;Салонный фильтр печки и кондиционера салонный DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 30/9263621, 332/F8191, 580/12175&lt;/p&gt;&lt;p&gt;Салонный фильтр для печки и кондиционера изготовлен для экскаваторов погрузчиков британской марки JCB, а именно для экскаваторов погрузчиков моделей 3CX, 4CX. Фильтр состоит из синтетических волокон, обладает прочностью и стойкостью к износу. Является компонентом системы охлаждения и обогрева, защищает воздух, проникающий в кабину, и является гарантом комфорта оператора экскаватора погрузчика. Необходимо регулярно проводить замену фильтра согласно регламенту производителя. Мы предлагаем фильтры высокого качества, способные очищать воздух даже от самых мелких частиц.&lt;/p&gt;', '', 'Фильтр печки и кондиционера салонный DELSA JCB 30/9263621, 332/F8191, 580/12175', '', ''),
(142, 1, 'Фильтр масляный FORKNIFILT для JCB 02/630935', '&lt;p&gt;&lt;b&gt;Фильтр масляный FORKNIFILT&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 02/630935&lt;/p&gt;&lt;p&gt;Масляный фильтр для спецтехники британской марки JCB. Подходит для моделей, оснащённых двигателем Perkins. Фильтр предохраняет масло от попадания в него вредоносных примесей и механического сора, тем самым защищает двигатель внутреннего сгорания и увеличивает его мощность. Не забывайте менять масляный фильтр каждые 500 м/ч, так вы продлите срок службы вашей техники. Замена фильтра обычно производится во время планового технического обслуживания. Наша компания предлагает высококлассные фильтры отменного качества, механически прочные и показывающие отличный результат в очистке масел от самых мелких частиц. &lt;/p&gt;', '', 'Фильтр масляный FORKNIFILT для JCB 02/630935', '', ''),
(143, 1, 'Фильтр воздушный внутренний DELSA на JCB 32/905002', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внутренний DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/905002&lt;/p&gt;&lt;p&gt;Внутренний воздушный фильтр для двигателя внутреннего сгорания DELSA британской спецтехники JCB. Предназначен для тонкой очистки воздуха. Состоит из втулки цилиндрической формы, которая вмещает в себя фильтрующий элемент. Фильтр прекрасно очищает воздух, регулирует температуру горючей смеси и уменьшает шум. Важно регулярно производить замену фильтра в соответствии с регламентом производителя. Наша компания предлагает высококлассные фильтры отменного качества, механически прочные и показывающие отличный результат в очистке рабочих жидкостей от самых мелких частиц.  &lt;/p&gt;', '', 'Фильтр воздушный внутренний DELSA на JCB 32/905002', '', ''),
(144, 1, 'Фильтр воздушный наружный DELSA на JCB 32/905001', '&lt;p&gt;&lt;b&gt;Фильтр трансмиссионный DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 581/18076, 32/915500&lt;/p&gt;&lt;p&gt;Внутренний воздушный фильтр для двигателя внутреннего сгорания DELSA британской спецтехники JCB. Необходим для очистки системы подачи воздуха в двигатель от вредоносных элементов, пыли и сажи. Качественный наружный воздушный фильтр контролирует температуру горючих смесей, уменьшает шум, снижает расход топлива, а также гарантирует хорошую тягу. Периодически производите процесс проверки фильтра, если фильтр загрязнён, то следует провести замену. Все виды фильтров вы сможете найти на нашем сайте, а высококвалифицированные менеджеры компании СпецТехРус помогут вам в выборе.&lt;/p&gt;', '', 'Фильтр воздушный наружный DELSA на JCB 32/905001', '', ''),
(145, 1, 'Фильтр гидравлический JCB 581/18020', '&lt;p&gt;&lt;b&gt;Фильтр трансмиссионный&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 581/18020&lt;/p&gt;&lt;p&gt;Гидравлический фильтр, изготовленный для спецтехники британской марки JCB. Гидравлический фильтр – существенный компонент системы очистки воздуха. Фильтр очищает гидравлические масла всех типов от различных видов загрязнения. Качественный фильтр, который вы всегда можете найти на нашем сайте, гарантирует долгую работу оборудования и не допускает возможности внезапной поломки. Регулярно производить проверку фильтра. Если он загрязнен, то его следует заменить в срочном порядке. Наша компания предлагает высококлассные фильтры отменного качества, механически прочные и показывающие отличный результат в очистке рабочих жидкостей от мельчайших частиц.&lt;/p&gt;', '', 'Фильтр гидравлический JCB 581/18020', '', ''),
(146, 1, 'Фильтр гидравлический JCB 335/G0531', '&lt;p&gt;&lt;b&gt;Фильтр гидравлический&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 335/G0531&lt;/p&gt;&lt;p&gt;Гидравлический фильтр произведён для спецтехники британской компании JCB. Данный фильтр используется в качестве очистительного элемента, позволяющего организовать защиту рабочих контуров техники от всевозможных загрязнений пылью, грязью или же вредными частицами. Также фильтр позволяет маслу без перебоев поступать в гидравлическую систему машины. Производите замену гидравлического фильтра вовремя, так как от этого зависит сохранность вашего оборудования. Менеджеры нашей компании всегда подскажут вам всю необходимую информацию о заинтересовавшей вас детали. &lt;/p&gt;', '', 'Фильтр гидравлический JCB 335/G0531', '', ''),
(147, 1, 'Фильтр нефроновый JCB 32/925140', '&lt;p&gt;&lt;b&gt;Фильтр нефроновый&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925140&lt;/p&gt;&lt;p&gt;Нефроновый гидравлический фильтр, изготовленный для спецтехники британской компании JCB. Используется для сверхтонкой очистки масла от элементов, вредящих качеству работы. Данная деталь позволяет эксплуатировать гидравлическое масло в течение 5 тысяч м/ч. Нефроновый гидравлический фильтр стоит менять с интервалом 2000 м/ч. Наши менеджеры всегда помогут вам получить всю необходимую информацию о запчасти, которая вас заинтересует. &lt;/p&gt;', '', 'Фильтр нефроновый JCB 32/925140', '', ''),
(148, 1, 'Фильтр нефроновый JCB 32/925164', '&lt;p&gt;&lt;b&gt;Фильтр нефроновый&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925164&lt;/p&gt;&lt;p&gt;Нефроновый гидравлический фильтр, изготовленный для спецтехники британской компании JCB. Оригинальное название: Element filter bypass Plexus. Фильтр используют в качестве очищающего элемента для сверхтонкой фильтрации масла от элементов, нарушающих процесс работы оборудования. Уровень защиты от вреда, наносимого различными примесями: 1мкм. Данная деталь позволяет эксплуатировать гидравлическое масло в течение 5 тысяч м/ч. Нефроновый гидравлический фильтр следует менять с периодичностью равной 2000 м/ч. Менеджеры компании СпецТехРус всегда помогут вам получить всю необходимую информацию о запчасти, которая вас заинтересует.&lt;/p&gt;', '', 'Фильтр нефроновый JCB 32/925164', '', ''),
(149, 1, 'Фильтр воздушный DELSA на JCB 32/917301', '&lt;p&gt;&lt;b&gt;Фильтр воздушный DELSA&lt;/b&gt;&lt;p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим со спецтехникой:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/917301&lt;/p&gt;&lt;p&gt;Воздушный фильтр DELSA для спецтехники британской марки JCB. Воздушный фильтр гарантирует исправное функционирование двигателя внутреннего сгорания. Фильтр гарантирует защиту воздуха от пыли, влаги и других примесей, наносящих вред двигателю. Фильтр абсолютно непроницаем, что способствует качественной преграде вредным элементам, фильтрует воздух на 100%, сохраняет мощность техники и влияет на расход топлива. Замену фильтра требуется производить согласно регламенту изготовителя. Строго воспрещается использовать один фильтр несколько раз, так как это ведёт к неисправностям.&lt;/p&gt;', '', 'Фильтр воздушный DELSA на JCB 32/917301', '', ''),
(150, 1, 'Фильтр гидравлический возвратный ORIGINAL JCB 335/G2059, 32/925214', '&lt;p&gt;&lt;b&gt;Фильтр гидравлический возвратный ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 335/G2059, 32/925214&lt;/p&gt;&lt;p&gt;Возвратный гидравлический фильтр на спецтехнику британской компании JCB.  Наименование: Filter Return. Фильтр гарантирует защиту рабочих контуров техники от всевозможных загрязнений пылью, грязью или же вредными частицами. Также гидравлический возвратный фильтр позволяет маслу исправно следовать в гидравлическую систему машины. Важно менять гидравлический фильтр вовремя, согласно регламенту производителя. Менеджеры нашей компании всегда подскажут вам всю необходимую информацию о заинтересовавшей вас детали.&lt;/p&gt;', '', 'Фильтр гидравлический возвратный ORIGINAL JCB 335/G2059, 32/925214', '', ''),
(151, 1, 'Фильтр топливный ORIGINAL JCB 32/922300', '&lt;p&gt;&lt;b&gt;Фильтр топливный ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/922300&lt;/p&gt;&lt;p&gt;Топливный фильтр для спецтехники британской компании JCB. Оригинальное название: Filter fuel pre-filter. Топливный фильтр гарантирует чистоту топлива от пыли, сора, ржавчины и краски, он улавливает даже мельчайшие примеси. Данная деталь представляет собой пластиковый корпус цилиндрической формы, включающий в комплектацию фильтрующие элементы с бумагой. Фильтр рекомендуется менять, согласно регламенту производителя. Если вовремя менять фильтр, то это надолго продлит срок службы вашего оборудования, а также повысит мощность двигателя внутреннего сгорания. На нашем сайте вы найдёте топливные фильтры высокого качества, а менеджеры всегда помогут вам сделать правильный выбор.&lt;/p&gt;', '', 'Фильтр топливный ORIGINAL JCB 32/922300', '', ''),
(152, 1, 'Фильтр топливный тонкой очистки на JCB 320/07309, 320/07138', '&lt;p&gt;&lt;b&gt;Фильтр топливный тонкой очистки&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 320/07309, 320/07138&lt;/p&gt;&lt;p&gt;Аналоговый топливный фильтр, изготовленный для спецтехники британской компании JCB. Оригинальное название: Filter Fuel 3 Layer, 2 Micron. Используется в топливной аппаратуре. Фильтр тонко очищает топливо от мельчайших примесей. Важно периодически менять топливный фильтр. Менеджеры нашей компании всегда подскажут вам всю необходимую информацию о заинтересовавшей вас детали.&lt;/p&gt;', '', 'Фильтр топливный тонкой очистки на JCB 320/07309, 320/07138', '', ''),
(153, 1, 'Фильтр топливный ORIGINAL JCB 32/925994', '&lt;p&gt;&lt;b&gt;Фильтр топливный ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925994&lt;/p&gt;&lt;p&gt;Оригинальный топливный фильтр для спецтехники марки JCB. Фильтр прекрасно справляется с очистительной функцией, он защищает топливо от всевозможных примесей и вредных элементов. При загрязнении фильтра, его необходимо поменять. Производить замену следует регулярно и с постоянной периодичностью. Менеджеры компании СпецТехРус всегда окажут вам помощь в выборе необходимой детали, а также расскажут много полезной информации об оборудовании, которое вас заинтересует. &lt;/p&gt;', '', 'Фильтр топливный ORIGINAL JCB 32/925994', '', ''),
(154, 1, 'Фильтр топливный DELSA JCB 32/925869', '&lt;p&gt;&lt;b&gt;Фильтр топливный DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925869&lt;/p&gt;&lt;p&gt;Фильтр топливный, произведённый фирмой DELSA, для спецтехники британской марки JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения эффективности. Топливный фильтр удерживает ржавчину, вредные примеси и ненужные частицы из топлива, которые могут привести к износу топливного насоса. Является важным очистительным элементом топливной магистрали. Мощность двигателя может повышаться за счет топливного фильтра, который обеспечивает защиту от загрязнения. Фильтр рекомендуется менять согласно регламенту производителя. Менеджеры компании СпецТехРус всегда расскажут много полезной информации о деталях, которые вас заинтересуют.&lt;/p&gt;', '', 'Фильтр топливный DELSA JCB 32/925869', '', ''),
(155, 1, 'Фильтр топливный тонкой очистки ORIGINAL JCB 320/07382', '&lt;p&gt;&lt;b&gt;Фильтр топливный тонкой очистки ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 320/07382&lt;/p&gt;&lt;p&gt;Топливный фильтр тонкой очистки, изготовленный для спецтехники британской компании JCB. Наименование: Element fuel filter. Используется в топливной аппаратуре. Фильтр тонко очищает топливо от мельчайших примесей. Топливный фильтр помогает сохранить дизелю высокое качество. Важно периодически менять топливный фильтр, так как это помогает сохранить технику в прекрасном состоянии. Менеджеры нашей компании всегда подскажут вам всю необходимую информацию о заинтересовавшей вас детали.&lt;/p&gt;', '', 'Фильтр топливный тонкой очистки ORIGINAL JCB 320/07382', '', ''),
(156, 1, 'Фильтр топливный ORIGINAL JCB 32/925760', '&lt;p&gt;&lt;b&gt;Фильтр топливный ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925760&lt;/p&gt;&lt;p&gt;Топливный фильтр произведён для спецтехники британской компании JCB. Наименование: Element fuel sediment filter. Фильтр очищает топливо от мельчайших примесей, краски и ржавчины. Фильтр гарантирует высокое качество топлива. Важно периодически менять топливный фильтр, так как это помогает сохранить технику в прекрасном состоянии. Менеджеры компании СпецТехРус помогут разобраться вам в широком ассортименте товаров и подскажут необходимую информацию о заинтересовавшей вас детали.&lt;/p&gt;', '', 'Фильтр топливный ORIGINAL JCB 32/925760', '', ''),
(157, 1, 'Фильтр топливный ORIGINAL JCB 32/925856A, 02/800001', '&lt;p&gt;&lt;b&gt;Фильтр топливный ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925856A, 02/800001&lt;/p&gt;&lt;p&gt;Топливный фильтр для спецтехники марки JCB. Фильтр прекрасно справляется с очистительной функцией, он защищает топливо от всевозможных примесей и вредных элементов. Также фильтр является важной частью топливной аппаратуры. Менять фильтр следует регулярно согласно рекомендациям производителя. Менеджеры компании СпецТехРус всегда окажут помощь в выборе необходимой детали, а также расскажут много полезной информации о запчасти, которая вас заинтересует.&lt;/p&gt;', '', 'Фильтр топливный ORIGINAL JCB 32/925856A, 02/800001', '', ''),
(158, 1, 'Фильтр гидравлический DELSA JCB 332/B7467, 332/B1489', '&lt;p&gt;&lt;b&gt;Фильтр гидравлический DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 332/B7467, 332/B1489&lt;/p&gt;&lt;p&gt;Гидравлический фильтр, произведённый фирмой DELSA, для спецтехники марки JCB. Наименование: Element 18096.  DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Покупая запчасти данного производителя, вы обеспечиваете свою технику незаменимыми элементами для повышения эффективности. Гидравлический фильтр очищает компрессорное масло от ненужных примесей, таких как краска, ржавчина и от других вредных элементов. Фильтроэлемент следует периодически заменять на новый, чтобы не падала работоспособность техники.    &lt;/p&gt;', '', 'Фильтр гидравлический DELSA JCB 332/B7467, 332/B1489', '', ''),
(159, 1, 'Фильтр масляный ORIGINAL JCB 581/18096', '&lt;p&gt;&lt;b&gt;Фильтр масляный ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 581/18096&lt;/p&gt;&lt;p&gt;Оригинальный масляный фильтр для спецтехники марки JCB. Предназначен для двигателей внутреннего сгорания экскаваторов полноповоротных колёсных и гусеничных серии JS. Масляный фильтр очищает компрессорное масло от элементов вредных спецтехнике. Масло, в котором находятся твёрдые частицы, ухудшает работу охлаждения и наносит ущерб винтовому блоку. Масляный фильтр необходимо регулярно менять согласно регламенту изготовителя. Фильтры, представленные на нашем сайте, обладают высокой термостойкостью, устойчивы к компрессорному маслу, перепадам давления, задерживают большое количество вредных частиц, а также изготовлены из материала, который не боится коррозии. Покупая запчасти на нашем сайте, вы обеспечиваете свою технику незаменимыми деталями для повышения продуктивности.&lt;/p&gt;', '', 'Фильтр масляный ORIGINAL JCB 581/18096', '', ''),
(160, 1, 'Фильтр масляный ORIGINAL JCB 320/04133A', '&lt;p&gt;&lt;b&gt;Фильтр масляный ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 320/04133A&lt;/p&gt;&lt;p&gt;Масляный фильтр для экскаваторов погрузчиков британской марки JCB, выпущенных в период с 2005 до 2018 года. Фильтр защищает двигатель от вредных частиц, которые могут находиться в масле. Грязное масло снижает качество работы охлаждения и наносит ущерб винтовому блоку. Фильтр следует часто менять в соответствии с регламентом производителя. Фильтры, представленные на нашем сайте, обладают высокой термостойкостью, устойчивы к компрессорному маслу, перепадам давления, задерживают большое количество вредных частиц, а также изготовлены из материала, который не боится коррозии. Покупая запчасти на нашем сайте, вы обеспечиваете свою технику незаменимыми деталями для повышения продуктивности.&lt;/p&gt;', '', 'Фильтр масляный ORIGINAL JCB 320/04133A', '', ''),
(161, 1, 'Фильтр масляный ORIGINAL JCB 320/04133', '&lt;p&gt;&lt;b&gt;Фильтр масляный ORIGINAL JCB&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Британия&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 320/04133&lt;/p&gt;&lt;p&gt;Масляный фильтр, изготовлен для создания препятствия ненужным элементам рабочего масла двигателя Dieselmax, входящего в комплектацию экскаваторов погрузчиков британской компанией JCB 2005-218 годов выпуска. Устраняя засоры и пыль, масляный фильтр способствует лёгкому прохождению масла и даёт возможность маслу прекрасно смазывать поршни и другие элементы двигателя. Периодически производите замену масляного фильтра, ведь долгая эксплуатация масляного фильтра ведёт к износу детали и снижению качества работы двигателя.  &lt;/p&gt;', '', 'Фильтр масляный ORIGINAL JCB 320/04133', '', ''),
(162, 1, 'Фильтр воздушный внутренний DELSA на JCB 32/920402', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внутренний DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt;Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/920402&lt;/p&gt;&lt;p&gt;Воздушный фильтр для спецтехники британской марки JCB. Покупая запчасти на нашем сайте, вы обеспечиваете свою технику незаменимыми элементами для повышения продуктивности. Воздушный фильтр – это  важный компонент очищающей системы, которая фильтрует воздух от механических примесей, сора и грязи. Фильтр гарантирует бесперебойную работу техники и увеличивает её эффективность. Важно своевременно менять воздушный фильтр, так как несвоевременная замена ведёт к износу и поломке. Менеджеры компании СпецТехРус всегда помогут вам в выборе оборудования и обеспечат вас всей необходимой информацией.&lt;/p&gt;', '', 'Фильтр воздушный внутренний DELSA на JCB 32/920402', '', ''),
(163, 1, 'Фильтр воздушный внутренний DELSA на JCB 32/925348', '&lt;p&gt;&lt;b&gt;Фильтр воздушный внутренний DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt;Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925348&lt;/p&gt;&lt;p&gt;Воздушный фильтр произведён для экскаваторов погрузчиков марки JCB серии 3CX, 4CX. Компания СпецТехРус предлагает широкий ассортимент высококачественных деталей на спецтехнику JCB, которые увеличат эффективность вашего оборудования. Воздушный фильтр – это значимая деталь, отвечающая за защиту от пыли и стружки, а также позволяющая избежать износа техники и её повреждения. Прекрасно защищает от влаги, а также продлевает время работы масляного фильтра, маслоотделителя, масла. Менять фильтр необходимо в соответствии с регламентом производителя. Менеджеры нашей компании с радостью окажут помощь и проинформируют вас по любым интересующим вас вопросам касательно запчастей на спецтехнику JCB.&lt;/p&gt;', '', 'Фильтр воздушный внутренний DELSA на JCB 32/925348', '', ''),
(164, 1, 'Фильтр топливный грубой очистки DELSA на JCB 32/925915', '&lt;p&gt;&lt;b&gt;Фильтр топливный грубой очистки DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt;Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 32/925915&lt;/p&gt;&lt;p&gt;Оригинальный топливный фильтр, произведённый компанией DELSA, на спецтехнику британской марки JCB. DELSA – фирма, которая зарекомендовала себя на мировом рынке, изготавливая детали для спецтехники и автомобилей. Обладает высокой прочностью и большой вместимостью, гарантирует чистоту топлива от различной пыли, сора, примесей и ржавчины. Улавливает частицы размером в 0,1 мм. Топливный фильтр удерживает в себе грязь, пыль и другие вредоносные элементы, тем самым сохраняя в безопасности двигатель внутреннего сгорания. Меняйте топливный фильтр с интервалом 500 м/ч, это повышает эффективность всей техники.&lt;/p&gt;', '', 'Фильтр топливный грубой очистки DELSA на JCB 32/925915', '', ''),
(165, 1, 'Фильтр печки и кондиционера салонный DELSA на JCB 30/926362, 332/F8191', '&lt;p&gt;&lt;b&gt;Фильтр печки и кондиционера салонный DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt;Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 30/926362, 332/F8191&lt;/p&gt;&lt;p&gt;Салонный фильтр печки и кондиционера произведён для экскаваторов погрузчиков британской марки JCB. Наименование: FILTER AIR Con. Фильтр производится из синтетических волокон, обладает прочностью и стойкостью к износу. Данный фильтр является компонентом системы охлаждения и обогрева, защищает воздух, проникающий в кабину, а также является гарантом комфорта оператора экскаватора погрузчика. Необходимо регулярно проводить замену фильтра согласно регламенту производителя. Наша компания предлагаем широкий ассортимент фильтров и гарантирует высокое качество всей продукции.&lt;/p&gt;', '', 'Фильтр печки и кондиционера салонный DELSA на JCB 30/926362, 332/F8191', '', ''),
(166, 1, 'Фильтр масляный DELSA на JCB 581/18096', '&lt;p&gt;&lt;b&gt;Фильтр масляный DELSA&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt;Турция&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместим с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 581/18096&lt;/p&gt;&lt;p&gt;Масляный фильтр на британскую спецтехнику JCB, а именно для экскаваторов погрузчиков серий 3CX и 4CX. Масляный фильтр – это элемент, очищающий масло от посторонних примесей, которые могут нанести вред двигателю внутреннего сгорания. Фильтр, представленный на нашем сайте, прекрасно справляется с поставленной задачей. Важно менять фильтр в соответствии с регламентом производителя. Менеджеры компании СпецТехРус подскажут необходимую информацию о любой запчасти, которая зацепит ваше внимание.&lt;/p&gt;', '', 'Фильтр масляный DELSA на JCB 581/18096', '', ''),
(167, 1, 'Патрубок радиатора нижний JCB 834/00147', '&lt;p&gt;Нижний патрубок радиатора JCB 834/00147 является небольшим элементом гибкой трубы, которая присоединяется к основному устройству для отвода жидкости. Эта запчасть выдерживает большое давление и высокие температуры. Через определенный период эксплуатации патрубки радиатора охлаждения могут лопнуть, вздуться или порваться. Чтобы этого не произошло, регулярно проверяйте их целостность. Если вы заметили нарушение формы трубы, как можно скорее купите новую деталь JCB на замену старой. В противном случае может произойти неожиданная поломка, которая приведет к простою техники.&lt;/p&gt;', '', 'Патрубок радиатора нижний JCB 834/00147', '', ''),
(168, 1, 'Патрубок радиатора JCB 834/11199', '&lt;p&gt;Патрубок радиатора JCB 834/11199 – это небольшой кусок шланга, изготовленного из резины, соединяющего радиатор техники с мотором. Модель имеет изогнутую форму, является деталью погрузчиков-экскаваторов JCB 3CX, JCB 4CX. Деталь является одним из важнейших элементов системы охлаждения двигателя, поэтому требует своевременной замены.В каталоге нашего интернет-магазина вы можете выбрать и купить запчасти для экскаватора-погрузчика JCB любой серии. В том числе JCB 3CX, JCB 4CX, агрегатов сельскохозяйственного назначения, предназначенных для дорожно-ремонтных работ и т.д. В интернет-магазине представлены запасные части для JCB по ценам от производителя.&lt;/p&gt;', '', 'Патрубок радиатора JCB 834/11199', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(169, 1, 'Патрубок радиатора верхний JCB 834/00528', '&lt;p&gt;Патрубок радиатора верхний JCB 834/00528, представленный в этом разделе, доступен для заказа из каталога запчастей для спецтехники онлайн. От нижнего он отличается местом расположения, назначением, формой и длиной. Он являет собой маленький отрезок шланга, изготовленного из резины. Его задача - объединять радиатор с двигателем. Форма изделия изогнутая.Чтобы приобрести оригинальные или неоригинальные запчасти JCB, регистрируйтесь на сайте и добавляйте товары в Корзину. Возникли вопросы? Не знаете, что выбрать? Менеджеры ответят на все вопросы и подробно проконсультируют вас.&lt;/p&gt;', '', 'Патрубок радиатора верхний JCB 834/00528', '', ''),
(170, 1, 'Патрубок радиатора верхний JCB 834/00739', '&lt;p&gt;Наш интернет-магазин занимается продажей запчастей JCB оптом и в розницу. Вы можете заказать товары из каталога онлайн, воспользовавшись удобной формой на сайте.В этом разделе представлен верхний патрубок радиатора JCB 834/00739. Он изготовлен из качественной резины – плотного, износостойкого и долговечного материала. Менять этот элемент следует раз в три-четыре года, максимум – раз в пять лет. Также следует заменить изделие, если вы заметили изменения структуры, трещины, изломы. В крайнем случае, сильно изношенная деталь лопнет, а жидкость разольется в подкапотном пространстве.&lt;/p&gt;', '', 'Патрубок радиатора верхний JCB 834/00739', '', ''),
(171, 1, 'Патрубок радиатора JCB 834/00414', '&lt;p&gt;В нашем каталоге представлены различные запасные части JCB. Товары изготовлены ведущими мировыми производителями. В ассортименте есть и оригинальные, и неоригинальные детали.В этом разделе представлен патрубок радиатора JCB 834/00414. Он изготавливается из качественной резины, способной выдержать серьезные нагрузки. Главная задача изделия – подавать жидкость в систему охлаждения и задерживать на себе вибрацию. Менять его следует каждые три-четыре года. Цена на патрубок радиатора указана на странице товара за единицу. Благодаря недорогому материалу, она довольно доступна.&lt;/p&gt;', '', 'Патрубок радиатора JCB 834/00414', '', ''),
(172, 1, 'Патрубок радиатора верхний JCB 834/00181', '&lt;p&gt;Предлагаем вам купить патрубок радиатора или любые другие запчасти JCB оптом. Чтобы сделать заказ, зарегистрируйтесь на нашем сайте и добавьте товар в Корзину в нужном вам количестве. Если у вас возникли вопросы, закажите обратный звонок!Верхний патрубок радиатора JCB 834/00181 изготавливается из прочной резины, способной выдержать серьезные нагрузки. При визуальном осмотре трудно определить целостность изделия, поэтому поломка такой детали часто является для владельца неприятной неожиданностью – трос лопается, жидкость выливается. Чтобы этого не произошло, меняйте товар через каждые три-четыре года.&lt;/p&gt;', '', 'Патрубок радиатора верхний JCB 834/00181', '', ''),
(173, 1, 'Патрубок радиатора верхний JCB 834/00347', '&lt;p&gt;В нашем каталоге запчастей спецтехники представлен огромный ассортимент деталей от производителей со всего мира. Вы найдете как оригинальные товары, так и неоригинальные, с гарантией качества. В этом разделе представлен верхний патрубок радиатора JCB 834/00347. Этот элемент располагается в подкапотном пространстве. Он изготавливается из прочной и гибкой резины, которая дешево стоит и не передает вибрацию на радиатор при работе. Такие запчасти для спецтехники JCB следует менять раз в три-четыре года. Причиной для срочной замены детали является поломка, наличие трещины и нарушение целостности изделия.&lt;/p&gt;', '', 'Патрубок радиатора верхний JCB 834/00347', '', ''),
(174, 1, 'Патрубок радиатора нижний JCB 834/00211', '&lt;p&gt;В этом разделе представлен нижний патрубок радиатора JCB 834/00211. Он представляет собой небольшой отрезок гибкой трубы, присоединенный к резервуару. Данная деталь является основой системы охлаждения. Чтобы его использование было эффективным, изделие должно быть выполнено из качественного материала, который выдержит всю сложную нагрузку. Менять деталь следует при замеченном нарушении целостности.Запчасти на спецтехнику JCB можно заказать онлайн, оптом и в розницу, с доставкой или самовывозом. Цена на нижний патрубок радиатора зависит от количества выбранных вами товаров.&lt;/p&gt;', '', 'Патрубок радиатора нижний JCB 834/00211', '', ''),
(175, 1, 'Патрубок радиатора нижний JCB 834/00263', '&lt;p&gt;Интересует цена на патрубок радиатора? Просмотрите наш каталог. Мы занимаемся продажей запчастей JCB, как оригинальных, так и неоригинальных. Изделия от разных производителей отличаются окончательной стоимостью.В этом разделе представлен нижний патрубок радиатора JCB 834/00263. Это гибкая часть трубки, которая присоединяется к резервуару и служит для транспортировки охлаждающей жидкости. Изделие создается из качественного материала, который обеспечивает долгий срок службы. Во время эксплуатации элемент подвергается серьезным нагрузкам и воздействию высоких температур.&lt;/p&gt;', '', 'Патрубок радиатора нижний JCB 834/00263', '', ''),
(176, 1, 'Патрубок радиатора нижний JCB 834/00666', '&lt;p&gt;Ищете, где купить патрубки радиатора? Присмотритесь к нашему каталогу запчастей JCB онлайн. В ассортименте вы найдете и оригинальные, и неоригинальные товары от различных производителей.В этом разделе представлен нижний патрубок радиатора JCB 834/00666. Этот небольшой отрезок гибкой трубы очень важен для функционирования системы охлаждения специальной техники. Для эффективной эксплуатации необходимо, чтобы он был качественным, прочным и долговечным. Изделие должно выдерживать высокие температуры, не теряя целостности. Менять такие элементы следует своевременно.&lt;/p&gt;', '', 'Патрубок радиатора нижний JCB 834/00666', '', ''),
(177, 1, 'Патрубок радиатора нижний JCB 834/00450', '&lt;p&gt;Предлагаем вам купить нижний патрубок радиатора. Эта деталь является важной частью системы охлаждения специальной техники. Нижний патрубок радиатора JCB 834/00450 представляет собой отрезок гибкой трубы из качественного материала. Он подсоединяется к резервуару для отвода охлаждающей жидкости. Важно, чтобы это изделие выдерживало большие температуры и сильные нагрузки. В случае нарушения целостности такие запчасти для экскаватора JCB следует немедленно заменить. Они могут высохнуть и дать трещину, лопнуть, вздуться. Чтобы этого не произошло, своевременно меняйте эти элементы.&lt;/p&gt;', '', 'Патрубок радиатора нижний JCB 834/00450', '', ''),
(178, 1, 'Патрубок радиатора нижний АВ JCB 834/00685', '&lt;p&gt;Нижний патрубок радиатора АВ JCB 834/00685 представляет собой малый отрезок гибкой трубки, который присоединен к этому устройству. Он используется для подключения к нему других путей для отвода жидкостей. Главная проблема, которая возникает с таким изделием – нарушение целостности вследствие активной эксплуатации. В таком случае нужно как можно быстрее снять старый элемент и установить на его место новое изделие.Чтобы купить патрубок радиатора или другую деталь JCB, добавьте интересующий вас товар в Корзину в нужном количестве. Для этого воспользуйтесь удобной онлайн-формой.&lt;/p&gt;', '', 'Патрубок радиатора нижний АВ JCB 834/00685', '', ''),
(179, 1, 'Патрубок радиатора JCB 834/11380', '&lt;p&gt;Патрубок радиатора JCB 834/11380 – это небольшой кусок шланга, изготовленного из резины, соединяющего радиатор техники с мотором. Модель имеет изогнутую форму, является деталью погрузчиков-экскаваторов JCB 3CX, JCB 4CX. Деталь является одним из важнейших элементов системы охлаждения двигателя, поэтому требует своевременной замены.&lt;/p&gt;', '', 'Патрубок радиатора JCB 834/11380', '', ''),
(180, 1, 'Патрубок радиатора нижний JCB 834/10597', '&lt;p&gt;Предлагаем вам купить нижний патрубок радиатора, который является важной частью системы охлаждения. Этот элемент изготовлен из резины, что уменьшает и его общую стоимость, и возможную вибрацию, которая проходит через него. Нижний патрубок радиатора JCB 834/10597 требует замены в случае износа или выхода из строя. Следует регулярно проверять эту деталь на предмет потери целостности, нельзя дожидаться ее полного разрушения.&lt;/p&gt;', '', 'Патрубок радиатора нижний JCB 834/10597', '', ''),
(181, 1, 'Патрубок для JCB 834/11384', 'Патрубок для JCB 834/11384', '', 'Патрубок для JCB 834/11384', '', ''),
(182, 1, 'Патрубок 332/C4382', 'Патрубок JCB 332/C438', '', 'Патрубок 332/C4382', '', ''),
(183, 1, 'Патрубок гидравлический 332/F9194', 'Патрубок гидравлический JCB 332/F919', '', 'Патрубок гидравлический 332/F9194', '', ''),
(184, 1, 'Патрубок гидравлический 332/H4551', 'Патрубок гидравлический JCB 332/H455', '', 'Патрубок гидравлический 332/H4551', '', ''),
(185, 1, 'Патрубок радиатора 128/E0100', 'Верхний шланг - патрубок радиатора для JCB 128/E010', '', 'Патрубок радиатора 128/E0100', '', ''),
(186, 1, 'Патрубок радиатора 128/E0101', 'Верхний шланг - патрубок радиатора для JCB 128/E010', '', 'Патрубок радиатора 128/E0101', '', ''),
(187, 1, 'Патрубок радиатора 332/F8547', 'Патрубок радиатора нижний для JCB 332/F854', '', 'Патрубок радиатора 332/F8547', '', ''),
(188, 1, 'Патрубок гидравлический для JCB 834/11566', 'Патрубок гидравлический для JCB 834/11566', '', 'Патрубок гидравлический для JCB 834/11566', '', ''),
(189, 1, 'Патрубок радиатора 834/11198', 'Патрубок радиатора фирмы Partspro для JCB 834/1119', '', 'Патрубок радиатора 834/11198', '', ''),
(190, 1, 'Патрубок гидравлический для JCB 834/10759', 'Патрубок гидравлический для JCB 834/1075', '', 'Патрубок гидравлический для JCB 834/10759', '', ''),
(191, 1, 'Патрубок гидравлический 834/11383', 'Патрубок для JCB 834/1138', '', 'Патрубок гидравлический 834/11383', '', ''),
(192, 1, 'Радиатор охлаждения JCB 30/926051 (диагональный)', '&lt;p&gt;В этом разделе представлен радиатор 4СХ (новая модель) JCB 30/926051. Деталь устанавливается в передней подкапотной части. Она состоит из множества пластин с несколькими слоями, а также трубочек из металла, которые пропускают через себя воздух. Особая конструкция способствует увеличению площади соприкосновения с атмосферным газом. Устройство требует регулярного осмотра и чистки.&lt;/p&gt;', '', 'Радиатор охлаждения JCB 30/926051 (диагональный)', '', ''),
(193, 1, 'Радиатор охлаждения JCB 332/G3691 (радиальный)', '&lt;p&gt;В каталоге запчастей экскаватора представлен радиатор охлаждения JCB 332/G3691, 128/14326. Он является одним из ключевых и наиболее важных элементов жидкостной системы охлаждения. Его главная задача – рассеивание или отвод тепла в атмосферу методом остывания жидкости. Чаще всего деталь устанавливается в подкапотном пространстве за радиаторной решеткой.Цена на запчасти JCB указана в этом разделе за единицу. Если вы хотите приобрести товар оптом, свяжитесь с менеджерами компании. Они сообщат вам о выгодных условиях для оптовиков или сформируют индивидуальное предложение для вашей фирмы.&lt;/p&gt;', '', 'Радиатор охлаждения JCB 332/G3691 (радиальный)', '', ''),
(194, 1, 'Радиатор охлаждения JCB 30/915200, 332/C8731 (диагональный)', '&lt;p&gt;В этом разделе представлен радиатор на погрузчик 3СХ JCB 30/915200, 332/C8731. Это устройство отводит тепло от жидкости системы охлаждения. Зимой он прогревается от тепла мотора, нагревает состав и салон. Радиаторы охлаждения для спецтехники состоят из металлических пластин с множеством слоев и трубочек. Обычно они находятся под капотом, где пропускают много воздуха. Конструктивно эта запчасть состоит из сердцевины, коробок с ппатрубками и латунных трубок. Ее нужно регулярно чистить и проверять. Частая причина поломок – загрязнение внутренних полостей или течь хладагента.&lt;/p&gt;', '', 'Радиатор охлаждения JCB 30/915200, 332/C8731 (диагональный)', '', ''),
(195, 1, 'Вентилятор охлаждения на JCB 262/36800', 'Вентилятор охлаждения на спецтехнику JCB. Артикул: 262/36800', '', 'Вентилятор охлаждения на JCB 262/36800', '', ''),
(196, 1, 'Вентилятор охлаждения JCB 30/925525', '&lt;p&gt;Вентилятор охлаждения JCB 30/925525 имеет несколько пар лопастей, закрепленных под определенным углом. Он изготовлен из износостойкого материала. Его основная задача – отвод тепла от мотора и внутренних запасных частей экскаваторов. Механизм действия детали прост: привод запускает вращательное движение, лопасти крутятся, забирая воздух и подавая его к двигателю. Мотор обдувается, максимальный поток проходит через ячейки и ребра оборудования.Эту и другие запчасти на экскаватор-погрузчик JCB можно заказать онлайн, с оперативной доставкой. Жителям Москвы предлагается самовывоз.&lt;/p&gt;', '', 'Вентилятор охлаждения JCB 30/925525', '', ''),
(197, 1, 'Вентилятор охлаждения JCB с тепломуфтой 30/926537-72', '&lt;p&gt;Вентилятор охлаждения с тепломуфтой JCB 30/926537-72.&lt;/p&gt;', '', 'Вентилятор охлаждения JCB с тепломуфтой 30/926537-72', '', ''),
(198, 1, 'Диффузор вентилятора JCB 2663 123/05898', '&lt;p&gt;Диффузор вентилятора  JCB 123/05898.&lt;/p&gt;', '', 'Диффузор вентилятора JCB 2663 123/05898', '', ''),
(199, 1, 'Вентилятор охлаждения JCB 123/05911', '&lt;p&gt;Хотите купить запчасти JCB в Москве? Представляем вам большой выбор оригинальных и неоригинальных товаров от известных производителей со всего мира. Продукция доступна для заказа оптом и в розницу, с доставкой на дом и самовывозом.В этом разделе вы можете приобрести вентилятор охлаждения JCB 123/05911. Он имеет десять лопастей. Элемент подходит для мотора Perkins, соответствующего моделям 3СХ и 4СХ, выпущенным до 2005 года.Такие запасные части для погрузчиков используются для стабильного и равномерного отвода тепла в окружающую среду, а также для охлаждения мотора. Причиной для их замены является неисправность, перебои в работе, внезапные остановки.&lt;/p&gt;', '', 'Вентилятор охлаждения JCB 123/05911', '', ''),
(200, 1, 'Вентилятор охлаждения JCB 30/925526', '&lt;p&gt;Крыльчатка ентилятор системы охлаждения JCB 30/925526 для экскаватора-погрузчика JCB 3CX, JCB 4CX с двигателями без вискомуфты.Оригинальное название: Fan D=20 PullerКоличество лопастей: 9В этом разделе представлен вентилятор охлаждения JCB 30/925526, главное назначение которого - эффективный обдув двигателя воздухом для предотвращения перегрева. Привод (гидромеханический или электрический) запускает вращение крыльчатки для спецтехники JCB, а лопасти крутятся, захватывая и передавая воздух на двигатель. Охлажденный поток направляется прямо к двигателю, снижая его общую температуру во время работы. Крыльчатка имеет девять лопастей и выполнена из износостойкого термопластика.Эту и другие запасные части JCB можно заказать онлайн. У вас есть вопросы? Звоните нашим менеджерам. Специалисты проконсультируют вас по выбору, скидкам и выгодным акциям.&lt;/p&gt;', '', 'Вентилятор охлаждения JCB 30/925526', '', ''),
(201, 1, 'Насос водяной для JCB 332/H0893 02/200450 (Perkins)', 'Насос водяной - помпа. На тип двигателя AB-Perkins. Для JCB 332/H0893 02/20045', '', 'Насос водяной для JCB 332/H0893 02/200450 (Perkins)', '', ''),
(202, 1, 'Насос водяной для JCB 332/H0895, 02/202510 (Perkins)', 'Насос водяной - помпа. На тип двигателя - AK-Perkins. Для JCB: 332/H0895, 02/20251', '', 'Насос водяной для JCB 332/H0895, 02/202510 (Perkins)', '', ''),
(203, 1, 'Бачок расширительный JCB 128/15313', '&lt;p&gt;Предлагаем вам приобрести расширительный бачок JCB 128/15313. Изделие из пластика наполняется лишним объемом антифриза, который расширяется при нагреве и уменьшается при охлаждении. Также он перераспределяет излишки давления и направляет антифриз обратно в систему.&lt;/p&gt;', '', 'Бачок расширительный JCB 128/15313', '', ''),
(204, 1, 'Бачок расширительный JCB 128/14093', '&lt;p&gt;Бачок расширительный JCB 128/14093 для экскаватора-погрузчика JCB 3CX, JCB 4CX. Оригинальное название: Tank expansion assembly.&lt;/p&gt;', '', 'Бачок расширительный JCB 128/14093', '', ''),
(205, 1, 'Бачок расширительный JCB 128/15479', '&lt;p&gt;Расширительный бачок JCB 128/15479. Представляет собой емкость из прочного износостойкого пластика белого цвета. Тара имеет завинчивающуюся крышку из черного материала.&lt;/p&gt;', '', 'Бачок расширительный JCB 128/15479', '', ''),
(206, 1, 'Бачок расширительный JCB 128/14754', '&lt;p&gt;Бачок расширительный 128/14754 для системы охлаждения двигателя на радиатор экскаватора-погрузчика JCB 3CX, JCB 4CXОригинальное название: Tank coolant expansion assembly&lt;/p&gt;', '', 'Бачок расширительный JCB 128/14754', '', ''),
(207, 1, 'Крышка расширительного бачка JCB 477/00223', '&lt;p&gt;Вы хотите приобрести запчасти для экскаватора-погрузчика JCB 3CX? Просмотрите наш обширный каталог товаров от таких производителей, как Baldwin Filters, ISKRA Motor AE, GARRETT, Parker, Bavaria Filters и других. В ассортименте только запасные части для спецтехники, в качестве которых мы уверены на сто процентов.Товары на московском складе всегда есть в наличии. Возможна оперативная доставка грузов транспортными компаниями в другие города.В этом разделе представлена крышка расширительного бачка (н.м.) JCB 477/00223. Это основная часть элемента жидкостной системы охлаждения.&lt;/p&gt;', '', 'Крышка расширительного бачка JCB 477/00223', '', ''),
(208, 1, 'Корпус термостата 4133L054', '&lt;p&gt;Здесь вы можете приобрести корпус термостата 4133L054 - важную часть системы охлаждения для машин старого образца, оснащенных двигателями Perkins серии AK. Установленный термостат позволит контролировать температуру охлаждающей жидкости на экскаваторе JCB. Запчасть оригинальная, изготавливается из термостойкого пластика. Основные характеристики - повышенная сопротивляемость высоким температурам, изнашиванию, различным нагрузкам. Защитите двигатель с помощью качественных деталей для вашей спецтехники от производителя - сделайте заказ на данной странице.&lt;/p&gt;', '', 'Корпус термостата 4133L054', '', ''),
(209, 1, 'Кран печки JCB 25/221239', '&lt;p&gt;Кран печки JCB 25/221239 является важным элементом отопительной системы погрузчика. При этом он часто ломается по ряду причин. Иногда кран печки в экскаваторе течет, когда нарушается его целостность. Иногда он прикипает к основному элементу и ломается при попытке его повернуть. Также важным поводом для замены старой запчасти является окисление материала. В таких случаях вам придется купить новую деталь. Поменять ее можно самостоятельно или заказав услуги наших работников.Все товары из каталога запчастей спецтехники для доступны для заказа онлайн, с доставкой или самовывозом.&lt;/p&gt;', '', 'Кран печки JCB 25/221239', '', ''),
(210, 1, 'Уголок пластиковый на радиатор JCB 332/C0010', '&lt;p&gt;Уголок на радиатор JCB 332/C0010. Он представляет собой часть трубы из прочного материала черного цвета, согнутую под прямым углом. Изделие прочно и надежно подсоединяется к устройству для отвода жидкости в системе охлаждения.&lt;/p&gt;', '', 'Уголок пластиковый на радиатор JCB 332/C0010', '', ''),
(211, 1, 'Заглушка расширительного бачка JCB 816/90702', '&lt;p&gt;Заглушка расширительного бачка JCB 816/90702 представляет собой пробку из прочного материала – качественного и долговечного пластика. С помощью этого предмета достигается герметизация. Изделие требует замены в случае потери заглушки или ее поломке. Если это произошло, как можно скорее следует купить новые запчасти JCB. Чтобы сделать заказ, пройдите регистрацию на сайте и добавьте продукцию в Корзину. В случае возникновения вопросов, свяжитесь с менеджерами компании.Запчасти для экскаваторов доступны для доставки по Москве и в другие города страны. Их также можно забрать самовывозом из наших магазинов в столице.&lt;/p&gt;', '', 'Заглушка расширительного бачка JCB 816/90702', '', ''),
(212, 1, 'Бачок расширительный радиатора JCB JCB 126/02237', 'Бачок расширительный радиатора JCB JCB 126/0223', '', 'Бачок расширительный радиатора JCB JCB 126/02237', '', ''),
(213, 1, 'Вентилятор охлаждения на JCB 262/36800', 'Вентилятор охлаждения на спецтехнику JCB. Артикул: 262/36800', '', 'Вентилятор охлаждения на JCB 262/36800', '', ''),
(214, 1, 'Водяная помпа JCB 320/04542', '&lt;p&gt;В этом разделе представлена водяная помпа JCB 320/04542 (оригинал). Она подходит для двигателя экскаватора-погрузчика моделей 3CX и 4CX. Это специальное приспособление с электрическим приводом, который обеспечивает циркуляцию жидкости.В каталоге запасных частей экскаватора вы найдете огромное количество оригинальных и неоригинальных изделий. Все они отличаются надежностью, долговечностью и высоким качеством, подтвержденным международными сертификатами. Вы можете приобрести их онлайн, с доставкой на дом, как оптом, так и в розницу. Цена на запчасти JCB указана на странице товара.&lt;/p&gt;', '', 'Водяная помпа JCB 320/04542', '', ''),
(215, 1, 'Насос водяной (помпа) RG JCB 02/202480, 332/H0896', '&lt;p&gt;Насос водяной JCB (водяная помпа) 02/202480, 332/H0896 для экскаватора-погрузчика JCB 3CX, JCB 4CX с двигателями Perkins серии RG до 2005 года выпуска.Оригинальное название: Pump waterАртикул: 02/202480, 332/H0896Предлагаем вам купить запчасти на экскаватор погрузчик, созданные известными и надежными производителями со всего мира. В этом разделе представлен насос водяной (помпа) RG JCB 02/202480, 332/H0896 который используется для создания напора при подаче охлаждающей жидкости. Его основная функция – это циркуляция охлаждающей жидкости в охлаждающей системе для предотвращения перегрева двигателя. Когда антифриз (тосол) проходит по кругу, его температура резко уменьшается, а способность к охлаждению работающего мотора восстанавливается.Если вы хотите приобрести запчасти на экскаваторы ДжиСиБи, оформите покупку онлайн, оптом или в розницу, с доставкой на дом или самовывозом.&lt;/p&gt;', '', 'Насос водяной (помпа) RG JCB 02/202480, 332/H0896', '', ''),
(216, 1, 'Насос водяной - помпа АК JCB 02/202110', '&lt;p&gt;Насос водяной (помпа) АК JCB 02/202110 – это механизм, позволяющий транспортировать большие объемы жидкости и создать требуемый объем при ее подаче. По механизму он относится к центробежным насосам. Главная задача этой запчасти JCB – обеспечение равномерной циркуляции антифриза по всей охлаждающей системе мотора. В результате передвижения охлаждающей жидкости, узлы и механизмы получают желаемую температуру.Просмотрев наш каталог запчастей спецтехники, вы можете заказать любой товар онлайн, как оптом, так и в розницу. Детали из нашего ассортимента можно забрать самовывозом или с доставкой.&lt;/p&gt;', '', 'Насос водяной - помпа АК JCB 02/202110', '', ''),
(217, 1, 'Насос водяной - помпа JCB Perkins АВ 02/201630', '&lt;p&gt;Предлагаем вам приобрести насос водяной – помпу JCB Perkins АВ 02/201630. Это товар из каталога деталей JCB 3CX и 4CX, который предназначен для специальной техники. Данный предмет является основным элементом жидкостной охлаждающей системы. Он состоит из вала, крыльчатки с саморегулируемым сальником, подшипника, приводного шкива и специальной картонной прокладки.Такие запчасти устанавливаются на экскаватор-погрузчик, чтобы вернуть воде способность охлаждать прочие детали. В системе охлаждения жидкость циркулирует по кругу. После прохождения пути, ее температура снижается.&lt;/p&gt;', '', 'Насос водяной - помпа JCB Perkins АВ 02/201630', '', ''),
(218, 1, 'Термостат SB JCB 320/04552', '&lt;p&gt;Предлагаем вам купить в Москве термостат на погрузчик. Товар можно заказать онлайн, оптом и в розницу.Изделие используется для поддержания определенной температуры внутренних узлов во время движения, своевременного охлаждения двигателя, обеспечения скоростного прогрева и защиты автомобиля от перегрева при сильных нагрузках. Это один из главных компонентов, принимающих участие в действии мотора. Термостат SB JCB 320/04552 представляет собой чувствительный к температуре клапан в рамке из латуни. Он применяется в системе охлаждения и регулирует путь антифриза между двигателем и радиатором.&lt;/p&gt;', '', 'Термостат SB JCB 320/04552', '', ''),
(219, 1, 'Термостат JCB 320/04618', '&lt;p&gt;Если вы ищете термостат на погрузчик, вы можете приобрести этот качественный товар. Он является конструктивным элементом системы охлаждения. Термостат SB JCB 320/04618 позволяет поддерживать постоянную температуру за счет применения терморегуляторов. Он состоит из корпуса и тарелки клапана, токов, рамок, пружины, резинового элемента и уплотнителя, направляющего устройства, датчика. Стандартная температура колеблется в режиме от семидесяти до восьмидесяти пяти градусов.Чтобы приобрести запчасти на спецтехнику JCB, нужно добавить товар в Корзину и оформить заказ онлайн.&lt;/p&gt;', '', 'Термостат JCB 320/04618', '', ''),
(220, 1, 'Радиатор охлаждения диагональный на JCB 30/915200, 332/C8731', 'Радиатор охлаждения диагональный на спецтехнику JCB 3CX, 4CX. Артикулы: 30/915200, 332/C8731', '', 'Радиатор охлаждения диагональный на JCB 30/915200, 332/C8731', '', ''),
(221, 1, 'Радиатор охлаждения двигателя на JCB 332/C8935', 'Радиатор охлаждения двигателя на спецтехнику JCB 3CX, 4CX. Артикулы: 332/C8935', '', 'Радиатор охлаждения двигателя на JCB 332/C8935', '', ''),
(222, 1, 'Переключатель скорости отопителя JCB 923/10103', 'Переключатель скорости отопителя JCB. Артикул: 923/10103', '', 'Переключатель скорости отопителя JCB 923/10103', '', ''),
(223, 1, 'Выпускной шланг отопителя 923/10088', '&lt;p&gt;&lt;b&gt;Выпускной шланг отопителя 923/10088&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 923/10088&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Выпускной шланг отопителя 923/10088', '', ''),
(224, 1, 'Термостат JCB 02/203184', '&lt;p&gt;&lt;b&gt;Термостат JCB 02/203184&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 02/203184&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Термостат JCB 02/203184', '', ''),
