(313, 1, 'Болт крепления каретки JCB 123/00928, 826/11511, 826/11235, 123/00544', '&lt;p&gt;&lt;b&gt;Болт крепления каретки JCB 123/00928, 826/11511, 826/11235, 123/00544&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 123/00928, 826/11511, 826/11235, 123/00544&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Болт крепления каретки JCB 123/00928, 826/11511, 826/11235, 123/00544', '', ''),
(314, 1, 'Печка отопителя JCB в сборе ОРИГИНАЛ 332/C4284', '&lt;p&gt;Печка отопителя JCB в сборе 332/C4284 – многофункциональное электрооборудование в оригинальном исполнении от всемирно известного английского производителя. Оно выполнено по уникальной технологии с использованием современных материалов и методик. Система кондиционирования позволяет поддерживать оптимально комфортную температуру в кабине на протяжении всего периода работы оператора. Купить запчасти в интернет-магазине jcbprof в Москве можно в широком ассортименте по низкой цене. Наши менеджеры помогут в выборе и предоставят выгодные условия оплаты и доставки. Каталог запчастей JCB порадует клиентов огромным разнообразием механизмов и аксессуаров, предназначенных для улучшения эксплуатационных свойств вашей спецтехники.&lt;/p&gt;', '', 'Печка отопителя JCB в сборе ОРИГИНАЛ 332/C4284', '', ''),
(315, 1, 'Кожух рычагов управления телескопа и задней стрелы 332/F1130', '&lt;p&gt;Кожух рычагов управления телескопа и задней стрелы – деталь, устанавливаемая в кабине оператора. Имеет простую конструкцию, поэтому у водителя не возникнет сложностей с установкой. Приспособление предназначено для улучшения внешнего вида и защиты органов управления спецтехники.&lt;/p&gt;', '', 'Кожух рычагов управления телескопа и задней стрелы 332/F1130', '', ''),
(316, 1, 'Газовый амортизатор двери JCB (микролифт) 128/13052', '&lt;p&gt;Газовый амортизатор микролифт двери JCB 128/13052 – функциональная деталь для усовершенствования работы элементов кабины. Она выполнена в соответствии с нормативными требованиями действующего стандарта. Автозапчасти для спецтехники данной каталожной группы совместимы с кабинами операторов экскаваторов погрузчиков 3CX и 4CX. Для изготовления газового амортизатора использовался высококачественный металл, устойчивый к износу, коррозии и прочим неблагоприятным факторам окружающей среды. Наш интернет-магазин предлагает купить запчасти на JCB 4CX в Москве по выгодной цене.&lt;/p&gt;', '', 'Газовый амортизатор двери JCB (микролифт) 128/13052', '', ''),
(317, 1, 'Дверной замок внутренний левый JCB 123/07383', '&lt;p&gt;Дверной замок внутренний левый с тросиком JCB 123/07383 для старых моделей кабин экскаваторов-погрузчиков JCB 1998 - 2004 года выпускаОригиальное название: Lock left hand doorДверной замок внутренний левый JCB 123/07383 – практичный механизм, предназначенный для предотвращения открывания двери в процессе рабочей деятельности. Он имеет надежную конструкцию, выполненную из высококачественных материалов. Изделие устойчиво к износу и механическим воздействиям. В нашем магазине представлен удобно структурированный каталог запасных частей JCB для моделей 3CX и 4CX. Мы предлагаем широкий ассортиментный ряд оригинальной продукции для произведения замены элементов любой части экскаваторов-погрузчиков. У нас на запчасти для спецтехники в Москве самые выгодные  и доступные цены.&lt;/p&gt;', '', 'Дверной замок внутренний левый JCB 123/07383', '', ''),
(318, 1, 'Ручка защелка двери JCB внутренняя левая 826/11105, 826/11627', '&lt;p&gt;Ручка защелка двери внутренняя&lt;/p&gt;', '', 'Ручка защелка двери JCB внутренняя левая 826/11105, 826/11627', '', ''),
(319, 1, 'Дверной замок левой ручки внутренний JCB 123/02450', '&lt;p&gt;Дверной замок левой ручки внутренний JCB 123/02450 для экскаваторов-погрузчиков JCBОригинальное название: Lock Door Left HandДверной замок левой ручки внутренний JCB 123/02450 – важнейшая часть двери кабины оператора. Механизмы предназначены для установки в экскаваторы-погрузчики моделей 3CX и 4CX. Они выполняют защитную функцию, направленную на предотвращение взлома или случайного открытия двери во время работы. Купить запчасти на экскаватор-погрузчик JCB 3CX в Москве можно в оригинальном исполнении. Производителем продукции является английская компания, которая занимается выпуском транспорта особого назначения для сельскохозяйственной и строительной деятельности. На запчасти для спецтехники в интернет-магазине jcbprof цена вполне приемлема и доступна.&lt;/p&gt;', '', 'Дверной замок левой ручки внутренний JCB 123/02450', '', ''),
(320, 1, 'Дверной замок правой ручки внутренний JCB 123/02451', '&lt;p&gt;Дверной замок правой ручки(внутр.) JCB 123/02451Дверной замок правой ручки внутренний JCB 123/02451 – надежная защита кабины оператора от взломщиков и выпадения грузов во время работы. Деталь является незаменимым элементом конструкции двери, поэтому должна всегда находиться в исправном состоянии. Запчасти для экскаваторов JCB в оригинальном исполнении можно купить в нашем магазине по доступной цене. Мы предлагаем сертифицированные механизмы высокого качества для моделей 3CX и 4CX. Сайт запчастей спецтехники jcbprof порадует широким ассортиментом продукции, прошедшего строжайший контроль на надежность и безопасность.&lt;/p&gt;', '', 'Дверной замок правой ручки внутренний JCB 123/02451', '', ''),
(321, 1, 'Дворник заднего стекла на JCB 714/40146', '&lt;p&gt;Дворник заднего стекла экскаватора-погрузчика JCB – практичная и функциональная деталь кабины оператора. Она является основной частью стеклоочистителя и предназначена для эффективного улучшения видимости на дороге. Изделие выполнено по уникальной технологии с использованием материалов высокого качества. Купить запчасти на экскаватор-погрузчик JCB моделей 3CX и 4CX можно в нашем интернет-магазине. Мы предлагаем оригинальную и сертифицированную продукцию в широчайшем ассортименте. У нас на запчасти JCB цена вполне выгодная и доступная.&lt;/p&gt;', '', 'Дворник заднего стекла на JCB 714/40146', '', ''),
(322, 1, 'Поводок на дворник заднего стекла на JCB 714/40144', '&lt;p&gt;Дворник заднего стекла с поводком – функциональная деталь для экскаваторов-погрузчиков торговой марки JCB. Она устанавливается на все виды спецтехники данного типа по причине спецификации геометрии кабины. Во время движения или рабочего процесса грязь с дороги попадает на стекло. Механизм такой запчасти для экскаваторов JCB имеет уникальную щеточку с абразивным элементом для эффективной очистки. Плановую замену дворников заднего стекла необходимо проводить 1-2 раза в год. Купить запчасти для спецтехники в интернет-магазине jcbprof можно по низким и выгодным ценам.&lt;/p&gt;', '', 'Поводок на дворник заднего стекла на JCB 714/40144', '', ''),
(323, 1, 'Дворник лобового стекла 333/C1550 332/A7768', '&lt;p&gt;Щетка стеклоочистителя передняя лобового стекла 333/C1550, 332/А7768 экскаватора-погрузчика JCB.Дворник лобового стекла JCB – практичная и многофункциональная щетка для экскаваторов-погрузчиков английской компании JCB. Изделие представлено надежной конструкцией с абразивной щеточкой для эффективной очистки поверхности от дождя, пыли и грязи. Автозапчасти для спецтехники изготовляются на современном оборудовании с применением высококачественных материалов. Детали и комплектующие систем проходят строжайший контроль на прочность, надежность и долговечность. В интернет-магазине можно купить запчасти на экскаватор погрузчик JCB 3CX по выгодной цене и с возможностью замены профессиональным мастером.&lt;/p&gt;', '', 'Дворник лобового стекла 333/C1550 332/A7768', '', ''),
(324, 1, 'Зеркало заднего вида наружное JCB 123/04970, 477/01608, 334/E0829', '&lt;p&gt;Зеркало заднего вида наружное JCB – качественная деталь кабины оператора в оригинальном исполнении. Она предназначена для бокового крепления и обеспечения хорошей видимости во время движения или выполнения функциональной деятельности. Принадлежность имеет эргономичную конструкцию, снабженную крепежным механизмом для максимально простого монтажа на кабину экскаватора JCB. Изделие подойдет установки на спецтехнику моделей 3CX и 4 CX. Купить запчасти на экскаватор-погрузчик английского производителя можно в нашем интернет-магазине jcbprof по выгодной цене.&lt;/p&gt;', '', 'Зеркало заднего вида наружное JCB 123/04970, 477/01608, 334/E0829', '', ''),
(325, 1, 'Кресло оператора JCB', '&lt;p&gt;Кресло оператора JCB 40/910709 – комфортное и эргономичное посадочное место кабины спецтехники.&lt;/p&gt;', '', 'Кресло оператора JCB', '', ''),
(326, 1, 'Кронштейн крепления зеркала левый изогнутый JCB 331/26945', '&lt;p&gt;Кронштейн крепления зеркала левый изогнутый JCB – необходимая часть наружной комплектации кабины экскаватора-погрузчика. Изделие имеет эргономичную форму для максимально удобной фиксации на определенном уровне. Запчасти на JCB 4CX изготовляют в соответствии с нормативными требованиями современного стандарта. В качестве основного материала выступает сверхпрочный окрашенный металл, устойчивый к коррозии и неблагоприятным воздействиям окружающей среды. Наш каталог запасных частей JCB порадует разнообразием моделей для всех узлов спецтехники.&lt;/p&gt;', '', 'Кронштейн крепления зеркала левый изогнутый JCB 331/26945', '', ''),
(327, 1, 'Кронштейн крепления зеркала левый прямой JCB 123/04969', '&lt;p&gt;Кронштейн крепления зеркала левый прямой JCB модели 123/04969 – оригинальная запасная часть высокого качества. Она предназначена для повышения радиуса обзорности с рабочего места оператора. Изделие имеет уникальную конструкцию, которая позволяет расположить боковое зеркало для захвата невидимой зоны. Купить запчасти на экскаватор-погрузчик можно для улучшения технических характеристик спецтехники. Кронштейн выполнен из прочного металла, устойчивого к неблагоприятному воздействию окружающих факторов. Только в нашем магазине представлен самый объемный каталог запчастей JCB, цены на которые вполне приемлемы и доступны.&lt;/p&gt;', '', 'Кронштейн крепления зеркала левый прямой JCB 123/04969', '', ''),
(328, 1, 'Кронштейн крепления зеркала правый изогнутый JCB 331/26946', '&lt;p&gt;Кронштейн крепления зеркала правый изогнутый JCB модели 331/26946 – функциональное устройство для обеспечения хорошей обзорности оператору экскаватора и другой спецтехники. Оно выполнено по современной технологии с применением высококачественного металла. Купить запчасти в интернет-магазине jcbprof для кабин можно в широком разнообразии моделей. Правый изогнутый кронштейн позволит создать захват всех невидимых зон для максимально эффективного выполнения поставленных задач. Оптовым клиентам мы предлагаем запчасти для спецтехники в Москве по самым приятным ценам.&lt;/p&gt;', '', 'Кронштейн крепления зеркала правый изогнутый JCB 331/26946', '', ''),
(329, 1, 'Кронштейн крепления зеркала правый прямой JCB 123/04968', '&lt;p&gt;Кронштейн крепления зеркала правый прямой JCB 123/04968 – практичный и функциональный механизм высокого качества. Он предназначен для повышения радиуса обзора оператору кабины во время движения или выполнения рабочих задач. Изделия имеют особую конструкцию, поэтому используются только на моделях 3CX и 4CX. Наш магазин автозапчастей спецтехники предлагает только сертифицированную продукцию, которая прошла строжайший контроль на качество, надежность и безопасность. Мы работаем с розничными и оптовыми клиентами, также предлагая свои услуги по ремонту и плановому обслуживанию экскаваторов-погрузчиков. На оригинальные запчасти JCB цена в Москве приемлема и доступна.&lt;/p&gt;', '', 'Кронштейн крепления зеркала правый прямой JCB 123/04968', '', ''),
(330, 1, 'Маяк проблесковый желтый JCB 700/50114, 700/36800', '&lt;p&gt;Маячок проблесковый желтый JCB 700/36800 – стационарное электроустройство для экскаваторов-погрузчиков. Оно предназначено для оповещения водителей близ движущихся транспортных средств о потенциальной опасности. Конструкция изделия достаточно проста, его нижняя часть снабжена крепежными механизмами, которые позволят надежно зафиксировать устройство на крыше кабины. Купить запасные части для JCB рекомендуется для улучшения технических характеристик техники. В нашем магазине представлены только оригинальные детали для моделей 3CX и 4CX. Только здесь купить запчасти на экскаватор можно по выгодным и доступным ценам.&lt;/p&gt;', '', 'Маяк проблесковый желтый JCB 700/50114, 700/36800', '', ''),
(331, 1, 'Мотор стеклоочистителя заднего JCB 714/40293 оригинальный', '&lt;p&gt;Мотор стеклоочистителя заднего JCB – функциональный механизм для кабины оператора спецтехники JCB. Его замену необходимо производить сразу, после того как оператор услышал шум несвойственный при работе устройства или на стекле начали появляться царапины от щеточек дворника. Оригинальные запчасти на экскаватор погрузчик 3CX и 4CX помогут улучшить технические характеристики системы. Они просты в обслуживании и долговечны в эксплуатации, так как соответствуют нормативным требованиям действующего стандарта. Купить запчасти JCB в Москве можно в нашем интернет-магазине по доступной цене.&lt;/p&gt;', '', 'Мотор стеклоочистителя заднего JCB 714/40293 оригинальный', '', ''),
(332, 1, 'Петля дверная JCB  813/10167', '&lt;p&gt;Предлагаем вам разнообразные детали JCB, предназначенные для размещения в кабине фронтального погрузчика. Товары отличаются высоким качеством, надежностью и долговечностью. Они выполняются из прочных компонентов.В этом разделе каталога представлена дверная петля JCB 813/10167. С помощью этого приспособления полотно плотно крепится к коробке. Также эта запчасть способствует беспрепятственному открытию и закрытию дверей экскаватора-погрузчика. Данный элемент создан из качественного материала, обеспечивающего длительную эксплуатацию без заедания и посторонних шумов.&lt;/p&gt;', '', 'Петля дверная JCB  813/10167', '', ''),
(333, 1, 'Подушка кабины JCB 263/24405', '&lt;p&gt;Подушка кабины JCB 263/24405 относится к деталям пневматической подвески. Очень важно точно подобрать этот товар. Выбирая такие запчасти на спецтехнику JCB, нужно исходить из пары основных параметров: диаметра сильфона и величины хода. Эти факторы влияют на количество колец. От размера предмета зависит нагрузка, который он может выдержать без повреждений. Его высота влияет на мягкость подвески (чтобы сделать ее мягче, можно подключить ресивер).Хотите приобрести запчасти JCB оптом или в розницу? Тогда зарегистрируйтесь на нашем сайте. Все товары можно приобрести с доставкой.&lt;/p&gt;', '', 'Подушка кабины JCB 263/24405', '', ''),
(334, 1, 'Ручка защелка двери JCB внутренняя правая 826/11106, 826/11628', '&lt;p&gt;Ручка замок двери JCB внутренняя правая 826/11106 для экскаватора-погрузчика JCB 3CX, JCB 4CX, JCB 5CX для кабин нового образца 2005 - 2017 года выпуска.Оригинальное название: Latch lever releaseРучка замок JCB 826/11106 устанавливается с внутренней части правой двери и отвечает за фиксацию - открытие и закрытие двери из кабины.&lt;/p&gt;', '', 'Ручка защелка двери JCB внутренняя правая 826/11106, 826/11628', '', ''),
(335, 1, 'Подушка кабины в сборе JCB 331/18441, 331/18442', '&lt;p&gt;Предлагаем вам купить запчасти на погрузчик. В ассортименте нашего интернет-магазина есть огромное множество оригинальных и неоригинальных товаров. Вся продукция изготовлена проверенными производителями из Европы и Азии.В этом разделе представлена подушка кабины JCB 331/18441, 331/18442. Товар требует замены вследствие износа или выхода из строя.&lt;/p&gt;', '', 'Подушка кабины в сборе JCB 331/18441, 331/18442', '', ''),
(336, 1, 'Руль JCB ORIGINAL (Оригинал) 333/D1381', '&lt;p&gt;Руль оператора 333/D1381 для экскаватора-погрузчика JCBОригинальное название: Assembly steering wheel ABI inc, cap &amp; plugРуль JCB 333/D1381 – это основной орган управления экскаватором-погрузчиком. Оператор может использовать данное приспособление, установленное в кабине, чтобы менять направление движения специальной техники. Руль моментально и точно передает колесам желаемый импульс. При любых условиях на дороге усилие, которое прилагается к рулевому колесу, остается на одном уровне в течение примерно двух-трех лет.Мы занимаемся продажей запчастей JCB по приемлемым ценам. Также вы можете заказать у нас технический осмотр спецтехники, диагностику, ремонт и установку купленной детали.&lt;/p&gt;', '', 'Руль JCB ORIGINAL (Оригинал) 333/D1381', '', ''),
(337, 1, 'Ручка рычага управления JCB 331/30884', '&lt;p&gt;Ручка рычага управления JCB 331/30884 является одним из манипуляторов, позволяющих быстро и точно влиять на движение машины. Она подходит для популярных моделей погрузчика от английского бренда. Предмет размещается непосредственно в кабине экскаватора JCB таким образом, чтобы быть доступным для оператора. Данный товар имеет эргономичную форму и удобен в использовании. Вы можете заказать его оптом и в розницу, с оперативной доставкой на объект.В каталоге запчастей спецтехники вы найдете и другие детали от проверенных производителей. Мы предлагаем вам и оригинальные, и неоригинальные товары.&lt;/p&gt;', '', 'Ручка рычага управления JCB 331/30884', '', ''),
(338, 1, 'Фиксатор бокового стекла  331/31071', '&lt;p&gt;Фиксатор бокового стекла 331/31071 – это внутренний элемент, который вставляется в дверь на специальных защелках. Он плотно удерживает стеклянную вставку в полотне и не дает ему выскальзывать. Такие запчасти устанавливаются на экскаватор-погрузчик JCB. Чтобы их заменить, следует опустить стекло вниз, снять дверную карту, открутить фиксаторы головкой на десять. Затем нужно отвернуть винт и снять внешний уплотнитель стекла. После этого фиксаторы снимаются и заменяются на новые. При установке порядок действий обратный.Чтобы заказать запасные части JCB, зарегистрируйтесь на нашем сайте. Менеджеры помогут вам сделать выбор.&lt;/p&gt;', '', 'Фиксатор бокового стекла  331/31071', '', ''),
(339, 1, 'Дверной замок внутренний правый JCB 123/07382', '&lt;p&gt;Ручка двери JCB 3CX - 4C', '', 'Дверной замок внутренний правый JCB 123/07382', '', ''),
(340, 1, 'Радиатор отопителя салона 30/925766', '&lt;p&gt;Радиатор отопителя салона 30/925766, представленный в этом разделе, являет собой батарею для кабины. Он состоит из трубок и пластин, спаянных с ребрами. С помощью этой эффективной конструкции можно отрегулировать «погоду» в автомобиле. Также такие товары используются для отвода тепла от жидкости, которая находится в системе охлаждения двигателя.В магазине запчастей JCB вы можете купить эту и другие детали онлайн, оптом и в розницу. Товары доступны для заказа с доставкой. Чтобы сделать покупку, загляните в каталог запасных частей экскаватора и добавьте выбранное изделие в Корзину.&lt;/p&gt;', '', 'Радиатор отопителя салона 30/925766', '', ''),
(341, 1, 'Радиатор отопителя салона JCB 30/925722', '&lt;p&gt;Радиатор отопителя салона JCB 30/925722 состоит из сердцевины с трубчато-пластинчатой конструкцией, верхних и нижних коробок (бачков), а также дополнительных патрубков. В нем используются решетки с трубками и лентами или пластинками. Такие детали для спецтехники изнашиваются в силу многих причин: при разгерметизации в местах соединения элементов, разрушении швов, возникновении трещин, повреждении уплотнительных материалов. Проверить их необходимо и после аварии, ведь механическая поломка также может произойти вследствие встряски.Если вы хотите приобрести такие запасные части для экскаваторов, регистрируйтесь на сайте.&lt;/p&gt;', '', 'Радиатор отопителя салона JCB 30/925722', '', ''),
(342, 1, 'Замок левой двери внутренний 826/11627 826/11105', '&lt;p&gt;Замок левой двери внутренний 826/11627, представленный в этом разделе, устанавливается в кабине специальной технике. Он обладает прочной и эффективной конструкцией. Такие запасные части JCB изготавливаются из качественного, долговечного и износостойкого материала. Высококлассный механизм «переживет» множество открытий и закрытий. Требует замены в случаях поломки, например, если в отверстии остался обломок ключа, устройство перестало закрываться или открываться.Вы можете купить запчасти на экскаватор-погрузчик моделей 3СХ и 4СХ нового образца, выпущенных в период с 2005 по 2017 годы.&lt;/p&gt;', '', 'Замок левой двери внутренний 826/11627 826/11105', '', ''),
(343, 1, 'Буфер форточки JCB 331/34878', '&lt;p&gt;Оригинальное название: Buffer windowПовреждение стекол погрузчика становится настоящей проблемой, потому что машина выходит из строя до полной исправности поломки. Буфер форточки JCB 331/34878 предназначен для экскаватора-погрузчика JCB с новой кабиной 2005-2017 года выпуска. В онлайн-каталоге запчастей спецтехники нашего интернет-магазина представлено огромное количество оригинальных запчастей от производителя.Детали погрузчика JCB представлены для любой модели спецтехники, сопровождаются сертификатами соответствия и гарантийными обязательствами, что дает вам дополнительную уверенность в их качестве!&lt;/p&gt;', '', 'Буфер форточки JCB 331/34878', '', ''),
(344, 1, 'Газовый амортизатор микролифт окна JCB 331/20895, 123/05404', '&lt;p&gt;Газовый микролифт окна JCB 331/20895 для экскаватора-погрузчика JCB 3CX, JCB 4CXОригинальное название: Strut gas, rear windowНазначение: открытие и фиксация стеклаГазовый микролифт окна JCB 331/20895 – оригинальная комплектующая часть кабины спецтехники JCB. Она рекомендована к использованию экскаваторам-погрузчикам моделей 3CX и 4CX, имеет простую конструкцию, поэтому не доставит труда в установке. Каталог запчастей JCB онлайн предлагает широкий выбор запчастей для кабины оператора спецтехники. Механизмы выполнены из сверхпрочных материалов и прошли строжайший контроль качества, надежность и долговечность. У нас на запчасти на экскаватор погрузчик JCB 3CX цена вполне приемлема и доступна.&lt;/p&gt;', '', 'Газовый амортизатор микролифт окна JCB 331/20895, 123/05404', '', ''),
(345, 1, 'Амортизатор сидения оператора JCB 40/910298', '&lt;p&gt;Амортизатор сидения оператора JCB 40/910298 предназначен для удобства работы на экскаваторе-погрузчике JCB. Наш интернет-магазин онлайн представляет детали для экскаваторов JCB, произведенные из высококачественных материалов с применением новейших технологий. Заказать детали, представленные в оригинале, можно с доставкой во все регионы России.Каталог запчастей JCB онлайн предлагает и наш магазин реализует запасные части для экскаваторов, изготовленные в соответствии с мировыми стандартами соответствия качества и безопасности, имеющие гарантийный срок эксплуатации.&lt;/p&gt;', '', 'Амортизатор сидения оператора JCB 40/910298', '', ''),
(346, 1, 'Газовый амортизатор двери JCB (микролифт) 128/13052', '&lt;p&gt;Газовый амортизатор микролифт двери JCB 128/13052 – функциональная деталь для усовершенствования работы элементов кабины. Она выполнена в соответствии с нормативными требованиями действующего стандарта. Автозапчасти для спецтехники данной каталожной группы совместимы с кабинами операторов экскаваторов погрузчиков 3CX и 4CX. Для изготовления газового амортизатора использовался высококачественный металл, устойчивый к износу, коррозии и прочим неблагоприятным факторам окружающей среды. Наш интернет-магазин предлагает купить запчасти на JCB 4CX в Москве по выгодной цене.&lt;/p&gt;', '', 'Газовый амортизатор двери JCB (микролифт) 128/13052', '', ''),
(347, 1, 'Газовый амортизатор двери JCB (микролифт)  123/06334, 331/14573, 331/66778', '&lt;p&gt;Газовый амортизатор микролифт двери JCB 123/06334, 331/14573 предназначен для замены вышедшей из строя аналогичной детали на двери экскаватора-погрузчика JCB. Деталь изготовлена из качественных, инновационных материалов, имеет долгий срок службы. В каталоге нашего интернет-магазина представлены детали для спецтехники JCB любой модификации.&lt;/p&gt;', '', 'Газовый амортизатор двери JCB (микролифт)  123/06334, 331/14573, 331/66778', '', ''),
(348, 1, 'Амортизатор сидения оператора JCB', '&lt;p&gt;Амортизатор сидения оператора JCB 40/906902 предназначен для замены аналогичной, вышедшей из строя детали экскаваторов-погрузчиков JCB. Изделие глушит вибрацию и ударные волны при движении техники или работе. Тем самым, комфортные условия оператора позволяют ему качественно и сосредоточенно выполнять свою работу.&lt;/p&gt;', '', 'Амортизатор сидения оператора JCB', '', ''),
(349, 1, 'Газовый амортизатор окна (микролифт) JCB 123/05404, 331/20895, 123/02550', '&lt;p&gt;Газовый микролифт окна JCB 123/05404 – функциональный механизм, используемый для замены износившейся системы или усовершенствования технических свойств части двери. Изделие можно найти в каталожной группе «Кабины». Магазин запчастей для спецтехники jcbprof предлагает широкий ассортимент деталей и аксессуаров для всей модельной линейки экскаваторов английского производства. Вся продукция представлена в оригинальном исполнении и полностью соответствует требованиям качества и безопасности современного стандарта. У нас купить запасные части для JCB 3CX/4CX можно по низким ценам.&lt;/p&gt;', '', 'Газовый амортизатор окна (микролифт) JCB 123/05404, 331/20895, 123/02550', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(350, 1, 'Газовый микролифт двери JCB 123/05403, 123/04798, 122/67484', '&lt;p&gt;Газовый микролифт двери JCB 123/05403 – функциональная деталь для улучшения эксплуатационных качеств кабины оператора. Она отличается простотой конструкции и легкостью установки. Для изготовления микролифта использовались высококачественные материалы, устойчивые к износу, повреждениям и воздействию влаги. Наш интернет-магазин предлагает оригинальные запчасти для экскаваторов моделей JCB 3CX/4CX. В каталожной группе «Кабина» собран широчайший ассортимент продукции английской компании ДжиСиБи. Все детали прошли обязательную сертификацию и имеют гарантийные талоны. У нас купить запчасти JCB можно по доступной и выгодной цене.&lt;/p&gt;&lt;p&gt;Газовый микролифт двери JCB 123/05403 представляет собой функциональную деталь для оптимизации эксплуатации техники. Микролифт легко установить и просто использовать. Для изготовления данной детали использовались самые проверенные и качественные материалы, обладающие высокой износостойкостью и устойчивостью к воздействию негативных внешних факторов.&lt;/p&gt;', '', 'Газовый микролифт двери JCB 123/05403, 123/04798, 122/67484', '', ''),
