(373, 1, 'Ручка переключателя печки JCB 331/36910', 'Ручка переключателя печки. Артикул: 331/36910', '', 'Ручка переключателя печки JCB 331/36910', '', ''),
(374, 1, 'Бачок тормозной жидкости JCB 126/00200', '&lt;p&gt;Данный бачок для залива тормозной гидравлической жидкости устанавливался на экскаваторы-погрузчики JCB 3CX, JCB 4CX с тормозной системой, при которой усилие передается от педали тормоза на главные тормозные цилиндры посредством создания необходимого давления вакуумными усилителями тормоза и подачей гидравлической жидкости в каналы тормозного суппорта заднего моста.&lt;/p&gt;', '', 'Бачок тормозной жидкости JCB 126/00200', '', ''),
(375, 1, 'Тормозные колодки ручного тормоза JCB 15/920160', '&lt;p&gt;Комплект тормозных колодок стояночного тормоза прямоугольные JCB 15/920160, 452/02700 старого образца для экскаваторов-погрузчиков JCB до 2002 года выпуска.&lt;/p&gt;', '', 'Тормозные колодки ручного тормоза JCB 15/920160', '', ''),
(376, 1, 'Тормозные колодки ручного тормоза круглые JCB 15/920103', '&lt;p&gt;Комплект тормозных колодок стояночного тормоза круглые JCB 15/920103 нового образца для экскаваторов-погрузчиков JCB после 2000 года выпуска.Оригинальное название: Kit-pad brake pad&lt;/p&gt;', '', 'Тормозные колодки ручного тормоза круглые JCB 15/920103', '', ''),
(377, 1, 'Вакуумный усилитель тормозов JCB 15/905501', '&lt;p&gt;Вакуумный усилитель тормозов JCB 15/905501&lt;/p&gt;', '', 'Вакуумный усилитель тормозов JCB 15/905501', '', ''),
(378, 1, 'Тормозной цилиндр JCB Perkins 15/920110', '&lt;p&gt;Цилиндр Perkins 15/920110 - важный элемент тормозной системы. Применяется для старых моделей JCB, таких как 3CХ и 4СХ, где представлены автоматически регулируемые дисковые тормоза. Чтобы работа системы была бесперебойной, важно следить за тем, чтобы все детали были исправными. Качество этого цилиндра проверено при работе спецтехники даже в сложных погодных условиях, он изготовлен из добротных материалов. Его несложно установить и отрегулировать.&lt;/p&gt;', '', 'Тормозной цилиндр JCB Perkins 15/920110', '', ''),
(379, 1, 'Главный тормозной цилиндр 15/920389', '&lt;p&gt;Главный тормозной цилиндр 15/920389, 15/905504, 15/920158 является центральным элементом данной системы. Такая запчасть устанавливается на экскаватор-погрузчик с двумя основными целями. Во-первых, она препятствует произвольному движению транспорта в нерабочее время. Во-вторых, она позволяет замедлять скорость спецтехники и полностью останавливать ее. Элемент воздействует на тормозные колодки дискового типа.&lt;/p&gt;', '', 'Главный тормозной цилиндр 15/920389', '', ''),
(380, 1, 'Диск тормозной JCB 450/10226 458/20285', '&lt;p&gt;Наш интернет-магазин предлагает тормозные диски модели 450/10226 по демократичной цене. Эти запчасти оригинальные, выполнены из высококачественных материалов, подходят для экскаваторов-погрузчиков JCB. При правильной установке работают эффективно, с ними тормозная система будет в полном порядке. Чтобы заказать эту и другие детали для спецтехники, просто добавьте товар в корзину. Также возможен оперативный монтаж на вашу модель. Для получения подробной консультации позвоните по телефону, который дан на сайте, или сформируйте заявку на обратный звонок.&lt;/p&gt;', '', 'Диск тормозной JCB 450/10226 458/20285', '', ''),
(381, 1, 'Диск фрикционный заднего моста 450/10224', '&lt;p&gt;Тормозной диск фрикционный с феррадо заднего моста JCB 450/10224&lt;/p&gt;', '', 'Диск фрикционный заднего моста 450/10224', '', ''),
(382, 1, 'Энергоаккумулятор тормозной JCB 332/H3679', '&lt;p&gt;Энергоаккумулятор тормозной заряженый 332/H3679 для JCB 3CX/4CXПроизводство: FRANCE.&lt;/p&gt;&lt;p&gt;Расположение: справа по ходу движения под капотом возле турбины экскаватора-погрузчика JCB 3CX/4CX.&lt;/p&gt;', '', 'Энергоаккумулятор тормозной JCB 332/H3679', '', ''),
(383, 1, 'Гидроаккумулятор тормозной системы JCB  332/G7186', '&lt;p&gt;Гидроаккумулятор тормозной системы JCB 332/G7186 заряженный азотом для экскаватора-погрузчика JCB.Оригинальное название: Accumulator&lt;/p&gt;', '', 'Гидроаккумулятор тормозной системы JCB  332/G7186', '', ''),
(384, 1, 'Направляющий палец тормозного поршня JCB 450/24303', '&lt;p&gt;Оригинальное название: Pin headed backoff.&lt;/p&gt;&lt;p&gt;Направляющий палец тормозного поршня (оригинальное название - pin-headed backoff) - важный элемент тормозной системы заднего моста JCB. Удерживает суппорт на поворотном кулаке. Подходит для моделей погрузчиков 3СХ и 4СХ.&lt;/p&gt;', '', 'Направляющий палец тормозного поршня JCB 450/24303', '', ''),
(385, 1, 'Трос стояночного ручного тормоза JCB  910/60203', '&lt;p&gt;Трос стояночного ручного тормоза JCB 910/60203, 910/M1244 для экскаваторов-погрузчиков JCB 3CX, 4CXОригинальное название: Cable parkbrakeОписание: трос ручника 910/60203, 910/M1244 отвечает за блокировку тормозов во время остановки и стоянки техники, приводится в действие оператором из кабины поднятием стояночного рычага, который натягивая стояночный трос приводит к зажиму тормозных колодок.Трос стояночного ручного тормоза JCB 910/60203, 910/M1244 выполнен из высокопрочных материалов с применением передовых технологий, износоустойчив, необходим для замены аналогичной детали погрузчика. В нашем магазине представлены качественные запчасти от проверенных производителей, заказать и приобрести которые можно с доставкой во все регионы России.Мы предоставляем каталог запасных частей погрузчика и реализуем детали, изготовленные в соответствии с мировыми стандартами соответствия качества, безопасности и гарантийным сроком эксплуатации. Все изделия продаются по самым оптимальным ценам.&lt;/p&gt;', '', 'Трос стояночного ручного тормоза JCB  910/60203', '', ''),
(386, 1, 'Диск стояночного тормоза JCB 458/20693', '&lt;p&gt;Диск стояночного тормоза JCB 458/20693 устанавливается на заднем мосту со стороны коробки переключения передач. Он представляет собой плоскую шайбу из металла с отверстием посередине. Деталь погрузчика используется как основной механизм в тормозной системе трансмиссионного тормоза. Главная особенность такой конструкции – воздействие на трансмиссию, а не на колеса. Она используется в большинстве случаев, в отличие вариантов с электронным приводом или барабанных.Интересуют эти и другие запчасти JCB? Регистрируйтесь на сайте и добавляйте их в Корзину! Менеджеры проконсультируют вас по всем вопросам.&lt;/p&gt;', '', 'Диск стояночного тормоза JCB 458/20693', '', ''),
(387, 1, 'Крышка бачка тормозной жидкости JCB 265/00989', '&lt;p&gt;Крышка тормозного бачка 265/00989 для JCB 3CX, JCB 4CX&lt;/p&gt;', '', 'Крышка бачка тормозной жидкости JCB 265/00989', '', ''),
(388, 1, 'Уплотнение тормозного суппорта JCB 813/50012-26', '&lt;p&gt;Уплотнение тормозного суппорта JCB 813/50012-26 используется для герметизации элементов и гидроизоляции. Специальное изделие особой конструктивной формы играет немаловажную роль. Прежде всего, такие запасные части JCB защищают изделия от попадания влаги, грязи, воздуха, посторонних предметов. Также они оберегают тормозной суппорт от преждевременного или быстрого износа.Вы можете купить запчасти на экскаватор-погрузчик онлайн, заказав их с оперативной доставкой или самовывозом из магазинов компании. Менеджеры помогут вам сделать заказ, проконсультируют по ассортименту.&lt;/p&gt;', '', 'Уплотнение тормозного суппорта JCB 813/50012-26', '', ''),
(389, 1, 'Уплотнение тормозного поршня (малое) JCB 813/50012', '&lt;p&gt;Уплотнение тормозного поршня малое JCB 813/50012, представленное в этом разделе, доступно для заказа онлайн из каталога запасных частей погрузчика. Данный товар создается из прочного, долговечного материала, который оберегает детали от преждевременного износа. Также он препятствует попаданию в тормозной поршень влаги, грязи и пыли, обеспечивает герметичность и влагостойкость.Хотите заказать запчасти для JCB 3CX в Москве? Зарегистрируйтесь на сайте компании и добавьте товар в Корзину. В случае возникновения вопросов по ассортименту, звоните менеджерам или заказывайте обратный звонок.&lt;/p&gt;', '', 'Уплотнение тормозного поршня (малое) JCB 813/50012', '', ''),
(390, 1, 'Уплотнение тормозного поршня (большое) JCB 813/50026', '&lt;p&gt;Предлагаем вам приобрести уплотнение тормозного поршня большое JCB 813/50026. Это специальный элемент, созданный из прочного, долговечного и стойкого к износу материала. Изделие используется для герметизации тормозного поршня. Оно защищает элемент от влаги, грязи и пыли, а также от преждевременного износа. Запчасть для спецтехники представлена в интернет-магазине по доступной цене. Стоимость указана на странице товара.Чтобы приобрести товары из каталога запчастей JCB онлайн, пройдите регистрацию на сайте. У вас есть вопросы? Свяжитесь с менеджерами или закажите обратный звонок.&lt;/p&gt;', '', 'Уплотнение тормозного поршня (большое) JCB 813/50026', '', ''),
(391, 1, 'Тормозной шланг 900мм JCB 649/31004', '&lt;p&gt;В магазине JCB вы найдете качественные запчасти от ведущих производителей со всего мира. Если вам нужна консультация специалиста, звоните или заказывайте обратный звонок. Менеджеры помогут вам сделать выбор и заказ.В этом разделе вы найдете тормозной шланг 900 мм JCB 649/31004. Это отрезок из политетрафторэтилена и стальной оплетки. В некоторых случаях он дополняется пластиковой защитной трубкой. Такие детали для спецтехники обеспечивают тормозной системе полную герметичность, они не пропускают влагу и воздух. Также они защищают ее от преждевременного износа, обеспечивая надежность и долговечность.&lt;/p&gt;', '', 'Тормозной шланг 900мм JCB 649/31004', '', ''),
(392, 1, 'Трос ручного тормоза JCB 910/60207', '&lt;p&gt;В каталоге запчастей спецтехники вы найдете множество качественных товаров от ведущих производителей.На этой странице есть тросик ручного тормоза (н.м.) JCB 910/60207, который является важным элементом специальной техники и представлен в новой модели. Он устанавливается под капотом (возможен самостоятельный монтаж) и выполняет основную роль в процессе торможения. Если эта деталь неисправна, эксплуатация транспортного средства полностью запрещена.Чтобы купить запчасти JCB в Москве, сделайте заказ онлайн. Изделия доступны для приобретения оптом и в розницу, с доставкой и самовывозом.&lt;/p&gt;', '', 'Трос ручного тормоза JCB 910/60207', '', ''),
(393, 1, 'Тормозной шланг 760мм правый JCB 649/51320', '&lt;p&gt;Хотите купить запчасти JCB по приемлемым ценам? Загляните в магазин нашей компании! Выбирайте продукцию, заказывайте ее онлайн с доставкой или забирайте самовывозом из магазинов в столице!В этом разделе представлен тормозной шланг 760 мм правый JCB 649/51320. Он изготавливается из политетрафторэтилена и стальной оплетки, иногда дополняется пластиковой защитной трубкой. Предмет имеет несколько функций – обеспечение долговечности, надежности и герметичности системы, защита от влаги и воздуха.Запчасти для экскаваторов можно заказать с доставкой по Москве и в другие города страны.&lt;/p&gt;', '', 'Тормозной шланг 760мм правый JCB 649/51320', '', ''),
(394, 1, 'Тормозной шланг 580мм левый JCB 649/51240', '&lt;p&gt;Ищете качественные детали для погрузчиков от английского бренда? Загляните в каталоги запчастей спецтехники и закажите выбранные товары онлайн! У вас есть вопросы? Звоните или заказывайте обратный звонок.В этом разделе представлен тормозной шланг 580 мм левый JCB 649/51240. Он обладает значительной долговечностью, высокой прочностью и стойкостью к износу. Изделие не боится воздействия агрессивных сред и механических повреждений, не трескается и не высыхает. Такие запчасти JCB оберегают систему от преждевременного износа, случайного проникновения влаги и воздуха извне.&lt;/p&gt;', '', 'Тормозной шланг 580мм левый JCB 649/51240', '', ''),
(395, 1, 'Тормозной цилиндр рабочий в сборе с поршнем JCB 998/10456', '&lt;p&gt;Представляем вам широкий каталог запчастей для экскаватора JCB. В продаже представлены оригинальные и неоригинальные товары от ведущих производителей. Продукцию можно приобрести онлайн, как оптом, так и в розницу, с оперативной доставкой или самовывозом из магазинов в столице.В этом разделе для заказа доступен тормозной цилиндр рабочий в сборе с поршнем JCB 998/10456. Он используется для снижения скорости и остановки специальной техники, для препятствия самопроизвольного движения в нерабочее время. Такая деталь погрузчика являет собой центральный элемент тормозной системы.&lt;/p&gt;', '', 'Тормозной цилиндр рабочий в сборе с поршнем JCB 998/10456', '', ''),
(396, 1, 'Диск фрикционный заднего моста JCB 458/20353', '&lt;p&gt;В этом разделе представлен тормозной диск фрикционный с феррадо заднего моста JCB 458/20353. Данный элемент являет собой изделие из прочного, долговечного и износостойкого металла. Такие детали служат для обеспечения торможения спецтехники. Они устанавливаются на заднем мосту между главной парой и бортовым редуктором. Предметы должны быть качественными и надежными, ведь от таких элементов зависит безопасность. Запчасти на экскаватор-погрузчик JCB доступны для заказа онлайн. Чтобы сделать заказ, регистрируйтесь на сайте и добавьте товар в Корзину. Менеджеры проконсультируют вас по всем вопросам.&lt;/p&gt;', '', 'Диск фрикционный заднего моста JCB 458/20353', '', ''),
(397, 1, 'Тормозной диск комплект (задний мост) JCB 450/10224-26', '&lt;p&gt;Предлагаем вам приобрести качественные детали для спецтехники, созданные ведущими производителями со всего мира. В этом разделе можно заказать тормозной диск (комплект) на задний мост JCB 450/10224-26. Он создан из металла и представляет собой плоский элемент с соответствующими отверстиями. Товар используется для обеспечения торможения специальной техники. Такие запчасти на экскаватор-погрузчик JCB должны обладать впечатляющим качеством, ведь от них зависит ваша безопасность. Советуем вам приобретать продукцию только от надежных изготовителей, представленную в нашем интернет-магазине.&lt;/p&gt;', '', 'Тормозной диск комплект (задний мост) JCB 450/10224-26', '', ''),
(398, 1, 'Тормозной диск комплект (задний мост) JCB 450/10211-12', '&lt;p&gt;Интересуют запчасти для спецтехники от английского бренда JCB и цены на них? Загляните на наш сайт! В каталоге запасных частей экскаватора вы найдете оригинальные и неоригинальные товары от ведущих производителей со всего мира.В этом разделе представлен тормозной диск комплект на задний мост JCB 450/10211-12. Он создан из металла, который выбран за прочность, долговечность и износостойкость. Предмет необходим для того, чтобы машина могла быстро и плавно тормозить.Рекомендуем вам покупать только надежные товары от проверенных брендов. Именно такие доступны для заказа в интернет-магазине.&lt;/p&gt;', '', 'Тормозной диск комплект (задний мост) JCB 450/10211-12', '', ''),
(399, 1, 'Направляющая тормозных дисков JCB 450/10213', '&lt;p&gt;В каталоге деталей JCB 3CX представлены высококачественные товары, как оригинальные, так и от сторонних производителей. Все они доступны для покупки оптом или в розницу, с доставкой в любую точку страны или самовывозом из магазинов.Направляющая тормозных дисков JCB 450/10213 является частью механизма торможения. Их замена необходима при ремонте или установке новых элементов. Такие товары делаются из прочных и долговечных материалов, стойких к износу.Предлагаем вам заказать запчасти на экскаватор-погрузчик онлайн. Зарегистрируйтесь на сайте и добавьте выбранный товар в Корзину.&lt;/p&gt;', '', 'Направляющая тормозных дисков JCB 450/10213', '', ''),
(400, 1, 'Суппорт ручного тормоза JCB 15/920269', '&lt;p&gt;Суппорт ручного тормоза JCB 15/920269 – это узел, прижимающий колодки к диску во время торможения машины, когда оператор нажимает педаль. Он относится к движимым элементам и ставится только на дисковые варианты.Такие запчасти для спецтехники JCB должны быть очень прочными и надежными. Они принимают на себя основную нагрузку при торможении. Если установить некачественные детали, они быстро сломаются, не выдержав давящих на них усилий.Чтобы заказать продукцию из каталога запчастей спецтехники онлайн, оптом или в розницу, с доставкой или самовывозом, зарегистрируйтесь на сайте.&lt;/p&gt;', '', 'Суппорт ручного тормоза JCB 15/920269', '', ''),
(401, 1, 'Пружина рабочего тормозного цилиндра JCB 814/00365', '&lt;p&gt;Пружина рабочего тормозного цилиндра JCB 814/00365, представленная в этом разделе, доступна для онлайн-покупки. Изделие можно приобрести в интернет-магазине запчастей для спецтехники оптом и в розницу, с доставкой или самовывозом.Товар необходим в случае, когда основная возвратная пружина сломалась. Такая неполадка приводит к замедленному передвижению поршня со штоком в первоначальное положение, когда отпускается тормоз. У нас вы можете заказать не только запчасти, но и их установку на ваш погрузчик JCB. Мастера заменят сломанную деталь, проведут диагностику и технический осмотр.&lt;/p&gt;', '', 'Пружина рабочего тормозного цилиндра JCB 814/00365', '', ''),
(402, 1, 'Крышка бачка тормозной жидкости JCB', '&lt;p&gt;Предлагаем вам купить запчасти JCB в Москве. Жители столицы часто пользуются возможностью самовывоза из наших магазинов. Также вы можете заказать доставку по всей стране, для этого нужно выбрать подходящую транспортную компанию.Крышка бачка тормозной жидкости JCB 123/06356 сделана из пластика белого и зеленого цвета. Она имеет круглую форму с резьбой, что позволяет легко откручивать и закручивать ее. Такая деталь погрузчика выполняет очень важную функцию. Верхняя часть устройства плотно и герметично закрывает бачок тормозной жидкости, препятствует ее случайному проливанию.&lt;/p&gt;', '', 'Крышка бачка тормозной жидкости JCB', '', ''),
(403, 1, 'Кольцо стопорное пальца рабочего тормозного цилиндра JCB 2203/1020', '&lt;p&gt;Предлагаем вам купить запчасти на экскаватор-погрузчик. В ассортименте представлено большое количество товаров, как оригинальных, так и от сторонних производителей. В этом разделе вы можете приобрести кольцо стопорное пальца рабочего тормозного цилиндра JCB 2203/1020.Это незамкнутая деталь, которая используется для фиксации подшипников качения и других элементов на валу или в отверстии. Для ее изготовления используется углеродистая сталь, иногда – нержавейка или медь. Запасные части JCB устанавливаются в пазы так, чтобы выступ становился плечом, удерживающим деталь на нужном месте.&lt;/p&gt;', '', 'Кольцо стопорное пальца рабочего тормозного цилиндра JCB 2203/1020', '', ''),
(404, 1, 'Бачок тормозной жидкости (оригинал) JCB 123/02140', '&lt;p&gt;В этом разделе представлен бачок тормозной жидкости (оригинал) JCB 123/02140. Это емкость из прочного пластика, в которую заливается нужный состав. Тара имеет две отметки – минимального и максимального уровня. При заливке жидкости важно, чтобы ее было не больше и не меньше рекомендуемого количества. Такие запчасти для погрузчиков можно приобрести в Москве онлайн, забрав самовывозом из наших магазинов или заказав с доставкой. Оригинальные изделия имеют международные сертификаты качества.Цены на запчасти JCB 3CX указываются за единицу товара. При заказе оптом действуют выгодные скидки.&lt;/p&gt;', '', 'Бачок тормозной жидкости (оригинал) JCB 123/02140', '', ''),
(405, 1, 'Датчик тормоза JCB 701/80486, 332/C9990', '&lt;p&gt;В этом разделе представлены товары для специальной техники – датчики тормоза JCB 701/80486, 332/C9990. Они обладают высоким качеством и долговечностью. Однако если датчики педали тормоза эти детали рассогласованы, могут возникнуть проблемы в работе мотора. Наиболее частой причиной неполадки является поломка пружины. Проще всего заменить старую неисправную деталь на новую. Обратившись к нам, вы сможете заказать не только сами запасные части JCB из каталога, но и их оперативную установку. Мастера нашей компании проведут технический осмотр, ремонт экскаватора-погрузчика и монтаж купленного вами товара.&lt;/p&gt;', '', 'Датчик тормоза JCB 701/80486, 332/C9990', '', ''),
(406, 1, 'Колодки ручного тормоза JCB (комплект) 333/C2926', '&lt;p&gt;Колодки ручного тормоза круглые нового образца для экскаватора-погрузчика JCB 3CX, JCB 4CX&lt;/p&gt;', '', 'Колодки ручного тормоза JCB (комплект) 333/C2926', '', ''),
(407, 1, 'Сенсорный датчик тормозов (лягушка) JCB 332/С9990', '&lt;p&gt;Сенсорный датчик тормозов (лягушка) JCB 332/С9990 является «глазами и ушами» системы торможения. Он обладает высокой точностью и эффективностью, имеет постоянное напряжение. Запчасть предназначена специально для экскаваторов JCB, она состоит из нескольких элементов: корпус, постоянный магнит, полупроводниковая пластика, микросхема, выводные элементы. Если «родная» деталь сбоит или вышла из строя, замените ее на новую, от надежного производителя.Чтобы заказать этот и другие запчасти для спецтехники из каталога, зарегистрируйтесь на сайте. Продукция доступна для заказа онлайн, оптом и в розницу, с доставкой и самовывозом.&lt;/p&gt;', '', 'Сенсорный датчик тормозов (лягушка) JCB 332/С9990', '', ''),
(408, 1, 'Сенсорный датчик тормозов JCB 8500', '&lt;p&gt;Сенсорный датчик тормозов JCB 332/C8548 представляет собой «органы чувств» системы торможения. Эта деталь прикрепляется стандартными крепежными элементами к спецтехнике. Она состоит из корпуса, в котором заключен постоянный магнит, полупроводниковая пластика, микросхема, выводные элементы.Такие запчасти JCB должны быть очень качественными и надежными, ведь от них зависит безопасность оператора и людей на площадке. Поэтому важно приобретать продукцию от проверенных производителей. В каталоге запасных частей погрузчика вы найдете высокоточные и эффективные изделия с постоянным напряжением.&lt;/p&gt;', '', 'Сенсорный датчик тормозов JCB 8500', '', ''),
(409, 1, 'Суппорт тормозной ориг. на JCB 15/920270', 'Суппорт тормозной оригинальный на спецтехнику JCB. Артикулы: 15/920270,  15/M04040', '', 'Суппорт тормозной ориг. на JCB 15/920270', '', ''),
(410, 1, 'Корпус ступицы тормоза на JCB JCB 458/20365, 458/M5480', 'Корпус ступицы тормоза на JCB 3CX, 4CX. Артикул: 458/20365, 458/M548', '', 'Корпус ступицы тормоза на JCB JCB 458/20365, 458/M5480', '', ''),
(411, 1, 'Трос стояночного тормоза JCB 910/47000, 332/C9365', '&lt;p&gt;&lt;b&gt;Трос стояночного тормоза JCB 910/47000, 332/C9365&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 910/47000, 332/C9365&lt;/&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p', '', 'Трос стояночного тормоза JCB 910/47000, 332/C9365', '', ''),
(412, 1, 'Ремкомплект гидравлического насоса JCB 20/902901', '&lt;p&gt;Ремонтный комплект основного гидравлического шестеренчатого насоса 20/902901, 333/Y4969 для экскаваторов-погрузчиков JCB 3CX, JCB 4CX до 2005 года выпуска.Оригинальное название: Kit-seal pumpАртикул: 20/902901, 333/Y4969Ремкомплект гидравлического шестеренчатого насоса JCB состоит из набора уплотнительных манжет, сальников, пластиковых полуколец и резинок. Он предназначен для ремонта гидронасоса Parker, например при появлении течи, вибраций во время работы или повышенного шума. Также ремкомплект гидронасоса JCB потребуется при резких колебаниях давления, сниженной подачи агрегата. При переборке гидравлического насоса вскрывается корпус, состоящий из двух секций, вынимаются рабочие шестеренки, и после замена всех манжет и сальников собирается в обратном порядке.&lt;/p&gt;', '', 'Ремкомплект гидравлического насоса JCB 20/902901', '', ''),
(413, 1, 'Ремкомплект гидравлического насоса JCB 20/950906', '&lt;p&gt;Ремонтный комплект основного гидравлического шестеренчатого насоса 20/950906 для экскаваторов-погрузчиков JCB 3CX, JCB 4CX&lt;/p&gt;Оригинальное название: Kit-seal Main Hydraulic Pump 4 Seal Energisers, 2 Shaft Seals, 1 Assy Sleeve, 5 O rings, 1 Circlip.&lt;/p&gt;', '', 'Ремкомплект гидравлического насоса JCB 20/950906', '', ''),
(414, 1, 'Ремкомплект клапана MRV JCB 25/618902', '&lt;p&gt;Ремкомплект клапана MRV JCB 25/618902 является необходимым товаром, который рано или поздно требуется каждому оператору погрузчика. Такой товар необходим в ряде случаев, например, при течи масла или потери герметичности. Ремкомплекты гидроцилиндров экскаваторов состоят из нескольких резиновых деталей, представляющих собой колечки разных размеров и конфигураций. С их помощью вы можете легко и быстро заменить старые изношенные детали. Такие запчасти JCB поставляются по цене, указанной на странице товара за единицу. Вы можете заказать их с доставкой или забрать самостоятельно.&lt;/p&gt;', '', 'Ремкомплект клапана MRV JCB 25/618902', '', ''),
(415, 1, 'Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа 991/00100 Набор сальников и манжет для ремонта (40*70)', '&lt;p&gt;Набор сальников и манжет для ремонта гидравлических цилиндров экскаватора-погрузчика JCB.Применение: гидроцилиндры челюсти, аутригера, телескопа, выворота переднего ковшаОригинальное название: Kit-seal 40x70Размеры: 40*70 ммПредставляем вам ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа 991/00100 (40*70). Этот универсальный набор включает в себя множество резинотехнических изделий, позволяющих быстро и эффективно произвести починку. С его помощью решаются вопросы очистки штоков, потери герметичного соединения, возникновения протечек. Ремкомплект гидроцилиндра погрузчика позволяет отремонтировать гидравлические цилиндры, отвечающие за опрокидывание фронтального ковша, находящегося спереди устройства. Он используется для починки таких детали JCB, как челюстей переднего ковша и не только.&lt;/p&gt;', '', 'Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа 991/00100 Набор сальников и манжет для ремонта (40*70)', '', ''),
(416, 1, 'Ремкомплект гидроцилиндра 50х90 заднего ковша JCB 991/00157', '&lt;p&gt;Ремкомплект гидроцилиндра 50х90 заднего ковша JCB 991/00157 подходит для быстрой и качественной починки во множестве случаев. Набор включает в себя несколько колечек из резины. Чаще всего ремкомплект гидроцилиндра ковша используется при сборке и разборке цилиндра, когда следует удалить какую-либо неполадку. Также товар применяют в случаях, когда при передвижении штока наблюдаются некие рывки. Еще один вариант, когда вам потребуются запасные части JCB – возникшая течь масла или вынос жидкости по штоку. Также починка потребуется в ряде других проблем. Вы можете узнать подробности у наших специалистов.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 50х90 заднего ковша JCB 991/00157', '', ''),
(417, 1, 'Ремкомплект гидроцилиндра 60х100 JCB 991/00152', '&lt;p&gt;Ремкомплект гидроцилиндра 60х100 JCB 991/00152 представляет собой набор из нескольких резиновых колечек, отличающихся диаметром и размерами. Они используются в ряде случаев, когда наблюдается потеря герметизации, течь масла, рывки при движении штока и не только. Ремкомплекты не всегда являются панацеей. Иногда недостаточно просто полностью заменить все резиновые детали. Часто причина более серьезна и требует серьезной проверки. Вы можете обратиться к нашим специалистам не только для покупки запчастей на спецтехнику JCB, но и для полного осмотра, технического обслуживания и монтажа.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 60х100 JCB 991/00152', '', ''),
(418, 1, 'Ремкомплект г/ц заднего ковша 332/E8224  (60*90)', '&lt;p&gt;Аналог 991/00147 с дополнительным пыльником нового образца.Ремкомплект г/ц заднего ковша 332/E8224 (60*90) предназначен для модели 3СХ, а также для новой модели 4СХ (от старой он отличается 60-миллиметровым диаметром штока). В этот набор включаются манжеты, сальники, уплотнители, пыльники, грязесъемники и прочие кольца из резины. Они отличаются разными размерами и профилями сечения. Ремкомплекты гидроцилиндров экскаваторов состоят из необходимых для починки предметов или для их своевременной замены. Если резина износилась, в механизме могут возникать протечки и другие проблемы.Наш магазин предлагает вам большой ассортимент других запчастей JCB.&lt;/p&gt;', '', 'Ремкомплект г/ц заднего ковша 332/E8224  (60*90)', '', ''),
(419, 1, 'Ремкомплект г/ц заднего ковша  (50*90) 991/00103', '&lt;p&gt;Ремкомплект г/ц заднего ковша 991/00103 (50*90), представленный в этом разделе, предназначен для специальной техники 3СХ и новой модели 4СХ, отличающейся 50-миллиметровым размером штока. В наборе вы найдете множество необходимых резинотехнических изделий. Вы можете приобрести ремкомплекты гидроцилиндров по доступной цене, и в дальнейшем будет не раз применять их для починки. Наборы включают в себя манжеты, пыльники, сальники, уплотнители и прочие изделия в форме колец разных размеров и профилей сечения.Если вы хотите приобрести запчасти JCB оптом, обращайтесь к нашим специалистам. Менеджеры помогут вам выбрать качественные товары.&lt;/p&gt;', '', 'Ремкомплект г/ц заднего ковша  (50*90) 991/00103', '', ''),
(420, 1, 'Ремкомплект гидроцилиндра 75х45 JCB 991/00156', '&lt;p&gt;Ремкомплект гидроцилиндра 75х45 JCB 991/00156 подходит для починки системы в ряде случаев. Наборы отличаются спектром используемых резиновых колец, по брендам и по виду техники, по оригинальности и не оригинальности, по функциональности. Менеджеры компании готовы проконсультировать вас по всем интересующим вопросам и помочь с подбором подходящего варианта.Цена на ремкомплекты гидроцилиндров указана на странице товара за единицу. Вы можете приобрести их с доставкой или забрать самовывозом. В каталоге запчастей спецтехники представлено огромное количество других товаров.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 75х45 JCB 991/00156', '', ''),
(421, 1, 'Ремкомплект г/ц телескопа 991/00095(40*70)', '&lt;p&gt;Ремкомплект г/ц телескопа 991/00095 (40*70) позволяет починить механизм, отвечающий за выдвижение телескопа задней стрелы. Набор из нескольких резиновых «колечек» предназначен для моделей 3СХ и 3СХ. В него входят манжеты, пыльник, сальники, уплотнители и прочие подобные изделия. Размеры ремкомплекта JCB следующие: 40 на 70 миллиметров. С помощью таких товаров вы можете герметично соединить части механизма, починить протечку, зафиксировать рабочий орган, очистить детали и сделать ряд других действий.В каталоге запчастей спецтехники представлено огромное количество различных товаров.&lt;/p&gt;', '', 'Ремкомплект г/ц телескопа 991/00095(40*70)', '', ''),
(422, 1, 'Ремкомплект г/ц подъема передней стрелы  (50*90) 991/20009', '&lt;p&gt;Ремкомплект г/ц подъема передней стрелы 991/20009 (50*90) имеет в составе несколько резинотехнических изделий. Если старые резиновые кольца износились, не выдержали давления, пропускают жидкость, не дают рабочему органу находиться в нужном положении, замените их! Ремкомплект гидроцилиндра подъема стоит совсем недорого. Однако он поможет вам быстро и эффективно устранить возникшую поломку, привести машину в рабочее состояние, осуществить герметичное соединение.Ищете запасные части для JCB 3СХ и 4СХ? Обращайтесь к нашим специалистам. Менеджеры помогут вам выбрать подходящие детали.&lt;/p&gt;', '', 'Ремкомплект г/ц подъема передней стрелы  (50*90) 991/20009', '', ''),
(423, 1, 'Ремкомплект г/ц рукояти задней стрелы 991/00145 (60*100)', '&lt;p&gt;Ремкомплект г/ц рукояти задней стрелы 991/00145 (60*100) состоит из нескольких резиновых колец. Каждый набор создается специально для определенного типа оборудования. Соответственно, вам нужно будет приобретать разные товары для починки разных механизмов. Ремкомплект гидроцилиндра подъема стрелы имеет особенный набор резиновых деталей, выполненных в виде колец различных форм сечения и параметров.Чтобы правильно подобрать такой комплект, свяжитесь с нашими менеджерами. Специалисты помогут вам приобрести подходящие запчасти для спецтехники JCB и наборы для ремонта.&lt;/p&gt;', '', 'Ремкомплект г/ц рукояти задней стрелы 991/00145 (60*100)', '', ''),
(424, 1, 'Ремкомплект гидроцилиндра (опорная лапа) JCB 991/10142', '&lt;p&gt;Ремкомплект гидроцилиндра (опорная лапа) JCB 991/10142 незаменим для работы мастера и оператора, использующего погрузчик. В наборе вы найдете все, что необходимо для осуществления быстрой и качественной починки запчастей спецтехники JCB. Комплект включает в себя поршневые уплотнения, штоковые манжеты, направляющие кольца, статические уплотнения (они делают набор полным) и не только. Вы легко проведете герметизацию недвижимых соединений, снимете грязь и пыль с деталей, замените часть элементов.Ремкомплект гидроцилиндра JCB изготавливается из резины. Он является расходным материалом.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра (опорная лапа) JCB 991/10142', '', ''),
(425, 1, 'Ремкомплект г/ц подъема задней стрелы JCB 991/00115 (65*120)', '&lt;p&gt;Ремкомплект г/ц подъема задней стрелы JCB 991/00115 (65*120) – это набор резинотехнических изделий, с помощью который осуществляются ремонтные работы. Параметры такого комплекта следующие: 65 на 120 миллиметров. Купить ремкомплект гидроцилиндра можно для самостоятельной починки сломанного механизма, организации герметичного соединения, очистки штока поршня и других работ.Наш интернет-магазин занимается продажей запчастей JCB по приемлемым ценам, с доставкой или самовывозом. Возможна установка купленных товаров на вашу технику, техосмотр и ремонт, проводимый силами мастеров компании.&lt;/p&gt;', '', 'Ремкомплект г/ц подъема задней стрелы JCB 991/00115 (65*120)', '', ''),
(426, 1, 'Пыльник JCB 813/00427', '&lt;p&gt;Пыльник JCB 813/00427 – это важная запчасть для экскаватора, представляющая собой резиновый защитный чехол-«гармошку». Эта деталь разнится параметрами – формой, длиной, шириной, количеством складок и другими особенностями конструкции. В зависимости от того, какую часть механизма закрывает пыльник, он обретает определенные отличия. В среднем, количество таких элементов в одном автомобиле может достигать ста штук. В среднем, в специальной технике их около десяти-двадцати.Другие товары вы можете просмотреть в каталоге запасных частей JCB на нашем сайте. Они доступны для заказа онлайн, с доставкой.&lt;/p&gt;', '', 'Пыльник JCB 813/00427', '', ''),
(427, 1, 'Пыльник каретки JCB 813/00456', '&lt;p&gt;Пыльник каретки JCB 813/00456 – это небольшая, но очень важная деталь в устройстве специальной техники. Она предназначена для защиты различных элементов от пыли, грязи и масел. Изделие изготавливается из резины и имеет форму «гармошки». Количество складок, форма, размеры, ширина, длина и прочие конструктивные параметры отличаются в зависимости от того, на какие запасные части JCB надевается деталь.В одном виде транспорта может быть от десяти до ста пыльников, защищающих разные узлы и элементы. Если вы хотите купить эти и другие запчасти на погрузчик, обращайтесь к нам. Менеджеры помогут вам сделать заказ.&lt;/p&gt;', '', 'Пыльник каретки JCB 813/00456', '', ''),
(428, 1, 'Пыльник пальца каретки JCB 123/04237', '&lt;p&gt;Пыльник пальца каретки JCB 123/04237 является резиновым изделием, защищающим указанную деталь. Он имеет рифленую форму со множеством складок и напоминает трубчатую гармошку. Пыльники надеваются на каретку и оберегают ее от грязи, пыли и влаги. Также они продлевают срок службы такого изделия, защищая его от преждевременного износа и выхода из строя. Особенно такие товары нужны в случаях, когда для функционирования запчасти JCB требуется герметичность.Цена на товары, представленные на этой странице, указана за единицу. Вы можете заказать их с доставкой на объект или самовывозом.&lt;/p&gt;', '', 'Пыльник пальца каретки JCB 123/04237', '', ''),
(429, 1, 'Ремкомплект гидроцилиндра JCB 991/00036', '&lt;p&gt;Ремкомплект гидроцилиндра JCB 991/00036 представляет собой набор деталей, с помощью которых производят уплотнение. Для этого применяются поршневые элементы, штоковые манжеты, направляющие кольца и т.п. Вы можете купить запчасти на погрузчик до поломки, заранее. В таком случае у вас всегда под рукой будут детали, которые помогут вам быстро и качественно произвести починку. Например, частой проблемой является потеря герметичности недвижимых соединений. Для этого достаточно использовать кольца из резины, имеющие круглое сечение. В каталоге запасных частей JCB вы найдете и другие подходящие товары.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра JCB 991/00036', '', ''),
(430, 1, 'Ремкомплект гидроцилиндра (опорная лапа) JCB 991/10142', '&lt;p&gt;Ремкомплект гидроцилиндра (опорная лапа) JCB 991/10142 незаменим для работы мастера и оператора, использующего погрузчик. В наборе вы найдете все, что необходимо для осуществления быстрой и качественной починки запчастей спецтехники JCB. Комплект включает в себя поршневые уплотнения, штоковые манжеты, направляющие кольца, статические уплотнения (они делают набор полным) и не только. Вы легко проведете герметизацию недвижимых соединений, снимете грязь и пыль с деталей, замените часть элементов.Ремкомплект гидроцилиндра JCB изготавливается из резины. Он является расходным материалом.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра (опорная лапа) JCB 991/10142', '', ''),
(431, 1, 'Ремкомплект гидроцилиндра 100х60 задняя стрела-рукоять 991/00130JCB', '&lt;p&gt;Ремкомплект гидроцилиндра 100х60 задняя стрела-рукоять JCB 991/00130 изготавливается из резины. В наборе вы найдете большое количество деталей в виде колец, которые необходимы во время починки. С их помощью вы легко уплотните часть элементов, потерявших герметизацию. Также товары используются для съема грязи с деталей. Манжеты штока, защитные и направляющие кольца, поршневые и статические уплотнения – все эти предметы необходимы для осуществления разных действий. Ремкомплект гидроцилиндра стрелы JCB считается расходным материалом. Если вы перебираете цилиндры, вам следует полностью применять весь набор, заменяя старые детали на новые.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 100х60 задняя стрела-рукоять 991/00130JCB', '', ''),
(432, 1, 'Ремкомплект гидроцилиндра 110мм кингпост 991/00018 JCB', '&lt;p&gt;Ремкомплект гидроцилиндра 110мм Кингпост JCB 991/00018 является расходным материалом, который требует полной замены всех элементов при осуществлении починки. Поэтому многие заказчики приобретают такие товары в нескольких наборах сразу. Вы также можете добавить в Корзину требуемое количество ремкомплектов гидроцилиндров для спецтехники.Если сравнить стоимость покупки такого набора с ценой вынужденного простоя вследствие поломки, то выгода от первого будет очевидна. Заменить запасные части JCB могут и наши специалисты. Для этого обратитесь к менеджерам, заказав установку силами мастеров компании.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 110мм кингпост 991/00018 JCB', '', ''),
(433, 1, 'Ремкомплект гидроцилиндра 110х60 991/00131 JCB', '&lt;p&gt;Ремкомплект гидроцилиндра 110х60 JCB 991/00131 является набором резиновых колец, который применяется при починке и в случае потери герметизации. Товар является расходным материалом. Когда вы осуществляете переборку цилиндров, вам следует заменить все соответствующие запчасти на экскаваторе погрузчике JCB. При этом стоимость набора гораздо ниже затрат от вынужденного простоя. Часто заказчики приобретают сразу несколько комплектов, чтобы они всегда имелись под рукой.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 110х60 991/00131 JCB', '', ''),
(434, 1, 'Ремкомплект гидроцилиндра 40х70 991/00122 JCB', '&lt;p&gt;Ремкомплект гидроцилиндра 40х70 JCB 991/00122 используется для быстрой и качественной починки и организации уплотнения элементов. В наборе вы найдете большое количество колец из резины, которыми можно заменить изношенные детали. Ремкомплект гидроцилиндра является расходным материалом, так что вам необходимо использовать все компоненты при ремонте цилиндра.Стоимость товара достаточно доступна. Она указана на странице за единицу. В ассортименте вы найдете другие запчасти для экскаватора JCB. Мы также предлагаем вам услугу техобслуживания, ремонта и установки купленных вами товаров.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 40х70 991/00122 JCB', '', ''),
(435, 1, 'Ремкомплект гидроцилиндра 50х80 991/00102 JCB', '&lt;p&gt;Ремкомплект гидроцилиндра 50х80 JCB 991/00102 необходим в ряде случаев. Он представляет собой набор из резиновых колец, которыми можно устранить распространенные проблемы, возникающие при эксплуатации специальной техники. Такие запчасти JCB используются в Москве при возникновении течи масла (или когда масло выносит по штоку), при рывках в работе цилиндра, для разборки и сборки прибора, восстановления герметизации, съема грязи и устранения прочих проблем.Вы можете купить запчасти на погрузчик онлайн, с оперативной доставкой на дом. Специалисты помогут вам определиться с выбором.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 50х80 991/00102 JCB', '', ''),
(436, 1, 'Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа 991/20021', '&lt;p&gt;Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа 991/20021 (40*70) предназначен для моделей экскаваторов-погрузчиков 3СХ и 4 СХ. Его параметры следующие: 40 на 70 миллиметров. Внутри набора находится несколько «колечек» из резины разных размеров и форм сечения. Ремкомплекты гидроцилиндров для спецтехники используются для починки механизмов опрокидывания, закрывания и открывания челюстей переднего ковша, выдвижения задних опор аутригера и телескопа.&lt;/p&gt;', '', 'Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа 991/20021', '', ''),
(437, 1, 'Ремкомплект гидроцилиндра 60х110 JCB 991/00148', '&lt;p&gt;Ремкомплект гидроцилиндра 60х110 JCB 991/00148 состоит из нескольких резиновых колечек, используемых для уплотнения. Они применяются для быстрой и эффективной починки элементов специальной техники. Ремкомплект гидроцилиндра подъема позволяет вам заменить изношенные и растянувшиеся кольца на новые. Внимание! При ремонте цилиндра вам потребуется установить все новые расходники вместо старых, даже если визуально они не кажутся устаревшими.Но если проблема не была устранена после процедуры, следует обратиться к специалистам. Менеджеры помогут вам выбрать подходящие детали JCB и заказать техосмотр спецтехники силами мастеров компании.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 60х110 JCB 991/00148', '', ''),
(438, 1, 'Ремкомплект гидроцилиндра 60х110 JCB 991/00110', '&lt;p&gt;Ремкомплект гидроцилиндра 60х110 JCB 991/00110 требуется для решения проблем с уплотнениями и при потере герметизации. Однако иногда такие неполадки говорят о более серьезных неполадках внутри цилиндра. Грязь и задиры штока уменьшают плотность фиксации деталей и приводят к выносу масла. При возникновении такой проблемы следует обратиться к специалистам для ремонта. Мастера нашей компании могут не только заменить ремкомплект гидравлического цилиндра, но и провести технический осмотр спецтехники.Если же вам нужны запчасти JCB оптом, закажите товар в нужном вам количестве, самовывозом или с доставкой.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 60х110 JCB 991/00110', '', ''),
(439, 1, 'Ремкомплект гидроцилиндра 70х30 JCB 991/00099', '&lt;p&gt;Ремкомплект гидроцилиндра 70х30 JCB 991/00099 является набором качественных колечек из резины, которые используются для замены уплотнителей. Кольца обладают разными размерами и параметрами и подходят для различных целей.В целом, все современные ремкомплекты гидроцилиндров для спецтехники делятся на несколько типов: оригинальные, неоригинальные, оптимальные. Товары первого вида поступают от производителя, товары второго – от торговых представителей. Последние производят компании, специализирующиеся на создании уплотнений.В нашем магазине JCB вы найдете качественные и оригинальные запчасти на любой случай.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 70х30 JCB 991/00099', '', ''),
(440, 1, 'Ремкомплект гидроцилиндра 70х40 разворот переднего ковша JCB 991/10151', '&lt;p&gt;Ремкомплект гидроцилиндра 70х40 разворот переднего ковша JCB 991/10151 является высококлассным набором резиновых изделий для герметизации и уплотнения ряда деталей. Кольца из резины отличаются различными размерами и параметрами.Ремкомплект гидроцилиндра погрузчика может быть оригинальным, неоригинальным и оптимальным (от специальных фирм, производящих уплотнительные товары). Такие наборы делятся по видам техники и по брендам. В данном случае в Москве представлены запчасти для спецтехники JCB. Если вам требуются другие виды комплектов, обратитесь к нашим специалистам. Они помогут вам определиться с выбором.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 70х40 разворот переднего ковша JCB 991/10151', '', ''),
(441, 1, 'Ремкомплект гидроцилиндра 80х50 JCB 991/00123', '&lt;p&gt;Ремкомплект гидроцилиндра 80х50 JCB 991/00123 включает в себя манжеты из резины и чистильщики из полиуретана. Они обладают высоким качеством, износостойкостью и надежностью, их долговечность проверена временем.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 80х50 JCB 991/00123', '', ''),
(442, 1, 'Ремкомплект гидроцилиндра 90х50 JCB 991/00127', '&lt;p&gt;Ремкомплект гидроцилиндра 90х50 JCB 991/00127 является набором уплотнителей, которые используются для починки спецтехники. В него включают чистильщики из полиуретана и манжеты из резины, используемые для дополнительной герметизации.&lt;/p&gt;', '', 'Ремкомплект гидроцилиндра 90х50 JCB 991/00127', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(443, 1, 'Ремкомплект тормозного цилиндра JCB 15/908201', '&lt;p&gt;Ремкомплект тормозного цилиндра JCB 15/908201. В наборе находятся все необходимые для ремонта компоненты.&lt;/p&gt;', '', 'Ремкомплект тормозного цилиндра JCB 15/908201', '', ''),
(444, 1, 'Ремкомплект г/ц подъема задней стрелы  (65*120) 991/20013', '&lt;p&gt;Ремкомплект г/ц подъема задней стрелы 991/20013 (65*120), представленный в этом разделе, доступен для заказа. Он используется для ремонта механизма, съема загрязнений со штока поршня, осуществления герметичных соединений и других работ. Ремкомплект гидроцилиндра стрелы имеет следующие размеры: 65 на 120 миллиметров. Он включает в себя необходимые резинотехнические изделия. Такой набор позволяет сделать машину работоспособной в случае поломки.Если вас интересуют запчасти JCB в Москве, обращайтесь к нашим специалистам. Менеджеры помогут вам выбрать товар и сделать заказ онлайн.&lt;/p&gt;', '', 'Ремкомплект г/ц подъема задней стрелы  (65*120) 991/20013', '', ''),
(445, 1, 'Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа  (40*70) 332/D4850', '&lt;p&gt;Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа 332/D4850 (40*70) является универсальным набором резинотехнических изделий. Они выполняются в виде колец и могут иметь разные параметры, формы сечения. Размер набора следующий: 40 на 70 миллиметров. Ремкомплект гидроцилиндра ковша позволяет починить разнообразные механизмы (опрокидывания, открытия/закрытия, выдвижения). Соответственно, лучше всегда иметь такие детали под рукой.Если вас интересуют запчасти JCB в Москве, обратитесь к нашим специалистам. Они помогут вам заказать подходящие товары с доставкой. Также возможен самовывоз.&lt;/p&gt;', '', 'Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа  (40*70) 332/D4850', '', ''),
(446, 1, 'Ремкомплект гидрораспределителя JCB 25/997722', '&lt;p&gt;Оригинальное название: Kit-repair face seal 7 section valveРемкомплект гидрораспределителя JCB 25/997722 – это набор деталей для JCB погрузчиков моделей 3CX и 4CX. Своевременная замена данного типа запчастей гарантирует долгий срок службы оборудования, безопасную работу людей.В онлайн-каталоге запчастей JCB нашего интернет магазина ремкомплект представлен в следующем наборе элементов:манжетарезиновые кольца круглого сеченияуплотнителидополнительные комплектующие.В нашем магазине вы можете купить детали для JCB погрузчиков и экскаваторов по ценам от производителей.&lt;/p&gt;', '', 'Ремкомплект гидрораспределителя JCB 25/997722', '', ''),
(447, 1, 'Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа 991/20021', '&lt;p&gt;Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа 991/20021 (40*70) предназначен для моделей экскаваторов-погрузчиков 3СХ и 4 СХ. Его параметры следующие: 40 на 70 миллиметров. Внутри набора находится несколько «колечек» из резины разных размеров и форм сечения. Ремкомплекты гидроцилиндров для спецтехники используются для починки механизмов опрокидывания, закрывания и открывания челюстей переднего ковша, выдвижения задних опор аутригера и телескопа.&lt;/p&gt;', '', 'Ремкомплект г/ц переднего ковша, челюсти, опор аутригера, телескопа 991/20021', '', ''),
