(489, 1, 'Ремкомплект насоса подкачки JCB 32/925710', '&lt;p&gt;&lt;b&gt;Ремкомплект насоса подкачки 32/925710&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера: &lt;/b&gt;32/925710&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с: &lt;/b&gt;JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель: &lt;/b&gt;Турция &lt;/p&gt;', '', 'Ремкомплект насоса подкачки JCB 32/925710', '', ''),
(490, 1, 'Ковш JCB задний (80 см) 980/61700', '&lt;p&gt;&lt;/p&gt;', '', 'Ковш JCB задний (80 см) 980/61700', '', ''),
(491, 1, 'Ковш JCB задний (90 см) 980/61800', '&lt;p&gt;&lt;/p&gt;', '', 'Ковш JCB задний (90 см) 980/61800', '', ''),
(492, 1, 'Ковш JCB задний (40 см) 980/61400', '&lt;p&gt;Ковш JCB задний (40 см) – это основной рабочий орган специальной землеройной машины, который крепится на стреле или рукоятке. С его помощью копают грунт и выгружают в отвал. Вы можете купить навесное оборудование на погрузчик, чтобы использовать его в строительстве. Область применения такой детали практически не ограничена. С ее помощью разрабатывают выемки и насыпи, роют каналы и котлованы, планируют территорию, перевозят сыпучие стройматериалы, сооружают дамбы и многое другое.Чтобы приобрести запчасти JCB в Москве с доставкой на объект или самовывозом, оформите заказ онлайн.&lt;/p&gt;', '', 'Ковш JCB задний (40 см) 980/61400', '', ''),
(493, 1, 'Ковш JCB задний (30 см) 980/62300', '&lt;p&gt;Ковш JCB задний (30 см) доступен для покупки онлайн.Это стандартный рабочий орган экскаватора, предназначенный для набора рыхлой земли, песка и других субстанций. Вы можете заказать любое интересующее вас навесное оборудование для погрузчиков, просмотрев наш каталог.Существует несколько видов ковшей. Для эксплуатации в тяжелых условиях выбирают модели с усиленными кромками и установленными деталями защиты JCB. Есть варианты, отличающиеся по сфере применения – для сгребания различных типов грунта (общеземельные), для рыхления, рытья траншей, осуществления планировки и т.п.&lt;/p&gt;', '', 'Ковш JCB задний (30 см) 980/62300', '', ''),
(494, 1, 'Ковш задний 25 см. на JCB', 'Ковш задний 25 см. на спецтехнику JC', '', 'Ковш задний 25 см. на JCB', '', ''),
(495, 1, 'Ковш JCB задний стандартный (60 см) 980/61600', '&lt;p&gt;Ковш задний стандартный 60 см изготовлен из прочных и износостойких материалов. Приспособление обладает долгим сроком службы и отличным качеством. Совершенно новый товар доступен для заказа уже сейчас. Он подойдет тем владельцам экскаваторов-погрузчиков моделей 3CX и 4CX, которые хотят купить ковш JCB стандартного типа. Это оборудование устанавливается на заднюю стрелу специальной техники. В комплекте идет непосредственно ковш с объемом 0,4 кубических метра, а также необходимые детали - усиленные зубья и бокорезы. Ковш JCB задний 60 см – это необходимая часть экскаватора, которая закрепляется на телескопической стреле-рукояти. С его помощью выполняется огромное количество действий по строительству и демонтажу конструкций. В магазине JCB представлены и другие запчасти, расширяющие сферу применения и спектр возможностей такого транспорта. Например, на специальную технику можно установить пику с определенной рабочей формой.В нашем каталоге вы можете приобрести любое интересующее вас навесное оборудование для погрузчиков JCB. Эти многоковшовые экскаваторы являются машинами непрерывного действия.&lt;/p&gt;', '', 'Ковш JCB задний стандартный (60 см) 980/61600', '', ''),
(496, 1, 'Ковш фронтальный передний в сборе JCB', '&lt;p&gt;Ковш фронтальный передний в сборе JCB является универсальным инструментом, имеющим несколько сфер применения. Вы можете использовать его для снегоуборочных работ, для погрузки и разгрузки разных предметов, для переноса силоса и не только. Чаще всего такие ковши для экскаваторов применяются на строительных площадках. Различные товары отличаются по форме, параметрам, объему, форме зубьев.В нашем ассортименте вы также можете приобрести другие запчасти JCB. Если вы живете в Москве, закажите товар с доставкой на объект или заберите самовывозом. Действует доставка в другие регионы страны.&lt;/p&gt;', '', 'Ковш фронтальный передний в сборе JCB', '', ''),
(497, 1, 'Челюсть на фронтальный передний ковш', '&lt;p&gt;Челюсть на фронтальный передний ковш помогает основному элементу техники во время погрузки рыхлых сыпучих пород. Челюсть размыкается, когда емкость пуста, и смыкается, когда она заполнена, чтобы ухватить или перенести определенное количество почвы. Данный товар подойдет тому владельцу спецтехники, который желает купить сменное навесное оборудование на погрузчик, экскаватор. Приспособление изготовлено из износостойкой стали с высокой прочностью и долгим сроком службы.Если вас интересует продажа запчастей JCB, обращайтесь к нашим специалистам. Менеджеры помогут вам выбрать нужный товар.&lt;/p&gt;', '', 'Челюсть на фронтальный передний ковш', '', ''),
(498, 1, 'Нож на челюсть СТ65Г с квадратными отверстиями на JCB 2350*20*210', 'Нож на челюсть СТ65Г с квадратными отверстиями на спецтехнику JCB. 8 отверстий, 2 фаски. Размеры: 2345*20*21', '', 'Нож на челюсть СТ65Г с квадратными отверстиями на JCB 2350*20*210', '', ''),
(499, 1, 'Нож на челюсть СТ65Г приварной под зубья на JCB 2345*20*180', 'Нож на челюсть СТ65Г приварной под зубья на спецтехнику JCB. Размеры: 2345*20*180', '', 'Нож на челюсть СТ65Г приварной под зубья на JCB 2345*20*180', '', ''),
(500, 1, 'Нож планировочный переднего ковша сварной с фаской на JCB 2345*16*130', 'Нож планировочный переднего ковша сварной с фаской на спецтехнику JCB. Размеры 2345*16*130', '', 'Нож планировочный переднего ковша сварной с фаской на JCB 2345*16*130', '', ''),
(501, 1, 'Зуб JCB центральный ковша 332/C4388', '&lt;p&gt;Зуб JCB центральный ковша  332/C4388, 531/03205 является надежным товаром, обеспечивающим высокую производительность работы специальной техники. Так как он относится к расходникам, которые требуют регулярной замены, он обладает впечатляющим качеством. Если вы ищете запчасти на экскаватор погрузчик JCB, выбирайте только лучшие товары. Ведь их долговечность напрямую влияет на уровень затрат на содержание спецтехники.Такое навесное оборудование для погрузчиков сделано из износостойких сталей, обладающих значительной прочностью и длительным сроком службы.&lt;/p&gt;', '', 'Зуб JCB центральный ковша 332/C4388', '', ''),
(502, 1, 'Пика гидромолота JCB HM 260', '&lt;p&gt;В этом разделе каталога вы можете купить пику для гидромолота экскаватора-погрузчика. Ее рабочий механизм – HAMMERMASTER (Rammer). Форма пики гидромолота JCB HM 260 называется «карандаш». Эта особенность определяет сферу применения товара. Такое оборудование используется тогда, когда необходимо с применением значительной мощности разрушить хрупкие строительные материалы. Обычно с его помощью ломают крупные конструкции из бетона и железобетона.В нашем интернет-магазине вы можете приобрести запчасти JCB оптом и в розницу, с оперативной доставкой и даже с установкой на спецтехнику.Пика-конус: используется для вскрытия бетонных покрытий, дробления негабаритов, а также для общих разрушающих работ, где требуется проникающее разрушение.Пика-зубило: подходит для разрушения асфальта, мерзлого грунта и там, где необходимо срезающее действие, т.е, рубка или ступенчатая выработка. Зубило имеет большую степень износа и больший уровень напряжения в области фиксации пики.Пика-карандаш: применяется для разрушения бетона, железобетона, осуществления демонтажных работ, т.е., в случаях, когда требуется повышенная разрушительная сила. Как правило, такая пика предназначена для работы с достаточно хрупкими материалами.Пика-зубило с канавками: используется для работы с материалами, способными при разрушении разбиваться на мелкие части, которые гасят часть энергии удара гидромолота.Пика-крестовая: применяется в условиях образования большого количества мелких частей обрабатываемого материала, частично гасящих энергию удара гидромолота.Пика-лопатка: представляет собой широкое зубило для повышенной эффективности в мягком материале (например, для вскрытия асфальтового покрытия).Пика-тупая: используется для дробления больших объектов на мелкие части, дробления высокопрочных горных пород, гранита, для работ в рудных и нерудных карьерах. Такая пика используется, по-преимуществу, для вторичного разрушения материалов, для дробления негабаритов прочных пород (например, после буровзрывных работ) пика легко устанавливается на обрабатываемый объект и не соскальзывает.Пика-тупая с увеличенным диаметром: применяется для вторичного разрушения материалов, отличается большой износоустойчивостью и увеличенным сроком службы.Пика-трамбовка: используется для уплотнения рыхлых грунтов.&lt;/p&gt;', '', 'Пика гидромолота JCB HM 260', '', ''),
(503, 1, 'Пика гидромолота Delta F6', '&lt;p&gt;Представляем вам разнообразные запчасти для экскаватора JCB. В этом разделе вы можете приобрести пику гидромолота Delta F6. Ее острие карандаш используется тогда, когда необходимо разрушить хрупкий материал, применяя значительную силу. Такой товар легко сломает даже большие конструкции из бетона и железобетона. Его диаметр семьдесят пять миллиметров, а длина семьдесят сантиметров. Цена пики на гидромолот указана на странице товара за единицу. Чтобы заказать ее, вам необходимо зарегистрироваться на сайте и добавить предмет в Корзину. Если у вас возникли вопросы, звоните нашим менеджерам.Пика-конус: используется для вскрытия бетонных покрытий, дробления негабаритов, а также для общих разрушающих работ, где требуется проникающее разрушение.Пика-зубило: подходит для разрушения асфальта, мерзлого грунта и там, где необходимо срезающее действие, т.е, рубка или ступенчатая выработка. Зубило имеет большую степень износа и больший уровень напряжения в области фиксации пики.Пика-карандаш: применяется для разрушения бетона, железобетона, осуществления демонтажных работ, т.е., в случаях, когда требуется повышенная разрушительная сила. Как правило, такая пика предназначена для работы с достаточно хрупкими материалами.Пика-зубило с канавками: используется для работы с материалами, способными при разрушении разбиваться на мелкие части, которые гасят часть энергии удара гидромолота.Пика-крестовая: применяется в условиях образования большого количества мелких частей обрабатываемого материала, частично гасящих энергию удара гидромолота.Пика-лопатка: представляет собой широкое зубило для повышенной эффективности в мягком материале (например, для вскрытия асфальтового покрытия).Пика-тупая: используется для дробления больших объектов на мелкие части, дробления высокопрочных горных пород, гранита, для работ в рудных и нерудных карьерах. Такая пика используется, по-преимуществу, для вторичного разрушения материалов, для дробления негабаритов прочных пород (например, после буровзрывных работ) пика легко устанавливается на обрабатываемый объект и не соскальзывает.Пика-тупая с увеличенным диаметром: применяется для вторичного разрушения материалов, отличается большой износоустойчивостью и увеличенным сроком службы.Пика-трамбовка: используется для уплотнения рыхлых грунтов.&lt;/p&gt;', '', 'Пика гидромолота Delta F6', '', ''),
(504, 1, 'Пика гидромолота Delta F5', '&lt;p&gt;Пика гидромолота Delta F5, представленная в этом разделе, является рабочим инструментом экскаватора-погрузчика от английского бренда. Ее форма – острие карандаш – позволяет использовать товар для разрушения бетонных и железобетонных конструкций, а также других сооружений из хрупких материалов. Применяя эти запчасти для спецтехники JCB, вы сможете производить демонтажные работы в случаях, когда нужна будет высокая разрушительная сила. Диаметр пики шестьдесят восемь миллиметров, а длина семьдесят сантиметров. Такое навесное оборудование для JCB 4CX имеет массу восемнадцать килограмм.Пика-конус: используется для вскрытия бетонных покрытий, дробления негабаритов, а также для общих разрушающих работ, где требуется проникающее разрушение.Пика-зубило: подходит для разрушения асфальта, мерзлого грунта и там, где необходимо срезающее действие, т.е, рубка или ступенчатая выработка. Зубило имеет большую степень износа и больший уровень напряжения в области фиксации пики.Пика-карандаш: применяется для разрушения бетона, железобетона, осуществления демонтажных работ, т.е., в случаях, когда требуется повышенная разрушительная сила. Как правило, такая пика предназначена для работы с достаточно хрупкими материалами.Пика-зубило с канавками: используется для работы с материалами, способными при разрушении разбиваться на мелкие части, которые гасят часть энергии удара гидромолота.Пика-крестовая: применяется в условиях образования большого количества мелких частей обрабатываемого материала, частично гасящих энергию удара гидромолота.Пика-лопатка: представляет собой широкое зубило для повышенной эффективности в мягком материале (например, для вскрытия асфальтового покрытия).Пика-тупая: используется для дробления больших объектов на мелкие части, дробления высокопрочных горных пород, гранита, для работ в рудных и нерудных карьерах. Такая пика используется, по-преимуществу, для вторичного разрушения материалов, для дробления негабаритов прочных пород (например, после буровзрывных работ) пика легко устанавливается на обрабатываемый объект и не соскальзывает.Пика-тупая с увеличенным диаметром: применяется для вторичного разрушения материалов, отличается большой износоустойчивостью и увеличенным сроком службы.Пика-трамбовка: используется для уплотнения рыхлых грунтов.&lt;/p&gt;', '', 'Пика гидромолота Delta F5', '', ''),
(505, 1, 'Пика гидромолота Delta F10', '&lt;p&gt;Пика гидромолота Delta F10 обладает высоким качеством, прочностью и долговечностью. Она прослужит действительно долго, даже в случае интенсивной эксплуатации. Это навесное оборудование для полноповоротного экскаватора погрузчика изготовлено из прочных материалов и компонентов. В ассортименте вы также можете найти пику с формой рабочего инструмента «карандаш», «конус», «зубило», «крестовая», «лопатка», «тупая», «трамбовка» и многие другие.Чтобы купить пику для гидромолота, зарегистрируйтесь на нашем сайте. Менеджеры помогут вам определиться с выбором и сделать заказ.&lt;/p&gt;', '', 'Пика гидромолота Delta F10', '', ''),
(506, 1, 'Пика гидромолота JCB HM380', '&lt;p&gt;Сменный инструмент гидромолота - пика JCB HM380 для оригинального навесного оборудования HammerMaster.Оригинальное название: Tool MoilАртикул: 332/A2455, 332/A2456, 332/A2457, 332/A2458, 332/A2459         332/A3061, 332/A3062, 332/A3063, 332/A3064, 332/A3065Пика поставляется с двемя видами острия - карандаш (пирамида) и клин.Гидравлический отбойный молоток предназначен для демонтажа различных твердых поверхностей - бетона, асфальта, блочных и кирпичных перекрытий, литых панелей, каменных и шлакоблочных строений и стен. Гидромолот цепляется на заднюю стрелу экскаватора-погрузчика JCB и соединяется двумя гидравлическими шлангами к трубкам подачи рабочей гидравлической жидкости. Масло непрерывно подается в отбойный молоток через один из рукавов высокого давления и пройдя в механизме гидромолота рабочий цикл уходит через второй рукав снова в гидравлическую систему экскаватора. При подаче гидравлического масла в гидромолоте создается высокое давление, которое приводит в действие ударный механизм - баек, который с высокой силой ударяет по тыльной части сменного инструмента HM380 - пики гидромолота. Пика под действием байка совершает возвратно-поступательные движения с высокой тактовой частотой и оказывает давления на точку соприкосновения - твердую поверхность, в результате чего происходит процесс разрушения.Важно знать, что сменный инструмент предназначен прежде всего для раскалывания различных твердых поверхностей, передавая энергию удара на точку опоры, и недопустимо использование пики в качестве лома, так как пика может надломиться. Также при работе с навесным оборудованием необходимо соблюдать меры предосторожности, так от разрушающейся поверхности отлетают в разные стороны куски.Пика гидромолота HammerMaster JCB НМ380 должна беспрепятственно двигаться во внешней и внутренней втулках гидромолота, не встречая сопротивления и трения, поэтому необходимо своевременно проводить шприцевание инструмента.Наилучшей смазкой для ударных механизмов оригинального навесного оборудования HammerMaster являются консистентные графитовые смазки с высокотемпературным режимом, которые не плавятся и не текут из гидромолота при высоких ударных нагрузках.&lt;/p&gt;', '', 'Пика гидромолота JCB HM380', '', ''),
(507, 1, 'Палец пики гидромолота JCB 332/A3879', '&lt;p&gt;Палец пики гидромолота JCB HM380 332/A3879 для оригинального навесного оборудования HammerMaster.Оригинальное название: Pin Tool retainerНазначение: палец пики навесного гидравлического отбойного молотка JCB HM380 332/A3879 устанавливается в корпус гидромолота для удерживания и фиксации инструмента - пики гидромолота JCB HM380. Палец изготовлен из особо прочного закаленного металла, что способствует длительному сроку эксплуатации навесного оборудования и его бесперебойной работы. В пике гидромолота JCB HM380 имеются две специальные выемки с противоположных сторон, благодаря которым инструмент удерживается в корпусе отбойного молотка двумя пальцами 332/A3879 и свободно движется в нижней втулке гидромолота, совершая возвратно-поступательные движения.Палец пики гидромолота JCB HM380 332/A3879 изготовлен из высокопрочного закаленного металла, произведен с применением инновационных технологий. Каталог запасных частей экскаватора представляет и реализует эту модель в оригинале. В нашем интернет магазине представлены запчасти известных производителей с доставкой по всем регионам России по оптовым и розничным ценам.Магазин jcb запчасти для спецтехники представлены и изготовлены в соответствии с мировыми стандартами качества и безопасности, а также имеют гарантийный срок эксплуатации и продаются по самым оптимальным ценам.&lt;/p&gt;', '', 'Палец пики гидромолота JCB 332/A3879', '', ''),
(508, 1, 'Палец держатель пики гидромолота Delta F5', '&lt;p&gt;Палец держатель пики гидромолота Delta F5, представленный в этом разделе, монтируется на рабочий инструмент. Этот товар устанавливается через отверстие в правой щеке гидромолота и закрепляется зажимом в виде трубки. Предмет подходит для гидравлического молота с механизмом DELTA FINE (South Korea),который является деталью моделей экскаваторов-погрузчиков 3СХ и 4СХ JCB. В каталоге нашего интернет-магазина вы найдете и другое навесное оборудование, доступное для заказа. Мы занимаемся продажей запчастей JCB, а также проведением технического осмотра, ремонта и монтажа запчастей.&lt;/p&gt;', '', 'Палец держатель пики гидромолота Delta F5', '', ''),
(509, 1, 'Палец держатель пики гидромолота JCB-260', '&lt;p&gt;В этом разделе представлен палец держатель пики гидромолота, предназначенный для погрузчиков моделей 3СХ и 4СХ. Такое навесное оборудование экскаватора применяется на гидравлических молотах моделей JCB 260, CAT H63 с механизмом HAMMERMASTER (Rammer). Данное приспособление просовывается в отверстие, которое имеется в правой щеке рабочего инструмента. После установки оно крепится с помощью шплинта.В нашем ассортименте вы можете приобрести и другие запчасти для спецтехники JCB. Чтобы заказать подходящий товар, зарегистрируйтесь на нашем сайте. Если у вас возникли вопросы, звоните специалистам компании.&lt;/p&gt;', '', 'Палец держатель пики гидромолота JCB-260', '', ''),
(510, 1, 'Втулка гидромолота нижняя JCB HM380 332/A2446', '&lt;p&gt;Втулка гидромолота JCB HM380 332/A2445 нижняя для оригинального навесного оборудования HammerMaster.Оригинальное название: Bush End CoverНазначение: втулка пики навесного гидравлического отбойного молотка JCB HM380 332/A2446 устанавливается в корпус гидромолота, внутри которой движется во время работы инструмент - пика гидромолота JCB HM380. Втулка 332/А2446 немного выступает из корпуса отбойника, поэтому при неумелой или небрежной работе с гидромолотом можно ее повредить ударив об бетон или другую твердую поверхность. Втулка каленая, что обуславливает долгий срок службы и высокую надежность эксплуатации. При работе гидромолотом пика движется с большой скоростью внутри втулки 332/А2446, поэтому необходимо как можно чаще смазывать рабочий механизм инструмента для улучшения процесса скольжения пики гидромолота JCB и предотвращения преждевременного износа внутренней части втулки HM380 332/A2446.Наилучшей смазкой для ударных механизмов оригинального навесного оборудования HammerMaster являются консистентные графитовые смазки с высокотемпературным режимом, которые не плавятся и не текут из гидромолота при высоких ударных нагрузках.Втулка гидромолота нижняя JCB HM380 332/A2446 навесного гидравлического отбойного молотка JCB HM380 332/А2446 является основной деталью корпуса гидромолота, внутри которой движется в процессе работы инструмент – пика. Деталь изготовлена из каленого материала, что подразумевает длительное использование и надежность при эксплуатации. В каталоге запчастей JBC втулка представлена в оригинале.В нашем интернет магазине JCB запчасти вы можете купить втулку гидромолота JBC, изготовленную в соответствии с мировыми стандартами качества. Она имеет сертификат соответствия и имеет гарантийный срок эксплуатации. У нас вы можете купить запчасти для спецтехники этого производителя по самым оптимальным ценам.&lt;/p&gt;', '', 'Втулка гидромолота нижняя JCB HM380 332/A2446', '', ''),
(511, 1, 'Болт и гайка крепления зубьев 826/00303, 1305/0714, 1340/0701', '&lt;p&gt;Болт и гайка крепления зубьев 826/00303, 1305/0714, 1340/0701 ковша и планировочноко ковша челюсти экскаваторов-погрузчиков JCB.Крепеж зубьев ковша JCB 826/00303, 1305/0714, 1340/0701 используется в качестве крепежного элемента. Она фиксирует зубья к режущему краю. Чтобы установить навесное оборудование для фронтальных погрузчиков, также требуются соответствующие шайбы и болт с головкой на шесть граней. Такая деталь используется для крепления центрального зуба к фронтальному ковшу, двух центральных и боковых к заднему.В нашем магазине вы можете приобрести эти и другие запчасти JCB, как оптом, так и в розницу. Вы также можете заказать оперативную установку купленного товара. Мастера проведут техосмотр спецтехники и монтаж детали.Болт и гайка крепления зубьев 826/00303, 1305/0714, 1340/0701 предназначены для замены вышедших из строя аналогичных изделий экскаватора-погрузчика JCB. Детали погрузчика JCB изготовлены из качественных, инновационных материалов, имеют долгий срок службы. В каталоге нашего интернет-магазина представлены детали для спецтехники JCB любой модификации.В каталоге запасных частей для экскаватора JCB представлены изделия, отвечающие всем заявленным требованиям, сопровождающиеся сертификатами соответствия и гарантийными обязательствами для вашей уверенности в высоком качестве.&lt;/p&gt;', '', 'Болт и гайка крепления зубьев 826/00303, 1305/0714, 1340/0701', '', ''),
(512, 1, 'Автосцепка быстросъем JCB 980/88833 980/88352', '&lt;p&gt;Автосцепка быстросъем JCB 980/88833, 980/88352, 980/84507 для навесного оборудования экскаваторов-погрузчиков JCB.Оригинальное название: Kit-quickhitch mechanicalАртикул: 980/88833, 980/88352, 980/84507Назначение: Быстросъемное соединение JCB Kit-quickhitch 980/88833, 980/88352, 980/84507 предназначается для быстрой и легкой смены навесного оборудования на задней стреле экскаватора-погрузчика JCB 3CX, JCB 4CX. С помощью автосцепки можно подсоединять на телескопическую рукоять JCB различного назначения ковши (планировочные, стандартные, троншейные), гидравлические отбойные молотки, гидробуры, дробилки и т.д. С помощью специального рычага оператор приводит в действие пружину, которая отсоединяет закрепленный внешний инструмент, происходит быстрое снятие навесного оборудования.Автосцепка быстросъем JCB 980/88833, 980/88352, 980/84507 используется для быстрого и простого съема навесного оборудования на задней стреле экскаватора. В нашем каталоге представлены запчасти для спецтехники JCB в широком ассортименте по самым оптимальным ценам от мировых производителей.У нас вы можете купить детали для погрузчика, комплектующие, расходники и запчасти в высоком качестве. Все товары имеют сертификат соответствия и гарантийные сроки. Каждая запчасть изготовлена в строгом соответствии с международными требованиями к качеству и безопасности продукции.&lt;/p&gt;', '', 'Автосцепка быстросъем JCB 980/88833 980/88352', '', ''),
(513, 1, 'Соединительная пластина тяги переднего ковша и стрелы на JCB 331/43843', 'Соединительная (опорная) пластина тяги переднего ковша и стрелы на спецтехнику JCB. Артикул: 331/4384', '', 'Соединительная пластина тяги переднего ковша и стрелы на JCB 331/43843', '', ''),
(514, 1, 'Замок-кольцо (навесное) JCB 826/00600', '&lt;p&gt;Замок-кольцо (навесное) JCB 826/00600 является замыкающей частью деталей специальной техники. Деталь создается из легированного и нелегированного чугуна. Она устанавливается на поршень и другие элементы, затем концы обрабатываются и сжимаются с помощью термической фиксации.Если вас интересует навесное оборудование для JCB 4CX, обращайтесь к нашим специалистам. Профессионалы проконсультируют вас и помогут с выбором деталей. Мы занимаемся не только продажей запчастей с доставкой, но и техническим осмотром спецтехники, ремонтом и установкой купленных деталей на погрузчики.&lt;/p&gt;', '', 'Замок-кольцо (навесное) JCB 826/00600', '', ''),
(515, 1, 'Гайка болта крепления каретки JCB 1340/1101', '&lt;p&gt;Гайка болта крепления каретки JCB 1340/1101 – это небольшая деталь крепежа, необходимая для фиксации элемента в специальной технике. Выбирая такие запчасти на экскаватор погрузчик, обращайте внимание на производителя товара и на заявленное качество. Важно, чтобы эти детали могли выдержать значительную нагрузку. От надежности крепежа зависит долговечность всей системы, даже в условиях интенсивной эксплуатации.Мы предлагаем вам различные запчасти JCB в Москве. К вашим услугам мастера компании, которые могут оперативно провести технический осмотр спецтехники, отремонтировать поломку и установить новую деталь.&lt;/p&gt;', '', 'Гайка болта крепления каретки JCB 1340/1101', '', ''),
(516, 1, 'Втулка для гидромолота DELTA F5 на спецтехнику JCB 3CX, 4CX', 'Втулка для гидромолота DELTA F5 на спецтехнику JCB 3CX, 4CX', '', 'Втулка для гидромолота DELTA F5 на спецтехнику JCB 3CX, 4CX', '', ''),
(517, 1, 'Кольцо стопорное 60 V JCB 821/00459', '&lt;p&gt;Кольцо стопорное 60 V JCB – это элемент с особой незамкнутой формой. Такой товар может быть наружного типа и внутреннего. Первый вариант используется для крепежа узлов и деталей в отверстии. Второй применяется для установки различных механизмов.&lt;/p&gt;', '', 'Кольцо стопорное 60 V JCB 821/00459', '', ''),
(518, 1, 'Быстросъемное соединение ковша и гидромолота JCB 980/27600', '&lt;p&gt;Хотите купить запчасти на погрузчик? Просмотрите наш каталог. В этом разделе вы можете приобрести быстросъемное соединение ковша и гидромолота JCB. С их помощью вы будете легко менять навесное оборудование погрузчика, не привлекая для этого других работников. Цена товара указана за единицу. Автосцепка позволяет быстро, просто и эффективно приступать к работе с использованием нужного механизма (ковша, гидромолота, грейфера, рыхлителя и других). Товар также известен под названиями «БСМ» механического действия, Quick Coupler, автоматическая сцепка, быстросъемный механизм.&lt;/p&gt;', '', 'Быстросъемное соединение ковша и гидромолота JCB 980/27600', '', ''),
(519, 1, 'Тяга трапес вертикальная передней стрелы на JCB 331/43848, 331/25064', 'Тяга трапес вертикальная передней стрелы (3 отверстия) на спецтехнику JCB. Артикулы: 331/43848, 331/25064', '', 'Тяга трапес вертикальная передней стрелы на JCB 331/43848, 331/25064', '', ''),
(520, 1, 'Межрычаговая пластина на JCB 331/43844', 'Межрычаговая пластина на спецтехнику JCB. Артикул: 331/43844, 123/02110', '', 'Межрычаговая пластина на JCB 331/43844', '', ''),
(521, 1, 'Кольцо стопорное 35 V JCB 821/00297', '&lt;p&gt;Кольцо стопорное 35 V JCB является частью гидравлической системы специальной техники. Эта небольшая деталь представляет собой незамкнутое стальное кольцо (иногда его изготавливают из нержавейки). С его помощью фиксируют элементы и узлы в определенных отверстиях.Если вам требуются различные запчасти JCB в Москве или навесное оборудование для экскаватора погрузчика, обращайтесь к нашим специалистам. Менеджеры помогут вам определиться с выбором товара и оформлением заказа. Если у вас возникли вопросы по представленному ассортименту или услугам мастеров компании, позвоните нам!&lt;/p&gt;', '', 'Кольцо стопорное 35 V JCB 821/00297', '', ''),
(522, 1, 'Бокорез ковша правый 332/C4389', '&lt;p&gt;Бокорез ковша правый с крепежом 332/C4389, 333/D8457 создается из износостойких материалов значительной прочности. Элементы прикрепляются с помощью болтов и гаек. Товар соответствует требованиям международных стандартов. Такое навесное оборудование для экскаватора погрузчика отлично защищает боковую режущую сторону ковша от поломок и истирания. Также наличие этих деталей позволяет ковшу вмещать больше грунта и не рассыпать его.&lt;/p&gt;', '', 'Бокорез ковша правый 332/C4389', '', ''),
(523, 1, 'Бокорез ковша левый 332/C4390', '&lt;p&gt;В этом разделе представлен бокорез заднего ковша левый с крепежом 332/C4390, 333/D8456. Он является боковой защитой экскаватора. Обычно его устанавливают на боковую режущую сторону ковша, предотвращая навесное оборудование погрузчиков JCB от преждевременного износа и повреждений камнями. Если не использовать эту деталь, возможно разрушение элементов и даже их выход из строя. Ремонт ковша очень дорогой, так что лучше предотвратить его поломку.Такие запчасти крепятся на спецтехнику JCB с помощью болтов и гаек. В любой момент вы легко можете раскрутить их для снятия или замены детали.&lt;/p&gt;', '', 'Бокорез ковша левый 332/C4390', '', ''),
(524, 1, 'Кронштейн линии гидромолота на JCB 128/G8690', 'Кронштейн линии гидромолота на спецтехнику JCB 3CX, 4CX. Артикул: 128/G869', '', 'Кронштейн линии гидромолота на JCB 128/G8690', '', ''),
(525, 1, 'Диск колеса 9*18 на JCB 41/901800', 'Диск колеса 9*18 на спецтехнику JCB. Фирма-производитель: Jansta. Страна: Турция. Артикул: 41/901800', '', 'Диск колеса 9*18 на JCB 41/901800', '', ''),
(526, 1, 'Диск колеса 14*28 на JCB 41/912100', 'Диск колеса 14*28 на спецтехнику JCB. Фирма-производитель: Jansta. Страна: Турция. Артикул: 41/912100', '', 'Диск колеса 14*28 на JCB 41/912100', '', ''),
(527, 1, 'Диск колеса 16*26 на JCB 41/910100', 'Диск колеса 16*26 на спецтехнику JCB. Фирма-производитель: Jansta. Страна: Турция. Артикул: 41/910100', '', 'Диск колеса 16*26 на JCB 41/910100', '', ''),
(528, 1, 'Диск колеса 14*24 на JCB 41/910000', 'Диск колеса 14*24 на спецтехнику JCB. Фирма-производитель: Jansta. Страна: Турция. Артикул: 41/91000', '', 'Диск колеса 14*24 на JCB 41/910000', '', ''),
(529, 1, 'Диск колесный 15*24 на JCB 41/922600, 334/L2028', 'Диск колесный 15*24 на спецтехнику JCB. Артикулы: 41/922600, 334/L2028. Фирма-производитель: Jansta. Страна: Турция', '', 'Диск колесный 15*24 на JCB 41/922600, 334/L2028', '', ''),
(530, 1, 'Шпилька колесного диска JCB 826/00923', '&lt;p&gt;Шпилька колесного диска 826/00923 для экскаватора-погрузчика JCB 3CX, 4CXШпилька колесного диска JCB – это небольшая, но очень важная деталь. Она обеспечивает максимально надежное и прочное крепление колеса, которого требует большая скорость и значительная нагрузка при движении. Естественно, представленные в Москве запчасти JCB полностью соответствуют высоким требованиям. Такие простые и эффективные детали выполняют важную роль в работе спецтехники. Также они повышают  безопасность эксплуатации  погрузчика.Чтобы купить шпильки для колесных дисков, выберите подходящую модель и требуемое вам количество товаров. Затем добавьте покупку в Корзину и оформите заказ. &lt;/p&gt;', '', 'Шпилька колесного диска JCB 826/00923', '', ''),
(531, 1, 'Гайка колесного диска JCB 106/40001', '&lt;p&gt;Гайка колесная JCB 106/40001&lt;/p&gt;', '', 'Гайка колесного диска JCB 106/40001', '', ''),
(532, 1, 'Вентиль колесный JCB', '&lt;p&gt;Вентиль колесный тракторный для безкамерного колесного диска R18, R24, R26, R28Вентиль тракторный JCB используется для шин крупных габаритов постоянного давления. Такой товар создан специально для экскаватора-погрузчика. Его аналоги подходят  и для других специальных транспортных средств. Такие запчасти для спецтехники в Москве предназначены для бескамерного диска  радиусом восемнадцать, двадцать четыре, двадцать шесть, двадцать восемь.  Деталь отличается высоким качеством, прочностью и надежностью. Она обладает значительной износостойкостью. Цена на запчасти JCB указана на странице товара. здесь же вы можете увидеть и другие характеристики товара. &lt;/p&gt;', '', 'Вентиль колесный JCB', '', ''),
(533, 1, 'Шина R18: TechKing Enforce2 TL клюшка (12.5/80-18)', '&lt;p&gt;Шина TECHKING ENFORCE2 TL для экскаватора-погрузчика JCB 3CX безкамернаяРадиус: R18, передние колесаРазмеры: 12.5/80-18Рисунок протектора: клюшкаКоличество слоев: 14Тип шины: диагональнаяКласс шины: Standart+Страна производитель: КитайВ этом разделе представлена шина R18 TechKing Enforce2 TL. Товар произведен в Китае и обладает отличным качеством, износостойкостью и выносливостью.   Резина класса Standart+ подойдет на экскаватор-погрузчик JCB 3CX.  Тип шины диагональный, размер 12.5/80-18. Колесо радиусом R18 используется для передних колес. В данном изделии имеется четырнадцать слоев. Протектор обладает рисунком «клюшка». Вы можете приобрести и другие бескамерные колеса в нашем интернет-магазине с доставкой в Москве или по регионам. К вашим услугам большой выбор запчастей, которые подойдут для спецтехники JCB.  &lt;/p&gt;', '', 'Шина R18: TechKing Enforce2 TL клюшка (12.5/80-18)', '', ''),
(534, 1, 'Камера R28 16.9-28', '&lt;p&gt;Камера 16.9-28 для экскаватора-погрузчика JCB 4CX, 4CX SuperРадиус: R28, передние/задние колесаРазмеры: 16.9-28Производитель: Kabat, ПольшаПредставляем вам необходимые товары на экскаватор-погрузчик JCB 4CX Super  и JCB 4CX. Для заказа с доставкой по Москве доступна  шина R18 Solideal BHZ, произведенная польской компанией Kabat. Эта фирма известна своим большим выбором резины великолепного качества.  Вы смело можете использовать  бескамерные колеса размерами 16.9-28 и радиусом R28, если в вашем распоряжении имеется спецтехника JCB. Качественные польские шины, устанавливаемые и на передние, и  на задние колеса погрузчика, выдержат любые условия эксплуатации, даже значительные нагрузки и передвижение по сложным трассам или бездорожью.&lt;/p&gt;', '', 'Камера R28 16.9-28', '', ''),
(535, 1, 'Камера R26 18.4-26', '&lt;p&gt;Камера 18.4-26 для экскаватора-погрузчика JCB 3CXРадиус: R26, задние колесаРазмеры: 18.4-26Производитель: Kabat, ПольшаВ этом разделе представлена шина камера R26, которая подходит на экскаватор-погрузчик JCB 3CX. Ее размеры 18.4-26, радиус R26. Данный товар предназначен для спецтехники JCB, шина устанавливается на задние колеса. Запасная часть изготовлена в Польше, компанией Kabat. Это известный производитель камер для агропромышленной техники и легковых автомобилей. Если вам требуется резина на вашу спецтехнику или конкретная модель колеса, вы можете заказать ее в нашем интернет-магазине. Свяжитесь с представителями компании, чтобы приобрести товары с доставкой по Москве или в регионы. &lt;/p&gt;', '', 'Камера R26 18.4-26', '', ''),
(536, 1, 'Шина R24: Solideal SL R4 клюшка (16.9-24)', '&lt;p&gt;Шина SOLIDEAL SL R4 для экскаватора-погрузчика JCB 3CX SUPER безкамернаяРадиус: R24, передние/задние колесаРазмеры: 16.9-24Рисунок протектора: клюшкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: PremiumСтрана производитель: Шри-ЛанкаШина R24 Solideal SL R4 устанавливается на экскаватор-погрузчик JCB 3CX Super в качестве переднего или заднего колеса. Эта бескамерная резина производится на острове Шри-Ланка. Товар соответствует классу Premium. Изделие диагонального типа включает в себя двенадцать слоев. Размер 16.9-24. На протекторе имеется самый популярный для шин тяжелой техники рисунок – «клюшка». Его выбирают за хорошие показатели проходимости на дорогах и с мягким грунтом, и с асфальтовым покрытием. Для владельцев спецтехники JCB мы подготовили большой выбор товаров и выгодные условия покупки. Жителям Москвы доступен самовывоз. Также возможна доставка.&lt;/p&gt;', '', 'Шина R24: Solideal SL R4 клюшка (16.9-24)', '', ''),
(537, 1, 'Шина R24: Solideal SLA R4 елка (16.9-24)', '&lt;p&gt;Шина SOLIDEAL SLA R4 для экскаватора-погрузчика JCB 3CX SUPER безкамернаяРадиус: R24, передние/задние колесаРазмеры: 16.9-24Рисунок протектора: елкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: StandartСтрана производитель: Шри-ЛанкаВы используете для работы экскаватор-погрузчик JCB 3CX Super? Тогда вам подойдет бескамерная шина R24 Solideal SLA R4, изготовленная на острове Шри-Ланка.  Эта резина класса Standart имеет диагональный тип. Запчасть состоит из двенадцати слоев. Размеры товара 16.9-24, радиус R24На протекторе рисунок «елка» с широкими грунтозацепами. Он позволяет использовать спецтехнику JCB, на передние или задние колеса которой установлена такая резина, и в полях, и на мягких грунтах.  Хотите заказать товар с доставкой? Обращайтесь к нам. Жителям Москвы доступен и самовывоз из любого нашего магазина. &lt;/p&gt;', '', 'Шина R24: Solideal SLA R4 елка (16.9-24)', '', ''),
(538, 1, 'Шина R26: Solideal SLA R4 елка (18.4-26)', '&lt;p&gt;Шина SOLIDEAL SLA R4 для экскаватора-погрузчика JCB 3CX безкамернаяРадиус: R26, передние/задние колесаРазмеры: 18.9-24Рисунок протектора: клюшкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: StandartСтрана производитель: Шри-ЛанкаВ нашем каталоге представлена шина R26 Solideal SLA R4, изготовленная на острове  Шри-Ланка. Ее класс (Standart) гарантирует хорошее качество запчасти и приемлемую стоимость. Товар подходит на экскаватор-погрузчик JCB 3CX в качестве переднего или заднего колеса. Тип бескамерной шины диагональный, резина состоит из двенадцати слоев. Рисунок протектора  «клюшка» относится к наиболее распространенным вариантам для тяжелого транспорта. Если вы владелец спецтехники JCB и ищете в Москве качественные и недорогие запчасти, заказывайте товары у нас онлайн, с доставкой в любую точку страны.&lt;/p&gt;', '', 'Шина R26: Solideal SLA R4 елка (18.4-26)', '', ''),
(539, 1, 'Шина R26: Solideal SL R4 клюшка (18.4-26)', '&lt;p&gt;Шина SOLIDEAL SL R4 для экскаватора-погрузчика JCB 3CX безкамернаяРадиус: R26, задние колеса колесаРазмеры: 18.4-26Рисунок протектора: клюшкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: PremiumСтрана производитель: Шри-ЛанкаЕсли вы ищете бескамерную резину класса Premium,  подходящую на ваш экскаватор-погрузчик JCB 3CX, обратите внимание на этот товар. Шина SOLIDEAL SL R4 произведена на острове Шри-Ланка. Она имеет двенадцать слоев и гарантирует великолепное качество, стойкость к износу. Размеры запчасти диагонального типа – 18.4 - 26, радиус R26. Шина устанавливается на задние колеса спецтехники JCB. Рисунок протектора «клюшка» обеспечивает наилучшие тяговые характеристики для такого рода транспорта.Хотите получить купленный товар быстро? Закажите оперативную доставку по Москве или в любой другой город России. &lt;/p&gt;', '', 'Шина R26: Solideal SL R4 клюшка (18.4-26)', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(540, 1, 'Шина R26: Solideal BHZ шашка (18.4-26)', '&lt;p&gt;Шина SOLIDEAL BHZ для экскаватора-погрузчика JCB 3CX бескамернаяРадиус: R26, задние колеса колесаРазмеры: 18.4-26Рисунок протектора: шашкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: PremiumСтрана производитель: Шри-ЛанкаДля владельцев экскаватора-погрузчика JCB 3CX мы подготовили большой выбор запасных частей и деталей. На этой странице вы можете приобрести бескамерную шину R26 Solideal BHZ. Диагональная резина состоит из двенадцати слоев. Она относится к классу Premium и обладает впечатляющим качеством и долговечностью. Изделие размерами 18.4-26 и радиусом R26 устанавливается на задние колеса спецтехники JCB.  В качестве рисунка протектора выбрана «шашка» - современный вариант, увеличивающий срок службы  резины. Если вы живете в Москве, заберите товар самовывозом или закажите доставку на дом. &lt;/p&gt;', '', 'Шина R26: Solideal BHZ шашка (18.4-26)', '', ''),
(541, 1, 'Шина R28: Forerunner R-4 QH601 TL клюшка (16.9-28)', '&lt;p&gt;Шина FORERUNNER R-4 QH601 TL для экскаватора-погрузчика JCB 4CX безкамернаяРадиус: R28, передние/задние колесаРазмеры: 16.9-28Рисунок протектора: клюшкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: ЭкономСтрана производитель: КитайВ этом разделе нашего онлайн-каталога представлена бескамерная Шина R28 Forerunner R-4 QH601 TL. Этот товар подойдет вам, если вы применяете в работе экскаватор-погрузчик JCB 4CX. Резина диагонального типа устанавливается на передние или задние колеса. Изделие включает в себя двенадцать слоев. Проектор имеет популярный рисунок «клюшка», обеспечивающий хорошую проходимость по любым дорогам.Для тех, кто использует спецтехнику JCB, наш магазин подготовил большой выбор запчастей от проверенных производителей (данный товар изготовлен в Китае). Возможна доставка по Москве или в регионы. &lt;/p&gt;', '', 'Шина R28: Forerunner R-4 QH601 TL клюшка (16.9-28)', '', ''),
(542, 1, 'Шина R28: Solideal SL R4 клюшка (16.9-28)', '&lt;p&gt;Шина Solideal SL R4 для экскаватора-погрузчика JCB 4CX безкамернаяРадиус: R28, передние/задние колесаРазмеры: 16.9-28Рисунок протектора: клюшкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: PremiumСтрана производитель: Шри-ЛанкаБескамерная шина R28 Solideal SL R4, доступная для заказа нашим клиентам, устанавливается на экскаватор-погрузчик JCB 4CX, на передние/задние колеса. Товар класса Premium произведен на острове Шри-Ланка и обладает отличным качеством, долгим сроком службы и поразительной износостойкостью. В изделии диагонального типа двенадцать слоев. Размер резины для  спецтехники JCB – 16.9-28, радиус R28. Протектор имеет самый популярный и распространенный рисунок «клюшка».Предлагаем вам заказать товар с доставкой. Это актуально не только для жителей Москвы, но и для клиентов из других городов и регионов.  &lt;/p&gt;', '', 'Шина R28: Solideal SL R4 клюшка (16.9-28)', '', ''),
(543, 1, 'Камера R18 12.5/80-18', '&lt;p&gt;Камера 12.5/80-18 для экскаватора-погрузчика JCB 3CXРадиус: R18, передние колесаРазмеры: 12.5/80-18Производитель: Kabat, ПольшаПредставленная здесь камера R18 подойдет владельцам  спецтехники JCB. В частности, этот товар устанавливается  на экскаватор-погрузчик JCB 3CX, в качестве переднего колеса. Производится такая резина в Польше. Компания Kabat, изготовившая данный товар, известна разнообразием предлагаемых моделей и отличным качеством готовых запчастей. Для изготовления шины размером 12.5/80-18 и радиусом R18 используется высококачественное сырье, применяются современные технологии.Если вы живете в Москве, вы можете забрать товар в одном из наших магазинов. Или же закажите запчасти с доставкой по стране.&lt;/p&gt;', '', 'Камера R18 12.5/80-18', '', ''),
(544, 1, 'Шина R18: Forerunner TL R4 клюшка (12.5/80-18)', '&lt;p&gt;Шина FORERUNNER TL R4 для экскаватора-погрузчика JCB 3CX безкамернаяРадиус: R18, передние колесаРазмеры: 12.5/80-18Рисунок протектора: клюшкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: экономСтрана производитель: КитайЭта шина R18 Forerunner TL R4, относящаяся к классу «эконом», произведена в Китае. Она обладает доступной ценой и достаточной стойкостью к износу. Вы можете применять ее, если используете в работе экскаватор-погрузчик JCB 3CX. Бескамерная резина имеет диагональный тип и состоит из двенадцати слоев. Размеры переднего колеса 12.5/80-18,  радиус R18.Протектор обладает рисунком «клюшка», который используется наиболее часто. С такими колесами спецтехника JCB будет иметь максимальную проходимость даже в условиях бездорожья. Предлагаем вам заказать товар с доставкой по России или самовывозом в Москве.&lt;/p&gt;', '', 'Шина R18: Forerunner TL R4 клюшка (12.5/80-18)', '', ''),
(545, 1, 'Шина R28: Solideal SLA R4 елка (16.9-28)', '&lt;p&gt;Шина SOLIDEAL SLA R4 для экскаватора-погрузчика JCB 4CX безкамернаяРадиус: R28, передние/задние колесаРазмеры: 16.9-28Рисунок протектора: елкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: StandartСтрана производитель: Шри-ЛанкаШина R28 Solideal SLA R4 подходит на экскаватор-погрузчик JCB 4CX (на передние и задние колеса).  Запчасть имеет двенадцать слоев и относится к диагональному типу. Бескамерное изделие класса Standart, используемое для   спецтехники JCB,  обладает параметрами 16.9-28 и радиусом R28. Страна производитель товара: Шри-Ланка. Протектор «елка» обеспечивает плавное передвижение транспорта, хорошее сцепление с дорогой и минимальный уровень вибраций при движении.Вы можете забрать колеса в наших магазинах в Москве или оформить доставку на резину или другие товары в любой регион страны. &lt;/p&gt;', '', 'Шина R28: Solideal SLA R4 елка (16.9-28)', '', ''),
(546, 1, 'Шина R28: Solideal BHZ шашка (16.9-28)', '&lt;p&gt;Шина Solideal BHZ R4 для экскаватора-погрузчика JCB 4CX безкамернаяРадиус: R28, передние/задние колесаРазмеры: 16.9-28Рисунок протектора: шашкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: PremiumСтрана производитель: Шри-ЛанкаШина R28 Solideal BHZ, представленная в этом разделе, необходима владельцам спецтехники JCB.  Бескамерная резина устанавливается на передние или задние колеса. Этот товар подходит на  экскаватор-погрузчик JCB 4CX. Размеры шины – 16.9-28, а радиус R28.Высокий класс диагонального колеса – Premium – гарантирует отличное качество и долгий срок службы такой запчасти. Протектор обладает эффективным рисунком «шашка», в котором отсутствуют грунтозацепы.Чтобы приобрести товар, произведенный на Шри-Ланке, вы можете оформить доставку по Москве и по России или забрать шину в одном из наших магазинов.&lt;/p&gt;', '', 'Шина R28: Solideal BHZ шашка (16.9-28)', '', ''),
(547, 1, 'Шина R18: Petlas Starmaxx IND25 клюшка (12.5/80-18)', '&lt;p&gt;Шина PETLAS STARMAXX IND25 для экскаватора-погрузчика JCB 3CXРадиус: R18, передние колесаРазмеры: 12.5/80-18Рисунок протектора: клюшкаКоличество слоев: 14Тип шины: диагональнаяКласс шины: PremiumСтрана производитель: Турция (завод Goodyear)Ищете качественные колеса на экскаватор-погрузчик JCB 3CX? Мы подготовили для вас шину R18 Petlas Starmaxx IND25. Она состоит из четырнадцати слоев и  соответствует классу Premium, гарантирующему высокую надежность, отличную проходимость и значительную долговечность. Резина диагонального типа производится в Турции, на заводе Goodyear. Ее размеры (12.5/80-18) и радиус (R18) позволяют использовать запчасть для спецтехники JCB. Рисунок протектора обеспечивает отличные тяговые характеристики.Этот и другие товары можно заказать с доставкой транспортными компаниями. Для жителей Москвы доступен самовывоз.  &lt;/p&gt;', '', 'Шина R18: Petlas Starmaxx IND25 клюшка (12.5/80-18)', '', ''),
(548, 1, 'Шина R18: Eurogrip TL клюшка (12.5/80-18)', '&lt;p&gt;Шина Eurogrip TL для экскаватора-погрузчика JCB 3CX безкамернаяРадиус: R18, передние колесаРазмеры: 12.5/80-18Рисунок протектора: клюшкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: экономСтрана производитель: ИндияВы используете экскаватор-погрузчик JCB 3CX? Тогда вас может заинтересовать этот товар. Бескамерная шина R18 Eurogrip TL, произведенная индийской компанией, относится к классу эконом и отличается доступной ценой при приемлемом качестве.Диагональное колесо с двенадцатью слоями имеет размеры 12.5/80-18.  Проектор обладает рисунком «клюшка». Радиус запчасти  R18. Товар используется для передних колес. Если у вас имеется спецтехника JCB, то вы легко можете заказать онлайн бескамерные колеса и другие запчасти. Возможна оперативная доставка резины и прочих товаров по Москве или в регионы.  &lt;/p&gt;', '', 'Шина R18: Eurogrip TL клюшка (12.5/80-18)', '', ''),
(549, 1, 'Камера R24 16.9-24', '&lt;p&gt;Камера 16.9-24 для экскаватора-погрузчика JCB 3CX SUPERРадиус: R24, передние/задние колесаРазмеры: 16.9-24Производитель: Kabat, ПольшаЕсли в вашем арсенале имеется спецтехника JCB, а точнее, экскаватор-погрузчик JCB 3CX Super, то вам точно понадобится этот товар. В каталоге представлена камера R24, которая рассчитана на серьезные нагрузки. Ее размеры – 16.9-24. Товар произведен в Польше.  Камеру, которую можно установить и на передние, и задние колеса, изготовила известная по всему миру компания Kabat. Она стабильно производит высококачественные и износостойкие шины. Чтобы приобрести бескамерную резину, обращайтесь к нашим специалистам! У нас вы можете заказать колеса и другие запчасти с доставкой по Москве или в другие города страны.&lt;/p&gt;', '', 'Камера R24 16.9-24', '', ''),
(550, 1, 'Шина R18: Solideal IPS/SL R4 SD клюшка (12.5/80-18)', '&lt;p&gt;Шина Solideal IPS/SL R4 SD для экскаватора-погрузчика JCB 3CX безкамернаяРадиус: R18, передние колесаРазмеры: 12.5/80-18Рисунок протектора: клюшкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: PremiumСтрана производитель: Шри-ЛанкаЕсли вам нужна резина на спецтехнику JCB, обращайтесь к нам!  Мы представляем вам шину R18 Solideal IPS/SL R4 SD размером 12.5/80-18.  Запчасть класса Premium изготовлена надежным производителем из Шри-Ланки. В изделии диагонального типа имеется двенадцать слоев. Протектор колеса, подходящего на экскаватор-погрузчик JCB 3CX, обладает размером «клюшка». Радиус товара – R18. Шина используется для передних колес.  Предлагаем приобрести колеса бескамерного типа с доставкой по Москве и Московской области, а также в любой регион страны. Подробности узнавайте у наших специалистов. &lt;/p&gt;', '', 'Шина R18: Solideal IPS/SL R4 SD клюшка (12.5/80-18)', '', ''),
(551, 1, 'Шина R18: TechKing Enforce2 TL клюшка (12.5/80-18)', '&lt;p&gt;Шина TECHKING ENFORCE2 TL для экскаватора-погрузчика JCB 3CX безкамернаяРадиус: R18, передние колесаРазмеры: 12.5/80-18Рисунок протектора: клюшкаКоличество слоев: 14Тип шины: диагональнаяКласс шины: Standart+Страна производитель: КитайВ этом разделе представлена шина R18 TechKing Enforce2 TL. Товар произведен в Китае и обладает отличным качеством, износостойкостью и выносливостью.   Резина класса Standart+ подойдет на экскаватор-погрузчик JCB 3CX.  Тип шины диагональный, размер 12.5/80-18. Колесо радиусом R18 используется для передних колес. В данном изделии имеется четырнадцать слоев. Протектор обладает рисунком «клюшка». Вы можете приобрести и другие бескамерные колеса в нашем интернет-магазине с доставкой в Москве или по регионам. К вашим услугам большой выбор запчастей, которые подойдут для спецтехники JCB.  &lt;/p&gt;', '', 'Шина R18: TechKing Enforce2 TL клюшка (12.5/80-18)', '', ''),
(552, 1, 'Шина R24: Forerunner R-4 QH601 TL клюшка (16.9-24)', '&lt;p&gt;Шина FORERUNNER R-4 QH601 TL для экскаватора-погрузчика JCB 3CX SUPER безкамернаяРадиус: R24, передние/задние колесаРазмеры: 16.9-24Рисунок протектора: клюшкаКоличество слоев: 12Тип шины: диагональнаяКласс шины: ЭкономСтрана производитель: КитайВ нашем ассортименте представлено множество запчастей от разных производителей. Все товары соответствуют спецтехнике JCB. Вы можете приобрести их с доставкой или забрать самовывозом в Москве из любого нашего магазина.Эта бескамерная шина R24 Forerunner R-4 QH601 TL  устанавливается на экскаватор-погрузчик JCB 3CX Super. Подходит и для заднего, и для переднего колеса. Ее размер – 16.9-24. Резина относится к эконом-классу и имеет соответствующую доступную стоимость. В диагональном изделии, произведенном в Китае, двенадцать слоев. На протекторе рисунок «клюшка» для максимальной проходимости. &lt;/p&gt;', '', 'Шина R24: Forerunner R-4 QH601 TL клюшка (16.9-24)', '', ''),
(553, 1, 'Моторчик стеклоомывателя JCB 714/20600', '&lt;p&gt;Моторчик стеклоомывателя JCB 714/20600 – функциональный механизм, который тесно взаимосвязан с работой дворников. Он имеет простой принцип работы, состоящий в подаче жидкости для удаления большого количества грязи и пыли с поверхности. Подходят такие запчасти для экскаваторов-погрузчиков моделей 3CX и 4CX. Они выполнены в соответствии с европейским стандартом и прошли контроль на качество, надежность и безопасность. Каталог запчастей JCB онлайн предоставляет возможность ознакомиться с основными составляющими кабины оператора и заказать необходимую деталь по выгодной цене.&lt;/p&gt;', '', 'Моторчик стеклоомывателя JCB 714/20600', '', ''),
(554, 1, 'Стекло заднее JCB закаленное с шелкографией 827/80310', '&lt;p&gt;Стекло заднее 827/80310 для JCB 3CX/4CX 2005-2015 г.в. с шелкографией&lt;/p&gt;&lt;p&gt;Размеры: 1065х1412&lt;/p&gt;', '', 'Стекло заднее JCB закаленное с шелкографией 827/80310', '', ''),
(555, 1, 'Стекло двери JCB правое закаленное с шелкографией 827/80144', '&lt;p&gt;Стекло двери правое 827/80144 для JCB 3CX/4CX&lt;/p&gt;', '', 'Стекло двери JCB правое закаленное с шелкографией 827/80144', '', ''),
(556, 1, 'Стекло двери JCB левое водительское закаленное с шелкографией 827/80143', '&lt;p&gt;Стекло двери левое водительское 827/80143 для JCB 3CX/4CX&lt;/p&gt;', '', 'Стекло двери JCB левое водительское закаленное с шелкографией 827/80143', '', ''),
(557, 1, 'Стекло форточки JCB правое закаленное с шелкографией 827/80249', '&lt;p&gt;Стекло форточка правая 827/80249 для JCB 3CX/4CX&lt;/p&gt;', '', 'Стекло форточки JCB правое закаленное с шелкографией 827/80249', '', ''),
(558, 1, 'Стекло форточки JCB левое закаленное с шелкографией 827/80269', '&lt;p&gt;Стекло форточка левая 827/80269 для JCB 3CX/4CX&lt;/p&gt;', '', 'Стекло форточки JCB левое закаленное с шелкографией 827/80269', '', ''),
(559, 1, 'Стекло лобовое JCB триплекс многослойное с шелкографией 827/80139', '&lt;p&gt;Стекло лобовое 827/80139 для JCB3CX/4CX&lt;/p&gt;&lt;p&gt;Тип стекла: лобовое триплекс.&lt;/p&gt;&lt;p&gt;Размеры: 1097х1455&lt;/p&gt;', '', 'Стекло лобовое JCB триплекс многослойное с шелкографией 827/80139', '', ''),
(560, 1, 'Стекло JCB нижнее лобовое правое триплекс с шелкографией 821/80142', '&lt;p&gt;Стекло переднее нижнее под лобовым многослойное триплекс с шелкографией правое 827/80142, 333/R4243 для JCB 3CX/4CX&lt;/p&gt;', '', 'Стекло JCB нижнее лобовое правое триплекс с шелкографией 821/80142', '', ''),
(561, 1, 'Стекло JCB нижнее лобовое левое триплекс с шелкографией 827/80141', '&lt;p&gt;Стекло под лобовым левое 827/80141, 333/R4242 для JCB 3CX/4CX&lt;/p&gt;', '', 'Стекло JCB нижнее лобовое левое триплекс с шелкографией 827/80141', '', ''),
(562, 1, 'Стекло двери верхнее левое JCB закаленное 827/30465', '&lt;p&gt;Размеры стекла: 856*1086 ммВ каталоге запчастей для экскаватора представлено огромное количество деталей от проверенных брендов. Мы не работаем с сомнительными фирмами и подпольными производствами, поэтому вы можете быть уверены в качестве каждого товара. Кроме того, оно подтверждено международными сертификатами.Предлагаем вам приобрести стекло двери верхнее левое JCB закаленное 827/30465. Оно используется для моделей 3СХ и 4СХ с кабиной старого образца – до 2005 года выпуска. Размеры детали JCB следующие: длина 1086 миллиметров, ширина – 856 миллиметров.Оригинальное название: Glass left hand upper door tinted (rounded).&lt;/p&gt;', '', 'Стекло двери верхнее левое JCB закаленное 827/30465', '', ''),
(563, 1, 'Ремкомплект герметик для клейки стекла', '&lt;p&gt;Ремкомплект - профессиональный набор для клейки стекла экскаваторов-погрузчиков JCB 3CX, 4CX.Производитель: NFСтрана производства: GermanyКомплект поставки: обезжириватель поверхности стекла, грунтовка, герметик, кисть для нанесения грунтовкиПредставляем вам ремкомплект для вклейки стекла, с помощью которого вы можете самостоятельно установить стекло на специальную технику JCB.Набор для вклейки стекла включает в себя состав для обезжиривания поверхности, праймер с кисточкой для его нанесения, герметик для вклейки стекол.Для самостоятельной замены стекол на экскаваторе-погрузчике JCB необходимо снять рамку стекла (если это дверь или заднее стекло) либо демонтировать разбитое лобовое стекло с передней части кабины.Количество герметика для вклейки стекла JCB:- лобовое 2 шт.- заднее 1 шт.- двери (правое или левое) 1 шт.- лобовые нижние (правое или левое) 1 шт.&lt;/p&gt;', '', 'Ремкомплект герметик для клейки стекла', '', ''),
(564, 1, 'Пистолет для герметика', '&lt;p&gt;Пистолет для установки тубы герметика для клейки стекол экскаватора-погрузчика JCB 3CX, 4CX&lt;/p&gt;', '', 'Пистолет для герметика', '', ''),
(565, 1, 'Стекло боковое левое старая модель JCB 827/20270', '&lt;p&gt;В этом разделе каталога запасных частей JCB представлено левое боковое стекло на старую модель 827/20270. Такой товар обладает несколькими важными преимуществами. Стекло прочное и долговечное, оно не боится случайных механических повреждений. Кроме того, деталь точно соответствует по размеру кабине JCB 3CX. О замене данного товара следует задуматься в случае, когда его поверхность покрыта многочисленными или продолжительными по длине трещинами, сколами. Если этого не сделать, ухудшится обзорность и снизится безопасность во время проведения строительных и погрузочных работ.&lt;/p&gt;', '', 'Стекло боковое левое старая модель JCB 827/20270', '', ''),
(566, 1, 'Стекло боковое правое старая модель JCB 827/20271', '&lt;p&gt;Предлагаем вам приобрести боковое правое стекло на старую модель JCB 827/20271. Товар устанавливается в кабину фронтального погрузчика. Он необходим в случае разбивания или повреждения соответствующего стекла экскаватора. Использовать элемент с трещинами или эксплуатировать транспорт при его отсутствии недопустимо. Это существенно снижает безопасность на строительной площадке или в погрузочной зоне.Чтобы заказать эту и другие запчасти JCB в Москве, зарегистрируйтесь на нашем сайте как покупатель и добавьте товар в Корзину. Менеджеры помогут вам сделать выбор и оформить заказ.&lt;/p&gt;', '', 'Стекло боковое правое старая модель JCB 827/20271', '', ''),
(567, 1, 'Стекло двери верхнее левое старая модель JCB 827/20266', '&lt;p&gt;Ищете товары для кабины спецтехники? В нашем каталоге вы найдете огромное количество оригинальных и неоригинальных запчастей от мировых производителей. В этом разделе представлено левое верхнее стекло двери старой модели JCB 827/20266. Этот товар необходимо приобрести для замены соответствующего элемента. Если «родное» стекло покрылось царапинами, сколами и трещинами или даже разбилось вдребезги, следует заменить его как можно скорее. Косметический ремонт производится только в тех случаях, когда на этих запасных частях JCB обнаружена трещина длиной меньше 157 миллиметров.&lt;/p&gt;', '', 'Стекло двери верхнее левое старая модель JCB 827/20266', '', ''),
(568, 1, 'Стекло двери верхнее правое старая модель JCB 827/20267', '&lt;p&gt;Предлагаем вам приобрести верхнее правое стекло двери старой модели JCB 827/20267. Это прочный, надежный и долговечный товар от проверенного производителя.Если какие-то стекла на вашей спецтехнике в Москве повредились, покрылись сколами, трещинами и царапинами, их следует незамедлительно заменить. То же самое относится и к ситуации, когда элемент полностью разрушился вследствие аварии. Косметический ремонт возможен в редких случаях незначительных повреждений.В магазине JCB вы можете заказать не только сами запчасти, но и их установку, а также ремонт, диагностику и технический осмотр погрузчика.&lt;/p&gt;', '', 'Стекло двери верхнее правое старая модель JCB 827/20267', '', ''),
(569, 1, 'Стекло двери левое нижнее старая модель JCB 827/20264', '&lt;p&gt;Предлагаем вам приобрести запчасти для экскаватора JCB. В ассортименте представлено огромное количество разнообразных товаров от проверенных производителей со всего мира. В этом разделе вы можете заказать левое нижнее стекло двери на старую модель JCB 827/20264. Данный товар обладает высокой прочностью, надежностью и износостойкостью. Он необходим, если вы заметили нарушение целостности на аналогичном элементе вашего погрузчика. Если стекло на спецтехнике разбилось вдребезги, вам необходимо как можно скорее купить новое и заменить его. Использовать транспорт без такой детали небезопасно.&lt;/p&gt;', '', 'Стекло двери левое нижнее старая модель JCB 827/20264', '', ''),
(570, 1, 'Стекло заднее старая модель JCB 827/20263', '&lt;p&gt;В этом разделе представлено заднее стекло – старая модель JCB 827/20263. Данный товар отличается высоким качеством и прочностью. Стекла экскаваторов погрузчиков должны быть надежными и долговечными. Высококлассные изделия легко выносят удары камешками и гравием во время различных погрузочных и строительных работ. При повреждении они разбиваются вдребезги, а не идут небольшой трещиной. Заметив нарушение целостности стекла, вы можете попробовать заклеить деталь (это временная мера). Или же просто приобретите новую, выбрав ее из каталога запчастей спецтехники. Мастера установят элемент на ваш погрузчик.&lt;/p&gt;', '', 'Стекло заднее старая модель JCB 827/20263', '', ''),
(571, 1, 'ТНВД - Топливный Насос Высокого Давления на JCB 17/113100', '&lt;p&gt;Оригинальное название: Pump fuel injectionПредлагаем вам купить ТНВД на JCB 3CX. Это топливный насос высокого давления, который ответственен за транспортировку топлива в мотор. Данный элемент используется во всех видах двигателей. Он отличается прочностью и надежностью, высоким качеством и долговечностью, легкостью и компактностью. ТНВД фронтального погрузчика JCB 17/113100 создается из высококлассной стали с точнейшим соблюдением всех размеров.Все запчасти на экскаватор погрузчик JCB, представленные в нашем каталоге, доступны для заказа онлайн, оптом и в розницу. Продукцию можно приобрести с доставкой или забрать самовывозом.&lt;/p&gt;', '', 'ТНВД - Топливный Насос Высокого Давления на JCB 17/113100', '', ''),
(572, 1, 'ТНВД - Топливный Насос Высокого Давления на JCB 320/06924 - 68kw 12V', '&lt;p&gt;Топливный насос высокого давления 320/06924 JCB основной (ТНВД) для спецтехники JCB.Оригинальное название: FIP 68kW + ADV BOX C FIP 68kW + ADV BOX CАртикул: 320/06924Производительность: 68 кВтНапряжение: 12 ВПроизводитель: DELPHIТопливный насос высокого давления (ТНВД) предназначен для экскаваторов-погрузчиков JCB моделей 3СХ, 4СХ. Основная функция - впрыскивание горючего в двигатель. Технические характеристики: производительность 68kW, напряжение 12V. Наименование - Fuel injection pump. Производитель Delphi.В наличии деталь с каталожным номером 320/06924 для спецтехники британского производителя. Помпа производительна и отличается хорошим качеством. Вы можете купить ее на данной странице интернет-магазина или заказать самовывоз (адреса вы найдете в разделе «Контакты»).&lt;/p&gt;', '', 'ТНВД - Топливный Насос Высокого Давления на JCB 320/06924 - 68kw 12V', '', ''),
(573, 1, 'ТНВД Топливный Насос Высокого Давления на JCB 320/06927 - 63kw 12V', '&lt;p&gt;Топливный насос высокого давления JCB основной (ТНВД) для спецтехники JCBОригинальное название: Pump Fuel Injection, 63kWАртикул: 320/06927Производительность: 63 кВтНапряжение: 12 ВПроизводитель: DELPHIТопливный насос высокого давления основной (ТНВД) для установки на спецтехнику JCB. Основное назначение - подача горючей смеси к форсункам методом впрыска. Технические характеристики: производительность 63kW, напряжение 12V. Наименование - Fuel injection pump. Производитель Delphi.В магазине jcbprof представлена запчасть с артикулом 320/06927. Купите ее на сайте или закажите самовывоз из московского магазина. Мы не только реализуем детали для погрузчиков, но и можем установить их на собственной ремонтной базе или на вашем объекте. Звоните по указанному телефону - ответим на любые вопросы.&lt;/p&gt;', '', 'ТНВД Топливный Насос Высокого Давления на JCB 320/06927 - 63kw 12V', '', ''),
(574, 1, 'ТНВД - Топливный Насос Высокого Давления JCB 320/06929 - 68.6kw 12V', '&lt;p&gt;Оригинальное название: FUEL INJ. PUMP 68.6k FUEL INJECTION PUMPАртикул: 320/06929Производительность: 68,6 кВтНапряжение: 12 ВПроизводитель: DELPHIОригинальный топливный насос высокого давления основной (ТНВД) для экскаватора-погрузчика JCB 3CX, 4CX с двигателем Dieselmax, выпущенных в период с 2006 по 2017 год. Основная задача - подача горючего под высоким давлением на форсунки. Технические характеристики: производительность 68,6kW, напряжение 12V. Оригинальное наименование - Fuel injection pump. Производитель Delphi.Вы можете купить данную деталь с артикулом 320/06929. Возможна доставка в любой регион или самовывоз. Предлагаем установку запасных частей и обслуживание спецтехники. На все вопросы могут ответить наши менеджеры.&lt;/p&gt;', '', 'ТНВД - Топливный Насос Высокого Давления JCB 320/06929 - 68.6kw 12V', '', ''),
(575, 1, 'ТНВД - Топливный Насос Высокого Давления на JCB 320/06930 74.2kw 12V', '&lt;p&gt;Оригинальный топливный насос высокого давления JCB 320/06930 74.2kw 12V для двигателей JCB Dieselmax 2005-2017 г.в. Оригинальное название: Pump Fuel injection 74.2kАртикул: 320/06930Производительность: 74,2 кВтНапряжение: 12 ВПроизводитель: DELPHIВ каталоге запчастей JCB представлены товары, которые можно приобрести онлайн, как оптом, так и в розницу. Оригинальные и неоригинальные изделия имеют впечатляющее качество, подтвержденное международными сертификатами. Они изготовлены ведущими производителями.В этом разделе можно приобрести ТНВД JCB 320/06930 74.2kw 12V. Это основной топливный насос высокого давления, который используется для экскаваторов-погрузчиков моделей 3СХ и 4CX. Товар из интернета можно заказать в качестве запчасти для спецтехники, имеющей двигатели Dieselmaxx, выпущенные в период с 2006 по 2017 годы.&lt;/p&gt;', '', 'ТНВД - Топливный Насос Высокого Давления на JCB 320/06930 74.2kw 12V', '', ''),
(576, 1, 'ТНВД - Топливный Насос Высокого Давления JCB 320/06937 - 74kw 12V', '&lt;p&gt;Топливный насос высокого давления 320/06939 JCB основной (ТНВД) для спецтехники JCB.Оригинальное название: FIP 74kw TC 12V mT3 FIP 74kw TC 12V mT3Артикул: 320/06939Производительность: 74kwНапряжение: 12 ВПроизводитель: DELPHIТНВД JCB 320/06937 - 74kw 12V - это топливный насос высокого давления, представленный компанией-производителем JCB. Модель предназначена для нагнетания в систему топливной смеси под высоким давлением.Каталог запасных частей для погрузчика нашего интернет-магазина содержит полный спектр запчастей для JCB погрузчиков, экскаваторов и других специализированных машин. В том числе JCB 3CX, JCB 4CX, агрегатов сельскохозяйственного назначения, предназначенных для дорожно-ремонтных работ и т.д. У нас вы можете купить запчасти для JCB и детали для спецтехники по ценам от производителя.&lt;/p&gt;', '', 'ТНВД - Топливный Насос Высокого Давления JCB 320/06937 - 74kw 12V', '', ''),
(577, 1, 'ТНВД - Топливный Насос Высокого Давления JCB 320/06738 - 68,6kw 12V', '&lt;p&gt;Оригинальный топливный насос высокого давления 320/06938 JCB основной (ТНВД) для спецтехники JCB.Оригинальное название: Pump injection 68.6kw 12v T2Артикул: 320/06938Производительность: 68,6 кВтНапряжение: 12 ВПроизводитель: DELPHIПредлагаем вам купить ТНВД для погрузчика JCB. Это топливный насос высокого давления, благодаря которому происходит впрыск топлива в мотор. Элемент обладает сложной конструкцией и бывает рядным, распределительным и магистральным. Тип устройства влияет на особенности и принцип его работы.Все детали представленной в каталоге запчасти создаются из высококачественных компонентов, обладающих высокой точностью параметров. ТНВД JCB 320/06738 служит за счет поршня и цилиндра, которые плотно комбинируются друг с другом. Допускается лишь небольшая щель незначительных размеров.&lt;/p&gt;', '', 'ТНВД - Топливный Насос Высокого Давления JCB 320/06738 - 68,6kw 12V', '', ''),
(578, 1, 'ТНВД - Топливный Насос Высокого Давления JCB 320/06739 - 74.2kw 12V', '&lt;p&gt;Топливный насос высокого давления 320/06939 JCB основной (ТНВД) для спецтехники JCB.Оригинальное название: Pump injection 74.2kw 12v T2Артикул: 320/06939Производительность: 74.2 кВтНапряжение: 12 ВПроизводитель: DELPHIПредлагаем вам купить запчасти на спецтехнику в Москве. В нашем каталоге представлены различные товары от известных производителей со всего мира. Продукция доступна для заказа оптом и в розницу.В этом разделе вы найдете ТНВД SB JCB 320/06739 – топливный насос высокого давления. Он ответственен за впрыск топлива в мотор. Элемент компактен, прочен и надежен. ТНВД экскаватора обладает высоким качеством, долгим сроком службы и значительной производительностью. Изделие работает за счет плунжерной пары (плунжеры и цилиндра), созданной из высококлассной стали в точном соответствии размерам.&lt;/p&gt;', '', 'ТНВД - Топливный Насос Высокого Давления JCB 320/06739 - 74.2kw 12V', '', ''),
(579, 1, 'ТНВД - Топливный Насос Высокого Давления JCB 320/06742 - 74kw 12V', '&lt;p&gt;Топливный насос высокого давления 320/06742 JCB основной (ТНВД) для спецтехники JCB.Оригинальное название: Pump injection 74kw 12v mT3Артикул: 320/06742Производительность: 74.0 кВтНапряжение: 12 ВПроизводитель: DELPHIТНВД JCB 320/06742 - 74kw 12V - это топливный насос высокого давления, представленный компанией-производителем JCB. Модель предназначена для нагнетания в систему топливной смеси под высоким давлением.В каталоге нашего интернет-магазина вы можете найти полный спектр запчастей для экскаваторов JCB, погрузчиков и других специализированных машин. В том числе JCB 3CX, JCB 4CX, агрегатов сельскохозяйственного назначения, предназначенных для дорожно-ремонтных работ и т.д. В каталоге запчастей для спецтехники представлены товары по ценам от производителя.&lt;/p&gt;', '', 'ТНВД - Топливный Насос Высокого Давления JCB 320/06742 - 74kw 12V', '', ''),
(580, 1, 'ТНВД - Топливный Насос Высокого Давления JCB 320/06939 - 68.6kw 12V', '&lt;p&gt;Топливный насос высокого давления 320/06939 JCB основной (ТНВД) для спецтехники JCB.Оригинальное название: FUEL INJ. PUMP 68.6k FUEL INJECTION PUMPАртикул: 320/06939Производительность: 68,6 кВтНапряжение: 12 ВПроизводитель: DELPHIТНВД JCB 320/06939 - 68.6kw 12V – это топливный насос высокого давления, представленный компанией-производителем JCB. Модель предназначена для нагнетания в систему топливной смеси под высоким давлением.В каталоге нашего интернет-магазина вы можете найти полный спектр запчастей для JCB по ценам от производителя для погрузчиков, экскаваторов и других специализированных машин. В том числе JCB 3CX, JCB 4CX, агрегатов сельскохозяйственного назначения, предназначенных для дорожно-ремонтных работ и т.д. Мы реализуем только оригинальные детали для спецтехники.&lt;/p&gt;', '', 'ТНВД - Топливный Насос Высокого Давления JCB 320/06939 - 68.6kw 12V', '', ''),
(581, 1, 'ТНВД - Топливный Насос Высокого Давления JCB 320/06943 - 85kw 24V', '&lt;p&gt;Топливный насос высокого давления JCB основной (ТНВД) для экскаватора JCB.Оригинальное название: Pump Injection 85kW TCA 24V mT3Артикул: 320/06943Производительность: 85,0 кВтНапряжение: 24 ВПроизводитель: DELPHIТНВД JCB 320/06943 - 85kw 24V – это топливный насос высокого давления, представленный компанией-производителем JCB. Модель предназначена для нагнетания в систему топливной смеси под высоким давлением.В каталоге нашего интернет-магазина вы можете найти полный спектр запчастей для JCB погрузчиков, экскаваторов и других специализированных машин. В том числе JCB 3CX, JCB 4CX, агрегатов сельскохозяйственного назначения, предназначенных для дорожно-ремонтных работ и т.д. Мы реализуем детали для спецтехники по ценам от производителя.&lt;/p&gt;', '', 'ТНВД - Топливный Насос Высокого Давления JCB 320/06943 - 85kw 24V', '', ''),
(582, 1, 'Насос топливный электрический JCB 17/919300, 4132A018', '&lt;p&gt;Электрический топливный насос поставляется в сборе с фильтрующим картриджем. Оригинальное наименование - Electric fuel lift pump. Используется для перекачивания топлива из бака погрузчика к бензиновому двигателю внутреннего сгорания с системой распределенного впрыска горючего, поддерживает давление в системе питания. В продаже в интернет-магазине детали JCB со следующими артикулами: 4132A018, ULPK0038, 4226144M1, 4132A014, 3679527M1. Вы можете заказать подходящую запчасть, в случае необходимости менеджеры могут дать вам консультацию.&lt;/p&gt;', '', 'Насос топливный электрический JCB 17/919300, 4132A018', '', ''),
(583, 1, 'Электромагнитный клапан отсечки топлива ТНВД JCB 17/105201', '&lt;p&gt;Электромагнитный клапан отсечки топлива для топливного насоса высокого давления (ТНВД). Обеспечивает холодный пуск двигателя и бесперебойную подачу горючего. Оригинальное наименование - Solenoid ESOS. Предназначен для экскаваторов-погрузчиков JCB моделей 3CX, 4CX старых моделей, оснащенных двигателем Perkins и выпущенных в период с 1996 по 2005 годы.В продаже имеется запчасть с артикулом 17/105201. Вы можете купить этот соленоид с данной страницы, заполнив форму заказа, или позвонить менеджеру, чтобы узнать, есть ли эта деталь в магазине для самовывоза.&lt;/p&gt;', '', 'Электромагнитный клапан отсечки топлива ТНВД JCB 17/105201', '', ''),
(584, 1, 'Насос топливный электрический JCB 17/919300', '&lt;p&gt;Электрический топливный насос (большой) предназначен для подкачки топлива JCB 3СХ, 4СХ старого образца, оснащенных двигателем Perkins. Это топливоподкачивающий насос низкого давления (ТННД). Оригинальное наименование - Pump electric fuel lift filter assembly.В продаже в интернет-магазине представлены артикулы: 17/919300, 4132A018. В комплекте - фильтр-картридж для горючего. Вы можете заказать запасные части с доставкой в любой регион или запросить самовывоз и обратиться в один из наших фирменных магазинов в Москве.&lt;/p&gt;', '', 'Насос топливный электрический JCB 17/919300', '', ''),
(585, 1, 'Шланг топливный JCB 320/07052', '&lt;p&gt;Топливная трубка 320/07052 на быстросъемных клипсах от топливного фильтра тонкой очистки топлива к топливному насосу высокого давления (ТНВД) экскаватора-погрузчика JCB 3CX, JCB 4CX 2005 - 2017 года выпуска с двигателями SB DieselMax 444.Артикул: 320/07052Материал: термостойкий пластикВес: 0,3 кгХотите купить запчасти на экскаватор-погрузчик? Просмотрите наш каталог.В этом разделе представлен шланг топливный JCB 320/07052 – специальное резинотехническое изделие. Устройство крепится на быстросъемных клипсах и используется для транспортировки жидкости. Оно ведет от топливного фильтра тонкой очистки к насосу высокого давления (ТНВД). Деталь изготовлена из прочного пластика, который не боится высоких температур и длительной эксплуатации. Запчасть подходит на погрузчики JCB моделей 3СХ и 4СХ, выпущенных в период с 2005 по 2017 годы, оснащенных двигателями SB DieselMax 444.&lt;/p&gt;', '', 'Шланг топливный JCB 320/07052', '', ''),
(586, 1, 'Шланг топливный JCB 320/07059', '&lt;p&gt;Топливная трубка 320/07059 на быстросъемных клипсах от топливоподкачивающего ручного насоса низкого давления к фильтру тонкой очистки топлива экскаватора-погрузчика JCB 3CX, JCB 4CX 2005 - 2017 года выпуска с двигателями SB DieselMax 444.Артикул: 320/07059Материал: термостойкий пластикВес: 0,3 кгШланг топливный JCB 320/07059, представленный в этом разделе каталога запчастей для спецтехники, изготовлен из прочного и долговечного пластика, стойкого к перепадам температур. Он являет собой трубку на быстросъемных клипсах, которая ведет от топливоподкачивающего ручного насоса низкого давления к фильтру тонкой очистки жидкости.Такая запасная часть подходит для экскаваторов-погрузчиков JCB моделей 3СХ и 4СХ, выпущенных в период с 2005 по 2017 год, оснащенных двигателями SB DieselMax 444. Вес продукции – триста грамм. Возможна покупка оптом и в розницу, самовывозом и с доставкой.&lt;/p&gt;', '', 'Шланг топливный JCB 320/07059', '', ''),
(587, 1, 'Прокладка бака датчика топлива JCB 332/F7495', '&lt;p&gt;Прокладка топливного бака и датчика топлива JCB 332/F7495 являет собой круглые кольца с отверстиями для крепежа. Такие товары делаются из прочных и долговечных материалов черного цвета. Запчасти на экскаватор-погрузчик JCB обеспечивают герметичность данного механизма. Кроме того, они препятствуют проникновению лишней влаги и позволяют сохранять все швы чистыми и сухими.Каждая деталь для спецтехники, представленная в нашем каталоге, имеет международный сертификат, который подтверждает высокое качество продукции. У вас есть вопросы? Звоните менеджерам компании. Они помогут вам выбрать подходящие товары.&lt;/p&gt;', '', 'Прокладка бака датчика топлива JCB 332/F7495', '', ''),
(588, 1, 'Шланг топливный JCB 320/07087', '&lt;p&gt;Топливная трубка 320/07087 на быстросъемной клипсе от верхнего корпуса сепаратора фильтра грубой очистки топлива к топливному насосу высокого давления экскаватора-погрузчика JCB 3CX, JCB 4CX 2005 - 2017 года выпуска с двигателями SB DieselMax 444.Артикул: 320/07087Материал: термостойкий пластик с металлорезьбойВес: 0,7 кгВ каталоге запасных частей погрузчика вы найдете такой товар, как топливный шланг JCB 320/07087. Это специальная трубка на быстросъемной клипсе, сделанная из прочного и долговечного термостойкого пластика с металлической резьбой. Вес этого качественного резинотехнического изделия – семьсот грамм. Деталь ведет от верхнего корпуса сепаратора фильтра грубой очистки жидкости к топливному насосу высокого давления.Этот товар подойдет тем, кто ищет соответствующие запчасти для JCB 3CX и 4СХ в Москве, выпущенных в период с 2005 по 2017 годы, оснащенных двигателями SB DieselMax 444.&lt;/p&gt;', '', 'Шланг топливный JCB 320/07087', '', ''),
(589, 1, 'Топливный шланг JCB 649/51784', '&lt;p&gt;Топливный шланг JCB 649/51784, представленный в этом разделе, изготовлен из прочной, износостойкой резины. Он являет собой полую трубку с металлическими элементами для крепления на концах. Используется в таких запасных частях экскаватора из каталога, как в корпусах фильтра грубой очистки топлива. Он идет от топливного бака к верхнему сепаратору. Применяется в моделях 3СХ и 4СХ, дополненных моторами DieselMaxx, выпущенных в период с 2005 по 2017 годы.&lt;/p&gt;', '', 'Топливный шланг JCB 649/51784', '', ''),
(590, 1, 'Топливные трубки инжектора 1,2 JCB 320/06551', '&lt;p&gt;Материал: алюминийВ этом разделе представлены топливные трубки инжектора 1,2 JCB 320/06551. Они поставляются в количестве двух штук. Изготовлены из легкого и прочного алюминия. Подходят в качестве деталей погрузчика моделей 3СХ и 4СХ, выпущенных в период с 2005 по 2017 годы. Устанавливаются между топливным насосом высокого давления, а также форсунками первого и второго цилиндров моторов DieselMax. Форма изделий сложная, с изгибами, соответствует основной задаче и назначению. Два элемента соединены между собой.Оригинальное название товаров в каталоге запчастей JCB онлайн: Pipe fuel assembly No.1 &amp; 2 injectors.&lt;/p&gt;', '', 'Топливные трубки инжектора 1,2 JCB 320/06551', '', ''),
(591, 1, 'Топливный насос Perkins 334/D8880, ULPK0041, ULPK0038, 4132A018, 3860189', '&lt;p&gt;Электрический топливный насос 334/D8880, ULPK0041, ULPK0038, 4132A018, 3860189 для топливной аппаратуры двигателей Perkins.Оригинальное название: Pump electric fuel lift filter assemblyАртикул:  334/D8880, ULPK0041, ULPK0038, 4132A018, 3860189Назначение данного насоса - фильтрация топлива фильтром-картриджем и последующая непрерывная подача дизельного топлива в насос высокого давления и далее в ДВС. Электронасос 334/D8880 подключается к электросистеме техники, в верхней части корпуса предусмотрен разъем для соединения фишки. В комплектацию топливного насос входит топливный фильтрующий картридж, интервал замены которого около 500 м/ч (зависит от качества используемого топлива).&lt;/p&gt;', '', 'Топливный насос Perkins 334/D8880, ULPK0041, ULPK0038, 4132A018, 3860189', '', ''),
(592, 1, 'Насос топливный ручной подкачки нижний (аналог) JCB 320/07037, 320/07201, 320/07040, 320/A7161', '&lt;p&gt;Насос топливный ручной подкачки нижний (аналог) JCB 320/07037, 320/07201, 320/07040, 320/A7161. Топливный насос ручной подкачки горючего, нижний, нового образца, предназначен для машин JCB 3СХ и 4СХ серии SB, оснащенных двигателем Dieselmax и выпущенных в период с 2005 по 2017 год. Агрегат служит для вспомогательной подачи горючего в ручном режиме, обеспечивает стабильный запуск мотора даже после продолжительного простоя. Эффективен, предохраняет топливную систему машины от завоздушивания.В интернет-магазине jcbprof представлена помпа для спецтехники с артикулом 320/07037 (FLP). Вы можете заказать деталь с доставкой или самовывозом.&lt;/p&gt;', '', 'Насос топливный ручной подкачки нижний (аналог) JCB 320/07037, 320/07201, 320/07040, 320/A7161', '', ''),
(593, 1, 'Датчик уровня топлива JCB 716/30202', '&lt;p&gt;Датчик уровня топлива JCB 716/30202 – это механизм, который измеряет и контролирует количество различных специальных жидкостей. Конечная информация конвертируется в объем и передается на соответствующий экран или устройство. Датчик уровня топлива в баке представлен по приемлемой цене, указанной на странице товара. Он состоит из металлического стержня, который монтируют в топливную емкость через соответствующее отверстие. В результате датчик подключается к системе мониторов транспорта.Оригинальное название: Sensor fuel levelВ каталоге запасных частей JCB представлено огромное количество товаров – как оригинальных, так и неоригинальных.&lt;/p&gt;', '', 'Датчик уровня топлива JCB 716/30202', '', ''),
(594, 1, 'Топливные трубки инжектора 3,4 JCB 320/06554', '&lt;p&gt;Топливные трубки инжектора 3,4 JCB 320/06554 созданы из металла – легкого и прочного алюминия. Они поставляются парой. Такие изделия являются частью топливного насоса высокого давления, также они подключаются к форсункам третьего и четвертого цилиндров моторов DieselMax. Запчасти подходят для экскаваторов-погрузчиков моделей 3СХ и 4СХ, выпущенных в период с 2005 по 2017 годы. Они представляют собой изогнутые элементы специальной формы, скрепленные между собой.В онлайн-каталоге запчастей JCB такие товары можно найти и по оригинальному названию: Pipe fuel assembly No.3 &amp; 4 injectors.&lt;/p&gt;', '', 'Топливные трубки инжектора 3,4 JCB 320/06554', '', ''),
(595, 1, 'Стакан топливного фильтра (влагоотделителя) JCB 32/904709', '&lt;p&gt;Стакан топливного фильтра (влагоотделителя) JCB 32/904709 по своей форме действительно напоминает емкость для напитка. Необходимо регулярно осматривать его на предмет пыли, грязи и лишней влаги. Он требует замены из-за трещин и поломок, которые возникают вследствие механических воздействий – ударов, падения. В цену запчасти JCB не входит ее установка силами мастеров компании. Если вы хотите, чтобы специалисты заменили деталь, провели диагностику и технический осмотр, обращайтесь к менеджерам компании! Специалисты также помогут вам выбрать запасные части для экскаваторов.&lt;/p&gt;', '', 'Стакан топливного фильтра (влагоотделителя) JCB 32/904709', '', ''),
(596, 1, 'Корпус топливного фильтра в сборе (сепаратор) JCB 32/925914', '&lt;p&gt;Корпус топливного фильтра в сборе (сепаратор + отстойник) для спецтехники JCB моделей 3CX, 4CX, 2005-2015 годов выпуска с двигателем Dieselmax (не подходит для моделей с двигателем Perkins). Фильтр грубой очистки топлива (ФГОТ) в сборе с насосом подкачки и стаканом-отстойником предназначен для отделения воды и механических загрязнений в дизельном топливе. Датчик на стакане-отстойнике подает оповещающий звуковой сигнал при наполнении водой и грязью. Вы можете купить комплектующие в нашей компании с самовывозом в Москве или с доставкой, где бы вы ни находились. В продаже имеется артикул 32/925914.&lt;/p&gt;', '', 'Корпус топливного фильтра в сборе (сепаратор) JCB 32/925914', '', ''),
(597, 1, 'Корпус топливного фильтра в сборе с датчиком загрязнения JCB 32/925914', '&lt;p&gt;Корпус топливного фильтра в сборе с датчиком загрязнения предназначен для установки на JCB моделей 3СХ, 4СХ с двигателями Dieselmax Tier 2, 3, механический ТНВД серий SF, SD. Состоит из насоса подкачки, сепаратора, стакана-отстойника, датчика, соединения. Предназначен для очистки дизельного топлива экскаватора-погрузчика от воды и загрязняющих включений. Электронный сенсор, расположенный на стакане-отстойнике, при заполнении отстойника водой и загрязнениями подает звуковой сигнал. В нашем интернет-магазине представлена данная деталь с оригинальным номером 332/C7113.&lt;/p&gt;', '', 'Корпус топливного фильтра в сборе с датчиком загрязнения JCB 32/925914', '', ''),
(598, 1, 'Форсунка топливная JCB320/06835, 320/06528', '&lt;p&gt;Оригинальная топливная форсунка JCB 320/06835, 320/06835 для топливного насоса высокого давления экскаватора-погрузчика JCB 3CX, 4CX с двигателями JCB Dieselmax 2005-2017 г.в.Оригинальное название: Injector mT2 TCПроизводитель: DELPHIАртикул: 320/06835, 320/06835Вес: 0,7 кгФорсунка топливная JCB 320/06835, 320/06835, представленная в этом разделе, является частью системы впрыска топливной аппаратуры. Оригинальное название товара: Injector mT2 TC, Injector fuel assembly 74.5Kw. Его основная задача – дозированная подача топлива под высоким давлением и последующие распыление в камере сгорания, превращение в топливно-воздушную взвесь. Данная запчасть предназначена для спецтехники JCB, относится к оригинальным деталям топливной системы. Она поставляется в сборе с впресованным распылителем. Изделие соответствует моторам SB DieselMax 444, установленным в специальной технике моделей 3СХ и 4СХ, выпущенных в период с 2005 по 2017 годы.&lt;/p&gt;', '', 'Форсунка топливная JCB320/06835, 320/06528', '', ''),
(599, 1, 'Бак топливный пластиковый (новая модель) JCB 128/C1162', '&lt;p&gt;Бак топливный пластиковый (новая модель) JCB 128/C1162, представленный в этом разделе, подходит для экскаватора моделей 3СХ и 4СХ, выпущенные в период с 2010 по 2017 годы. Деталь погрузчика имеет специальную форму с удобной завинчивающейся крышкой. Конструкция позволяет расположить емкость в соответствующее пространство. В бак наливается необходимое топливо. Материал, использованный для изготовления – прочный пластик серебристого цвета.В каталоге запчастей JCB вы можете приобрести все товары онлайн, с оперативной доставкой на объект. Изделия представлены по приемлемым ценам.&lt;/p&gt;', '', 'Бак топливный пластиковый (новая модель) JCB 128/C1162', '', ''),
(600, 1, 'Насос топливный ручной подкачки нижний JCB 17/401800', '&lt;p&gt;Топливный насос ручной подкачки, нижний, предназначен для погрузчиков JCB 3CХ, 4СХ с дизельным турбированным двигателем Perkins, старых модификаций (до 2004 года выпуска). Подает горючее от фильтра к центральному ТНВД, обеспечивает быстрый запуск мотора. Оригинальное наименование - Pump fuel lift.В нашем каталоге данная запчасть представлена артикулами 17/913600, 17/401800. Реализуем товар оптом или в розницу. Для заказа добавьте позицию в корзину. Доставим деталь для вашей спецтехники в любой регион страны или обеспечим наличие в нашем магазине в Москве.&lt;/p&gt;', '', 'Насос топливный ручной подкачки нижний JCB 17/401800', '', ''),
(601, 1, 'Прокладка датчика уровня топлива на JCB 103/77101', 'Прокладка датчика уровня топлива на спецтехнику JCB. Артикул: 103/7710', '', 'Прокладка датчика уровня топлива на JCB 103/77101', '', ''),
(602, 1, 'Крышка топливного бака металлическая JCB 123/05892', '&lt;p&gt;Запорная крышка на металлический топливный бак подходит для моделей 3CX, 4CX старого образца, которые выпускались в период с 1998 по 2004 год. Оригинальное наименование производителя - Cap diesel filter, vented. В конструкции детали предусмотрено отверстие для ключа. Сама комплектующая поставляется без него. Чтобы открыть или закрыть крышку, можно использовать стандартный ключ для спецтехники JCB. В нашем интернет-магазине доступна данная запчасть с артикулом 123/05892, вы можете заказать ее на выгодных условиях.&lt;/p&gt;', '', 'Крышка топливного бака металлическая JCB 123/05892', '', ''),
(603, 1, 'Насос топливного фильтра в сборе с датчиком  JCB 32/925717', '&lt;p&gt;Предлагаем вам приобрести качественные детали для спецтехники онлайн, выбрав их из каталога запчастей JCB. Зарегистрируйтесь на сайте и добавляйте товары в Корзину. Если у вас возникли вопросы, свяжитесь с менеджерами компании. Они подробно ответят на все ваши вопросы, помогут оформить заказ на сайте и провести оплату.В этом разделе представлен насос топливный фильтра JCB 32/925717. Всасывающее устройство является частью элемента системы, которая очищает топливо от пыли, грязи, мусора и ржавчины. Его применение позволяет избежать создания пробок в трубках и засоров форсунок.&lt;/p&gt;', '', 'Насос топливного фильтра в сборе с датчиком  JCB 32/925717', '', ''),
(604, 1, 'Насос топливный подкачивающий на JCB 17/402100, 17/401700', 'Насос топливный подкачивающий на спецтехнику JCB. Производитель: FDR. Страна: Турция. Артикул: 17/402100, 17/401700', '', 'Насос топливный подкачивающий на JCB 17/402100, 17/401700', '', ''),
(605, 1, 'Крышка топливного бака 332/F4780, 333/C0880, 331/11403', '&lt;p&gt;Крышка топливного бака 332/F4780, 333/C0880, 331/11403, представленная в этом разделе, изготовлена из прочного и долговечного материала. Она выдерживает множество открытий и закрытий с помощью ключа. Форма специальная, удобная для удерживания в руках. Деталь дополнена цепочкой с кольцом, позволяющей не потерять крышку. Изделие можно заказать в каталоге запчастей спецтехники онлайн. Такой товар приобретается в случае поломки центрального отверстия для ключа или потери.Хотите приобрести запчасти на погрузчик JCB? Регистрируйтесь на сайте, добавляйте продукцию в Корзину и оформляйте покупку.&lt;/p&gt;', '', 'Крышка топливного бака 332/F4780, 333/C0880, 331/11403', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(606, 1, 'Датчик уровня топлива JCB 704/50098', '&lt;p&gt;Датчик уровня топлива JCB 704/50098 предназначен для замены аналогичной детали в экскаваторах погрузчиках JCB разных модификаций. Изделие предназначено для контроля количества и расхода топлива, изготовлена из инновационных материалов и полностью соответствует всем заявленным стандартам качества.В каталоге запасных частей экскаватора JCB представлен обширный спектр оригинальных деталей от производителя. Наш магазин JCB-запчастей реализует только качественные, сертифицированные товары, соответствующие международным требованиям и указанным характеристикам, сопровождаемых гарантийными обязательствами.&lt;/p&gt;', '', 'Датчик уровня топлива JCB 704/50098', '', ''),
(607, 1, 'Стакан отстойник топливный с JCB 32/925708', '&lt;p&gt;Стакан-отстойник топливного фильтра грубой очистки с датчиком загрязнения предназначен для отделения воды и механических примесей в топливе. Оригинальное наименование комплектующей - Bowl assembly. Выполнен из прочного стекла. Устанавливается на фильтры спецтехники JCB моделей 3CX и 4CX нового образца (выпущенных с 2005 года), серии JS.На данной странице вы можете купить эту деталь для JCB по выгодной цене, с гарантией. В наличии комплектующая с артикулом 32/925708. Закажите ее по Интернету с доставкой или запросите самовывоз из наших торговых точек в Москве.&lt;/p&gt;', '', 'Стакан отстойник топливный с JCB 32/925708', '', ''),
(608, 1, 'Бак топливный пластиковый с датчиком уровня топлива и запорной крышкой 128/E5189', '&lt;p&gt;Пластиковый топливный бак с датчиком уровня топлива на экскаватор-погрузчик 3CX, 3СХ Super, 4CX новых моделей, выпущенных в период с 2010 по 2017 год.&lt;/p&gt;&lt;p&gt;Оригинальное наименование - Tank diesel, ABI plastic. Емкость составляет 160 литров. Снабжен запорной крышкой, которая открывается стандартным ключом JCB. Преимущество по сравнению с металлическим - нет коррозионных частиц, которые могут засорить горючее и топливную систему.&lt;/p&gt;&lt;p&gt;В продаже имеются артикулы 128/E5189, 128/C2000. Если нужно, мы готовы проконсультировать вас по телефону, указанному на сайте.&lt;/p&gt;', '', 'Бак топливный пластиковый с датчиком уровня топлива и запорной крышкой 128/E5189', '', ''),
(609, 1, 'Крышка топливного бака на JCB 331/45908, 331/33064, 331/26782', 'Крышка топливного бака на спецтехнику JCB 3CX, 4CX. Артикул: 331/45908, 331/33064, 331/26782', '', 'Крышка топливного бака на JCB 331/45908, 331/33064, 331/26782', '', ''),
(610, 1, 'Уплотнительное кольцо насоса ТННД 320/07051', '&lt;p&gt;Уплотнительное кольцо насоса ТННД 320/07051, 320/A7112, представленное в этом разделе, является простым, но эффективным элементом крепежа. Оно изготовлено из прочной, гибкой и износостойкой резины. Такие запасные части JCB монтируются в подготовленную щель топливного насоса ручной подкачки(низкого давления). Для максимально плотной фиксации он прижимается тремя болтами к блоку мотора. Используется на моделях 3СХ и 4СХ для двигателей DieselMax, выпущенных в период с 2005 по 2017 годы.Чтобы купить запчасти на экскаватор-погрузчик, добавьте товар в Корзину и оформите заказ. Чтобы задать вопросы, закажите обратный звонок в удобное вам время.&lt;/p&gt;', '', 'Уплотнительное кольцо насоса ТННД 320/07051', '', ''),
(611, 1, 'Клипса обратки форсунки JCB 320/07189', '&lt;p&gt;Клипса обратки форсунки JCB 320/07189A, представленная в этом разделе, поставляется комплектом из четырех человек. Такие детали погрузчика создаются из прочного и износостойкого материала черного цвета. Они представляют собой полукольцо. Этот зажим формируется и удерживается благодаря пластической деформации материала.Цены на запчасти JCB указаны на странице товара за единицу или за комплект, как в данном случае. Продукция обладает великолепным качеством, которое подтверждено международными сертификатами. В ассортименте вы найдете и оригинальные, неоригинальные товары от сторонних производителей.&lt;/p&gt;', '', 'Клипса обратки форсунки JCB 320/07189', '', ''),
(612, 1, 'Насос топливный бака JCB 20/925661', '&lt;p&gt;В каталоге запчастей экскаватора JCB вы найдете высококлассные детали погрузчика, как оригинальные, так и от сторонних производителей. Все товары имеют международные сертификаты качества и гарантию. Приобрести их можно оптом и в розницу, с оперативной доставкой или самовывозом. В данном разделе для заказа доступен насос топливный бака JCB 20/925661. Он имеет качающую функцию, призван перегонять топливо из одной части системы в другую. Товар совместим с моделями английского экскаватора-погрузчика 3СХ и 4СХ. Его также можно найти по оригинальному названию: Pump refuelling non-auto shutoff.&lt;/p&gt;', '', 'Насос топливный бака JCB 20/925661', '', ''),
(613, 1, 'Съемник для снятия ТНВД JCB 892/01154', '&lt;p&gt;Съемник для снятия ТНВД JCB 892/01154 – это специальное приспособление, с помощью которого демонтируют топливный насос высокого давления. Также оно используется для монтажа соответствующей аппаратуры. Главная особенность такой запчасти для экскаваторов JCB – специальная форма с шестигранной рукояткой и особой внутренней поверхностью, захватывающей насос. Такие детали для спецтехники делаются из качественного и прочного материала. В данном случае, это металл. Их можно купить один раз и использовать в дальнейшем годами. Они просты в применении, эффективны, удобны, компактны.&lt;/p&gt;', '', 'Съемник для снятия ТНВД JCB 892/01154', '', ''),
(614, 1, 'Съемник для снятия ТНВД JCB 892/01155', '&lt;p&gt;Съемник для ТНВД JCB 892/01155 является специальным приспособлением для снятия топливного насоса высокого давления. Он понадобится вам, если вы хотите перебрать, заменить или отсоединить устройство, отвечающее за впрыскивание топлива в дизельный двигатель. В каталоге запчастей спецтехники вы найдете множество оригинальных и неоригинальных товаров от проверенных производителей. Также вы можете заказать оперативную установку или замену выбранной запчасти JCB в Москве. Мастера нашей компании быстро произведут ремонт или диагностику погрузчика, проведут технический осмотр.&lt;/p&gt;', '', 'Съемник для снятия ТНВД JCB 892/01155', '', ''),
(615, 1, 'Насос топливный ручной подкачки JCB 17/913600', '&lt;p&gt;Насос топливный ручной подкачки нижний (топливная помпа) 17/913600, 17/401800 для экскаватора-погрузчика JCB 3CX, JCB 4CX старых модификаций с двигателем Perkins.Назначение: подача топлива от топливного фильтра к ТНВДАртикул: 17/913600, 17/401800Оригинальное название: Pump fuel liftПрименение: дизельные турбированные двигатели Perkins серии AA, AB, AK, AR, RGДанная запчасть представляет собой небольшой подкачивающий насос для ручной подачи топлива и крепится к блоку двигателя четырьмя болтами - прижимающими прокладку-диафрагму, которая отвечает за герметизацию. Топливная помпа 17/913600, 17/401800 устанавливалась только на экскаваторы-погрузчики JCB моделей до 2004 года выпуска.Насос топливный ручной подкачки JCB 17/401800 считается востребованной сменной запчастью для погрузчиков JCB. Агрегат предназначен для подкачки топлива к центральному насосу высокого давления. В каталоге запасных частей экскаваторов JCB 3сх и JCB 4CX он представлен, как деталь, одинаково подходящая для обеих моделей данной техники.К преимуществам топливного насоса данной серии относятся:быстрый запуск мотораускорение запуска двигателяобеспечение равнозавоздушивания системыстабильная работа погрузчиков на любых режимах.Купить запчасти на экскаватор-погрузчик можно в нашем интернет-магазине Москвы.&lt;/p&gt;', '', 'Насос топливный ручной подкачки JCB 17/913600', '', ''),
(616, 1, 'Электромагнитный клапан Perkins ТНВД 283/63771', '&lt;p&gt;Оригинальное название: Solenoid E.S.O.SАртикул Perkins: 28363771, 26420472, 718900TАртикул JCB: 17/105201Электромагнитный клапан Delphi на ТНВД для экскаваторов-погрузчиков, оснащенных двигателем Perkins. Основная задача - отключение (прерывание) подачи горючего на основной топливный насос. Оригинальное наименование - Solenoid E.S.O.S.В продаже имеются детали с артикулом JCB 17/105201 (артикулы «Перкинс» - 28363771, 26420472, 718900T). Они изготовлены в соответствии с международными требованиями к безопасности и качеству. Вы можете заказать доставку или запросить наличие в нашем магазине в Москве (смотрите раздел «Контакты»).&lt;/p&gt;', '', 'Электромагнитный клапан Perkins ТНВД 283/63771', '', ''),
(617, 1, 'Насос топливный электрический Perkins 17/927800, 17/919301', '&lt;p&gt;Топливный электрический насос Perkins предназначен для подкачки топлива. Оригинальное наименование - Electric fuel lift pump filter assembly, то есть поставляемый в сборе с фильтром. Модель изготовлена из инновационных материалов, полностью соответствует установленным международным стандартам качества. Подходит для JCB 3CX, 4CX.В нашем интернет-магазине имеется данная деталь с артикулами 17/927800, 17/919301. Предлагаем надежные запчасти для вашей спецтехники, которые позволят быстро провести ремонт и избежать простоев. На все комплектующие дается гарантия.&lt;/p&gt;', '', 'Насос топливный электрический Perkins 17/927800, 17/919301', '', ''),
(618, 1, 'Электропривод топливного фильтра (сепаратор) без фильтра и отстойника на JCB 32/925765', 'Электропривод топливного фильтра (сепаратор) без фильтра и отстойника на спецтехнику JCB. Производитель: FDR. Страна: Турция. Артикул: 32/925765', '', 'Электропривод топливного фильтра (сепаратор) без фильтра и отстойника на JCB 32/925765', '', ''),
