(621, 1, 'Корпус топливного фильтра в сборе FDR с электрическим приводом на JCB 320/07458, 320/07457', 'Корпус топливного фильтра в сборе FDR с электрическим приводом на спецтехнику JCB. Производитель: FDR. Страна: Турция. Артикул: 320/07458, 320/07457', '', 'Корпус топливного фильтра в сборе FDR с электрическим приводом на JCB 320/07458, 320/07457', '', ''),
(622, 1, 'Корпус топливного фильтра (сепаратор) с фильтром и отстойником, без датчика на JCB 32/925765', 'Корпус топливного фильтра (сепаратор) с фильтром и отстойником, без датчика на спецтехнику JCB. Производитель: FDR. Страна: Турция. Артикул: 32/925765', '', 'Корпус топливного фильтра (сепаратор) с фильтром и отстойником, без датчика на JCB 32/925765', '', ''),
