(626, 1, 'Топливный шланг L=2441mm на JCB 332/G6520', 'Топливный шланг L=1324mm на спецтехнику JCB. Артикул: 332/G652', '', 'Топливный шланг L=2441mm на JCB 332/G6520', '', ''),
