(628, 1, 'ТНВД - Топливный насос высокого давления 9323A350G на JCB 17/922100', 'ТНВД - Топливный насос высокого давления 9323A350G двиг. Perkins  на JCB 3CX, 4CX. Артикул: 17/92210', '', 'ТНВД - Топливный насос высокого давления 9323A350G на JCB 17/922100', '', ''),
