(632, 1, 'Топливный насос высокого давления - ТНВД PERKINS 8923A952G, 2644F041NG, 10160HWG', '&lt;p&gt;&lt;b&gt;Топливный насос высокого давления - ТНВД PERKINS 8923A952G, 2644F041NG, 10160HWG&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 8923A952G, 2644F041NG, 10160HWG&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Made in United Kingdom&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Производитель:&lt;/b&gt; DELPHI &lt;/p&gt;', '', 'Топливный насос высокого давления - ТНВД PERKINS 8923A952G, 2644F041NG, 10160HWG', '', ''),
(633, 1, 'Тросик газа JCB 910/60178', '&lt;p&gt;&lt;b&gt;Тросик газа JCB 910/60178&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 910/60178&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Тросик газа JCB 910/60178', '', ''),
(634, 1, 'Трос газа JCB 910/60236', '&lt;p&gt;&lt;b&gt;Трос газа JCB 910/60236&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 910/60236&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Трос газа JCB 910/60236', '', ''),
(635, 1, 'Электромагнитный клапан отсечки топлива ТНВД 716/30255, 716/30098', '&lt;p&gt;&lt;b&gt;Электромагнитный клапан отсечки топлива ТНВД 716/30255&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 716/30255, 716/30098&lt;/&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;&lt;p&gt;&lt;b&gt;Производитель:&lt;/b&gt; TOR &lt;/p&gt;', '', 'Электромагнитный клапан отсечки топлива ТНВД 716/30255, 716/30098', '', ''),
(636, 1, 'Пробка сливная JCB 816/80012', '&lt;p&gt;&lt;b&gt;Пробка сливная JCB 816/80012&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 816/80012&lt;/&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p', '', 'Пробка сливная JCB 816/80012', '', ''),
(637, 1, 'Турбина JCB двигатель DIESELMAX  оригинал 320/06159', '&lt;p&gt;Турбокомпрессор (турбина) для JCB 3CX, JCB 3CX Super, JCB 4CX на двигатели последнего поколения SB DIESELMAX 444.Артикул: 320/06159, 320/04047, 320/06016Турбина на экскаватор JCB марки 320/06159 – неотъемлемая часть системы транспорта специального назначения. Её главная задача – это увеличение мощности четырёхцилиндрового дизельного двигателя Dieselmax. Деталь изготовляется по уникальным технологиям с использованием высококачественных материалов.Турбина на JCB 3CX/4CX имеет рабочий объем 4,4 литра и мощность 68 кВт. При должном уходе и соблюдении правил эксплуатации она прослужит длительный срок. Также изделие отвечает экологическому стандарту EPA. У нас в интернет-магазине представлена турбина для JCB 3CX, цена на которую выгодна и доступна каждому покупателю.&lt;/p&gt;', '', 'Турбина JCB двигатель DIESELMAX  оригинал 320/06159', '', ''),
(638, 1, 'Турбина двигателя для JCB (PERKINS) 02/200460, 02/200880, 2674A394', 'Турбина двигателя PERKINS на JCB: 3CX и 4CX 02/200460, 02/200880, 2674A394', '', 'Турбина двигателя для JCB (PERKINS) 02/200460, 02/200880, 2674A394', '', ''),
(639, 1, 'Турбокомпрессор Perkins оригинал для JCB 2674A226, 2674A816', 'Турбокомпрессор Perkins оригинал для JCB 2674A226, 2674A81', '', 'Турбокомпрессор Perkins оригинал для JCB 2674A226, 2674A816', '', ''),
(640, 1, 'Турбина на двигатель ДЛЯ JCB 320/06047 (DIESELMAX)', 'Турбина на двигатель аналог от DIESELMAX 320/0604', '', 'Турбина на двигатель ДЛЯ JCB 320/06047 (DIESELMAX)', '', ''),
(641, 1, 'Турбина на двигатель для JCB 02/203160 (PERKINS)', 'Турбина на двигатель для JCB оригинал от PERKINS. Тип двигателя - RG. Артикулы: 02/203160, 2674A14', '', 'Турбина на двигатель для JCB 02/203160 (PERKINS)', '', ''),
(642, 1, 'Турбина JCB двигатель PERKINS AK  оригинал  02/202415', '&lt;p&gt;Оригинальный турбокомпрессор на экскаватор-погрузчик JCB 3CX, JCB 4CX старая модель до 2005 года выпуска с двигателем Perkins AK 02/202415.Производитель: GARRETTТурбокомпрессор JCB на двигатель Perkins – необходимая деталь для мощной и эффективной работы спецтехники. Она выпускается под маркой AK 02/202415 для экскаваторов-погрузчиков моделей 3CX/4CX.Турбины для спецтехники имеют функциональную конструкцию, элементы которой выполнены на современном оборудовании с использованием высококачественного материала. Преждевременная замена детали позволит предотвратить утечку масла или чрезмерные его перерасход, а также потерю мощности двигателя или появление шума. Купить турбокомпрессоры на экскаватор торговой марки JCB вы можете на нашем оптово-розничном онлайн-портале.&lt;/p&gt;', '', 'Турбина JCB двигатель PERKINS AK  оригинал  02/202415', '', ''),
(643, 1, 'Фланец турбины на двигатель Perkins АB JCB 02/200503, 3347A013', '&lt;p&gt;&lt;b&gt;Фланец турбины на двигатель Perkins АB JCB.&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Артикул:&lt;/b&gt; 02/200503, 3347A013&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-производитель:&lt;/b&gt; Турция&lt;/p&gt;', '', 'Фланец турбины на двигатель Perkins АB JCB 02/200503, 3347A013', '', ''),
(644, 1, 'Глушитель (резонатор) JCB 331/52383', '&lt;p&gt;Глушитель (резонатор) JCB 331/52383.&lt;/p&gt;', '', 'Глушитель (резонатор) JCB 331/52383', '', ''),
(645, 1, 'Глушитель (резонатор) JCB 331/50774', '&lt;p&gt;Глушитель (резонатор) JCB 331/50774.&lt;/p&gt;', '', 'Глушитель (резонатор) JCB 331/50774', '', ''),
(646, 1, 'Глушитель (резонатор) JCB 903/66300', '&lt;p&gt;Глушитель (резонатор) JCB 993/66300, представленный в этом разделе, обладает высоким качеством. Он не боится коррозии, долго служит, не подвержен износу, надежен и прочен. Легко переносит постоянный контакт с грязью и водой, раскаленным воздухом и высокими температурами. Главная задача данного приспособления – уменьшать уровень шума от газов, которые вырываются из устройства погрузчика.Цена резонатора/глушителя зависит от количества заказанного вами товара. Вы можете купить запчасти на погрузчик оптом и в розницу, с доставкой на дом или самовывозом из магазинов в столице&lt;/p&gt;', '', 'Глушитель (резонатор) JCB 903/66300', '', ''),
(647, 1, 'Глушитель (резонатор) JCB 331/40186', '&lt;p&gt;Предлагаем вам приобрести глушитель на JCB 3CX. Это качественное изделие от проверенного производителя, которое снизит уровень шума от переработанных газов, вырывающихся во время работы мотора. Глушитель (резонатор) JCB 331/40186 представляет собой металлическую камеру, к которой подсоединяется пламегаситель, выхлопная и приемная трубы. Он выдерживает работу при очень высокой температуре, постоянный контакт с водой и грязью, раскаленный пульсирующий поток газов с внутренней стороны.Чтобы приобрести запчасти JCB оптом, добавьте выбранный товар в Корзину в нужном количестве.&lt;/p&gt;', '', 'Глушитель (резонатор) JCB 331/40186', '', ''),
(648, 1, 'Глушитель (резонатор) JCB 331/148161', '&lt;p&gt;В этом разделе представлен глушитель (резонатор) JCB 331/148161. Данное приспособление позволяет эффективно уменьшать уровень шума от газов, которые выходят в процессе работы экскаватора. Глушитель на погрузчик должен быть качественным и прочным. Важно, чтобы он был сделан из высококлассного и долговечного материала, не подверженного коррозии. Изделие выдерживает большие нагрузки и значительные температуры.Цена на запчасти JCB зависит от количества выбранного вами товара. Вы можете приобрести нашу продукцию оптом и в розницу, с доставкой или самовывозом из магазинов в столице.&lt;/p&gt;', '', 'Глушитель (резонатор) JCB 331/148161', '', ''),
(649, 1, 'Глушитель (резонатор) АВ JCB 123/03963', '&lt;p&gt;В каталоге запчастей JCB вы можете приобрести онлайн глушитель на погрузчик и другие детали от известных производителей. В ассортименте и оригинальные, и неоригинальные товары от проверенных и надежных брендов.Глушитель (резонатор) АВ JCB 123/03963 является приспособлением, которое снижает шум газов, выходящих в атмосферу из устройств специальной техники. Оно состоит из приемных и выхлопной труб, а также пламегасителя. Иногда конструкция включает в себя гофру, каталитический нейтрализатор и другие элементы. Все детали обладают высоким качеством, прочностью и износостойкостью.&lt;/p&gt;', '', 'Глушитель (резонатор) АВ JCB 123/03963', '', ''),
(650, 1, 'Глушитель (резонатор) RG JCB 331/35702', '&lt;p&gt;Предлагаем вам приобрести запчасти на экскаватор-погрузчик JCB. В ассортименте вы найдете и оригинальные компоненты для спецтехники, и произведенные сторонними компаниями со всего мира.В этом разделе представлен глушитель (резонатор) RG JCB 331/35702. Главная задача такого приспособления – снижать уровень шума от вырывающихся из автомобиля газов. Глушитель экскаватора должен быть качественным и надежным. Он должен выносить серьезные нагрузки – воздействие воды, грязи, раскаленного потока воздуха, высоких температур. Важно, чтобы этот элемент делался из долговечной стали.&lt;/p&gt;', '', 'Глушитель (резонатор) RG JCB 331/35702', '', ''),
(651, 1, 'Глушитель (резонатор) JCB 123/03222', '&lt;p&gt;В этом разделе представлен глушитель (резонатор) JCB 123/03222. Это приспособление используется для уменьшения уровня шума от газов, которые выходят в атмосферу из автомобиля. Глушитель JCB также соединяется с приемной трубой, пламегасителем и выхлопной трубой. Он создается из прочной и долговечной стали, которая может выдержать серьезные нагрузки. Данный компонент вынужден выносить высокие температуры, воздействие воды, грязи, раскаленных пульсирующих газов. Имеется высокий риск коррозии. Поэтому важно выбирать качественные товары из проверенного каталога запчастей для спецтехники.&lt;/p&gt;', '', 'Глушитель (резонатор) JCB 123/03222', '', ''),
(652, 1, 'Глушитель (резонатор) JCB 128/H2997, 128/C2478', '&lt;p&gt;Глушитель (резонатор) JCB 128/H2997, 128/C2478 для выхлопной системы двигателя экскаватора-погрузчика JCB.&lt;/p&gt;&lt;p&gt;Оригинальное название: Silencer Exhaust Box 240 X 150mm.&lt;/p&gt;&lt;p&gt;Артикул: 128/H2997, 128/С2478.&lt;/p&gt;', '', 'Глушитель (резонатор) JCB 128/H2997, 128/C2478', '', ''),
(653, 1, 'Глушитель (резонатор) на DIESELMAX АВ JCB 123/06406', '&lt;p&gt;&lt;b&gt;Глушитель (резонатор) на DIESELMAX АВ JCB 123/06406&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 123/06406&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Глушитель (резонатор) на DIESELMAX АВ JCB 123/06406', '', ''),
(654, 1, 'Глушитель (труба) JCB 331/38960', '&lt;p&gt;&lt;b&gt;Глушитель (труба) JCB 331/38960&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 331/38960&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Глушитель (труба) JCB 331/38960', '', ''),
(655, 1, 'Гидротрансформатор JCB 04/501400', '&lt;p&gt;Предлагаем вам приобрести качественные запчасти для погрузчиков в Москве. Покупатели обычно заказывают оперативную доставку товаров на дом, а жители столицы могут забрать покупку самовывозом из наших магазинов.В этом разделе представлен гидротрансформатор JCB 04/501400. Это устройство, используемое во многих видах транспорта. С его помощью крутящий момент транспортируется от мотора внутреннего сгорания к планетарной коробке передач. Также он трансформируется необходимым образом (бесступенчато) и позволяет изменять параметры вращения, которые отправляются на ведомые валы&lt;/p&gt;', '', 'Гидротрансформатор JCB 04/501400', '', ''),
(656, 1, 'Гидротрансформатор для JCB 04/600650 (PERKINS)', 'Гидротрансформатор для JCB от фирмы PERKINS 04/600650', '', 'Гидротрансформатор для JCB 04/600650 (PERKINS)', '', ''),
(657, 1, 'Гидротрансформатор JCB 04/600786', '&lt;p&gt;Если вы ищете запчасти для JCB 3CX и вас интересуют цены на них, загляните в наш каталог. В ассортименте вы найдете множество деталей от сторонних производителей, завоевавших доверие покупателей со всего мира. Также есть большое количество оригинальных товаров.В этом разделе представлен гидротрансформатор JCB 04/600786. Он состоит из нескольких частей – двух колес (насосного и турбинного), реактора и блокировочного механизма. Внутри он заполнен маслом. Такая запчасть двигателя погрузчика используется для транспортировки и превращения крутящего момента от мотора к коробке передач.&lt;/p&gt;', '', 'Гидротрансформатор JCB 04/600786', '', ''),
(658, 1, 'Диск (04/501700) гидротрансформатора', '&lt;p&gt;Диск гидротрансформатора JCB 04/501700.&lt;/p&gt;', '', 'Диск (04/501700) гидротрансформатора', '', ''),
(659, 1, 'Диск (04/500300А) гидротрансформатора', '&lt;p&gt;Диск гидротрансформатора JCB 04/500300А.&lt;/p&gt;', '', 'Диск (04/500300А) гидротрансформатора', '', ''),
(660, 1, 'Гидротрансформатор JCB оригинал 04/500100', '&lt;p&gt;Гидротрансформатор JCB оригинал 04/500100.&lt;/p&gt;', '', 'Гидротрансформатор JCB оригинал 04/500100', '', ''),
(661, 1, 'Диск гидротрансформатора КПП JCB 04/600136, 04/600864', '&lt;p&gt;&lt;b&gt;Диск гидротрансформатора КПП JCB 04/600136, 04/600864&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 04/600136, 04/600864&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Диск гидротрансформатора КПП JCB 04/600136, 04/600864', '', ''),
(662, 1, 'Насос масляный двигателя JCB 02/201050', '&lt;p&gt;Насос масляный 02/201050 старого образца на двигатель Perkins AK, AB экскаватора-погрузчика JCB 3CX, JCB 4CXОрригинальное название: Pump oilАртикул: 02/201050, 4132F056, 930-366Масляный насос двигателя JCB 02/201050 – оригинальная деталь для качественной и производительной работы системы подачи масла. Она совместима с двигателями Perkins AK, AB спецтехники моделей 3CX/4CX. На нашем сайте купить масляный насос JCB можно оптом и в розницу.В каталоге вы не встретите аналогов, ведь здесь собрана только сертифицированная продукция от известных производителей. Механизм 02/201050 обеспечит полноценную подачу смазочного вещества к подвижным узлам, тем самым снизив трение между элементами и предотвратив их износ. У нас на масляный насос цена выгодная и конкурентоспособная.&lt;/p&gt;', '', 'Насос масляный двигателя JCB 02/201050', '', ''),
(663, 1, 'Насос масляный двигателя ORIGINAL Perkins RG JCB 02/202485', '&lt;p&gt;Насос масляный двигателя ORIGINAL Perkins RG JCB 02/202485, представленный в этом разделе, используется для переведения масла в специальный бак из емкости картера. Впрыск происходит во время работы механизма. Такие запасные части для экскаваторов применяются для смазывания двигающих деталей и подъема давления во внутренней системе.В ассортименте вы найдете и оригинальные, и неоригинальные изделия высокого качества. Все они отличаются значительной надежностью, впечатляющей прочностью и долговечностью. Цены на запчасти JCB 3CX указаны за единицу. Вы можете приобрести товары онлайн, оптом и в розницу.&lt;/p&gt;', '', 'Насос масляный двигателя ORIGINAL Perkins RG JCB 02/202485', '', ''),
(664, 1, 'Насос вакуумный JCB 15/920000', '&lt;p&gt;В этом разделе представлен вакуумный насос старой модели JCB 15/920000. Данное устройство предназначено для полного удаления газов и из замкнутого бака. В результате в емкости получается вакуум. Такая запасная часть дополнена эксцентрично установленным ротором. В нем непрерывно передвигается лопасть из пластмассы, которая делит полость на две части.Чтобы заказать этот товар, оформите покупку онлайн. Забрать ее можно самовывозом или получить доставкой. Для клиентов, решивших приобрести запчасти JCB в Москве оптом, мы подготовили особые условия и скидки. Подробности узнавайте у наших менеджеров.&lt;/p&gt;', '', 'Насос вакуумный JCB 15/920000', '', ''),
(665, 1, 'Насос масляный на двигателя для JCB 320/04186', 'Насос масляный на двигатель для JCB: 320/04186, 320/0430', '', 'Насос масляный на двигателя для JCB 320/04186', '', ''),
(666, 1, 'Насос вакуумный JCB 160/16357', '&lt;p&gt;Интересуют запасные части JCB по приемлемым ценам? Загляните в наш каталог. Если у вас возникли вопросы, задайте их специалистам нашей компании. Они проконсультируют по всей представленной на сайте продукции и помогут оформить покупку.В этом разделе вы найдете насос вакуумный JCB 160/16357 нового образца. Он является важной деталью экскаватора модели 3CX и 4CX. Основная функция устройства – это циркуляция охлаждающей жидкости по всей системе охлаждения. Когда вода проходит по полному кругу, она приобретает способность снижать температуру прочих элементов специальной техники.&lt;/p&gt;', '', 'Насос вакуумный JCB 160/16357', '', ''),
(667, 1, 'Насос вакуумный SB JCB 160/15137', '&lt;p&gt;Мы подготовили для вас впечатляющий каталог запасных частей для погрузчиков. В продаже вы найдете как оригинальные товары, так и неоригинальные, созданные надежными сторонними производителями.На этой странице вы можете приобрести онлайн вакуумный насос SB JCB 160/15137. Это важная часть охлаждающей системы, которая предназначена для снижения температуры жидкости, циркулирующей по устройству. Когда она проходит полный круг, то охлаждается настолько, что может повлиять на нагретость других деталей JCB. Устройство состоит из корпуса, вала, шариковых подшипников и приводного шкива.&lt;/p&gt;', '', 'Насос вакуумный SB JCB 160/15137', '', ''),
(668, 1, 'Насос масляный двигателя SB JCB 320/04300', '&lt;p&gt;Насос масляный двигателя Dieselmax JCB 320/04300Представляем вам обширный каталог запчастей JCB, в котором все детали можно заказать онлайн, оптом и в розницу. Возможна оперативная доставка по столице и в другие города страны. Для жителей Москвы предлагаем самовывоз из наших магазинов.В данном разделе находится масляный насос двигателя SB JCB 320/04300. Это устройство, чья основная функция заключается во впрыскивании масла в работающий механизм. При этом жидкость находится под давлением.Если вам нужны эти или другие запчасти двигателя погрузчика, но вы не можете выбрать подходящие, обратитесь к нашим специалистам, они помогут вам.&lt;/p&gt;', '', 'Насос масляный двигателя SB JCB 320/04300', '', ''),
(669, 1, 'Насос вакуумный SB JCB 160/15137', '&lt;p&gt;&lt;b&gt;Насос вакуумный SB JCB 160/15137&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 160/15137&lt;/&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p', '', 'Насос вакуумный SB JCB 160/15137', '', ''),
(670, 1, 'Шкив ролик опорный приводного ремня JCB 320/08724, 320/08586', '&lt;p&gt;Ищете запчасти на экскаватор погрузчик JCB? В нашем ассортименте представлено огромное множество товаров от производителей со всего мира. В продаже есть и оригинальная, и неоригинальная продукция высокого качества.В этом разделе каталог запчастей для погрузчика вы можете приобрести шкив ролик опорный приводного ремня JCB 320/08724. Обводной товар дополнен кронштейном из прочного металла. Он предназначен для двигателя и представляет собой конструкцию фрикционного колеса с ободом. Деталь передает импульс движения с вала на ремень, с помощью энергии трения. Она является частью ременной передачи.&lt;/p&gt;', '', 'Шкив ролик опорный приводного ремня JCB 320/08724, 320/08586', '', ''),
(671, 1, 'Ролик натяжителя ремня JCB оригинальный 320/08651, 320/08759, 320/08657, 320/08584', '&lt;p&gt;Предлагаем вам купить запчасти на экскаватор погрузчик. В ассортименте вы найдете разнообразную продукцию от ведущих производителей. Все товары можно заказать онлайн, с доставкой или забрать самовывозом.В этом разделе представлен оригинальный ролик натяжителя ремня JCB 320/08651. Это элемент генератора – одной из самых важных систем транспортного средства. Благодаря такой запчасти для погрузчика JCB, механизм сможет нормально функционировать, с требуемой скоростью. Приводной ремень будет полностью натянут, без провисания, а вращение от мотора будет передаваться полностью.&lt;/p&gt;', '', 'Ролик натяжителя ремня JCB оригинальный 320/08651, 320/08759, 320/08657, 320/08584', '', ''),
(672, 1, 'Ролик промежуточный паразитный JCB 320/08773', '&lt;p&gt;Обводной промежуточный паразитный ролик - часть приводного ремня. Выполняет прокаточную функцию, служит для верного позиционирования ремня. Предназначена для использования в машинах, оснащенных двигателями Dieselmax.В данном разделе представлена деталь JCB с артикулом 320/08773. Совместима с моделями 3CX, 4CX, отличается хорошим качеством. Мы предлагаем приобрести подходящую комплектующую для вашего экскаватора-погрузчика. Нашим клиентам доступен самовывоз из одного из магазинов компании в Москве, или доставка в любой регион России.&lt;/p&gt;', '', 'Ролик промежуточный паразитный JCB 320/08773', '', ''),
(673, 1, 'Ролик промежуточный паразитный JCB 320/08530', '&lt;p&gt;Предлагаем вам купить запчасти на экскаватор-погрузчик онлайн. Вы можете приобрести любые товары оптом и в розницу, с доставкой на дом или самовывозом из наших магазинов.В этом разделе представлен ролик промежуточный паразитный JCB 320/08530. Этот обводной предмет предназначен для  двигателя DIESELMAX, расположенного на специальной технике от английского бренда. Он соответствует моделям 3CX и 4CX и устанавливается из конструктивных соображений.В магазине JCB вы найдете оригинальные запчасти и от сторонних производителей. Все они обладают высоким качеством, износостойкостью и долговечностью.&lt;/p&gt;', '', 'Ролик промежуточный паразитный JCB 320/08530', '', ''),
(674, 1, 'Шкив ролик опорный JCB 320/08623', '&lt;p&gt;Предлагаем вам приобрести запасные части для фронтального погрузчика. Все товары доступны для заказа оптом и в розницу, с доставкой на дом. Добавьте выбранную продукцию в Корзину и оформите покупку.В этом разделе представлен шкив ролик опорный JCB 320/08623 приводного ремня. Данная продукция используется в ременных приводах. Изделие представляет собой диск с плоской поверхностью, расположенный на стальной опоре. Такая запчасть JCB является фрикционным колесом с ободом по окружности. Ее главная задача – при помощи трения передавать импульс приводному ремню непосредственно с вала.&lt;/p&gt;', '', 'Шкив ролик опорный JCB 320/08623', '', ''),
(675, 1, 'Шкив коленвала JCB 02/200877', '&lt;p&gt;Представляем вам шкив коленвала JCB 02/200877. Этот товар используется для специальной техники от английского бренда 3CX и 4CX. Цена на шкив коленвала указана на странице продукции за единицу. Изделие соответствует старой модели с двигателями PERKINS  до 2006 года выпуска. Деталь устанавливается на переднюю выходную часть вала, амортизирует вибрации и толчки коленчатого вала, передает крутящее усилие ряду устройств, синхронизирует работу коленчатого и распределительного валов.&lt;/p&gt;', '', 'Шкив коленвала JCB 02/200877', '', ''),
(676, 1, 'Подшипник шкива вентилятора JCB 02/200010', '&lt;p&gt;Подшипник шкива вентилятора - важная деталь системы воздушного охлаждения, сборочный узел, который поддерживает вал со определенной степенью жесткости. Является частью фрикционного колеса кулера JCB.На этой странице интернет-магазина вы можете заказать запасную часть с артикулом 02/200010 для экскаваторов «ДжиСиБи», оптом и в розницу. Доступны варианты приобретения с доставкой по стране или самовывозом из Москвы. Также возможна установка комплектующих на вашу спецтехнику, диагностика, технический осмотр и ремонт любой сложности.&lt;/p&gt;', '', 'Подшипник шкива вентилятора JCB 02/200010', '', ''),
(677, 1, 'Шкив опорный с кронштейном 320/08624', '&lt;p&gt;В этом разделе представлен шкив опорный с кронштейном 320/08624. Он предназначен для мотора DieselMax экскаватора-погрузчика и подходит для моделей 3CX и 4CX, выпущенных в период с 2005 по 2017 годы. Эта деталь JCB являет собой фрикционное колесо, которое транспортирует движение восьмиручейковому поликлиновому ремню генератора или наоборот. Она оснащена канавками, которые необходимы для перемещения от электрического мотора.Такие запасные части фронтального погрузчика отличаются прочностью, надежностью, износостойкостью. Они имеют международные сертификаты качества.&lt;/p&gt;', '', 'Шкив опорный с кронштейном 320/08624', '', ''),
(678, 1, 'Шкив ролик обводной приводного ремня JCB 320/08586', '&lt;p&gt;Наш интернет-магазин запчастей для спецтехники предлагает вам большой ассортимент продукции, как оригинальной, так и от сторонних производителей.В этом разделе представлен шкив ролик обводной приводного ремня JCB 320/08586. Такой товар подходит для погрузчика от английского бренда. Он оснащен кронштейном из металла серебристого цвета. Запчасть для экскаваторов JCB представляет собой конструкцию фрикционного колеса с ободком. Она передает импульс движения приводному ремню непосредственно от вала, с помощью силы трения. Данный предмет является частью ременной передачи.&lt;/p&gt;', '', 'Шкив ролик обводной приводного ремня JCB 320/08586', '', ''),
(679, 1, 'Шкив ролик опорный обводной с кронштейном JCB 320/08588', '&lt;p&gt;В этом разделе представлен шкив ролик опорный обводной с кронштейном для установки на экскаватор-погрузчик JCB. Он предназначен для двигателя спецмашины. По конструкции данная комплектующая представляет собой фрикционное колесо с ободом. Его главная задача – с помощью силы трения передавать движение от вала на приводной ремень.В интернет-магазине jcbprof доступна к заказу запчасть с артикулом 320/08588. По вопросу наличия для вашей модели спецтехники обращайтесь к нашим менеджерам. Вы можете запросить самовывоз или доставку в любую точку страны.&lt;/p&gt;', '', 'Шкив ролик опорный обводной с кронштейном JCB 320/08588', '', ''),
(680, 1, 'Шкив ролик опорный с кронштейном JCB 320/08931', '&lt;p&gt;Шкив ролик опорный с кронштейном JCB 320/08931, представленный в этом разделе, является важной деталью ременной передачи погрузчика. Это система из двух шкивов, установленных на валах, между которыми располагается кольцевой ремень.Обводной предмет предназначен для двигателя экскаватора. Конструкционно он является фрикционным колесом с ободом, расположенным по всей окружности. Используя энергию трения, такая запчасть JCB для спецтехники передает движение от вала на ремень или наоборот. Данный товар обладает высоким качеством, долгим сроком службы и износостойкостью.&lt;/p&gt;', '', 'Шкив ролик опорный с кронштейном JCB 320/08931', '', ''),
(681, 1, 'Клапан пыли на воздушный фильтр JCB 32/206007', '&lt;p&gt;Клапан пыли на воздушный фильтр JCB 32/206007, представленный в этом разделе, доступен для заказа. Он является важным элементом фильтрационной системы погрузчика от английского бренда. Данный товар обладает высоким качеством, надежностью, износостойкостью и долгим сроком службы. Такие запчасти для экскаватора JCB необходимы, ведь концентрация пыли на наших дорогах выше, чем на европейских. К тому же, много пыли оседает в воздухе на строительной площадке, во время проведения различных работ по погрузке и разгрузке. Чтобы грязь не забилась в камеру сгорания и в масло, требуется приобрести указанную запасную часть.&lt;/p&gt;', '', 'Клапан пыли на воздушный фильтр JCB 32/206007', '', ''),
(682, 1, 'Направляющие втулки клапанов RG комплект JCB 02/201812-817', '&lt;p&gt;Направляющие втулки клапанов RG поставляются в комплекте JCB 02/201812-817. Они представляют собой набор цилиндриков определенных параметров, внутри которых имеется полость. Изделия являются посредниками между  их головками, которые создаются из мягкого материала, и клапанным стержнем из прочной стали. Последние элементы все время передвигаются вверх-вниз во время эксплуатации, поэтому они вынуждены выносить серьезные нагрузки.В каталоге запчастей JCB вы найдете огромное количество товаров, выпущенных известными производителями. В ассортименте есть и оригинальные, и неоригинальные изделия.&lt;/p&gt;', '', 'Направляющие втулки клапанов RG комплект JCB 02/201812-817', '', ''),
(683, 1, 'Пилотный клапан JCB 332/F8176', '&lt;p&gt;Предлагаем вам купить запчасти на экскаватор-погрузчик. В ассортименте вы найдете изделия, имеющие международный сертификат качества. Все они произведены надежными компаниями со всего мира. Наши запчасти на погрузчик JCB представлены и оригинальными, и неоригинальными товарами. Каждый элемент обладает высокой прочностью, износостойкостью и долгим сроком службы.Пилотный клапан JCB 332/F8176, доступный для заказа в этом разделе, предназначен для регулировки прохождения жидкости. Он создается из прочнейшего металла, а уплотнители делаются из высокоэластичных полимеров.&lt;/p&gt;', '', 'Пилотный клапан JCB 332/F8176', '', ''),
(684, 1, 'Направляющие втулки клапанов АК комплект JCB 02/201511-13', '&lt;p&gt;Хотите купить запчасти JCB? Предлагаем вам впечатляющий выбор продукции от проверенных производителей со всего мира.В этом разделе вы найдете комплект направляющих втулок клапанов АК JCB 02/201511-13. Подобные товары изготавливаются из прочных материалов, способных выдержать большие нагрузки. Это посредники между мягким сплавом головки цилиндров и клапанным стержнем из стали, который все время передвигается вверх-вниз во время эксплуатации.Вы можете приобрести запасные части фронтального погрузчика онлайн, оптом и в розницу, с доставкой или самовывозом из наших магазинов в столице.&lt;/p&gt;', '', 'Направляющие втулки клапанов АК комплект JCB 02/201511-13', '', ''),
(685, 1, 'Направляющие втулки клапанов SB комплект', '&lt;p&gt;Предлагаем вам качественные и доступные запчасти для экскаваторов в Москве.В этом разделе представлен комплект направляющих втулок клапанов SB. Они являются конструкциями с полостью определенных параметров. Это посредники между мягким сплавом головки цилиндров и клапанным стержнем из стали, который все время передвигается вверх-вниз во время эксплуатации. Такие товары создаются из прочных материалов.Если вас интересуют цены на запчасти JCB 3CX, вы можете запросить нужные вам сведения у менеджеров нашей компании. Специалисты проконсультируют вас и помогут выбрать подходящий товар.&lt;/p&gt;', '', 'Направляющие втулки клапанов SB комплект', '', ''),
(686, 1, 'Клапан воздушного фильтра JCB 32/916603', '&lt;p&gt;Клапан воздушного фильтра JCB 32/916603 представляет собой важную деталь мотора. Он может отличаться по модели, форме, материалам изготовления и типу. Располагается по впускном коллекторе, на дроссельной заслонке. Если такая запасная часть спецтехники вышла из строя, ее придется менять целиком. Клапан не подлежит ремонту. Причинами для замены является прогорание узла, нестабильный холостой ход, слабая мощность мотора, подергивание двигателя на малых оборотах. В каталоге запчастей JCB представлены оригинальные и неоригинальные товары, которые можно приобрести онлайн, с доставкой или самовывозом.&lt;/p&gt;', '', 'Клапан воздушного фильтра JCB 32/916603', '', ''),
(687, 1, 'Ролик промежуточный паразитный на JCB 320/08921', 'Ролик промежуточный паразитный на спецтехнику JCB 3CX, 4CX. Артикул: 320/0892', '', 'Ролик промежуточный паразитный на JCB 320/08921', '', ''),
(688, 1, 'Прокладка турбины JCB (Original) 320/04208', 'Прокладка турбины JCB (Original) 320/0420', '', 'Прокладка турбины JCB (Original) 320/04208', '', ''),
(689, 1, 'Прокладка JCB 813/10175', '&lt;p&gt;Если вы хотите приобрести запчасти для JCB 3CX в Москве, обращайтесь к нашим специалистам. Они помогут вам сделать выбор и оформить заказ онлайн. Запчасти для спецтехники доступны для покупки в интернет-магазине, как оптом, так и в розницу. Их можно забрать в наших столичных магазинах, а можно заказать доставку в любую точку страны.В этом разделе находится прокладка JCB 813/10175. С ее помощью легко сделать любой узел или механизм герметичным, предотвратить протечку или проникновение излишней влаги. Это изделие также помогает держать швы и стыки разных элементов в чистоте и сухости.&lt;/p&gt;', '', 'Прокладка JCB 813/10175', '', ''),
(690, 1, 'Комплект прокладок SB нижний JCB 320/09281', '&lt;p&gt;Ищете высококлассные запасные части экскаватора-погрузчика? Загляните в наш ассортимент. Мы подготовили для вас большой выбор изделий от надежных производителей. Все товары имеют соответствующие международные сертификаты качества.Комплект прокладок (двигатель SB) низ JCB 320/09281, представленный в этом разделе, включает в себя несколько изделий из прочной резины. Они используются для ремонта, устранения течи, уплотнения узлов и механизмов. Детали JCB доступны для заказа онлайн, как оптом, так и в розницу. Вы можете забрать покупку из магазинов в Москве или оформить доставку.&lt;/p&gt;', '', 'Комплект прокладок SB нижний JCB 320/09281', '', ''),
(691, 1, 'Комплект прокладок SB верх JCB 320/09217', '&lt;p&gt;Комплект прокладок на двигатель SB верхний JCB 320/09217 состоит из сальников, манжет, клипс, колец, уплотнений и резинотехнических изделий, предназначенных для ремонта двигателя, уплотнения устанавливаемых деталей мотора и устранения последующей течи. В этом наборе есть элементы ГБЦ, крышки клапана, коллекторов, форсунок и т.д..В магазине JCB вы найдете разнообразные запчасти, как оригинальные, так и неоригинальные. Мы поставляем только продукцию, имеющую гарантии и международные сертификаты качества. Запчасти для погрузчиков в Москве можно заказать и оптом, и в розницу. Для жителей столицы возможен самовывоз. Также действует оперативная доставка по всей стране.&lt;/p&gt;', '', 'Комплект прокладок SB верх JCB 320/09217', '', ''),
(692, 1, 'Комплект прокладок RG нижний 02/203056', '&lt;p&gt;Полный набор прокладок и сальников на двигатель Perkins RG нижний JCB 02/203056 вмещает все необходимые товары и приспособления, которые относятся к цилиндровому блоку. Это такие уплотнительные элементы, как передний сальник коленчатого вала, элементы для поддона мотора и его крышки. Они изготовлены из особо прочной резины и силикона. Эти и другие детали JCB доступны для заказа онлайн, оптом и в розницу.В набор запасных частей экскаватора-погрузчика также входят изделия крышек охладительной рубашки, воздушного компрессора, водяного и топливного насоса, приводного картера, заглушки топливного и масляного фильтров.&lt;/p&gt;', '', 'Комплект прокладок RG нижний 02/203056', '', ''),
(693, 1, 'Комплект прокладок RG верх JCB 02/203156', '&lt;p&gt;Такой товар, как комплект прокладок (дв. RG) верх JCB 02/203156 необходим для бывалых автомобилистов. Если вы делаете ремонт головки блока цилиндров или хотите устранить внезапно возникшую протечку, вам не обойтись без этих деталей погрузчика.В комплекте вы найдете прокладку ГБЦ, крышки клапана, корпуса термостата, впускного и выпускного коллекторов. Также в наборе есть резиновые изделия для уплотнения форсунок и прочих элементов. В нашем каталоге запчастей спецтехники представлены и другие приспособления, необходимые для своевременной починки и замены запчастей экскаватора.&lt;/p&gt;', '', 'Комплект прокладок RG верх JCB 02/203156', '', ''),
(694, 1, 'Комплект прокладок АК нижний JCB 02/201931 02/202524 02/201851', '&lt;p&gt;В магазине запчастей JCB вы найдете огромное количество товаров от различных брендов. В ассортименте есть и оригинальные, и неоригинальные товары от сторонних производителей.В данном разделе представлен комплект прокладок (дв. АК) низ JCB 02/201931. В наборе поставляется несколько гибких и эластичных деталей из материала высокого качества. Такие товары располагаются между деталями, чтобы обеспечить герметичность, препятствовать проникновению излишней влаги, сохранять все стыки чистыми и сухими.Вы можете приобрести запчасти для погрузчиков в Москве онлайн, оптом и в розницу.&lt;/p&gt;', '', 'Комплект прокладок АК нижний JCB 02/201931 02/202524 02/201851', '', ''),
(695, 1, 'Комплект прокладок АК верх JCB 02/201849', '&lt;p&gt;Если вы хотите купить запчасти JCB в Москве, обращайтесь к нашим специалистам или оформляйте заказ онлайн самостоятельно. Менеджеры ответят на все интересующие вас вопросы по стоимости и другим нюансам продукции. Все товары из каталога запчастей спецтехники можно заказать оптом и в розницу, с доставкой на дом.В данном разделе представлен комплект прокладок (дв. АК) верх JCB 02/201849. Это набор из нескольких деталей, главная цель которых – обеспечивать герметичность механизмов в специальной технике. Такие предметы предотвращают проникновение лишней влаги и позволяют сохранить все стыки сухими и чистыми.&lt;/p&gt;', '', 'Комплект прокладок АК верх JCB 02/201849', '', ''),
(696, 1, 'Комплект прокладок АВ нижний JCB 02/200343', '&lt;p&gt;Каталог деталей JCB 3CX представлен широким ассортиментом оригинальных и неоригинальных товаров высокого качества. Мы предлагаем вам только те изделия, в надежности, прочности и долговечности которых мы уверены. Все запчасти на экскаватор погрузчик, доступные для заказа в нашем интернет-магазине, имеют соответствующие международные сертификаты качества.В этом разделе вы найдете комплект прокладок низ JCB 02/200434. Он необходим для ремонта блока цилиндров. В наборе имеются уплотнительные изделия из высокопрочной резины - прокладки поддона, рубашки охлаждения топливного и водяного насоса, сальники коленвала и многое другое.&lt;/p&gt;', '', 'Комплект прокладок АВ нижний JCB 02/200343', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(697, 1, 'Комплект прокладок АВ верх JCB 02/200184', '&lt;p&gt;Комплект прокладок верх JCB 02/200184 понадобится вам, если вы собрались делать самостоятельный ремонт погрузчика. Набор также пригодится для починки в случаях, если в узлах и механизмах появилась течь и нарушена герметичность. В комплекте присутствуют стандартные запчасти для экскаваторов JCB - прокладки ГБЦ, клапанные крышки, корпус термостата, резинки на форсунки, маслосъемные колпачки.В интернет-магазине запчастей для спецтехники представлены различные детали, как оригинальные, так и от сторонних производителей. Продукция доступна для заказа онлайн, оптом и в розницу.&lt;/p&gt;', '', 'Комплект прокладок АВ верх JCB 02/200184', '', ''),
(698, 1, 'Манжета термостата JCB 320/04543', '&lt;p&gt;В каталоге запасных частей погрузчика вы найдете качественную продукцию от известных производителей. Ассортимент представлен и оригинальными, и неоригинальными товарами.В данном разделе доступна для заказа манжета термостата JCB 320/04543. Это уплотнительный элемент устройства системы охлаждения, который автоматически перенаправляет потоки антифриза при разной температуре нагрева мотора. Движение жидкости проходит по контурам: большому – через радиатор, малому – не проходя через него.Если вы хотите приобрести запчасти JCB Москве оптом или в розницу, оформите заказ онлайн, с доставкой.&lt;/p&gt;', '', 'Манжета термостата JCB 320/04543', '', ''),
(699, 1, 'Сальник коленвала передний JCB 2418F437', '&lt;p&gt;Сальник коленчатого вала 2418F437, 02/10435 передний дял двигателей Perkins экскаваторов-погрузчиков JCB.Оригинальное название: Seal Front Oil Perkins EngineАртикул: 2418F437, 02/10435, 12014981B, DZJ02101435Предлагаем вам приобрести запчасти JCB, в этом разделе вы можете заказать передний сальник коленвала JCB 2418F437. Этот элемент препятствует протеканию масла через отверстие вращающегося вала. Сальник представляет собой кольцо с надписью, по которой можно определить направление вращения коленвала. Изделие обычно создается из прочного, долговечного и термостойкого силикона, также используется фторкаучуковая резина с теми же свойствами.Чтобы купить Москве сальник, соленоид и другие запчасти, закажите его на нашем сайте или по телефонам в разделе Контакты. Менеджеры помогут вам сделать заказ.&lt;/p&gt;', '', 'Сальник коленвала передний JCB 2418F437', '', ''),
(700, 1, 'Сальник коленвала передний SB JCB 320/03119', '&lt;p&gt;Предлагаем вам купить запчасти на погрузчик. В этом разделе представлен сальник коленвала передний SB JCB 320/03119. Этот сальник используется для препятствия протекания смазки из механизмов, имеющих ось или вал. В данном случае, предмет необходим для удерживания специальной жидкости в двигателе. Элемент представляет собой кольцо с эластичным краем внутри и твердой обоймой снаружи, дополненной пружиной.Замена переднего сальника коленвала необходима в случае, когда старый предмет перестал был гибким по внутренней кромке или потрескался, допускает течь масла или не крепится на валу плотно.&lt;/p&gt;', '', 'Сальник коленвала передний SB JCB 320/03119', '', ''),
(701, 1, 'Сальник коленвала задний АК JCB 02/202370', '&lt;p&gt;Сальник коленвала задний АК JCB 02/202370, представленный в том разделе, препятствует утечке масла из двигателя. Он устанавливается на таком элементе транспорта, как коленчатый вал. Предмет выглядит как кольцо с мягкой внутренней кромкой и жесткой внешней обоймой, дополненное пружиной. Такой товар позволяет удерживать смазку внутри.Замена задних сальников коленвала необходима в случае, когда деталь перестала выполнять свои функции. Нужно срочно ставить новые запчасти JCB, когда старые потрескались, допускают течь масла или фиксируются неплотно. Вы можете приобрести любые товары оптом или в розницу.&lt;/p&gt;', '', 'Сальник коленвала задний АК JCB 02/202370', '', ''),
(702, 1, 'Сальник коленвала задний АВ JCB 02/101436', '&lt;p&gt;Предлагаем вам приобрести сальники для спецтехники в нашем каталоге запасных частей JCB. Это детали, представляющие собой круглые кольца, усиленные пружинкой. Внутренняя часть элементов мягкая и эластичная, а внешняя – жесткая и твердая. Их устанавливают на коленчатый вал, препятствуя утечке масла из двигателя. Распространенным дефектом является потеря эластичности и появление трещин. Если такое произошло, нужно как можно скорее поставить новый задний сальник коленвала АВ JCB 02/101436. Эту процедуру следует выполнять не реже чем раз в три года или через каждые сто-сто пятьдесят тысяч километров пробега.&lt;/p&gt;', '', 'Сальник коленвала задний АВ JCB 02/101436', '', ''),
(703, 1, 'Сальник коленвала задний SB JCB 320/03029', '&lt;p&gt;Задний сальник коленвала SB JCB 320/03029 понадобится вам в случае износа старой детали. Определить это можно по утечке масла или потекам смазки на поверхности, появлению трещин, сколов, разорванностей и прочих дефектов. Сальник устанавливается на погрузчик во многих элементах транспортного средства. В данном случае представлены изделия для коленчатого вала. Их следует регулярно проверять и менять при обнаружении неисправностей (не реже чем раз в три года).Просмотрев каталог запчастей JCB, вы можете приобрести нужные товары онлайн, с оперативной доставкой в любой город страны.&lt;/p&gt;', '', 'Сальник коленвала задний SB JCB 320/03029', '', ''),
(704, 1, 'Сальник коленвала задний RG JCB 02/202935', '&lt;p&gt;Задний сальник коленвала RG JCB 02/202935 представляет собой прокладку, которая препятствует выходу смазочной жидкости из механизмов двигателя. По внешнему виду он напоминает кольцо с пружиной. Его внутренняя часть сделана из мягкого, эластичного материала, а внешняя очень твердая и жесткая. Определить, что пришла пора менять эту деталь, очень просто. Если вы увидели на изделии потеки масла, трещины, сколы или разрывы, или с момента прошлой замены прошло три года, пора приобрести новое.Мы занимаемся продажей запчастей JCB оптом и в розницу. Все товары можно заказать онлайн, с доставкой в любой город страны.&lt;/p&gt;', '', 'Сальник коленвала задний RG JCB 02/202935', '', ''),
(705, 1, 'Прокладка турбины JCB', '&lt;p&gt;Прокладка турбины JCB 320/06053 представляет собой резинотехническое изделие из плотного и износостойкого материала. Она используется для качественного и эффективного уплотнения частей турбокомпрессора. Обратите внимание, новая турбина всегда продается без прокладок.Запчасти для спецтехники можно заказать в интернете с доставкой. Вам не придется тратить время на дорогу до магазина – товары доставят вам в удобное время. Чтобы приобрести запчасти JCB в Москве, как оптом, так и в розницу, оформите заказ онлайн. Если у вас возникли вопросы, свяжитесь с менеджерами компании.&lt;/p&gt;', '', 'Прокладка турбины JCB', '', ''),
(706, 1, 'Прокладка глушителя JCB 813/00349', '&lt;p&gt;Прокладка глушителя JCB 813/00349 является важным изделием из резины, который уплотняет узлы и оберегает их от протечки. Она также используется во время ремонта или замены запчасти для экскаваторов. Если вы собрались устанавливать новый глушитель, вам нужно приобрести прокладки и глушитель. Такая же процедура необходима, когда замены требует какая-то часть устройства (например, она прогнила или вышла из строя), двигатель работает громче, возникает утечка газов.В каталоге запчастей JCB вы можете приобрести товары онлайн, с доставкой или самовывозом. Чтобы сделать заказ, воспользуйтесь удобной формой на сайте.&lt;/p&gt;', '', 'Прокладка глушителя JCB 813/00349', '', ''),
(707, 1, 'Прокладка коллектора JCB 320/06080', '&lt;p&gt;Прокладка выпускного коллектора JCB 320/06080 предназначена для модели мотора DieselMax SB 444. Она является необходимой запчастью для экскаваторов в Москве. Изделие подходит для погрузчиков 4СХ, выпущенных в период с 2007 по 2017 годы. Оно изготовлено из прочной и стойкой к износу резине. Главная задача прокладки – уплотнять элементы машины и оберегать узлы от протечки. Механизм, в котором она используется, собирает выхлопные газы и передает в катализатор.Чтобы купить запчасти JCB, зарегистрируйтесь на нашем сайте. Менеджеры помогут вам выбрать подходящий товар и сделать заказ.Артикул: 320/06080, 320/06398, 320/06035, 320/06030, 320/06034, 320/06324&lt;/p&gt;', '', 'Прокладка коллектора JCB 320/06080', '', ''),
(708, 1, 'Уплотнительное кольцо бортового редуктора JCB 828/00196', '&lt;p&gt;Интересуют цены на запчасти JCB 3CX? В ассортименте вы найдете большое количество товаров, доступных по приемлемым ценам, от ведущих производителей. Все изделия можно заказать онлайн, с доставкой или забрать самовывозом.Уплотнительное кольцо бортового редуктора JCB 828/00196, представленное в этом разделе, имеет круглое сечение. Товар изготавливается из эластичной резины. Он укладывается в запасные части для экскаваторов в качестве предохранителя. Любое резиновое колечко является уплотнителем, располагаемым между элементами из металла и пластика. Подобные изделия выпускают в разных размерах.&lt;/p&gt;', '', 'Уплотнительное кольцо бортового редуктора JCB 828/00196', '', ''),
(709, 1, 'Уплотнительное кольцо синхронизатор КПП JCB 904/50020', '&lt;p&gt;Если вы ищете высококачественные детали для спецтехники, обращайтесь в наш интернет-магазин. В ассортименте представлены изделия от ведущих производителей, как оригинальные, так и неоригинальные.В этом разделе вы найдете запчасти для экскаваторов ДжиСиБи. Уплотнительное кольцо синхронизатор КПП JCB 904/50020 представляет собой резиновый предохранитель с круглым сечением. Изделие используется не только в специальной технике, но и в различных видах технологического оборудования. Его главная задача – уплотнять металлические элементы.Все товары можно заказать онлайн, с доставкой или забрать самовывозом.&lt;/p&gt;', '', 'Уплотнительное кольцо синхронизатор КПП JCB 904/50020', '', ''),
(710, 1, 'Вкладыши коренные комплект ремонтный 2 AB,АА,АК Perkins JCB 02/192004', '&lt;p&gt;В этом разделе представлен ремонтный комплект коренных вкладышей 2 AB,АА,АК Perkins JCB 02/192004. Это специальный набор из нескольких деталей, который используется для ремонта двигателя. Также эти запчасти JCB понадобятся вам, если оригинальные вкладыши провернулись или стучат. Цена на изделия указана на страницах товаров.Коренные вкладыши монтируются в постели нижней части блока мотора. Покупая эти предметы из каталога запасных частей экскаватора, важно осмотреть их визуально. Канавки и ямки должны быть ровными, не должно быть никаких шероховатых частей или заусенцев.&lt;/p&gt;', '', 'Вкладыши коренные комплект ремонтный 2 AB,АА,АК Perkins JCB 02/192004', '', ''),
(711, 1, 'Кольца поршневые (комплект на 1 поршень) АВ JCB 02/201140', '&lt;p&gt;В этом разделе представлены поршневые кольца (комплект на 1 поршень) АВ JCB 02/201140. Их необходимо выбирать по качеству, диаметру, материалу. Если купить не те запчасти на экскаватор-погрузчик, которые нужно, можно сломать двигатель. Менеджеры компании помогут вам определиться с выбором и сделать заказ онлайн.Эти запчасти на погрузчик JCB изготавливаются из чугуна и нержавейки, покрываются разными составами. Они бывают простыми и составными, соединенными и наборными. По типу делятся на верхнее компрессионное, второе компрессионное и маслосъемное. Имеют особую конструкцию с вырезом-замком.&lt;/p&gt;', '', 'Кольца поршневые (комплект на 1 поршень) АВ JCB 02/201140', '', ''),
(712, 1, 'Вкладыши коренные комплект JCB 320/09202', '&lt;p&gt;Представляем вам ремонтный комплект коренных вкладышей 1 SB JCB 320/09202. Этот набор используется для быстрой и своевременной починки мотора. Запасные части для погрузчиков являют собой специальные элементы двигателя или подшипники скольжения. Они используются, чтобы препятствовать осевым перемещениям коленчатого вала и позволять коренным шейкам вращаться в блоке цилиндров.В ассортименте вы найдете разнообразные детали экскаватора от ведущих производителей, как оригинальные, так и неоригинальные. Все товары доступны для заказа онлайн, с доставкой или самовывозом.&lt;/p&gt;', '', 'Вкладыши коренные комплект JCB 320/09202', '', ''),
(713, 1, 'Поршень Perkins на двигатели AR-AK, на JCB 02/201505', 'Поршень Perkins на двигатели AR-AK, на спецтехнику JCB 3CX, 4CX. Артикул: 02/20150', '', 'Поршень Perkins на двигатели AR-AK, на JCB 02/201505', '', ''),
(714, 1, 'Вкладыши коренные комплект ремонтный RG JCB 02/202913', '&lt;p&gt;Если вы ищете качественные детали погрузчика от ведущих производителей, загляните в наш каталог. В этом разделе вы найдете ремонтный комплект коренных вкладышей 1 RG JCB 02/202913. Набор состоит из нескольких подшипников скольжения, применяемых для двигателя.Такие запчасти для спецтехники JCB призваны остановить осевые перемещения коленчатого вала и обеспечить вращение коренных шеек в блоке цилиндров. Товары можно заказать онлайн, с оперативной доставкой в любую точку страны. Жителям Москвы предлагается самовывоз из наших магазинов. Возможна оптовая и розничная продажа.&lt;/p&gt;', '', 'Вкладыши коренные комплект ремонтный RG JCB 02/202913', '', ''),
(715, 1, 'Кольца поршневые (комплект на 1 поршень) SВ 320/09299', '&lt;p&gt;Ищете качественные запчасти для экскаваторов JCB? Просмотрите каталог на сайте! В ассортименте нашего интернет-магазина запчастей для спецтехники вы найдете разнообразную продукцию от ведущих производителей. Оригинальные и неоригинальные товары можно заказать онлайн, с доставкой или самовывозом.Кольца поршневые (комплект на 1 поршень) SВ 320/09299 необходимы для выполнения нескольких задач сразу. Колечки делают камеру плотнее и увеличивают компрессию. Кроме того, они снижают расход масла в моторах, делают тепловую передачу намного лучше, переносят избыток тепла и препятствуют перегреванию.&lt;/p&gt;', '', 'Кольца поршневые (комплект на 1 поршень) SВ 320/09299', '', ''),
(716, 1, 'Кольца поршневые (комплект на 1 поршень) RG JCB 06/880800-90', '&lt;p&gt;Предлагаем вам купить запчасти JCB от ведущих производителей со всего мира. В ассортименте вы найдете и оригинальные, и неоригинальные товары. Вы можете заказать их с доставкой или забрать самовывозом.В этом разделе представлены кольца поршневые (комплект на 1 поршень) RG JCB 06/880800-90. Это не замкнутые колечки, установленные в соответствующих отверстиях. Подобные запчасти для экскаваторов в Москве выполняют 3 задачи сразу. Они уплотняют камеры сгорания/расширения, улучшают тепловую передачу сквозь цилиндровую стену и отвод избытков тепла, снижают расход моторного масла в двигателях.&lt;/p&gt;', '', 'Кольца поршневые (комплект на 1 поршень) RG JCB 06/880800-90', '', ''),
(717, 1, 'Вкладыши коренные комплект ремонтный АВ JCB 02/192003', '&lt;p&gt;Представляем вам каталог запчастей онлайн, в котором вы можете приобрести нужные товары самовывозом из наших магазинов или с доставкой на дом. Запчасти JCB удобно заказывать в Москве как оптом, так и в розницу.В этом разделе вы найдете ремонтный комплект коренных вкладышей 1 АВ JCB 02/192003. Это полноценный набор из различных элементов двигателя, представленных подшипниками скольжения. Данные предметы необходимы для ограничения коленвала от перемещений по оси. Также он обеспечивает передвижение коренных шеек в цилиндровом блоке. Причиной их поломки обычно является проворот.&lt;/p&gt;', '', 'Вкладыши коренные комплект ремонтный АВ JCB 02/192003', '', ''),
(718, 1, 'Вкладыши шатунные комплект ремонтный Стандарт АВ,АК JCB 02/192085', '&lt;p&gt;Представляем вам разнообразные запчасти для экскаваторов в Москве. В ассортименте вы найдете детали от сторонних производителей. Также вы можете купить у нас оригинальные запчасти JCB. Возможен самовывоз и доставка в любую точку страны.В этом разделе находятся вкладыши шатунные комплект ремонтный Стандарт АВ,АК JCB 02/192085. Они монтируются в нижнюю часть шатуна и обладают довольно простым устройством. Главная особенность качественных деталей – гладкая поверхность. Приобретая такие товары, осмотрите их визуально. Их стоимость зависит от состава набора, параметров и фирмы-производителя.&lt;/p&gt;', '', 'Вкладыши шатунные комплект ремонтный Стандарт АВ,АК JCB 02/192085', '', ''),
(719, 1, 'Вкладыши шатунные комплект ремонтный 2 SB JCB 320/09270', '&lt;p&gt;Представляем вам ремонтный комплект шатунных вкладышей 2 SB JCB 320/09270 B. Это детали с примитивным устройством, которые изготавливаются из прочных и недорогих материалов. Их устанавливают в нижнюю часть шатуна и используют при починке запчастей двигателя погрузчика. Обратите внимание, что для таких изделий очень важен характер поверхности – она должна быть гладкой, без заусенцев и шероховатостей. Иногда в комплекте идут упорные кольца.Эти и другие запасные части JCB доступны для заказа онлайн. Вы можете приобрести их с доставкой в любую точку страны, а можете забрать самовывозом из наших магазинов.&lt;/p&gt;', '', 'Вкладыши шатунные комплект ремонтный 2 SB JCB 320/09270', '', ''),
(720, 1, 'Вкладыши шатунные комплект ремонтный 2 AB.AK JCB 02/192087', '&lt;p&gt;В этом разделе представлен ремонтный комплект шатунных вкладышей 2 AB.AK JCB 02/192087. Это набор простых по конструкции деталей, сделанных из прочных износостойких материалов. Они используются при починке двигателя, а также в случаях, когда оригинальные шатуны провернулись или издают странные стуки. Покупая такие запасные части для экскаваторов, уделите время их визуальному осмотру. Все элементы и отверстия должны быть гладкими, без заусенцев, зацепов и шероховатостей.Цены на запчасти JCB 3CX представлены в этом разделе. Вы можете приобрести их онлайн, оптом или в розницу.&lt;/p&gt;', '', 'Вкладыши шатунные комплект ремонтный 2 AB.AK JCB 02/192087', '', ''),
(721, 1, 'Вкладыши шатунные комплект ремонтный 1 SВ JCB 320/09270А', '&lt;p&gt;Предлагаем вам приобрести ремонтный комплект шатунных вкладышей 1 SВ JCB 320/09270 A. Это специальные детали, необходимые для починки двигателя. Они имеют простую форму и выполняются из качественных материалов. В каталоге запчастей JCB также представлены и другие вкладыши – коренного типа. Они отличаются местом расположения. Шатунные ставятся в нижнюю часть шатуна, а коренные в «постель» нижней части моторного блока.В интернет-магазине запчастей для спецтехники вы найдете и оригинальные, и неоригинальные товары от различных производителей. Их можно приобрести оптом и в розницу, самовывозом и с доставкой.&lt;/p&gt;', '', 'Вкладыши шатунные комплект ремонтный 1 SВ JCB 320/09270А', '', ''),
(722, 1, 'Вкладыши шатунные комплект ремонтный АВ, АК JCB 02/192086', '&lt;p&gt;Ремонтный комплект шатунных вкладышей 1 АВ,АК JCB 02/192086, представленный в этом разделе, используется для починки деталей экскаватора. Такие элементы устанавливаются в нижней части шатуна. Их главная особенность – примитивное устройство. При этом конструкция достаточно эффективна. Иногда она включает в себя упорные кольца.Выбирая подобные товары, важно провести визуальный осмотр поверхности – она должна быть гладкой. Если вы сомневаетесь, какие запчасти приобрести на экскаватор погрузчик JCB, свяжитесь с менеджерами нашей компании. Они проконсультируют вас и подскажут, что лучше заказать.&lt;/p&gt;', '', 'Вкладыши шатунные комплект ремонтный АВ, АК JCB 02/192086', '', ''),
(723, 1, 'Кольца поршневые (комплект на 1 поршень) АК JCB 02/201504', '&lt;p&gt;Предлагаем вам приобрести поршневые кольца (комплект на 1 поршень) АК JCB 02/201504. Они имеют необычную форму с вырезом-замком, который препятствует расширению при нагревании. Очень важно правильно выбрать такие товары из каталога запчастей погрузчика. В противном случае может потребоваться капитальный ремонт мотора.Заказывая запчасти JCB 3CX в Москве, обращайте внимание на их тип, материал, точность диаметра. Они делятся на верхнее компрессионное, второе компрессионное и маслосъемное, изготавливаются из чугуна и нержавейки. Могут быть простыми и составными, соединенными и наборными.&lt;/p&gt;', '', 'Кольца поршневые (комплект на 1 поршень) АК JCB 02/201504', '', ''),
(724, 1, 'Вкладыши шатунные комплект ремонтный Стандарт SB 320/03270 320/09205', '&lt;p&gt;Для тех, кто ищет запчасти на экскаваторы ДжиСиБи, мы подготовили большой выбор оригинальных и неоригинальных изделий. В этом разделе вы найдете ремонтный комплект шатунных вкладышей Стандарт SB 320/03270. Это металлические изделия специальной формы, которые вкладываются в нижнюю часть шатуна. Они требуют замены при ремонте двигателя. Их главная особенность – примитивное, но надежное устройство. Основное качество такой детали для спецтехники – максимальная гладкость поверхности. Именно на этот параметр следует обращать внимание при приобретении таких товаров в магазине.&lt;/p&gt;', '', 'Вкладыши шатунные комплект ремонтный Стандарт SB 320/03270 320/09205', '', ''),
(725, 1, 'Полумесяц коленвала АК JCB 02/192083-084', '&lt;p&gt;Полумесяц коленвала АК JCB 02/192083-084 – это металлическая деталь, представляющая собой половинку кольца. Она является частью коленчатого вала (элементу двигателя, которая по форме напоминает колено), ее задача – отвечать за ход угла по оси. Если «родные» детали износились или стерлись из-за длительной эксплуатации, вам стоит купить запчасти на погрузчик в нашем интернет-магазине. Оригинальные и неоригинальные товары имеют гарантию качества и долгий срок службы. Чтобы сделать заказ, зарегистрируйтесь на сайте и добавьте товары в Корзину, выбрав их из каталога запчастей JCB онлайн.&lt;/p&gt;', '', 'Полумесяц коленвала АК JCB 02/192083-084', '', ''),
(726, 1, 'Полумесяц коленвала RG JCB 02/192011-084', '&lt;p&gt;Полумесяц коленвала RG JCB 02/192011-084 представляет собой половину диска, сделанную из прочной и долговечной стали. Эта деталь относится к коленчатому валу (элементу мотора, по форме напоминающему колено) и отвечает за его ход по оси. Такие запасные части JCB изнашиваются из-за интенсивной эксплуатации. Полукольцо, потерявшее форму или плотность, негативно влияет на всю систему в целом. Заметив на нем следы износа, следует как можно скорее установить новую аналогичную запчасть на экскаватор-погрузчик.В ассортименте вы найдете и другие детали, из которых состоит коленчатый вал.&lt;/p&gt;', '', 'Полумесяц коленвала RG JCB 02/192011-084', '', ''),
(727, 1, 'Полукольца JCB на двигатель коленвала SB DieselMax комплект JCB 320/09208, 320/03016', '&lt;p&gt;Предлагаем вам приобрести запчасти для экскаватора от английского бренда. В каталоге вы можете заказать и оригинальные, и неоригинальные товары от проверенных брендов. В этом разделе представлены полукольца коленвала SB в комплекте JCB 320/09208. Они представляют собой набор из половинок стальных дисков. Интенсивные нагрузки и сложные условия эксплуатации могут привести к их преждевременному износу.Такие детали JCB располагаются в нижней части мотора. Они являются элементами коленчатого вала – важного узла двигателя, который преобразовывает поступательное движение во вращающее.&lt;/p&gt;', '', 'Полукольца JCB на двигатель коленвала SB DieselMax комплект JCB 320/09208, 320/03016', '', ''),
(728, 1, 'Лягушка пружина JCB 814/00289', '&lt;p&gt;Лягушка пружина JCB 814/00289 – высококачественная запасная часть для спецтехники ведущего британского производителя. Она отличается уникальностью форм и оригинальностью исполнения. Лягушка пружина предназначена для профессиональной замены износившегося элемента в моделях 3CX/4CX. Для изготовления детали использовался сверхпрочный металл, устойчивый к коррозии, деформации и механическим повреждениям.В каталоге интернет-магазина jcbprof собраны исключительно сертифицированные запасные части в широком ассортименте. Мы предлагаем купить лягушку пружину в режиме онлайн по доступной цене.&lt;/p&gt;', '', 'Лягушка пружина JCB 814/00289', '', ''),
(729, 1, 'Болт головки блока цилиндра (М12 * 140 мм.) 320/02711', 'Болт головки блока цилиндра на JCB (М12 * 140 мм.) 320/0271', '', 'Болт головки блока цилиндра (М12 * 140 мм.) 320/02711', '', ''),
(730, 1, 'Лягушка пружина JCB 814/10106', '&lt;p&gt;Лягушка пружина для спецтехники JCB 814/10106 – уникальная деталь для топливной системы двигателей Perkins. Она имеет эргономичный размер и оригинальную форму. Лягушка пружина изготовлена на высокотехнологическом оборудовании с использованием сверхпрочного и износоустойчивого металла, который предназначен для использования неблагоприятной рабочей среде. Изделие подходит для установки на экскаваторы-погрузчики JCB 3CX/4CX.В нашем интернет-магазине можно купить лягушку пружину Москва с предоставлением профессиональных услуг по замене детали и проведению технического обслуживания.&lt;/p&gt;', '', 'Лягушка пружина JCB 814/10106', '', ''),
(731, 1, 'Пружина крепления глушителя JCB 814/10177', 'Пружина крепления глушителя JCB 814/1017', '', 'Пружина крепления глушителя JCB 814/10177', '', ''),
(732, 1, 'Шпилька крепления турбины (8X75mm) JCB 320/06007', 'Шпилька крепления турбины (8X75mm) JCB 320/0600', '', 'Шпилька крепления турбины (8X75mm) JCB 320/06007', '', ''),
(733, 1, 'Шпилька крепления турбины JCB (Original) 826/11384', 'Шпилька крепления турбины JCB (Original) 826/1138', '', 'Шпилька крепления турбины JCB (Original) 826/11384', '', ''),
(734, 1, 'Болт шатунный на JCB 320/03040', 'Болт шатунный на JCB 320/0304', '', 'Болт шатунный на JCB 320/03040', '', ''),
(735, 1, 'Пробка сливная поддона двигателя JCB 320/04013', 'Пробка сливная поддона двигателя JCB. Артикул: 320/04013', '', 'Пробка сливная поддона двигателя JCB 320/04013', '', ''),
(736, 1, 'Болт шкива коленвала 02/100579 ORIGINAL Perkins (Оригинал)', '&lt;p&gt;&lt;b&gt;Болт шкива коленвала 02/100579 Perkins&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 02/100579&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;&lt;p&gt;&lt;b&gt;Производитель:&lt;/b&gt; ORIGINAL Perkins &lt;/p&gt;', '', 'Болт шкива коленвала 02/100579 ORIGINAL Perkins (Оригинал)', '', ''),
(737, 1, 'Форсунка масляная JCB 02/201734, 02/200392, 02/101615, 3861A027 ORIGINAL Perkins (Оригинал)', '&lt;p&gt;&lt;b&gt;Форсунка масляная JCB 02/201734, 02/200392, 02/101615, 3861A027 Perkins&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 02/201734, 02/200392, 02/101615, 3861A027&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Made in Great Britan&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Производитель:&lt;/b&gt; ORIGINAL Perkins &lt;/p&gt;', '', 'Форсунка масляная JCB 02/201734, 02/200392, 02/101615, 3861A027 ORIGINAL Perkins (Оригинал)', '', ''),
(738, 1, 'Коленвал JCB 320/03336', '&lt;p&gt;Оригинальный корленчатый вал 320/03336 для двигателя SB (DieselMax 444) экскаватора-погрузчика JCB 2005-2018 года выпуска.Оригинальное название: Crankshaft machiningАртикул: 320/03336Ищете запчасти JCB в Москве? Представляем вам большой ассортимент товаров от ведущих  производителей запасных частей и расходных материалов со всего мира. У нас вы можете купить оригинальные и неоригинальные запчасти JCB. Чтобы заказать их, добавьте изделия в Корзину и оформите покупку. Если у вас есть вопросы по продукции, задайте их менеджерам компании.&lt;/p&gt;', '', 'Коленвал JCB 320/03336', '', ''),
(739, 1, 'Коленвал JCB 320/03107', '&lt;p&gt;Представляем вам удобный каталог запчастей JCB онлайн. Здесь вы можете выбрать подходящие товары, добавить их в Корзину и заказать с доставкой на дом или самовывозом. Возможны специальные условия для оптовиков.В этом разделе представлен коленвал SB JCB 320/03107. Такой товар изготавливается из углеродистой и легированной стали, а также особо прочного чугуна (используется для дешевых автомобилей). Стальной вариант предпочтительнее для спецтехники, ведь для него характерен малый вес, потрясающая надежность и износостойкость. Чтобы купить коленвал, зарегистрируйтесь на нашем сайте.&lt;/p&gt;', '', 'Коленвал JCB 320/03107', '', ''),
(740, 1, 'Коленвал АВ, AK JCB 02/200915', '&lt;p&gt;Коленвал АВ AK JCB 02/200915 – это элемент ходовой части погрузчика, который используется для превращения поступательного движения шатунов во вращательное. Его основное предназначение – преобразовывать энергию горящих в цилиндрах мотора газов в механическую. Стальной коленчатый вал включает в себя несколько колен и коренных шеек, которые опираются на подшипники.Главная техническая характеристика этой прочной JCB детали – радиус кривошипа, представляющий собой область между осей коренных шеек до осей шатунных. Меняя параметры такого товара, вы меняете все параметры двигателя.&lt;/p&gt;', '', 'Коленвал АВ, AK JCB 02/200915', '', ''),
(741, 1, 'Шкив ролик опорный JCB 320/08623', '&lt;p&gt;Предлагаем вам приобрести запасные части для фронтального погрузчика. Все товары доступны для заказа оптом и в розницу, с доставкой на дом. Добавьте выбранную продукцию в Корзину и оформите покупку.В этом разделе представлен шкив ролик опорный JCB 320/08623 приводного ремня. Данная продукция используется в ременных приводах. Изделие представляет собой диск с плоской поверхностью, расположенный на стальной опоре. Такая запчасть JCB является фрикционным колесом с ободом по окружности. Ее главная задача – при помощи трения передавать импульс приводному ремню непосредственно с вала.&lt;/p&gt;', '', 'Шкив ролик опорный JCB 320/08623', '', ''),
(742, 1, 'Стартер DIESELMAX JCB 320/09452, 320/09454, 320/09144', '&lt;p&gt;Производитель: KRAUF&lt;/p&gt;&lt;p&gt;Страна-произвоитель: Германия&lt;/p&gt;&lt;p&gt;Серийный номер JCB: 320/09452, 320/09454, 320/09144&lt;/p&gt;&lt;p&gt;Стартер JCB 320/ 09452 – это важная часть электрооборудования современной специальной техники. Он являет собой мотор с четырьмя полюсами постоянного тока. Состоит из нескольких деталей: корпуса, якоря, втягивающего реле, обгонной муфты и приводной шестерни, щеткодержателя и щетки. Такая запчасть JCB питается от аккумуляторной батареи и бывает двух видов – с редуктором и без. Первые более надежные и легкие в ремонте, вторые работают дольше, весят меньше, потребляют минимум энергии.В каталоге запчастей спецтехники все товары можно приобрести онлайн, оптом и в розницу, с доставкой на дом или самовывозом.&lt;/p&gt;', '', 'Стартер DIESELMAX JCB 320/09452, 320/09454, 320/09144', '', ''),
(743, 1, 'Выпускной клапан AВ комплект JCB 02/101705', '&lt;p&gt;Предлагаем вам приобрести запчасти для экскаватора JCB. В ассортименте вы найдете и оригинальные, и неоригинальные товары от различных производителей со всего мира.В этом разделе представлен выпускной клапан AВ комплект JCB 02/101705. Это важная деталь газораспределительного механизма. Поршень в цилиндре мотора переходит от НМТ к ВМТ. Стоит открыть его, и отработавшие газы из камеры сгорания удалятся. Продукция должна иметь высокое качество, чтобы выдерживать значительные нагрузки и высокие температуры. Цена на выпускной клапан зависит от количества товаров, заказанных вами.&lt;/p&gt;', '', 'Выпускной клапан AВ комплект JCB 02/101705', '', ''),
(744, 1, 'Гидроцилиндр поворота задней стрелы JCB  559/60216', '&lt;p&gt;В этом разделе вы можете приобрести гидроцилиндр поворота задней стрелы 100х60 JCB. Если оценивать его принцип работы, то он напоминает пневмоцилиндр. Различием является только движущая сила – жидкость вместо воздуха. Цилиндр для гидравлики может использоваться во многих видах строительной и сельскохозяйственной техники. С его помощью передвигаются погрузчики, манипуляторы, навесное оборудование.В ассортименте интернет-магазина вы найдете и другие товары. Чтобы выбрать подходящую деталь, просмотрите обширный каталог запчастей спецтехники, представленный на нашем сайте.&lt;/p&gt;', '', 'Гидроцилиндр поворота задней стрелы JCB  559/60216', '', ''),
(745, 1, 'Толкатель клапанов ORIGINAL PERKINS (Оригинал) АК JCB 02/201396', '&lt;p&gt;Предлагаем вам купить толкатели клапанов, которые используются для передачи усилий на штангу от распределительного вала. Они выдерживают значительные нагрузки и производятся из качественных и долговечных материалов. Толкатель клапанов АК JCB 02/201396 состоит из корпуса и плунжера с двумя камерами. Он являет собой небольшую полость, в которую под давлением входит смазочная жидкость. Запчасти JCB представлены по приемлемой цене. Они рассчитаны на длительный срок эксплуатации и позволяют максимально увеличить мощь всего агрегата.Поломку данного элемента можно определить по характерному звону.&lt;/p&gt;', '', 'Толкатель клапанов ORIGINAL PERKINS (Оригинал) АК JCB 02/201396', '', ''),
(746, 1, 'Стартер PERKINS JCB 714/29500R, 2873k532, 2873k632', '&lt;p&gt;Производитель: KRAUF&lt;/p&gt;&lt;p&gt;Страна-произвоитель: Германия&lt;/p&gt;&lt;p&gt;Серийный номер JCB: 714/29500R&lt;/p&gt;&lt;p&gt;Серийный номер PERKINS: 2873k532, 2873k632&lt;/p&gt;&lt;p&gt;Предлагаем вам купить стартер погрузчика. Это устройство, которое раскручивает вал мотора для запуска. Оно является важным агрегатом пусковой системы двигателя внутреннего сгорания и неотъемлемой частью электрического оборудования любого современного автомобиля.Стартер для спецтехники RG,AK JCB 714/40531 состоит из корпуса, якоря, втягивающего реле, обгонной муфты и приводной шестерни, щеток и щеткодержателей. Конструкционно он являет собой мотор с четырьмя полюсами постоянного тока. Такие товары бывают с редукторами и без, они отличаются мощностью и назначением.&lt;/p&gt;', '', 'Стартер PERKINS JCB 714/29500R, 2873k532, 2873k632', '', ''),
(747, 1, 'Выпускной клапан AK комплект JCB 02/201598 4 шт', '&lt;p&gt;Предлагаем вам купить выпускной клапан, являющийся элементом газораспределительного механизма. В процессе работы погрузчика из камеры сгорания мотора вырываются газы. Они удаляются через выпускной клапан AK комплект JCB 02/201598. Газы выпускаются благодаря силе повышенного давления.Товар обладает высоким качеством, долговечностью и прочностью. Продукция должна выдержать значительные нагрузки и высокие температуры до шестисот-восьмисот градусов по Цельсию.Чтобы приобрести запчасти на спецтехнику JCB, вы можете зарегистрироваться на нашем сайте и добавить товар в Корзину.&lt;/p&gt;', '', 'Выпускной клапан AK комплект JCB 02/201598 4 шт', '', ''),
(748, 1, 'Трос акселератора JCB 910/60236', '&lt;p&gt;Трос акселератора JCB 910/60236 – практичная и износоустойчивая деталь для ходовой части спецтехники. Она выполнена по новейшей технологии с применением высококачественных материалов. Трос акселератора подлежит регулярной замене, так как возникшая поломка при движении транспорта может привести к неблагоприятным последствиям.Изделие совместимо с системами экскаваторов-погрузчиков JCB 3CX/4CX. Наша компания специализируется на предоставлении клиентам оригинальных запасных частей для спецтехники и осуществления ремонта машин в самые кратчайшие сроки. У нас купить трос акселератора можно по выгодной цене.&lt;/p&gt;', '', 'Трос акселератора JCB 910/60236', '', ''),
(749, 1, 'Корпус воздушного фильтра JCB 332/G3496', '&lt;p&gt;Корпус воздушного фильтра JCB – уникальный элемент британского производства, предназначенный для двигателя Perkins. Он предназначен для использования в сельскохозяйственной и промышленной технике. Так как корпус воздушного фильтра применяется в агрессивных условиях с повышенными условиями нагрузки, его изготовляют из прочного и износоустойчивого материала.Главная задача данной детали – предотвращение попадания дорожной пыли в двигатель, что чаще всего приводит к потере эксплуатационных качеств. Купить корпус воздушного фильтра мы предлагаем по доступной цене с возможностью технического обслуживания.&lt;/p&gt;', '', 'Корпус воздушного фильтра JCB 332/G3496', '', ''),
(750, 1, 'Распредвал двигателя АК JCB 02/192668', '&lt;p&gt;Распредвал двигателя АК JCB 02/192668, представленный в этом разделе, позволяет открывать и закрывать устройства мотора. Он устанавливается на верху головки блока цилиндров и соединяется со шкивом коленчатого вала. Распределительный вал двигателя является важной деталью газораспределительного механизма, синхронизирующего частоту работы мотора, впуска и выпуска топлива и газов.Такие запасные части JCB доступны для заказа онлайн. Чтобы приобрести товар, зарегистрируйтесь на нашем сайте и добавьте его в Корзину в нужном количестве. У вас возникли вопросы? Свяжитесь с менеджерами компании!&lt;/p&gt;', '', 'Распредвал двигателя АК JCB 02/192668', '', ''),
(751, 1, 'Стартер JCB двигателя DIESELMAX 320/09346', '&lt;p&gt;Производство: ISKRA (Letrika) SloveniaСерийный номер производителя: IS1105. AZF4224. 11.131.848Серийный номер JCB: 320/09346, 320/09022, 320/09032, 320/09035, 320/09144, 320/09409Стартер JCB двигателя DIESELMAX 320/09346 относится к оригинальным товарам. Он произведен в Словении, компанией ISKRA. Главные преимущества этой запчасти для экскаватора JCB – великолепные технические характеристики, долговечность и легкость в монтаже. Устройство позволяет запустить двигатель из неподвижного состояния. Если вы будете оберегать данное приспособление от минусовых температур, оно прослужит вам действительно долго.Цена стартера двигателя SB, выпущенного в период с 2005 по 2015 год, указана на странице товара за единицу. Его напряжение 12 вольт, мощность 4.2 кВт.&lt;/p&gt;', '', 'Стартер JCB двигателя DIESELMAX 320/09346', '', ''),
(752, 1, 'Аккумулятор оригинальный JCB 105 А/ч 729/10663', '&lt;p&gt;Аккумулятор оригинальный JCB 105 А/ч 729/10643, 729/10663, 708/04100 для спецтехники JCB.&lt;/p&gt;&lt;p&gt;Назначение: экскаватор-погрузчик JCB 3CX, 4CX, 5CX.&lt;/p&gt;&lt;p&gt;Емкость: 105 Ач&lt;/p&gt;&lt;p&gt;Пусковой ток: 750 А&lt;/p&gt;&lt;p&gt;Оригинальное название: Battery wet charge,type 643 Standard duty&lt;/p&gt;', '', 'Аккумулятор оригинальный JCB 105 А/ч 729/10663', '', ''),
(753, 1, 'Датчик КПП JCB 716/30123', '&lt;p&gt;Датчик КПП JCB 716/30123 – это специальный измеритель, который находится в области вала селектора. Он отвечает за особенности передачи информации о том, в каком положении находится рычаг (данная рукоятка ответственна за переключение скоростей). Эта деталь посылает сигнал контроллеру коробки и обеспечивает управление другими элементами.Она может выйти из строя, если в ней не будет специальной защиты, если герметичность будет нарушена и внутрь попадет влага, в случае стирания контактов. В таком случае потребуется замена. Цена на запчасть JCB указана на странице товара за единицу.&lt;/p&gt;', '', 'Датчик КПП JCB 716/30123', '', ''),
(754, 1, 'Массаотключатель JCB 701/47400', '&lt;p&gt;Массаотключатель JCB 701/47400 также известен как «выключатель массы». Он является частью электрического оборудования специальной техники. Товар изготовлен из стали, он обладает высоким качеством, прочностью и надежностью. Чтобы выбрать подходящую деталь, проконсультируйтесь с менеджерами компании. Необходимо назвать полный тип транспорта, серийный номер, модель двигателя и другие сведения. Специалист подберет для вас нужные детали. Вы можете заказать запчасти для экскаватора JCB с доставкой по Москве или в другие города. Также возможен самовывоз из наших магазинов.&lt;/p&gt;', '', 'Массаотключатель JCB 701/47400', '', ''),
(755, 1, 'Стартер JCB двигателя PERKINS 714/40531', '&lt;p&gt;Производство: ISKRA (Letrika) SloveniaНапряжение/мощность: 14V, 3.2 кВтСерийный номер производителя: IS1201. AZE4173. 11.131.781Серийный номер JCB: 714/40231, 714/40159, 714/40159R, 714/40531, 714/40536(788128, 2873K405) В этом разделе представлен оригинальный стартер JCB двигателя PERKINS 417/40159, 417/29500,417/14300. Товар изготовлен в Словении, компанией ISKRA. Он осуществляет мгновенное зажигание и обеспечивает быстрое зацепление шестеренки с маховиком. Устройство состоит из корпуса, вала привода, бендикса, обгонной муфты и других элементов. Такие запчасти на спецтехнику JCB обладают прекрасными техническими характеристиками. Они многофункциональны, просты по своей конструкции, прочны и долговечны. Чтобы узнать, сколько стоит стартер на двигатель, просмотрите страницу товара. Актуальная цена указана под названием.&lt;/p&gt;', '', 'Стартер JCB двигателя PERKINS 714/40531', '', ''),
(756, 1, 'Переключатель крабового хода JCB 701/42700', '&lt;p&gt;Предлагаем вам заказать детали из каталога запчастей JCB онлайн. Зарегистрировавшись в нашем интернет-магазине, вы сможете приобрести любые товары с доставкой или самовывозом. В ассортименте представлена и оригинальная продукция, и от сторонних компаний. Мы предлагаем только качественные товары от проверенных фирм.В этом разделе представлен переключатель 4WD JCB 701/42700. С помощью этого устройства можно выбирать интересующий вас режим движения, в данном случае – полноприводный. Выбор режима зависит от дорожных условий. Он позволяет преодолевать скользкие участки, заснеженные или песчаные дороги.&lt;/p&gt;', '', 'Переключатель крабового хода JCB 701/42700', '', ''),
(757, 1, 'Тахометр JCB 704/50097', '&lt;p&gt;Тахометр JCB 704/50097 – это измерительный прибор, который определяет частоту вращения разнообразных деталей. Устройство позволяет узнать, сколько оборотов за единицу времени совершает вращающийся элемент. Этот товар является необходимой запасной частью, которая располагается в кабине JCB 4CX. Часто тахометром оборудуется приборная панель транспорта. Данные с устройства могут передаваться и на цифровой дисплей, и на аналоговый стрелочный указатель.Чтобы купить запчасти на погрузчик, необходимо зарегистрироваться на нашем сайте. Менеджеры помогут вам определиться с выбором продукции.&lt;/p&gt;', '', 'Тахометр JCB 704/50097', '', ''),
(758, 1, 'Аккумулятор JCB STORM 125 А/ч 729/10655', '&lt;p&gt;Мощный аккумулятор неоригинальный STORM Proffesional Power 125 А/ч 729/10655, 729/11655, 729/10647, 707/05100, 708/10060 для спецтехники JCB.Назначение: экскаватор-погрузчик JCB 3CX, 4CX, 5CX.Емкость: 125 АчПусковой ток: 1100 АПроизводитель: ПольшаНазначение: спецтехника JCB для экскаваторов-погрузчиков моделей 3CX, 4CX, 5CX и полноповоротных экскаваторов JS-серии (соединяются параллельно два аккумулятора).Данный аккумулятор полностью готов к работе, заряжен и залит электролитом, необходимо лишь установить батарею и запустить спецтехнику.Предлагаем вам приобрести аккумулятор JCB STORM 125 А/ч. Данный товар соответствует самым высоким требованиям заказчиков. Он обладает значительным стартерным током, впечатляющим сроком эксплуатации. Прочный корпус не боится механических воздействий и ударов, устойчив к вибрации и интенсивной эксплуатации. Товар легко выдержит огромное количество циклов зарядки и разрядки. Цена аккумулятора для погрузчика указана на странице товара за единицу. Вы можете приобрести его оптом и в розницу, как и другие товары из каталога запчастей спецтехники. Если у вас возникли вопросы, свяжитесь с менеджерами компании.&lt;/p&gt;', '', 'Аккумулятор JCB STORM 125 А/ч 729/10655', '', ''),
(759, 1, 'Тахометр JCB 704/50227', '&lt;p&gt;Тахометр JCB 704/50227&lt;/p&gt;', '', 'Тахометр JCB 704/50227', '', ''),
(760, 1, 'Генератор JCB двигатель DIESELMAX 320/08719, 320/08648', '&lt;p&gt;Производитель: KRAUF&lt;/p&gt;&lt;p&gt;Страна-произвоитель: Германия&lt;/p&gt;&lt;p&gt;Серийный номер JCB: 320/08719, 320/08648&lt;/p&gt;&lt;p&gt;Представляем вам впечатляющий каталог запасных частей JCB. В ассортименте вы найдете и оригинальные детали, и произведенные сторонними компаниями.В этом разделе представлен генератор JCB двигатель DIESELMAX 320/08649. Деталь выпущена компанией ISKRA. Элемент необходим для превращения механической энергии в электрическую. Товар из каталога оригинальных запчастей спецтехники состоит из ротора, статора, щеточного узла и регулятора напряжения. Все качественные компоненты заключены в корпус, защищенный от пыли и грязи. Изделие отличается компактностью, износостойкостью и эффективностью.&lt;/p&gt;', '', 'Генератор JCB двигатель DIESELMAX 320/08719, 320/08648', '', ''),
(761, 1, 'Датчик температуры охл.жидкости (холодный пуск) JCB 320/04554', '&lt;p&gt;Интересует, где купить датчик температуры охлаждающей жидкости? Предлагаем вам приобрести его в нашем каталоге! В ассортименте представлено огромное количество качественной продукции. Датчик температуры охл.жидкости (холодный пуск) JCB 320/04554 используется для измерения и передачи данных о настоящей температуре тосола или антифриза. После определения данные передаются на электронный блок управления. Эта информация требуется контроллеру специальной техники для регулировки ряда систем.Чтобы заказать запчасти JCB оптом или в розницу, зарегистрируйтесь на нашем сайте.&lt;/p&gt;', '', 'Датчик температуры охл.жидкости (холодный пуск) JCB 320/04554', '', ''),
(762, 1, 'Датчик температуры охлаждающей жидкости AB JCB 716/12800', '&lt;p&gt;Предлагаем вам купить запчасти на погрузчик. В ассортименте вы найдете и оригинальные, и неоригинальные товары от известных производителей. В этом разделе представлен датчик температуры охл.жидкости AB JCB 716/12800. Он являет собой корпус, в котором заключено несколько элементов. Среди них полупроводниковый термистор, электрический разъем и пружина, проводящая ток. Такая деталь JCB используется для измерения температуры тосола или антифриза. Полученные данные передаются на электронный блок управления. Эта информация требуется контроллеру спецтехники для регулировки ряда систем.&lt;/p&gt;', '', 'Датчик температуры охлаждающей жидкости AB JCB 716/12800', '', ''),
(763, 1, 'Печка отопителя JCB в сборе ОРИГИНАЛ 332/C4284', '&lt;p&gt;Печка отопителя JCB в сборе 332/C4284 – многофункциональное электрооборудование в оригинальном исполнении от всемирно известного английского производителя. Оно выполнено по уникальной технологии с использованием современных материалов и методик. Система кондиционирования позволяет поддерживать оптимально комфортную температуру в кабине на протяжении всего периода работы оператора. Купить запчасти в интернет-магазине jcbprof в Москве можно в широком ассортименте по низкой цене. Наши менеджеры помогут в выборе и предоставят выгодные условия оплаты и доставки. Каталог запчастей JCB порадует клиентов огромным разнообразием механизмов и аксессуаров, предназначенных для улучшения эксплуатационных свойств вашей спецтехники.&lt;/p&gt;', '', 'Печка отопителя JCB в сборе ОРИГИНАЛ 332/C4284', '', ''),
(764, 1, 'Датчик температуры охл.жидкости AK JCB 716/24200', '&lt;p&gt;Предлагаем вам купить запчасти на спецтехнику в Москве. Для этого необходимо зарегистрироваться на нашем сайте. Магазин JCB предоставляет запчасти с оперативной доставкой. Товары доступны оптом и в розницу. В этом разделе вы найдете датчик температуры охл.жидкости AK JCB 716/24200. Он необходим для получения данных о температуре тосола или антифриза. После того, как информация получена, она подается на электронный блок управления. Далее контроллер спецтехники регулирует кулер радиатора охлаждения, концентрацию топлива в смеси, обороты холостого хода при прогреве двигателя.&lt;/p&gt;', '', 'Датчик температуры охл.жидкости AK JCB 716/24200', '', ''),
(765, 1, 'Резистор печки отопителя JCB 716/30152', '&lt;p&gt;Резистор печки отопителя JCB, представленный в этом разделе, подходит для моделей 3СХ и 4СХ. Данный товар необходим, когда «родная» деталь выходит из строя. Чаще всего причиной этого является перегрев, который обычно происходит из-за забитого салонного фильтра. Если не заменить такие запчасти для экскаватора JCB, вентилятор будет работать исключительно на максимальных оборотах. Это будет создавать сильный посторонний шум, который неизбежно помешает работе оператора. Еще одна причина выхода данного товара из строя – поломка мотора. Все нужные запасные части для погрузчиков представлены в нашем каталоге.&lt;/p&gt;', '', 'Резистор печки отопителя JCB 716/30152', '', ''),
(766, 1, 'Датчик температуры охл.жидкости RG JCB 701/80389', '&lt;p&gt;Датчик температуры охл.жидкости RG JCB 701/80389 используется для получения данных о нагреве тосола или антифриза. Измерения передаются на электронный блок управления. В результате контроллер проверяет различные системы. Датчик температуры имеет довольно простой принцип работы. Температура влияет на полупроводники, меняя их электросопротивление. Конструкция изделия включает в себя корпус, резистор, который меняет сопротивление при охлаждении или нагреве, пружину, которая проводит ток, электроразъем.Эти запасные части JCB можно приобрести в нашем интернет-магазине.&lt;/p&gt;', '', 'Датчик температуры охл.жидкости RG JCB 701/80389', '', ''),
(767, 1, 'Датчик холодного пуска ORIGINAL Perkins (Оригинал) JCB 701/60014', '&lt;p&gt;Датчик холодного пуска JCB 701/60014 ORIGINAL Perkins (Оригинал) передает сигнал системе двигателя. Он также известен как термовременное реле форсунки. Чтобы проверить работоспособность системы холодного пуска, нужно сперва осмотреть все элементы визуально. Схема действует следующим образом: компьютер опрашивает датчики JCB 3CX, тестирует цепи на исправность, а затем обеспечивает запуск мотора. Когда ключ зажигания поворачивается, на стартер подается питания.Этот и другие товары вы можете приобрести в нашем интернет-магазине. Мы занимаемся продажей запчастей JCB, как оригинальных, так и от других производителей.&lt;/p&gt;', '', 'Датчик холодного пуска ORIGINAL Perkins (Оригинал) JCB 701/60014', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(768, 1, 'Датчик давления масла ORIGINAL (Оригинал) КПП JCB 701/M7305', '&lt;p&gt;Датчик давления трансмиссионного масла в коробке переключения передач экскаватора-погрузчика JCB 3CX, JCB 4CX.Описание: Swith Oil Pressure M12Датчик давления масла JCB устанавливается на все современные коробки переключения передач JCB - PowerShift, SideShift, SynchrosShuttl. Его назначение - определять и сигнализировать при недостаточном или избыточном давлении в трансмиссии переключения передач, когда дальнейшая работа может привести к выходу из строя узлов трансмиссии. На панели приборов загорается сигнализирующий знак в виде шестерен оранжевого цвета, что означает возможные проблемы в работе коробки передач. Датчик давления 701/M7305 срабатывает при недостаточном уровне трансмиссионного масла в коробке, или залитии масла значительно выше положенного уровня, при некорректной работе масляного фильтра трансмиссии, при неверном подборе масла в коробку переключения передач, выходе масляного насоса из строя и т.д.Датчик давления масла КПП JCB 701/M7305 монтируется на последние коробки переключения передач погрузчиков. Задача этой детали для спецтехники – выявлять и показывать лишнее или минимальное давление в трансмиссии, при котором продолжение действий может сломать узлы системы. Такие запасные части для экскаваторов включаются при маленьком уровне трансмиссионного масла, или его чрезмерном залитии, при неправильной эксплуатации фильтрующего элемента, при неверном выборе жидкости, разрушении или отключении насоса и т.д. На приборной панели включается сигнал в форме шестеренки шестерен оранжевого цвет. Это показывает оператору возникновение проблемы.&lt;/p&gt;', '', 'Датчик давления масла ORIGINAL (Оригинал) КПП JCB 701/M7305', '', ''),
(769, 1, 'Замок зажигания JCB аналог 701/80184', '&lt;p&gt;В этом разделе представлен замок зажигания JCB неоригинальный 701/80184. Это устройство посылает энергию от аккумулятора к реле и позволяет двигателю заводиться. Товар подходит для популярных моделей 3СХ и 4СХ. В наборе также представлены следующие элементы: гайка-фиксатор, кольцо, два ключа. Цена на замок зажигания указывается на странице товара за единицу.Наша компания занимается продажей запчастей JCB. Мастера могут установить купленный вами товар на специальную технику, произвести технический осмотр и ремонт. Если это вас заинтересовало, свяжитесь с нашими менеджерами.&lt;/p&gt;', '', 'Замок зажигания JCB аналог 701/80184', '', ''),
(770, 1, 'Датчик температуры JCB 701/80324', '&lt;p&gt;Датчик температуры JCB 701/80324 для спецтехники JCBОригинальное название: Switch oil temp 5/8 UNF Deutsch connectorДатчик температуры JCB 701/80324 предназначен для замены вышедшей из строя аналогичной детали на погрузчиках JCB. Оригинальное название: Switch oil temp 5/8 UNF Deutsch connector. В нашем каталоге запасных частей для экскаватора-погрузчика JCB представлены детали для спецтехники в широком ассортименте по самым оптимальным ценам от мировых производителей.В нашем интернет-магазине JCB-запчастей вы можете купить детали для погрузчика, комплектующие, расходники. Все товары имеют сертификат соответствия и гарантийные сроки. Каждая запчасть изготовлена в строгом соответствии с международными требованиями к качеству и безопасности продукции.&lt;/p&gt;', '', 'Датчик температуры JCB 701/80324', '', ''),
(771, 1, 'Датчик температуры двигателя JCB 701/80317', '&lt;p&gt;Датчик температуры двигателя JCB 701/80317 для спецтехники JCBОригинальное название: Switch temperatureДатчик температуры двигателя JCB 701/80317 представляет собой полупроводниковый резистор, сопротивление которого меняется от температуры. Он является комплектующей патрубка охлаждающей жидкости. В нашем каталоге запчастей для спецтехники JCB представлены детали в широком ассортименте по самым оптимальным ценам от мировых производителей.У нас вы можете купить детали для погрузчика, комплектующие, расходники. Все товары имеют сертификат соответствия и гарантийные сроки. Каждая запчасть изготовлена в строгом соответствии с международными требованиями к качеству и безопасности продукции.&lt;/p&gt;', '', 'Датчик температуры двигателя JCB 701/80317', '', ''),
(772, 1, 'Реле сигнала поворота JCB 716/25800', '&lt;p&gt;Представляем вам реле сигнала поворота JCB 716/25800. Товар используется также для регулировки аварийных световых сигналов. Он необходим для обеспечения безопасности во время маневров на дороге. Реле соответствует моделям JCB 3CX, 4CX. Оно отвечает за мерцание ламп и создание необходимого звукового сигнала во время аварийной остановки. Оборудование обладает следующими характеристиками: 12 вольт, 2*21W (4*21W). Оно изготовлено в Испании.В нашем каталог запчастей спецтехники вас ждет огромный ассортимент товаров по приемлемым ценам. Вы можете заказать их онлайн, с доставкой или самовывозом из магазинов.&lt;/p&gt;', '', 'Реле сигнала поворота JCB 716/25800', '', ''),
(773, 1, 'Клапан соленоид черепахи JC 25/222657', '&lt;p&gt;Представляем вам клапан соленоид черепахи JCB 25/222657. Товар относится к оригинальным. Он специально подготовлен для специальной техники от английского бренда, совместим с моделями экскаватора-погрузчика 3СХ, 4СХ, 5СХ. Электромагнитный клапан JCB изготовлен в Англии, известной по всему миру компанией J.C.Bamford Ltd. Он обладает высоким качеством и долгим сроком службы.Чтобы приобрести запчасти оптом или в розницу, зарегистрируйтесь на нашем сайте. Если у вас возникли вопросы, свяжитесь с менеджерами нашей компании. Они помогут вам выбрать подходящий товар и сделать заказ онлайн.&lt;/p&gt;', '', 'Клапан соленоид черепахи JC 25/222657', '', ''),
(774, 1, 'Термостат JCB Perkins AK 02/202107 Оригинал', '&lt;p&gt;Представляем вам термостат JCB Perkins AK 02/202107. Его главное назначение – охлаждение двигателя. Он состоит из корпуса, выводного клапана, соединяющего их стержня и баллона со спиртом. Термостат устанавливается на модели JCB 4CX и 3CX, выпущенные в период с 1998 по 2005 годы. Устройство необходимо для правильной и эффективной работы мотора в жаркий сезон, при увеличении температуры воздуха. Своевременное охлаждение оберегает внутренние элементы мотора и продлевает срок его службы.Вы можете заказать запчасти оптом в нашем интернет-магазине, с доставкой или самовывозом.&lt;/p&gt;', '', 'Термостат JCB Perkins AK 02/202107 Оригинал', '', ''),
(775, 1, 'Блок предохранителей JCB 716/30077', '&lt;p&gt;Предлагаем вам высококачественный блок предохранителей JCB 716/30077. Он подходит для моделей экскаваторов-погрузчиков 3CX, 4CX. Данное устройство является очень важным, ведь оно исключает возможность возникновения короткого замыкания. Оно необходимо тогда, когда требуется мгновенно разомкнуть электрическую цепь на запасных частях JCB. При выборе такого товара необходимо учитывать определенную силу тока, на которую рассчитана электроцепь.Чтобы купить блок предохранителей, зарегистрируйтесь на нашем сайте. Если у вас возникли вопросы, свяжитесь с менеджерами компании.&lt;/p&gt;', '', 'Блок предохранителей JCB 716/30077', '', ''),
(776, 1, 'Реле поворота колес JCB 728/3000', '&lt;p&gt;Реле поворота колес JCB 728/30000 для экскаватора-погрузчика JCBОригинальное название: Control Steer Mode ECUНазначение: блок управления крабовым ходом, положением и поворотом колесИщете качественные запчасти для JCB в Москве?Просмотрите наш каталог!В ассортименте представлены оригинальные и OEM товары с гарантией качества, выпущенные проверенными производителями со всего мира. Много деталей относится к ходовой части погрузчика. Например, в этом разделе вы можете приобрести реле поворота колес JCB 728/30000. Это устройство, которое заставляет осветительные приборы на транспорте включаться и выключаться при маневре или при движении крабовым ходом. Оно не только подает пульсирующие импульсы на лампы, но и запускает специальный щелкающий звук. Такая деталь крайне важна для безопасности оператора и рабочих на площадке.&lt;/p&gt;', '', 'Реле поворота колес JCB 728/3000', '', ''),
(777, 1, 'Ключ зажигания JCB 701/45501', '&lt;p&gt;Ключ зажигания JCB – необходимая деталь, приводящая в работу двигатель машины. Она предназначена для спецтехники моделей 3CX и 4CX. Изделие имеет эргономичную форму, что облегчает его использование. Купить ключ зажигания можно в случае поломки оригинала или для наличия запасного комплекта.Его задача заключается во включении стартера двигателя и подачи питания к электросистемам. Также элемент способен отмыкать защелку устройства, за которым расположен аккумулятор. Интернет-магазин jcbprof купить ключ зажигания в Москве по низким ценам, а также заказать ремонт спецтехники или плановое обслуживание.&lt;/p&gt;', '', 'Ключ зажигания JCB 701/45501', '', ''),
(778, 1, 'Клапан соленоид КПП JCB 459/M2874, 25/220804', '&lt;p&gt;Оригинальный электромагнитный клапан 459/M2874, 25/220804 на коробку переключения передач спецтехники JCB.Оригинальное название: Valve solenoid assemblyЭлектромагнитный клапан соленоид КПП JCB 459/M2874, 25/220804 является неотъемлемой частью трансмиссии коробки переключения передачи JCB. Он позволяет управлять электросигналом, который поступает по электропроводке - включая и отключая передачи трансмиссии. Период срабатывания практически мгновенен, составляя несколько милисекунд. Клапан состоит из металлического корпуса с каналом и разделенным сердечником, состоящим из стержня и штока.Эти запчасти устанавливаются на экскаватор погрузчик JCB, они подходят для моделей 3CX, 4CX и 5СХ. Чтобы купить клапан соленоид, свяжитесь с нами любым удобным для вас способом.Менеджеры помогут вам выбрать и заказать нужный товар.&lt;/p&gt;', '', 'Клапан соленоид КПП JCB 459/M2874, 25/220804', '', ''),
(779, 1, 'Блок соленоидов КПП JCB 459/10117', '&lt;p&gt;Представляем вам оригинальные и неоригинальные запчасти для экскаватора JCB. Товары в нашем магазине отличаются высоким качеством и эффективностью, долгим сроком службы. В этом разделе вы можете купить клапан-соленоид. Деталь состоит из магнита, представляющего собой стержень с медной обмоткой. На него поступает постоянный ток. Типичной проблемой, приводящей к износу изделия, является перегорание электрической обмотки или износ элементов. Блок соленоидов КПП JCB 459/10117 представляет собой набор электрических магнитных клапанов. Они обладают значительной надежностью.&lt;/p&gt;', '', 'Блок соленоидов КПП JCB 459/10117', '', ''),
(780, 1, 'Блок управления JCB 704/21600', '&lt;p&gt;Блок управления JCB – это неотъемлемый элемент современного транспорта от английского бренда. Он отвечает за различные узлы и системы, ответственен за работу мотора, трансмиссии и прочих агрегатов. Если такая запасная часть фронтального погрузчика вышла из строя, ее необходимо заменить как можно скорее, выбрав нужный товар из каталога запчастей спецтехники. Предварительно лучше произвести полный технический осмотр вашего транспортного средства, чтобы определить точную причину поломки. Для этого вы можете обратиться к нашим специалистам. Менеджеры проконсультируют вас и помогут выбрать время для ТО и ремонта.&lt;/p&gt;', '', 'Блок управления JCB 704/21600', '', ''),
(781, 1, 'Реле JCB 716/09500', '&lt;p&gt;Предлагаем вам приобрести запасные части JCB. Их можно заказать онлайн, добавив нужные товары в Корзину.В этом разделе представлено реле JCB 716/09500. Оно представляет собой электрический выключатель, разъединяющий или соединяющий цепь в соответствии с заданным сигналом. Товар состоит из якоря, магнитов и соединяющих деталей. С его помощью регулируется работа различных объектов. Устройство способно значительно усиливать импульс, замыкая мощную цепь, когда на него подается малое электричество. Цена на реле указывается на странице товара за единицу. Вы можете заказать его оптом и в розницу.&lt;/p&gt;', '', 'Реле JCB 716/09500', '', ''),
(782, 1, 'Реле (4 контакта) JCB 716/00600', '&lt;p&gt;В нашем каталоге запчастей для спецтехники вы найдете большое количество товаров, необходимых для починки погрузчика от английского бренда. В этом разделе представлено реле на 4 контакта JCB 716/00600. Товар также состоит из якоря и магнитов. Он включается под действием электротока, поступающего на обмотку.Устройство поставляется от надежного производителя. Оно обладает быстрым действием и высокой чувствительностью, впечатляющей надежностью и селективностью. Чтобы заказать запчасти JCB с доставкой по Москве, зарегистрируйтесь на нашем сайте. Менеджеры помогут вам сделать заказ.&lt;/p&gt;', '', 'Реле (4 контакта) JCB 716/00600', '', ''),
(783, 1, 'Реле (5 контактов) JCB 716/09800', '&lt;p&gt;Предлагаем вам детали JCB от проверенных производителей. В каталоге реле вы найдете надежные и чувствительные элементы, обладающие быстродействием и селективностью.Реле на 5 контактов JCB 716/09800, представленное в этом разделе, являет собой электромагнитное переключающее устройство. Оно контролирует работу управляемых объектов в случае, когда на них поступает нужное значение сигнала. Также устройство усиливает поступающий сигнал, подключая более мощную цепь. Такие элементы могут работать от постоянного и переменного токов. Также они различаются по начальному состоянию контактов.&lt;/p&gt;', '', 'Реле (5 контактов) JCB 716/09800', '', ''),
(784, 1, 'Реле микро JCB 716/30149', '&lt;p&gt;Предлагаем вам приобрести запчасти для спецтехники JCB из широкого ассортимента. В этом разделе представлено реле микро JCB 716/30149. Он представляет собой электромагнитный прибор, коммутирующий сигналы значительной мощности и управляющий импульсом минимальной мощности. Деталь замыкает и размыкает участки цепей при изменении входного действия. Такой товар обладает необходимым для работы погрузчика напряжением на катушке и небольшой группой контактов.Чтобы забрать реле из магазина в Москве, ознакомьтесь с графиком нашей работы. Вы также можете заказать товар с оперативной доставкой.&lt;/p&gt;', '', 'Реле микро JCB 716/30149', '', ''),
(785, 1, 'Соленоид трансмиссии JCB 25/220992', '&lt;p&gt;Предлагаем вам купить запчасти на погрузчик. В этом разделе представлен соленоид трансмиссии JCB 25/220992. Он является важной составляющей автоматической коробки передач. Изделие устанавливают в гидравлической клапанной плите. Оно отвечает за передачу импульса между электро- и гидросистемами. Электромагнитный клапан закрывает и открывает масляный поток, управляя режимами коробки передач. Он может переключить передачи или разблокировать гидротрансформатор.Чтобы купить соленоид на JCB, необходимо зарегистрироваться на нашем сайте и добавить товар в Корзину.&lt;/p&gt;', '', 'Соленоид трансмиссии JCB 25/220992', '', ''),
(786, 1, 'Клавиша включения гидромолота JCB 701/60002', '&lt;p&gt;Предлагаем вам купить запчасти на спецтехнику в Москве. В этом разделе представлена клавиша включения гидромолота JCB 701/60002. Деталь представляет собой кнопку с выводом к гидравлическому молоту. Такое навесное оборудование используется для разбивания скальных пород, асфальта, железобетона, замерзшего грунта. Например, его часто применяют во время зимних земляных работ или строительства. При включении этой запасной части JCB, молот начинает совершать поступательные движения, разрушая поверхность. Это оборудование универсально и эффективно. Его монтируют вместо ковша, подключая к гидравлической системе.&lt;/p&gt;', '', 'Клавиша включения гидромолота JCB 701/60002', '', ''),
(787, 1, 'Клавиша аварийного сигнала JCB 701/60005', '&lt;p&gt;Представляем вам обширный каталог запасных частей JCB. Все товары можно приобрести онлайн с доставкой или забрать самовывозом. В ассортименте вы найдете и оригинальные запчасти для экскаватора, и изделия от сторонних производителей.Клавиша аварийного сигнала JCB 701/60005 используется для информирования окружающих о нестандартной ситуации во время движения. Ее включают при авариях или поломках, во время вынужденной остановки в запрещенном месте. Кнопка включает поворотники и их повторители, запуская одновременно шесть световых приборов. Она оснащена выводами для перекоммутации цепей источников света.&lt;/p&gt;', '', 'Клавиша аварийного сигнала JCB 701/60005', '', ''),
(788, 1, 'Соленоид клапан на КПП JCB 25/104700, 35/900601, 25/103000', '&lt;p&gt;Предлагаем вам купить клапан соленоид. Этот товар доступен для заказа онлайн из каталога запчастей JCB. Детали можно приобрести с доставкой или забрать самовывозом из наших магазинов.Соленоид клапан на КПП JCB 25/104700 способен управляться электросигналом, который проходит по проводам. Он выполняет работу по закрытию и открытию масляного канала, а также отвечает за управление режимами коробки передач. Оборудование располагают в гидравлической клапанной плите. Деталь состоит из стержня, обвитого проволокой. Столбик из металла способен передвигаться от конца спирали к ее началу.&lt;/p&gt;', '', 'Соленоид клапан на КПП JCB 25/104700, 35/900601, 25/103000', '', ''),
(789, 1, 'Поводок переднего дворника стеклоочистителя JCB 714/40282', '&lt;p&gt;Оригинальный номер: Arm wiper twin armПоводок переднего дворника стеклоочистителя JCB 714/40282 – это комплектующая, посредством который приводится в движение механизм стеклоочистителя. Предназначается деталь для JCB 3CX, 4CX, 5CX. В каталоге продукции можно выбрать необходимые запчасти.Наш интернет-магазин предлагает запчасти на экскаватор-погрузчик JCB от производителя по самым привлекательным ценам. Каждая запчасть изготовлена в строгом соответствии с международными требованиями к качеству и безопасности продукции, сопровождается сертификатами и гарантийными обязательствами. Заказывайте необходимые детали только у нас!&lt;/p&gt;', '', 'Поводок переднего дворника стеклоочистителя JCB 714/40282', '', ''),
(790, 1, 'Соленоид крабового хода JCB 25/221054 477/00824 717/20142 721/10763', '&lt;p&gt;Соленоид крабового хода JCB 717/20142 для трансмиссии экскаватора-погрузчика JCBОригинальное название: Coil 12vСоленоид крабового хода JCB 717/20142 является необходимым товаром для экскаватора-погрузчика. Он является разновидностью катушки индуктивности. Используется преимущественно в машинах с равновеликими колесами. Приспособление обеспечивает специальной технике возможность особого движения боком, в условиях недостатка свободного пространства. Вы можете купить соленоид по приемлемой цене, указанной на странице товара за единицу.Чтобы купить запчасти на погрузчик, зарегистрируйтесь на нашем сайте. Если у вас возникли вопросы, свяжитесь с менеджерами компании.&lt;/p&gt;', '', 'Соленоид крабового хода JCB 25/221054 477/00824 717/20142 721/10763', '', ''),
(791, 1, 'Аккумулятор JCB STORM 125 А/ч 729/10655', '&lt;p&gt;Мощный аккумулятор неоригинальный STORM Proffesional Power 125 А/ч 729/10655, 729/11655, 729/10647, 707/05100, 708/10060 для спецтехники JCB.Назначение: экскаватор-погрузчик JCB 3CX, 4CX, 5CX.Емкость: 125 АчПусковой ток: 1100 АПроизводитель: ПольшаНазначение: спецтехника JCB для экскаваторов-погрузчиков моделей 3CX, 4CX, 5CX и полноповоротных экскаваторов JS-серии (соединяются параллельно два аккумулятора).Данный аккумулятор полностью готов к работе, заряжен и залит электролитом, необходимо лишь установить батарею и запустить спецтехнику.Предлагаем вам приобрести аккумулятор JCB STORM 125 А/ч. Данный товар соответствует самым высоким требованиям заказчиков. Он обладает значительным стартерным током, впечатляющим сроком эксплуатации. Прочный корпус не боится механических воздействий и ударов, устойчив к вибрации и интенсивной эксплуатации. Товар легко выдержит огромное количество циклов зарядки и разрядки. Цена аккумулятора для погрузчика указана на странице товара за единицу. Вы можете приобрести его оптом и в розницу, как и другие товары из каталога запчастей спецтехники. Если у вас возникли вопросы, свяжитесь с менеджерами компании.&lt;/p&gt;', '', 'Аккумулятор JCB STORM 125 А/ч 729/10655', '', ''),
(792, 1, 'Стартер PERKINS JCB 714/40231, 714/40531, 417/40159, 714/40536', '&lt;p&gt;Производитель: KRAUF&lt;/p&gt;&lt;p&gt;Страна-произвоитель: Германия&lt;/p&gt;&lt;p&gt;Серийный номер JCB: 714/40231, 714/40531, 417/40159, 714/40536&lt;/p&gt;&lt;p&gt;Стартер экскаватора JCB 3CX представляет собой двигатель постоянного тока с двумя обмотками (подвижной роторной и неподвижной статорной). Это важнейшая часть специальной техники. Он используется для пуска двигателя.Он требует немедленной замены вследствие выхода из строя. Причиной чаще является поломка механической части, иногда проблема кроется в электрической части. Признаки неисправности стартера RG,AK JCB 714/40231 – возникновение металлических звуков и скрежета, отсутствие завода мотора, отсутствие щелчка втягивающего реле. Все эти ситуации нельзя игнорировать, нужно провести диагностику.&lt;/p&gt;', '', 'Стартер PERKINS JCB 714/40231, 714/40531, 417/40159, 714/40536', '', ''),
(793, 1, 'Генератор JCB двигателя DIESELMAX 320/08610', '&lt;p&gt;ОписаниеОтзывыАренда JCBОригинальный генератор для двигателя SB DieselMax 444 экскаватора-погрузчика JCB 3CX, 4CX, 5CX модельного ряда 2005-2017 года выпускаОригинальное название: Alternator 14V-95AMPПроизводство: ISKRA Mahle (Letrika)Страна производства: СловенияНапряжение/ток: 95А, 14VПосадочные размеры: 78*10,2*93,7Серийный номер производителя: AAK5807. IA1212. 11.204.115JCB	320/08648JCB	320/08560JCB	320/08560-SLESTER	12786MAHLE Letrika	AAK5757MAHLE Letrika	11.203.811MAHLE Letrika	AAK5175MAHLE Letrika	11.201.908В этом разделе представлен оригинальный мультифункциональный генератор JCB двигателя DIESELMAX 320/08610, 320/08648, 320/08560. Товар состоит из прочного корпуса с ротором, статором, щеточным узлом и регулятором напряжения. Когда мотор работает, устройство создает стабильное напряжение в требуемом параметре, даже если частота его вращения меняется. Генератор соответствует моделям JCB 3CX, 4CX, он подходит на SB мотор, выпущенный в период с 2005 по 2017 год. Представленный товар компактен, защищен от пыли и грязи. Возможно использование на открытом воздухе.&lt;/p&gt;', '', 'Генератор JCB двигателя DIESELMAX 320/08610', '', ''),
(794, 1, 'Аккумулятор JCB Champion Pilot 110 А/ч', '&lt;p&gt;Производитель: Южная КореяОригинальный аккумулятор JCB Champion Pilot 110 А/ч, представленный в этом разделе, является качественным и долговечным товаром. Его емкость 110 ампер-час и 12 вольт, пусковой ток 800 ампер. Устройство обладает высоким стартерным током и повышенной стойкостью к вибрации. Корпус этой запчасти для экскаватора JCB упрочнен, что делает его устойчивым к воздействию ударов и интенсивной эксплуатации. Данный элемент способен выдержать длительный срок службы и множество циклов зарядки и разрядки. Он уже готов к работе.Вы можете купить аккумуляторы для погрузчиков в нашем интернет-магазине.&lt;/p&gt;', '', 'Аккумулятор JCB Champion Pilot 110 А/ч', '', ''),
(795, 1, 'Клеммы для аккумулятора комплект JCB', '&lt;p&gt;Предлагаем вам комплект клемм для аккумулятора JCB. Такие элементы очень важны для эксплуатации погрузчика-экскаватора. Они помогают батарее машины функционировать максимально эффективно. Вы можете купить быстросъемные клеммы на аккумулятор, чтобы проводить монтаж, различные работы и манипуляции наиболее быстро и безопасно.Такие запчасти для спецтехники JCB обычно создаются из бронзы, свинца и меди. Товары отличаются значительной электропроводностью, значительным весом и возможностью к механическому изменению параметров. При выборе важно, чтобы они хорошо подходили по размеру.&lt;/p&gt;', '', 'Клеммы для аккумулятора комплект JCB', '', ''),
(796, 1, 'Датчик температуры (циферблат) JCB 704/50099', '&lt;p&gt;Предлагаем вам запчасти на спецтехнику JCB. В ассортименте есть огромное количество оригинальных товаров для экскаваторов английского бренда. Также вы найдете множество товаров от других производителей. В этом разделе представлен датчик температуры (циферблат) JCB 704/50099. Он используется для измерения соответствующего показателя. Данное устройство принимает и преобразует эту величину в определенный сигнал. Далее он передается на прибор и отражается в виде понятного значения на циферблате. Чтобы установить датчики на погрузчик, вы можете обратиться к нашим мастерам. Они проведут монтаж, ТО и диагностику.&lt;/p&gt;', '', 'Датчик температуры (циферблат) JCB 704/50099', '', ''),
(797, 1, 'Подрулевой переключатель JCB 701/52701 АКПП', '&lt;p&gt;Страна производства: ТурцияПодрулевой переключатель JCB 701/52701 АКПП произведен в Венгрии. Он подходит для популярных моделей погрузчиков 3CX и 4CX с электроуправлением. Товар является клавишей, сделанной в виде «лепестка». Располагается он под рулевым механизмом. Кнопка направляет блоку управления нужную команду. Используя ее, оператор сможет выбирать передачу, не убирая рук с руля.Цена подрулевого переключателя указана на странице товара за единицу. Вы можете заказать его оптом и в розницу. Чтобы купить запчасти на погрузчик, зарегистрируйтесь на нашем сайте. Менеджеры помогут вам сделать подходящий выбор.&lt;/p&gt;', '', 'Подрулевой переключатель JCB 701/52701 АКПП', '', ''),
(798, 1, 'Аккумулятор оригинальный JCB 110 А/ч', '&lt;p&gt;Аккумулятор оригинальный JCB 126 А/ч 332/F3103, 729/10669 для спецтехники JCB.Емкость: 110 АчПусковой ток: 750 АОригинальное название: Battery Wet Charge 12V 110AHПредлагаем вам аккумулятор оригинальный JCB 729/10669 - 12В, с емкостью 110 А/ч. Параметр пускового тока равен 750 А. Такие аккумуляторы устанавливаются на спецтехнику JCB экскаваторов-погрузчиков моделей 3CX, 4CX, 5CX и полноповоротных экскаваторов JS-серии (соединяются параллельно два аккумулятора).Данный аккумулятор полностью готов к работе, заряжен и залит электролитом, необходимо лишь установить батарею, соединить клеммы и запустить спецтехнику.Аккумулятор оригинальный JCB 110 А/ч 332/F3103, 729/10669 представляет собой незаменимый электрообразующий узел, без которого невозможен запуск двигателя. Выход из строя этой детали требует немедленной ее замены. Каталог запчастей спецтехники нашего интернет-магазина предлагает широкий ассортимент необходимых изделий в оригинальном исполнении.Детали погрузчика представлены для разных модификаций спецтехники, выполненные по мировым стандартам качества и соответствия безопасности. Сопровождение запчастей документацией сертификации и гарантийными обязательствами позволяет нам становиться надежным партнером для наших заказчиков.&lt;/p&gt;', '', 'Аккумулятор оригинальный JCB 110 А/ч', '', ''),
(799, 1, 'Генератор JCB на двигатель PERKINS', '&lt;p&gt;Производство: ISKRA (Letrika) SloveniaНапряжение/ток: 70A, 14VПосадочные размеры: 80,5*8,2*86Серийный номер производителя: AAK4598. IA0810. 11.201.810Предлагаем вам купить оригинальные запчасти на погрузчик. В этом разделе представлен генератор JCB на двигатель PERKINS от компании ISKRA. Данный товар обладает высокой прочностью, надежностью, долговечностью и эффективностью. Устройство используется для преобразования магнитной энергии в электрическую. Оно оснащено диодным мостом и регулятором напряжения. Конструкционные особенности и технические характеристики (напряжение 70A, ток 14V), модели впечатляют.Цена на генераторы JCB указана на странице товара. Вы можете заказать их с доставкой или забрать самовывозом.&lt;/p&gt;', '', 'Генератор JCB на двигатель PERKINS', '', ''),
(800, 1, 'Подрулевой переключатель JCB 701/80296', '&lt;p&gt;Страна производства: ТурцияПредлагаем вам приобрести запчасти для экскаватора JCB. У нас вы можете заказать любые товары с доставкой или самовывозом. Также вам доступна услуга установки деталей на вашу специальную технику. Мастера компании произведут монтаж, технический осмотр и своевременный ремонт.В этом разделе представлен подрулевой переключатель JCB 701/80296 реверса. Он подходит для популярных моделей 3CX и 4CX. Товар, произведенный в Венгрии, обладает впечатляющей эффективностью, высоким качеством и долгим сроком службы. Чтобы купить подрулевой переключатель, зарегистрируйтесь на нашем сайте.&lt;/p&gt;', '', 'Подрулевой переключатель JCB 701/80296', '', ''),
(801, 1, 'Датчик поворота колес JCB 701/80345', '&lt;p&gt;Датчик поворота колес JCB 701/80345 определяет направление, в котором расположена шина в данный момент. Товар является одной из необходимых запчастей спецтехники. Он отвечает за работу сразу нескольких систем. Устройство фиксирует градус поворота шины и отправляет эти данные в блок управления, который изучает и использует полученную информацию. Если диагностика показала, что механизм вышел из строя, его следует заменить. Датчик положения колес JCB может принадлежать к одному из трех типов устройств – магниторезистивному, оптическому или потенциометическому. Последний вариант относится к устаревшим.&lt;/p&gt;', '', 'Датчик поворота колес JCB 701/80345', '', ''),
(802, 1, 'Подрулевой переключатель JCB 701/80297', '&lt;p&gt;Страна производства: ТурцияПодрулевой переключатель JCB 701/80297, представленный в этом разделе, произведен в Венгрии. Он соответствует популярным моделям экскаваторов-погрузчиков 3CX и 4CX и устанавливается под рулем. Используется для подачи сигнала блоку управления.Замена подрулевого переключателя необходима в случае неисправности старой детали. Определить это можно по отсутствию отклика на нажатие рычажка. Данное устройство ломается достаточно редко, но если поломка произошла, как можно скорее закажите его в нашем интернет-магазине. Цена на запчасти JCB указывается на странице товара за единицу.&lt;/p&gt;', '', 'Подрулевой переключатель JCB 701/80297', '', ''),
(803, 1, 'Щетка регулятор напряжения генератора JCB 714/40313', '&lt;p&gt;Регулятор напряжения (щетка) 714/40313 оригинального генератора ISKRA для спецтехники JCB.Оригинальное название: Regulator &amp; brush box assemblyПредлагаем вам разнообразные запчасти для экскаватора JCB. В этом разделе вы можете купить щетки генератора. Деталь подходит для популярных моделей 3CX и 4CX. Товар произведен в Словении, компанией ISKRA AE (Letrika DD). Щетка регулятор напряжения генератора JCB 714/40313 необходима для обеспечения эффективной работы устройства. Благодаря этому элементу регулятор поддерживает ток бортовой сети в необходимых параметрах. Устройство должно выдерживать перемены электронагрузки, внешней температуры, частоту движения ротора. Также этот узел оберегает элементы установки от аварий и перегруза.&lt;/p&gt;', '', 'Щетка регулятор напряжения генератора JCB 714/40313', '', ''),
(804, 1, 'Датчик положения колес JCB 701/60075', '&lt;p&gt;Датчик положения колес JCB, представленный в этом разделе, формирует сигнал расположения шин с высокой точностью. Он интегрируется в систему или автономное устройство. Такие запчасти для экскаватора JCB позволяют оператору получать информацию о том, как в данный момент расположены колеса. Это необходимо для выполнения ряда манипуляций и для обеспечения наибольшей безопасности на строительной площадке.Чтобы приобрести запчасти на экскаватор-погрузчик в Москве, зарегистрируйтесь на нашем сайте. Товары доступны для покупки и оптом, и в розницу. Звоните! Менеджеры помогут вам сделать заказ.&lt;/p&gt;', '', 'Датчик положения колес JCB 701/60075', '', ''),
(805, 1, 'Датчик давления гидроаккумулятора JCB 332/G3485', '&lt;p&gt;Датчик давления гидроаккумулятора тормозной системы JCB 332/G3485 экскаваторов-погрузчиков JCB 3CX, 4CX, 5CX 2010-2018 г.в.Оригинальное название: Switch pressureАртикул: 332/G3485Датчик давления гидроаккумулятора тормозной системы JCB 332/G3485 устанавливается на распределительную коробку в подкапотное пространство экскаватора погрузчика, рядом с пневмоаккумулятором 332/H3679.Назначение датчика - контролировать уровень давления в пневмоаккумуляторе (рабочее давление 40 Bar) и оповещать оператора об избыточном или недостаточном давлении тормозной системы - в результате в кабине срабатывает звуковой зуммер и загарается красная лампочка на панели приборов.&lt;/p&gt;', '', 'Датчик давления гидроаккумулятора JCB 332/G3485', '', ''),
(806, 1, 'Подрулевой переключатель JCB 701/80298', '&lt;p&gt;Страна производства: ТурцияПодрулевой переключатель JCB 701/80298 АКПП – это специальная кнопка, которая посылает блоку управления определенные команды оператора. Товар располагается под рулем. Неисправность рычажка легко определить по отсутствию отклика на нажатие. В таком случае вам следует купить подрулевые переключатели для их замены. Снять устройство можно самостоятельно, но лучше обратиться к мастерам нашей компании. Они установят купленные товары на ваш погрузчик, проведут технический осмотр или ремонт.Весь ассортимент представлен в каталоге запасных частей JCB на сайте нашего интернет-магазина.&lt;/p&gt;', '', 'Подрулевой переключатель JCB 701/80298', '', ''),
(807, 1, 'Подрулевой переключатель JCB 701/80299', '&lt;p&gt;Страна производства: ТурцияПредставляем вам подрулевой переключатель JCB 701/80299, произведенный в Венгрии. Данное устройство представляет собой рычажок, который устанавливают под рулем специальной техники. Он отвечает за передачу сигналов от оператора к блоку управления. По форме подобная деталь напоминает лепесток.Чаще всего запчасти JCB в Москве заказывают для моделей 3CX и 4CX. Для их снятия, установки и замены понадобится только крестовая отвертка. Чтобы купить подрулевые переключатели, вы можете зарегистрироваться на нашем сайте. Специалисты компании помогут вам выбрать подходящие товары.&lt;/p&gt;', '', 'Подрулевой переключатель JCB 701/80299', '', ''),
(808, 1, 'Датчик положения колес JCB 701/80312', '&lt;p&gt;В этом разделе представлен качественный товар для экскаватора-погрузчика – датчик положения колес JCB. Данный товар необходим для эффективной работы специальной техники. С помощью такого предмета оператор может в любой момент определить, как прямо сейчас расположены колеса машины. Такой товар увеличивает безопасность эксплуатации транспорта на строительной площадке.Мы занимаемся продажей запчастей спецтехники оптом и в розницу. Чтобы заказать запчасти на экскаватор-погрузчик JCB 3CX, зарегистрируйтесь на нашем сайте. Добавляйте выбранный товар в Корзину и оформляйте заказ онлайн!&lt;/p&gt;', '', 'Датчик положения колес JCB 701/80312', '', ''),
(809, 1, 'Подрулевой переключатель JCB 701/80145', '&lt;p&gt;Страна производства: ТурцияВ каталоге запчастей спецтехники представлено огромное количество товаров – и оригинальных, и неоригинальных. В этом разделе вы найдете подрулевой переключатель JCB, который подходит для популярных моделей 3СХ и 4СХ. Товар изготовлен в Венгрии. Установив его, вы получаете ряд клавиш, которые передают сигнал от оператора блоку управления о принудительном увеличении или снижении передачи. Для этого водителю не нужно снимать руки с руля. Такие запасные части JCB удобны в использовании, надежны и долговечны. Детали устанавливают под рулем, произвести установку можно самостоятельно.&lt;/p&gt;', '', 'Подрулевой переключатель JCB 701/80145', '', ''),
(810, 1, 'Датчик поворота колес JCB 701/80345', '&lt;p&gt;Датчик поворота колес JCB 701/80345 определяет направление, в котором расположена шина в данный момент. Товар является одной из необходимых запчастей спецтехники. Он отвечает за работу сразу нескольких систем. Устройство фиксирует градус поворота шины и отправляет эти данные в блок управления, который изучает и использует полученную информацию. Если диагностика показала, что механизм вышел из строя, его следует заменить. Датчик положения колес JCB может принадлежать к одному из трех типов устройств – магниторезистивному, оптическому или потенциометическому. Последний вариант относится к устаревшим.&lt;/p&gt;', '', 'Датчик поворота колес JCB 701/80345', '', ''),
(811, 1, 'Подрулевой переключатель JCB 701/70001', '&lt;p&gt;Страна производства: ТурцияПодрулевой переключатель JCB, представленный в этом разделе нашего интернет-магазина, произведен в Венгрии. Товар отличается удобной эргономичной формой, высоким качеством и долгим сроком службы. Такие запчасти JCB в Москве часто заказывают для популярных моделей 3СХ и 4СХ.Эти детали устанавливаются непосредственно под рулем. Их установка довольно проста, но вы можете заказать монтаж купленной детали у нас. Для этого добавьте в Корзину нужные товары и свяжитесь с менеджерами для консультации. В удобное для вас время наши мастера установят запчасти на ваш экскаватор-погрузчик.&lt;/p&gt;', '', 'Подрулевой переключатель JCB 701/70001', '', ''),
(812, 1, 'Датчик давления масла КПП М 12 красный JCB 701/41600', '&lt;p&gt;В этом разделе представлен датчик давления масла КПП М 12 красный JCB 701/41600. С его помощью вы можете контролировать уровень этого параметра. Оператор легко определит, достаточна ли его величина в масляной системе, насколько эффективно смазываются детали двигателя. Купить датчик давления масла необходимо, чтобы предотвратить аварийные ситуации и выход мотора из строя. Если старые устройства оказались неисправны, как можно скорее замените их на новые.Цена на запчасти JCB указана на странице товара. Заказывайте детали с доставкой по всей стране или забирайте самовывозом из наших магазинов.&lt;/p&gt;', '', 'Датчик давления масла КПП М 12 красный JCB 701/41600', '', ''),
(813, 1, 'Подрулевой переключатель JCB 701/52601', '&lt;p&gt;Предлагаем вам купить запчасти на спецтехнику в Москве. Подрулевой переключатель JCB 701/52601, представленный в этом разделе, обладает впечатляющим качеством. Он необходим для замены поврежденного или вышедшего из строя оригинального элемента. Деталь отвечает за указатель поворота, очиститель стекол, включение света или запуск дворников. Как понятно из названия, она устанавливается под рулем. Такой элемент должен быть всегда доступен для оператора, чтобы он смог как можно быстрее среагировать на изменившуюся ситуацию. Цена на запчасти JCB указана на странице товара за единицу.&lt;/p&gt;', '', 'Подрулевой переключатель JCB 701/52601', '', ''),
(814, 1, 'Подрулевой переключатель JCB 701/37701', '&lt;p&gt;Подрулевой переключатель JCB 701/37701 используется в системе управления погрузчика JCB, предназначен для замены вышедшей из строя аналогичной модели. Эта деталь для спецтехники изготовлена в соответствии со всеми международными стандартами качества из самых современных, износостойких и устойчивых к перепадам температура материалов.В онлайн-каталоге запчастей JCB нашего интернет-магазина представлены только оригинальные запчасти для экскаваторов-погрузчиков разных модификаций. Каждое изделие полностью соответствует заявленным характеристикам, мировым требованиям к производству деталей для спецтехники, сопровождается сертификатом соответствия и гарантией.&lt;/p&gt;', '', 'Подрулевой переключатель JCB 701/37701', '', ''),
(815, 1, 'Моторчик стеклоочистителя переднего JCB 714/40147 334/G7574 оригинальный', '&lt;p&gt;Моторчик стеклоочистителя JCB 714/40147, представленный в этом разделе, дополняется редуктором, щеткой, системой рычагов и специальным механизмом, возвращающим дворники автомобиля в исходное положение. Необходимо, чтобы этот элемент всегда был исправен, так как погода может резко измениться в любой момент. Вы можете купить моторчик стеклоочистителя, чтобы заменить вышедший из строя механизм на новый. Часто причиной поломки является отсутствие контакта между щетками и коллектором.В нашем магазине вы найдете запчасти JCB в ассортименте. Специалисты помогут вам выбрать подходящие устройства и аксессуары.&lt;/p&gt;', '', 'Моторчик стеклоочистителя переднего JCB 714/40147 334/G7574 оригинальный', '', ''),
(816, 1, 'Датчик давления масла АКПП JCB 701/80591 701/46601', '&lt;p&gt;Предлагаем вам купить запчасти на погрузчик. В каталоге вы найдете и оригинальные, и неоригинальные товары от надежных производителей со всего мира. В этом разделе представлен датчик давления масла АКПП JCB. Он является автоматическим контролером нормального параметра в масляной магистрали системы смазки двигателя. Такой товар делится на два основных типа – электронный и механический. Первый вид запчасти для спецтехники JCB также называют аварийным. Он просто показывает, есть давление масла или отсутствует. Второй вид имеет более сложную конструкцию и показывает точные параметры.&lt;/p&gt;', '', 'Датчик давления масла АКПП JCB 701/80591 701/46601', '', ''),
(817, 1, 'Моторчик стеклоомывателя JCB 332/G1897', '&lt;p&gt;Предлагаем вам купить моторчик стеклоомывателя лобового и заднего стекла, предназначенный для обеспечения качественной и эффективной работы этого устройства. Запчасти для спецтехники JCB представлены в ассортименте. Действует оперативная доставка, возможен самовывоз.Моторчик стеклоомывателя JCB 332/G1897 подходит для моделей экскаватора-погрузчика 3СХ и 4СХ. В нашем интернет-магазине вы можете не только приобрести такие товары, но и заказать их оперативную установку силами специалистов компании. Мастера осуществят монтаж запчасти на вашу технику, проведут техосмотр и ремонт.&lt;/p&gt;', '', 'Моторчик стеклоомывателя JCB 332/G1897', '', ''),
(818, 1, 'Датчик давления масла КПП JCB 701/80626', '&lt;p&gt;Датчик давления трансмиссионного масла в коробке переключения передач экскаватора-погрузчика JCB 3CX, JCB 4CX.Описание: Swith Oil Pressure M12Датчик давления масла JCB 716/80626 устанавливается на все современные коробки переключения передач JCB - PowerShift, SideShift, SynchrosShuttl. Его назначение - определять и сигнализировать при недостаточном или избыточном давлении в трансмиссии переключения передач, когда дальнейшая работа может привести к выходу из строя узлов трансмиссии. На панели приборов загорается сигнализирующий знак в виде шестерен оранжевого цвета, что означает возможные проблемы в работе коробки передач. Датчик давления 701/80626 срабатывает при недостаточном уровне трансмиссионного масла в коробке, или залитии масла значительно выше положенного уровня, при некорректной работе масляного фильтра трансмиссии, при неверном подборе масла в коробку переключения передач, выходе масляного насоса из строя и т.д.Предлагаем вам приобрести запчасти на ваш погрузчик. В ассортименте нашего интернет-магазина представлено огромное количество деталей, как оригинальных, так и неоригинальных.&lt;/p&gt;', '', 'Датчик давления масла КПП JCB 701/80626', '', ''),
(819, 1, 'Датчик давления масла в двигателе 1/8 NPTF JCB 701/80225', '&lt;p&gt;Датчик давления масла в двигателе 1/8 NPTF JCB, представленный в этом разделе, является важной деталью мотора погрузчика. Он определяет данный параметр в масляной магистрали системы смазки. Увидев на приборной панели, что этот показатель полностью пропал, необходимо срочно заглушить мотор. Иначе некоторые элементы и узлы могут повредиться. При выходе детали из строя ее следует заменить.Предлагаем вам заказать любые запчасти JCB оптом и в розницу. Вы можете купить датчик давления масла по приемлемой цене, указанной на странице товара. Для этого следует зарегистрироваться на нашем сайте.&lt;/p&gt;', '', 'Датчик давления масла в двигателе 1/8 NPTF JCB 701/80225', '', ''),
(820, 1, 'Датчик давления масла двигателя SB JCB 320/04046, 320/A4146', '&lt;p&gt;В этом разделе представлен датчик давления масла двигателя SB JCB. Он необходим при выходе из строя аналогичной запчасти на экскаваторе-погрузчике. Для проверки данной детали JCB есть несколько способов. Первый предусматривает осмотр с помощью манометра со шлангом и резьбовым штуцером. Для второго нужно выкрутить элемент и попросить напарника прокрутить электростартером коленвал мотора. В третьем нужно также вытащить деталь из двигателя и присоединить провод с клеммой. Все варианты имеют свои особенности и технологию.Чтобы купить датчик давления масла, зарегистрируйтесь на нашем сайте как покупатель.&lt;/p&gt;', '', 'Датчик давления масла двигателя SB JCB 320/04046, 320/A4146', '', ''),
(821, 1, 'Датчик давления масла КПП JCB 701/41700', '&lt;p&gt;Предлагаем вам купить в Москве датчик давления для экскаватора-погрузчика. В каталоге запасных частей JCB вы также найдете другие товары от известных производителей. В ассортименте есть и оригинальные, и неоригинальные изделия.Этот желтый датчик давления масла ККП М10 определяет указанный параметр и сообщает результат оператору. Водитель видит информацию на приборной панели, ориентируясь по удобной стрелочной шкале. Очень важно следить за этим параметром, ведь без правильного давления масла коробка передач не сможет функционировать эффективно. Если оно отсутствует, необходим осмотр и ремонт.&lt;/p&gt;', '', 'Датчик давления масла КПП JCB 701/41700', '', ''),
(822, 1, 'Генератор зарядки батареи JCB 320/08560', '&lt;p&gt;Генератор JCB 320/08560, 320/08648, 320/08719.&lt;/p&gt; &lt;p&gt;Устройство используется для зарядки батареи, которая в свою очередь применяется для запитки всех электрических приборов специальной техники.&lt;/p&gt;', '', 'Генератор зарядки батареи JCB 320/08560', '', ''),
(823, 1, 'Датчик давления масла КПП 3/8 BSP серый JCB 701/43700', '&lt;p&gt;Предлагаем вам качественные запчасти JCB по приемлемым ценам. В каталоге вы найдете разнообразные товары для моделей 3СХ и 4СХ, как оригинальные, так и неоригинальные. Менеджеры помогут вам определиться с выбором.В этом разделе представлен серый датчик давления масла КПП 3/8 BSP JCB. Он позволяет определить указанный параметр и информирует об этом оператору с помощью специальной стрелочной шкалы на приборной панели. Датчики на погрузчик может быть электронным (или аварийным) и механическим. Первый показывает, не пропало ли давление масла в двигателе, но не дает точных показателей.&lt;/p&gt;', '', 'Датчик давления масла КПП 3/8 BSP серый JCB 701/43700', '', ''),
(824, 1, 'Генератор Perkins JCB 714/32200, 714/40152, 714/40153, 714/40154', '&lt;p&gt;Производитель: KRAUF&lt;/p&gt;&lt;p&gt;Страна-произвоитель: Германия&lt;/p&gt;&lt;p&gt;Серийный номер JCB: 714/32200, 714/40152, 714/40153, 714/40154&lt;/p&gt;&lt;p&gt;Предлагаем вам купить запчасти на погрузчик. В этом разделе представлен генератор 113763 100А JCB 714/40154, заряжающий аккумулятор транспорта. Эта запасная часть обеспечивает эффективную и безотказную работу двигателя внутреннего сгорания в течение всего срока его эксплуатации.Данное устройство приводится в действие путем ременной передачи. Соответственно, при обрыве ремня оно требует своевременной замены. У нас вы можете приобрести генератор фронтального погрузчика и заказать его установку на вашу спецтехнику. Мастера выполнят все работы в короткий срок.&lt;/p&gt;', '', 'Генератор Perkins JCB 714/32200, 714/40152, 714/40153, 714/40154', '', ''),
(825, 1, 'Генератор ААК4598 11201810 АК', '&lt;p&gt;Представляем вам обширный каталог запасных частей JCB. В нашем интернет-магазине вы найдете разнообразные детали для экскаваторов-погрузчиков, как оригинальные, так и от сторонних производителей. В этом разделе можно купить генератор ААК4598 11201810 АК,АВ 70A JCB 714/26100. Товар необходим для качественной и эффективной работы двигателя внутреннего сгорания. Установка такой детали позволяет мотору выполнять нужные действия без перебоев и простоя. Принцип его работы прост: генератор для спецтехники заряжает или подзаряжает аккумулятор, который питает все электрические приборы транспорта.&lt;/p&gt;', '', 'Генератор ААК4598 11201810 АК', '', ''),
(826, 1, 'Датчик температуры воды АВ JC 701/37400', '&lt;p&gt;Датчик температуры воды АВ JCB 701/37400 является терморезистором или полупроводниковым резистором. Он установлен в корпус из латуни. Такая запчасть для экскаватора JCB необходима для определения соответствующего значения. Данные выводятся на контрольную панель. Вы также можете купить датчик температуры воды чтобы управлять автоматическим запуском вентилятора. При перегреве вы узнаете о ситуации по предупредительному сигналу в виде мигающей лампочки. Когда в устройстве станет слишком жарко, сопротивление снизится.В случае неисправностей, данный товар требует своевременной замены.&lt;/p&gt;', '', 'Датчик температуры воды АВ JC 701/37400', '', ''),
(827, 1, 'Датчик температуры двигателя SB синий 320/04588', '&lt;p&gt;Датчик температуры двигателя SB синий JCB 320/04588 определяет данное значение в экскаваторе. Если она повышается, устройство подает сигнал на ее снижение с помощью работающего вентилятора. Это позволяет избежать вскипания жидкости и перегрева мотора. Данные выводятся на информационный индикатор, расположенный в приборной планеты. Когда механизм выходит из строя, следует как можно скорее купить датчик температуры двигателя и заменить его на новый.Чтобы купить запчасти на погрузчик, вам необходимо зарегистрироваться на нашем сайте. Менеджеры помогут вам определиться с выбором.&lt;/p&gt;', '', 'Датчик температуры двигателя SB синий 320/04588', '', ''),
(828, 1, 'Датчик температуры масла АКПП 1/4 BSP JCB 701/80627', '&lt;p&gt;Предлагаем вам купить датчик температуры масла. Этот товар обладает высоким качеством и долгим сроком службы. В случае неисправности оригинальной детали, следует заменить ее на датчик температуры масла АКПП 1/4 BSP JCB 701/80627, купленный в нашем интернет-магазине. Распространенными причинами, выводящими этот механизм из строя, являются неполадки с термостатом и электрикой. Иногда это устройство ломается тогда, когда через соединение вытекает антифриз или жидкость имеет недостаточное качество. Покупка поддельной запчасти для экскаватора JCB также приведет к поломке.&lt;/p&gt;', '', 'Датчик температуры масла АКПП 1/4 BSP JCB 701/80627', '', ''),
(829, 1, 'Датчик температуры охл.жидкости JCB 716/30126', '&lt;p&gt;Предлагаем вам купить датчик указателя температуры охлаждающей жидкости. Этот товар является необходимой частью оборудования, используемого в специальной технике. Он состоит из корпуса, термистора, пружины и электрического разъема. С его помощью измеряется температура тосола или антифриза. Информацию об этом режиме датчик температуры охл.жидкости JCB 716/30126 передает на электронный блок управления. Затем контроллер управления использует эти данные для регулировки ряда систем.В каталоге запчастей спецтехники вы найдете оригинальные и неоригинальные товары для погрузчиков.&lt;/p&gt;', '', 'Датчик температуры охл.жидкости JCB 716/30126', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(830, 1, 'Соленоид JCB 25/222913', '&lt;p&gt;Клапан соленоид 25/222913, 25/MM3127 для коробки переключения передач трансмиссии спецтехники JCB.Оригинальное название: Valve Cartridge 2 Screw FixingСоленоид JCB 25/222913, 25/MM3127 – это необходимая клапан регулятор транспортного средства, являющаяся разновидностью катушки индуктивности. Товар представляет собой катушку с проводом, намотанным на цилиндрическую поверхность. Внутри запасные части JCB имеют подвижный сердечник. Электромагнитный клапан-регулятор в КПП закрывает и открывает масляный канал. Деталь располагается в гидравлической клапанной плите. В автоматической коробке передач находится не меньше четырех таких товаров.Чтобы купить в Москве соленоид, зарегистрируйтесь на нашем сайте. Менеджеры помогут вам сделать заказ.&lt;/p&gt;', '', 'Соленоид JCB 25/222913', '', ''),
(831, 1, 'Клапан редукционный ORININAL PERKINS (Оригинал) JCB 02/202447', '&lt;p&gt;Клапан редукционный JCB 02/202447представляет собой гидравлический дроссель. С его помощью выходящее давление удерживается на требуемом уровне, значительные колебания этого показателя исключаются. Он также применяется для запитки нескольких гидродвигателей от одного насоса. Вы можете купить эту запчасть на погрузчик для комплектации гидравлического привода. Наши мастера установят деталь на вашу спецтехнику в короткий срок.Цена на редукционный клапан указана на странице товара за единицу. Закажите товар с доставкой по стране или заберите самостоятельно из наших магазинов!&lt;/p&gt;', '', 'Клапан редукционный ORININAL PERKINS (Оригинал) JCB 02/202447', '', ''),
(832, 1, 'Соленоид АКПП JCB 25/105100', '&lt;p&gt;Соленоид АКПП JCB 25/105100, представленный в этом разделе, является электрическим магнитным клапаном. Устройство состоит из магнита, обмотанного медью, на который направляется постоянный ток. Оно управляется электронным блоком или мехатроником. Соленоид используется для закрытия или открытия канала в гидравлическом блоке автоматической коробки передач. Так переключаются передачи и подается трансмиссионная жидкость.Чтобы приобрести запчасти на экскаватор-погрузчик JCB, зарегистрируйтесь на нашем сайте и добавьте товар в Корзину. Менеджеры помогут вам определиться с выбором и сделать заказ.&lt;/p&gt;', '', 'Соленоид АКПП JCB 25/105100', '', ''),
(833, 1, 'Катушка управления колес JCB 25/222645, 25222645', '&lt;p&gt;Элетромагнитная катушка JCB управления колесами 25/222645 экскаватора-погрузчика JCB 3CX Super, JCB 4CX и 5CX.Оригинальное название: Coil 13V DCПредлагаем вам приобрести качественные запчасти для экскаватора, как оригинальные, так и от сторонних производителей. В этом разделе представлен соленоид АКПП JCB 25/222645. Это электрический магнитный клапан, состоящий из стержня-магнита и медной обмотки. Такая деталь используется для подачи трансмиссионной жидкости под давлением и переключения всех режимов работы автоматической коробки передач. Если эта деталь вышла из строя, ее необходимо заменить как можно быстрее.Чтобы купить соленоид на JCB, зарегистрируйтесь на нашем сайте. Товар можно забрать самовывозом из наших магазинов.&lt;/p&gt;', '', 'Катушка управления колес JCB 25/222645, 25222645', '', ''),
(834, 1, 'Соленоид АКПП JCB  25/220994', '&lt;p&gt;Соленоид АКПП JCB 25/220994 предназначен для регулировки канала в гидравлической плите в автоматической коробки переключения передач с помощью импульса. Он управляет потоком жидкости в автоматической коробке передач и отвечает за переключение ее режимов работы. Соленоид КПП подходит на популярную модель погрузчика JCB 3 CX.Причиной поломки такой детали часто становится перегорание электрообмотки и возникновение нагара на плунжере. Иногда изнашиваются составные части элемента, в таком случае тоже нужна срочная замена. В каталоге запчастей спецтехники вы найдете и другие товары, необходимые для эксплуатации экскаватора.&lt;/p&gt;', '', 'Соленоид АКПП JCB  25/220994', '', ''),
(835, 1, 'Соленоид КПП JCB 25/ММ3127', '&lt;p&gt;Соленоид КПП JCB 25/ММ3127 необходим в случае, когда эта деталь на вашем погрузчике вышла из строя. Причиной поломки часто является изношенность составных частей элемента, например, засорение плунжера. Также к остановке работы приводит перегорание электрообмотки. Иногда проблема в том, что устройство просто выработало свой ресурс, исчерпав определенное количество открываний и закрываний Если это произошло, вы можете купить соленоид на нашем сайте. Заберите его в Москве самовывозом или закажите с доставкой в ваш город. В магазине JCB вы найдете и другие необходимые запчасти для погрузчика от английского бренда.&lt;/p&gt;', '', 'Соленоид КПП JCB 25/ММ3127', '', ''),
(836, 1, 'Соленоид КПП (реверс) JCB 25/221090', '&lt;p&gt;Соленоид КПП (реверс) JCB 25/221090 выходит из строя по нескольким причинам. Первой из них является банальное исчерпание ресурса. Обычно срок службы варьируется от 300 000 до 400 000 циклов открываний и закрываний. Если это произошло, вам придется купить новый клапан соленоид. Также проблема может скрываться в механическом повреждении корпуса, износе составных частей устройства, недостаточной упругости пружины, в обрыве или перегорании электрической обмотки.Чтобы купить запчасти на спецтехнику в Москве, зарегистрируйтесь на нашем сайте. Менеджеры помогут вам сделать заказ.&lt;/p&gt;', '', 'Соленоид КПП (реверс) JCB 25/221090', '', ''),
(837, 1, 'Панель управления печки JCB 128/12266', '&lt;p&gt;Панель управления печки JCB 128/12266 представляет собой рамку со специальными кнопками или рычажками. Чаще всего используется вариант с клавишами, на который изображены интуитивно понятные пиктограммы. Используя панель, вы сможете легко переключать температурные режимы в салоне и управлять направлением потока теплого воздуха. Эта функция незаменима в холодный сезон, она обеспечивает максимальный комфорт для оператора специальной техники.Такая деталь обладает привлекательным дизайном, прочностью и долгим сроком службы. Цена на запчасть JCB указана на странице товара.&lt;/p&gt;', '', 'Панель управления печки JCB 128/12266', '', ''),
(838, 1, 'Реле JCB 704/10000', '&lt;p&gt;Предлагаем вам приобрести качественные запчасти по доступной цене. Для вас подготовлен впечатляющий ассортимент товаров от одобренных нами производителей. Мы сотрудничаем только с компаниями, выпускающими качественные и долговечные изделия.В этом разделе представлено реле JCB 704/10000. Это электронное устройство являет собой ключ, который замыкает и размыкает узлы цепей при осуществлении определенного воздействия. В реле JCB 3CX имеются входные и выходные контакты. Когда импульс передается на вход, выход замыкается. Если сигнал отсутствует, выходной контакт размыкается.&lt;/p&gt;', '', 'Реле JCB 704/10000', '', ''),
(839, 1, 'Реле JCB 716/30148', '&lt;p&gt;В нашем ассортименте представлены разнообразные запчасти на экскаватор погрузчик JCB. Мы гарантируем вам высокую эффективность, производительность и долгий срок службы наших деталей.Если вам нужно купить в Москве реле для вашего погрузчика, загляните в этот раздел. Здесь вы можете заказать электронное устройство, состоящее из сердечника, якоря и выходных контактов. Реле JCB 716/30148 реагирует на подачу напряжения на вход оборудования и замыкает выходные контакты. Когда данный сигнал отсутствует, контакты размыкаются. Существуют варианты, отличающиеся начальным состоянием контактов.&lt;/p&gt;', '', 'Реле JCB 716/30148', '', ''),
(840, 1, 'Соленоид крабового хода JCB 2/124661', '&lt;p&gt;Соленоид крабового хода JCB 02/124661 – это электромагнитный клапан с увеличенным ресурсом. Запчасть представляет собой один из компонентов уникальной системы крабового хода погрузчиков, разработанных только с учетом инновационных технологий. В нашем каталоге запчастей для спецтехники вы можете найти детали для разных узлов и агрегатов JCB, что позволит быстро провести ремонт любой из систем и ввести в строй машину за максимально короткий срок.Детали для погрузчика JCB представлены в оригинале от производителя. Все запчасти сопровождаются сертификатами качества и имеют гарантийный срок.&lt;/p&gt;', '', 'Соленоид крабового хода JCB 2/124661', '', ''),
(841, 1, 'Подрулевой переключатель реверса JCB 701/80165', '&lt;p&gt;Оригинальное название: Switch forward &amp; reverse left hand handleПодрулевой переключатель реверса JCB 701/80165 для управления движением экскаватора-погрузчика JCB 3CX – это качественное изделие, выполненное с применением новых технологий и качественных материалов. В каталоге запчастей экскаватора JCB деталь представлена от производителя.В нашем интернет-магазине вы сможете выбрать и приобрести детали погрузчика, изготовленные в строгом соответствии с мировыми стандартами качества. Каждое изделие подтверждено сертификатами соответствия и имеет гарантийный срок эксплуатации. У нас вы можете купить запчасти от данного производителя по самым приемлемым ценам.&lt;/p&gt;', '', 'Подрулевой переключатель реверса JCB 701/80165', '', ''),
(842, 1, 'Датчик давления JCB 701/80327', '&lt;p&gt;Датчик давления двигателя JCB 701/80327 для экскаваторов погрузчиков JCBОригинальное название: Switch Engine Oil PressureНазначение: датчик JCB 701/80327 отвечает за регулировку рабочего давления масла двигателя экскаваторов-погрузчиков JCB.Датчик давления JCB 701/80327 является основным узлом контроля за давлением масла двигателя. Деталь системы электрики имеет важную функцию для полноценной работы всей машины. В случае выхода из строя этой запчасти, неправильное снабжение маслом частей и механизмов может привести к серьезной поломке. Детали погрузчика мы предлагаем по ценам от производителя в оригинальном исполнении.Каталог запасных частей экскаватора представляет широкий ассортимент деталей, выполненных по мировым стандартам качества. Любое изделие сопровождается сертификатом и гарантийными обязательствами.&lt;/p&gt;', '', 'Датчик давления JCB 701/80327', '', ''),
