(869, 1, 'Микро реле приборной панели на JCB 332/C3148', 'Микро реле приборной панели на спецтехнику JCB 3CX, 4CX. Артикул: 332/C314', '', 'Микро реле приборной панели на JCB 332/C3148', '', ''),
(870, 1, 'Реле (5 контактов) JCB 716/09800', '&lt;p&gt;&lt;b&gt;Реле (5 контактов) JCB 716/09800&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 716/09800&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Реле (5 контактов) JCB 716/09800', '', ''),
(871, 1, 'Реле сигнала поворота ORIGINAL (Оригинал) JCB 716/25800', '&lt;p&gt;&lt;b&gt;Реле сигнала поворота JCB 716/25800&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 716/25800&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Реле сигнала поворота ORIGINAL (Оригинал) JCB 716/25800', '', ''),
(872, 1, 'Соленоид JCB 716/30091', '&lt;p&gt;&lt;b&gt;Соленоид JCB 716/30091&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера: &lt;/b&gt;716/30091&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с: &lt;/b&gt;JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-Производитель: &lt;/b&gt;Турция &lt;/p&gt;', '', 'Соленоид JCB 716/30091', '', ''),
(873, 1, 'Полуось внутренняя переднего моста 914/86301', '&lt;p&gt;Полуось внутренняя переднего моста длинной 911.5 мм. Подходит только для  экскаватора - погрузчика JCB 3CX. Продается как оптом так и в розницу.&lt;/p&gt;', '', 'Полуось внутренняя переднего моста 914/86301', '', ''),
(874, 1, 'Полуось короткая, переднего моста 914/89501, 333/F6602', '&lt;p&gt;Полуось короткая, переднего моста подходит только для экскаватора - погрузчика JCB 3CX Super - 4CX, которая входит в бортовой редуктор. Продается как оптом так и в розницу.&lt;/p&gt;', '', 'Полуось короткая, переднего моста 914/89501, 333/F6602', '', ''),
(875, 1, 'Полуось заднего моста 914/86602, 914/84301', '&lt;p&gt;Полуось заднего моста (идет к дифференциалу) экскаватора - погрузчика JCB 3CX Super - 4CX.  Продается как оптом так и в розницу. Так же называют вал полуоси заднего моста длинный.&lt;/p&gt;', '', 'Полуось заднего моста 914/86602, 914/84301', '', ''),
(876, 1, 'Полуось переднего моста 3CX JCB 914/86204', '&lt;p&gt;Приводной вал для экскаваторов-погрузчиков JCB 3CX. Для моделей JCB 3CX Super и 4CX полуось не подходит.&lt;/p&gt;', '', 'Полуось переднего моста 3CX JCB 914/86204', '', ''),
(877, 1, 'Полуось переднего моста JCB 914/88101, 914/86201', '&lt;p&gt;Полуось для переднего моста спецтехники JCB. Оригинальное название - Shaft hub side. Подходит только для модели 3CX.&lt;/p&gt;', '', 'Полуось переднего моста JCB 914/88101, 914/86201', '', ''),
(878, 1, 'Шарнирное соединение полуоси 4СХ JCB 914/86403', '&lt;p&gt;Шарнирное соединение полуоси (яблоко) 914/86403 для экскаватора-погрузчика JCB 3CX Super, JCB 4CXОригинальное название: Yoke doubleШарнирное соединение полуоси 4СХ JCB 914/86403 предназначено для комплектации экскаваторов-погрузчиков JCB 3CX Super, JCB 4CX. Модель является комплектующей ходовой части спецтехники, от ее исправности и целостности зависит бесперебойная работа агрегата и безопасность машины и водителя. Запчасти на погрузчики JCB в настоящее время продаются в огромном ассортименте от самых разных производителей.Однако купить запчасти на JCB в оригинале по ценам от фирмы-производителя самой техники вы можете не везде. Наш интернет-магазин предлагает детали и запчасти самого высокого качества с гарантией.&lt;/p&gt;', '', 'Шарнирное соединение полуоси 4СХ JCB 914/86403', '', ''),
(879, 1, 'Шарнирное соединение полуоси 4СХ JCB 914/84102', '&lt;p&gt;Шарнирное соединение полуоси 4СХ JCB 914/84102 является важным элементом ходовой погрузчика. Его задача – обеспечивать надежную фиксацию двух частей и передавать усилия от двигателя к ведущим колесам английского погрузчика. Товар являет собой конструкцию из двух сферических форм, между которых расположены шарики, которые передвигаются по канавкам в корпусе. Строение детали достаточно сложное, поэтому иногда она выходит из строя. Перед окончательной поломкой элемент издает характерный хруст. Если вы услышали такой звук, вам нужно как можно скорее заменить сломанный запчасти для экскаватора JCB на новые.&lt;/p&gt;', '', 'Шарнирное соединение полуоси 4СХ JCB 914/84102', '', ''),
(880, 1, 'Шарнирное соединение полуоси 3СХ JCB 914/80203', '&lt;p&gt;Предлагаем вам купить запчасти на спецтехнику в Москве. В этом разделе представлено шарнирное соединение полуоси 3СХ JCB 914/80203. Оно необходимо в полноприводных и переднеприводных автомобилях, так как их колеса могут проворачиваться, меняя свое расположение. Такая деталь ходовой части JCB позволяет переводить вращающий момент от мотора к ведущим управляемым шинам при повороте до семидесяти градусов относительно оси. На каждой полуоси английского погрузчика устанавливается по два элемента. Товар требует немедленной замены в случае выхода из строя.&lt;/p&gt;', '', 'Шарнирное соединение полуоси 3СХ JCB 914/80203', '', ''),
(881, 1, 'Полуось 4СХ в сборе 914/60109, 914/M0343, 914/89400', '&lt;p&gt;Полуось для 4CX соответствует самым высоким требованиям. Способна выдержать значительные нагрузки, рассчитана даже на езду по бездорожью.&lt;/p&gt;', '', 'Полуось 4СХ в сборе 914/60109, 914/M0343, 914/89400', '', ''),
(882, 1, 'Полуось JCB 3CX левая длинная 914/87800', '&lt;p&gt;Полуось JCB 3CX левая в сборе 914/87800 для трансмиссии экскаватора-погрузчика JCB.&lt;/p&gt;&lt;p&gt;Оригинальное название: Shaft drive assembly 1240.1mm long&lt;/p&gt;', '', 'Полуось JCB 3CX левая длинная 914/87800', '', ''),
(883, 1, 'Полуось 3СХ задняя JCB 450/10209, 914/60103, 914/M4448', '&lt;p&gt;Полуось прямая для заднего моста экскаватора-погрузчика JCB 3CX.Производитель: OYMACАртикул: 450/10209, 914/M7404Для эксплуатации специальной техники необходимо, чтобы все запчасти были исправны. И если задняя полуось в вашем погрузчике требует замены, вы можете заказать ее в нашем интернет-магазине. Предлагаем вам купить заднюю полуось оптом или в розницу. Чтобы забрать купленный товар, приезжайте в наши розничные магазины или оформляйте доставку с помощью транспортной компании.Также возможна установка данной запчасти на экскаватор клиента, силами наших специалистов. Задняя полуось JCB 3CX будет установлена на вашем объекте или на базе нашей компании. Возможно проведение диагностики спецтехники.&lt;/p&gt;', '', 'Полуось 3СХ задняя JCB 450/10209, 914/60103, 914/M4448', '', ''),
(884, 1, 'Полуось в сборе передняя JCB 3CX 914/88200, 914/86300', '&lt;p&gt;Полуось переднего моста в сборе 914/88100 для экскаватора-погрузчика JCB 3CX.Представленная здесь полуось передняя правая передает преобразованное редуктором вращение напрямую на колесо тяжелой техники. Этот товар, относящийся к элементам ходовой части, предназначен для моделей, произведенных известным английским брендом.Используется полуось передняя правая для JCB 3CX. Во время использования она принимает на себя несколько видов разнообразных нагрузок, поэтому деталь должна быть очень прочной. На нее влияет боковой ветер, сила тяжести, тяговая и тормозные силы. Особенно сильное воздействие правая полуось переднего моста испытывает при езде по бездорожью.&lt;/p&gt;', '', 'Полуось в сборе передняя JCB 3CX 914/88200, 914/86300', '', ''),
(885, 1, 'Полуось в сборе передняя JCB 3CX 914/88100, 914/86200', '&lt;p&gt;Полуось переднего моста в сборе 914/88100 для экскаватора-погрузчика JCB 3CX.Предлагаем вам купить полуось по доступной цене. Это вал основного моста, который передает вращение от дифференциального механизма на колесо. Если полуось передняя на вашей технике требует замены, закажите ее в нашей компании вместе с оперативной установкой специалистами на технику (на нашей ремонтной базе или на вашем объекте).Эта деталь является элементом ходовой части. Чтобы специальная техника работала эффективно и без сбоев, все запчасти должны быть исправны. Полуось JCB 3CX относится к полностью разгруженным, так как вынуждена выносить значительную нагрузку.&lt;/p&gt;', '', 'Полуось в сборе передняя JCB 3CX 914/88100, 914/86200', '', ''),
(886, 1, 'Втулка полуоси JCB 921/50000', '&lt;p&gt;Оригинальное название: Spacer 32mm longВтулка полуоси (оригинальное наименование - spacer 32 mm long) предназначена для вала полуоси на передний и задний мост экскаватора-погрузчика JCB. Выполнена из стали. В наличии артикул 921/50000. Соблюдайте размеры, подходящие для вашей модели, и применяйте только оригинальные комплектующие, в противном случае может пострадать полуось. На данной странице каталога вы можете заказать эту запчасть для JCB онлайн. В нашем интернет-магазине доступны эти и другие оригинальные детали для спецтехники - их приобретают с доставкой или на условиях самовывоза.&lt;/p&gt;', '', 'Втулка полуоси JCB 921/50000', '', ''),
(887, 1, 'Полуось передняя в сборе на спецтехнику JCB 4CX 914/89500, 914/84500', 'Полуось передняя в сборе на спецтехнику JCB 4CX. Артикулы: 914/89500, 914/84500', '', 'Полуось передняя в сборе на спецтехнику JCB 4CX 914/89500, 914/84500', '', ''),
(888, 1, 'Полуось в сборе на спецтехнику JCB 4CX 914/89800', 'Полуось в сборе на спецтехнику JCB 4CX 914/89800', '', 'Полуось в сборе на спецтехнику JCB 4CX 914/89800', '', ''),
(889, 1, 'Полуось передняя в сборе на спецтехнику JCB 4CX 914/89500, 914/84500', 'Полуось передняя в сборе на спецтехнику JCB 4CX. Артикулы: 914/89500, 914/84500', '', 'Полуось передняя в сборе на спецтехнику JCB 4CX 914/89500, 914/84500', '', ''),
(890, 1, 'Полуось в сборе на спецтехнику JCB 4CX 914/89800', 'Полуось в сборе на спецтехнику JCB 4CX 914/89800', '', 'Полуось в сборе на спецтехнику JCB 4CX 914/89800', '', ''),
(891, 1, 'Полуось в сборе на JCB 4CX 914/60109, 914/M0343', 'Полуось в сборе на спецтехнику JCB 4CX 914/60109, 914/M0343', '', 'Полуось в сборе на JCB 4CX 914/60109, 914/M0343', '', ''),
(892, 1, 'Полуось задняя на спецтехнику JCB 3СХ 450/10209, 914/M7404', 'Полуось задняя на спецтехнику JCB 3СХ. Артикулы: 450/10209, 914/M7404', '', 'Полуось задняя на спецтехнику JCB 3СХ 450/10209, 914/M7404', '', ''),
(893, 1, 'Рулевая тяга JCB телескопический погрузчик 531 453/23400', '&lt;p&gt;Товар в наличии. Вы можете приобрести его.&lt;/p&gt;', '', 'Рулевая тяга JCB телескопический погрузчик 531 453/23400', '', ''),
(894, 1, 'Шарнир рулевой тяги JCB 4CX 331/23193', '&lt;p&gt;В этом разделе представлена рулевая тяга JCB 4CX граната 331/23193, а именно, внутренняя часть. Она представляет собой сочленение, которое нивелирует пульсирующие нагрузки, передающиеся на основные колеса рычагами подвески. Другое название детали - шарниры равных угловых скоростей. Рулевые тяги экскаваторов являются соединителем между рулем и управляющей системой, они передают усилия от заворота на поворотные кулаки шин.&lt;/p&gt;', '', 'Шарнир рулевой тяги JCB 4CX 331/23193', '', ''),
(895, 1, 'Рулевая тяга в сборе 3CX Super, 4CX 126/02419, 128/13949, 126/01947, 2602419', '&lt;p&gt;В этом разделе можно приобрести рулевую тягу в сборе 3CX Super, 4CX 126/02419, 126/01947. Она используется для моделей с равновеликими колесами. Такой товар является связующим элементом между рулем и системой управления. Обычно требует замены вследствие поломки и деформации, разрушения резиновых вкладышей шарниров, попадания пыли и грязи.&lt;/p&gt;', '', 'Рулевая тяга в сборе 3CX Super, 4CX 126/02419, 128/13949, 126/01947, 2602419', '', ''),
(896, 1, 'Рулевая тяга в сборе 3CX Super, 4CX 128/13949, 2602419', '&lt;p&gt;Рулевая тяга в Москве представлена в нашем интернет-магазине в ассортименте. У нас вы можете заказать качественные запчасти по доступным ценам. Рулевые тяги JCB 4CX в сборе с наконечником, гранатой, гайкой, стопором и пыльниками предназначены для специальной техники с равновеликими колесами.Эта деталь может сломаться из-за наезда колеса на яму, при ударе о камень во время движения или от другого механического воздействия. Шарниры устройства ломаются из-за попадания грязи и пыли или вследствие длительного использования запчасти. Чтобы узнать, сколько стоит рулевая тяга, изучите информацию на данной странице.&lt;/p&gt;', '', 'Рулевая тяга в сборе 3CX Super, 4CX 128/13949, 2602419', '', ''),
(897, 1, 'Рулевая тяга передние колеса 3CX 126/02253, 126/01946', '&lt;p&gt;Предлагаем вам купить рулевую тягу JCB в сборе с гранатой и пыльниками на передние колеса спецтехники 3СХ. Она обеспечивает передачу усилия от поворота руля на поворотные кулаки колес. Заказ можете оформить на нашем сайте оставив телефон через форму обратной связи. &lt;/p&gt;', '', 'Рулевая тяга передние колеса 3CX 126/02253, 126/01946', '', ''),
(898, 1, 'Шарнир рулевой тяги JCB 3CX 331/14861', '&lt;p&gt;В этом разделе нашего интернет-магазина вы можете купить рулевую тягу (внутреннюю часть). Она передает усилие от поворота руля на соответствующие кулаки колес. Такой товар имеет два наконечника. Рулевая тяга - граната JCB 3CX 331/14861 – это промежуточный узел, объединяющий руль и управление в единую систему. Этот товар часто выходит из строя, если в него попадает влага и грязь, а он испытывает постоянные нагрузки и удары от экстремальной или длительной эксплуатации.&lt;/p&gt;', '', 'Шарнир рулевой тяги JCB 3CX 331/14861', '', ''),
(899, 1, 'Рулевая тяга на телескопический погрузчик JCB JS160W 453/26700', 'Рулевая тяга на телескопический погрузчик JCB JS160W. Запчасти на спецтехнику JCB 3CX, 4CX. Артикул: 453/26700', '', 'Рулевая тяга на телескопический погрузчик JCB JS160W 453/26700', '', ''),
(900, 1, 'Рулевая тяга на телескопический погрузчик JCB JS160W 453/29000', 'Рулевая тяга на телескопический погрузчик JCB JS160W. Запчасти на спецтехнику JCB 3CX, 4CX. Артикул: 453/29000', '', 'Рулевая тяга на телескопический погрузчик JCB JS160W 453/29000', '', ''),
(901, 1, 'Подшипник TIMKEN на КПП JCB 907/50500', '&lt;p&gt;Предлагаем вам купить подшипники TIMKEN КПП. Это сборочные узлы, которые поддерживают вал, обеспечивая ему вращение с минимальным сопротивлением. Если этот товар вышел из строя или был неверно установлен, механизм может сломаться и привести к аварии. Подшипник КПП JCB 907/50500 очень важен для погрузчика, поэтому он изготавливается из качественного, износостойкого и долговечного металла. Деталь состоит из наружной и внутренней обоймы, сепаратора с шариками и сальника из резины. Заменить его можно или самостоятельно, или обратившись к нашим мастерам. Цена на эти и другие запчасти JCB указывается на странице товара за единицу.&lt;/p&gt;', '', 'Подшипник TIMKEN на КПП JCB 907/50500', '', ''),
(902, 1, 'Подшипник КПП JCB 917/51400', '&lt;p&gt;Подшипник КПП JCB 917/51400 – это деталь, поддерживающая подвижное сооружение. Она обеспечивает движение с минимальным сопротивлением. Чтобы понять, что элемент разрушается, выходит из строя и требует срочной замены, обратите внимание на ряд признаков. Изношенный подшипник вала КПП свистит, воет или стучит во время движения, отказывается включать или выключать механизм. В таком случае деталь нужно заменить как можно скорее, не дожидаясь полной поломки.Все представленные товары можно заказать в каталоге запчастей JCB онлайн, оптом или в розницу, с доставкой или самовывозом.&lt;/p&gt;', '', 'Подшипник КПП JCB 917/51400', '', ''),
(903, 1, 'Подшипник КПП JCB  917/02800', '&lt;p&gt;Подшипник КПП JCB 917/02800, представленный в этом разделе, необходим для поддержки вращающегося вала с минимальным сопротивлением. Он обеспечивает способность свободного движения без разрушительных последствий износа и трения. При этом подшипник для спецтехники может изнашиваться из-за интенсивной эксплуатации. Разрушающаяся деталь приводит к проблемам с коробкой передач. Также она может издавать странные звуки при движении – вой, неприятный скрип или характерный стук.Все запчасти JCB можно заказать в магазине онлайн, с доставкой или самовывозом, оптом или в розницу.&lt;/p&gt;', '', 'Подшипник КПП JCB  917/02800', '', ''),
(904, 1, 'Подшипник конический КПП TIMKEN JCB 907/51500', '&lt;p&gt;Предлагаем вам купить конический подшипник. Это деталь, состоящая из роликов в форме конусов, которые принимают на себя значительную радиальную или осевую нагрузку. Данный товар включает в себя внешнюю и внутреннюю обойму, сальник и сепаратор. Конический подшипник КПП JCB 907/51500 обладает высокой прочностью и надежностью. Он не боится длительного износа и сильных ударов, а значит, прослужит вам гораздо дольше. На продукцию дается гарантия качества от производителя.Оригинальные и неоригинальные запчасти на спецтехнику JCB доступны для заказа онлайн, с доставкой или самовывозом.&lt;/p&gt;', '', 'Подшипник конический КПП TIMKEN JCB 907/51500', '', ''),
(905, 1, 'Подшипник полуоси внутренний TIMKEN JCB 907/08400, 907/20025', '&lt;p&gt;Предлагаем вам приобрести подшипники для экскаватора, произведенного английским брендом спецтехники JCB. Он подходит для моделей 3СХ и 4СХ. В этом разделе легко купить подшипники на полуоси внутренние, обладающие высоким качеством. Такие товары долго прослужат вам и обеспечат полноценное движение тяжелой спецтехники.В наличии  так же марки: ETERNO - 3300руб. FAG - 3200руб. OBR - 2300руб. Подшипник полуоси внутренний есть на нашем собственном складе в наличии. Вы можете не только приобрести его онлайн, с доставкой, но и заказать оперативную установку на вашем объекте. Опытные специалисты приедут к вам и заменят деталь. Возможна замена на нашей ремонтной базе.&lt;/p&gt;', '', 'Подшипник полуоси внутренний TIMKEN JCB 907/08400, 907/20025', '', ''),
(906, 1, 'Подшипник дифференциала TIMKEN для JCB 907/09200', '&lt;p&gt;Предлагаем вам качественные подшипники на погрузчик, экскаватор, произведенный известной английской компанией TIMKEN на JCB.Эти небольшие детали являются важным элементом ходовой части. Когда она выходит из строя, необходимо как можно быстрее приступить к ремонту, иначе поломка может привести к значительным убыткам. &lt;/p&gt;', '', 'Подшипник дифференциала TIMKEN для JCB 907/09200', '', ''),
(907, 1, 'Подшипник вторичного вала КПП (Timken) JCB 907/09600', '&lt;p&gt;На сайте компании вы можете приобрести подшипник вала КПП и другие высококачественные детали с доставкой, заказать диагностику, техническое обслуживание и ремонт.Возможна также дополнительная установка такой детали на вашу спецтехнику, силами мастеров компании. Замена производится или на нашей ремонтной площадке, или с выездом на объект.Предлагаем вам купить подшипник вторичного вала, подходящий для английской спецтехники JCB. Этот товар поставляется по оптимальной цене. Мы готовы предложить вам качественные подшипники вторичного вала КПП с оперативной доставкой на объект.&lt;/p&gt;', '', 'Подшипник вторичного вала КПП (Timken) JCB 907/09600', '', ''),
(908, 1, 'Подшипник КПП (Timken) JCB 907/52800', '&lt;p&gt;Чтобы купить подшипники КПП, необходимо оформить заказ на сайте. Наши специалисты помогут вам определиться с выбором и дадут ответы на все интересующие вас вопросы.Мы поставляем оригинальные и неоригинальные детали и работаем только с надежными, проверенными производителями, которые изготавливают товары высокого качества. Поэтому вы можете быть уверены в том, что высококлассные подшипники КПП, заказанные у нас, прослужат в течение долгого времени.&lt;/p&gt;', '', 'Подшипник КПП (Timken) JCB 907/52800', '', ''),
(909, 1, 'Подшипник ступичный Timken JCB 907/20043, 907/52200, 907/20043, 907/M7473, 907/11800, 907/07700, 907/50000', '&lt;p&gt;Подшипник ступичный JCB 907/20043 конусный роликовый для бортовой передачи экскаватора-погрузчика JCB 3CX, JCB 4CXОригинальное название: Bearing Taper RollerВ наличии есть марки: ARB - 2400 руб. ART - 3300 руб.Артикул: 907/20043Подшипник ступичный JCB 907/20043 служит для комплектации экскаваторов JCB 3СХ, JCB 4СХ. Являясь элементом ходовой части, эта деталь служит обеспечением бесперебойной работы всей машины и является гарантом безопасности для водителя. Каталоги запчастей спецтехники онлайн предлагают большое количество деталей от известных мировых брендов. Оригинальные изделия позволяют машинам работать исправно и надежно.Детали погрузчика в нашем интернет-магазине мы предлагаем по очень привлекательной цене, в соответствии с мировыми стандартами качества и гарантийными обязательствами. Простая форма заявки и быстрая доставка делает нас ближе к нашим покупателям.&lt;/p&gt;', '', 'Подшипник ступичный Timken JCB 907/20043, 907/52200, 907/20043, 907/M7473, 907/11800, 907/07700, 907/50000', '', ''),
(910, 1, 'Подшипник игольчатый полуоси (ARB) 907/50200', '&lt;p&gt;Подшипник ступицы роликовый игольчатый обладает стандартной конфигурацией и подходит для погрузчиков, экскаваторов от известной английской компании.Этот высококачественный товар относится к деталям ходовой части автотранспорта.Предлагаем вам купить игольчатый подшипник по приемлемой цене, с доставкой на дом или объект. Для заказа достаточно просто добавить товар в Корзину и оформить покупку на сайте. У вас возникли вопросы или предложения? Позвоните нашим специалистам! Если запасная часть вышла из строя, то вы легко можете купить игольчатые подшипники в Москве онлайн.&lt;/p&gt;', '', 'Подшипник игольчатый полуоси (ARB) 907/50200', '', ''),
(911, 1, 'Подшипник полушкворней и хвостовика конический (Timken) 907/08300', '&lt;p&gt;В нашем интернет-магазине вы можете выгодно купить конический подшипник, который также известен как подшипник поворотного кулака (полушкворней конический). Данный товар подходит для экскаваторов и погрузчиков, произведенных известным британским брендом.Все запчасти мы получаем напрямую от производителей, минуя перекупщиков и посредников. Именно поэтому нам удается держать выгодные цены для клиентов, всегда предлагая им большой ассортимент. Подшипник шкворня JCB 3CX обладает великолепным качеством и долгим сроком службы. Вы можете не только купить его, но и заказать установку на спецтехнику у нас.&lt;/p&gt;', '', 'Подшипник полушкворней и хвостовика конический (Timken) 907/08300', '', ''),
(912, 1, 'Подшипник хвостовика (Timken) JCB 907/09000, 10/301079', '&lt;p&gt;Предлагаем владельцам английской спецтехники JCB купить подшипник хвостовика. Эта важная деталь ходовой части автотранспорта впечатлит вас долгим сроком службы. Мы сотрудничаем только с надежными европейскими и азиатскими производителями таких комплектующих, как подшипник хвостовика, что гарантирует впечатляющие свойства всех предлагаемых товаров. Мы не работаем с запасными частями сомнительного или низкого качества.Если вас интересует, сколько стоит подшипник хвостовика, просмотрите информацию на этой странице. Цена на товар указывается возле названия запасной части.&lt;/p&gt;', '', 'Подшипник хвостовика (Timken) JCB 907/09000, 10/301079', '', ''),
(913, 1, 'Подшипник дифференциала (Timken) JCB 907/50100', '&lt;p&gt;Предлагаем вам купить подшипник дифференциала – высококачественный товар для специальной английской техники. Дифференциал понижает обороты от коробки передач к ведущим колёсам. При выходе из строя любой его детали, вам потребуется своевременная починка и замена.Если вам нужно установить новый подшипник дифференциала, то вы можете обратиться в нашу компанию. Мы предлагаем вам не только покупку товаров, которые всегда имеются в наличии на складе, но и возможность установки детали нашими специалистами – как на вашем объекте, так и на ремонтной базе компании. Цена на подшипник дифференциала достаточно доступна.&lt;/p&gt;', '', 'Подшипник дифференциала (Timken) JCB 907/50100', '', ''),
(914, 1, 'Подшипник 907/53700 JCB', 'Подшипник 907/53700 JCB производитель Timke', '', 'Подшипник 907/53700 JCB', '', ''),
(915, 1, 'Подшипник КПП TIMKEN JCB 907/20045, 907/M3131, 907/53800', 'Подшипник КПП JCB 907/20045, 907/M3131, 907/5380', '', 'Подшипник КПП TIMKEN JCB 907/20045, 907/M3131, 907/53800', '', ''),
(916, 1, 'Подшипник на хвостовик переднего моста TIMKEN JCB 907/09100', 'Подшипник на хвостовик переднего моста JCB 907/0910', '', 'Подшипник на хвостовик переднего моста TIMKEN JCB 907/09100', '', ''),
(917, 1, 'Подшипник Игольчатый TIMKEN на JCB 917/50400', 'Подшипник Игольчатый TIMKEN на JCB. Артикул: 917/5040', '', 'Подшипник Игольчатый TIMKEN на JCB 917/50400', '', ''),
(918, 1, 'Подшипник осевой тяги TIMKEN на JCB 907/05900', 'Подшипник осевой тяги на спецтехнику JCB 3CX, 4CX. Артикул: 907/05900', '', 'Подшипник осевой тяги TIMKEN на JCB 907/05900', '', ''),
(919, 1, 'Подшипник вала привода насоса TIMKEN на JCB 907/10000', 'Подшипник вала привода насоса на спецтехнику JCB 3CX, 4CX. Артикул: 907/10000', '', 'Подшипник вала привода насоса TIMKEN на JCB 907/10000', '', ''),
(920, 1, 'Подшипник на JCB 907/51400', 'Подшипник на спецтехнику JCB 3CX, 4CX. Артикул: 907/51400', '', 'Подшипник на JCB 907/51400', '', ''),
(921, 1, 'Подшипник игольчатый поворотного кулака на JCB 917/50200', 'Подшипник игольчатый поворотного кулака на спецтехнику JCB 3CX, 4CX. Артикул: 917/50200', '', 'Подшипник игольчатый поворотного кулака на JCB 917/50200', '', ''),
(922, 1, 'Подшипник шестерни трансмиссии на JCB 917/02700', 'Подшипник шестерни трансмиссии на спецтехнику JCB 3CX, 4CX. Артикул: 917/02700', '', 'Подшипник шестерни трансмиссии на JCB 917/02700', '', ''),
(923, 1, 'Подшипник скольжения на JCB 809/00081', 'Подшипник скольжения на спецтехнику JCB 3CX, 4CX. Артикул: 809/0008', '', 'Подшипник скольжения на JCB 809/00081', '', ''),
(924, 1, 'Шестерня с валом на трансмиссию 38 зубьев JCB', '&lt;p&gt;В нашем интернет-магазине вы найдете разнообразные запчасти на экскаватор-погрузчик JCB. В этом разделе представлена шестерня с валом на трансмиссию 38 зубьев JCB 445/64301. Она является частью коробки передач транспортного средства, которая является комплектом валов. Наиболее распространена трехвальная коробка передач с первичным, вторичным и промежуточным валами. На них находится сразу несколько шестеренок, каждая из которых выполняет свое задание. Цена на такие запчасти указывается на странице товара за единицу. Оригинальная и неоригинальная продукция доступна для заказа онлайн.&lt;/p&gt;', '', 'Шестерня с валом на трансмиссию 38 зубьев JCB', '', ''),
(925, 1, 'Шестерня поворота задней стрелы JCB 121/38101', '&lt;p&gt;Предлагаем вам купить шестеренки и другие запасные части JCB. В ассортименте представлены и оригинальные изделия, и неоригинальные, от сторонних производителей. В этом разделе вы найдете шестерню поворота задней стрелы JCB 121/38101. Такое изделие обладает множеством преимуществ. Оно сделано из качественного материала и имеет высокую стойкость к износу. Зубчатое колесо с определенным количеством зубьев применяется в соответствующем механизме специальной техники. В случае износа, причиной которого часто является откалывание зубцов, его следует менять как можно скорее.&lt;/p&gt;', '', 'Шестерня поворота задней стрелы JCB 121/38101', '', ''),
(926, 1, 'Комплект шестерен дифференциала JCB 450/16900', '&lt;p&gt;Комплект шестерен дифференциала моста JCB 450/16900 является необходимым набором деталей для спецтехники. С помощью таких изделий устройство получает способность распределять, менять и транспортировать вращающий момент. Кроме того, дифференциал может осуществить движение двух потребителей с различными угловыми скоростями.Так как изделия выдерживают постоянное трение, такие запасные части для экскаваторов обладают высокой прочностью. Они изготовлены из металла с повышенной износостойкостью и долговечностью. Вы можете быть уверенны в их качестве, подтвержденном сертификатами.&lt;/p&gt;', '', 'Комплект шестерен дифференциала JCB 450/16900', '', ''),
(927, 1, 'Шестерня бортового редуктора 86/89 4cx JCB 450/10204', '&lt;p&gt;Наш каталог запчастей спецтехники заинтересует тех, кто хочет приобрести качественные детали для своего экскаватора-погрузчика от английского бренда. Задняя бортовая шестерня 86/89 4CX JCB 450/10204, представленная в этом разделе, доступна для заказа. Это диск с определенным количеством зубьев, который прикрепляется к вращающейся оси. Поверхность зубчатого колеса бывает конической или цилиндрической.Для замены шестерни из-за износа вы можете обратиться к нашим специалистам. Мастера установят купленные вами детали, проведут технический осмотр, диагностику и ремонт.&lt;/p&gt;', '', 'Шестерня бортового редуктора 86/89 4cx JCB 450/10204', '', ''),
(928, 1, 'Шестерня промежуточная бортовой передачи JCB 450/12702', '&lt;p&gt;В этом разделе представлена шестерня промежуточная бортовой передачи JCB 450/12702. Она выполнена из прочного металла, способного выдержать серьезную ежедневную нагрузку. Его качество и точность подтверждаются сертификатами международного образца. Форма изделия специальная. Оно представляет собой вогнутый диск с отверстиями по центру и по всему внутреннему периметру. Внешняя кромка имеет зазубрины, за которые цепляются другие аналогичные шестеренки.&lt;/p&gt;', '', 'Шестерня промежуточная бортовой передачи JCB 450/12702', '', ''),
(929, 1, 'Прижимная шестерня бортового редуктора 453/04402', '&lt;p&gt;Прижимная шестерня бортового редуктора 453/04402 подходит для моделей 3СХ и 4СХ. Она представляет собой диск особой вогнутой формы, с зазубринами по краям и отверстиями внутри. Задача этой детали погрузчика – фиксировать бортовой редуктор в нужном положении. Она надевается на шлицы стандартного привода, а промежуточные и ведомые шестеренки приводят колесо в движение.&lt;/p&gt;', '', 'Прижимная шестерня бортового редуктора 453/04402', '', ''),
(930, 1, 'Шестерня полуоси внутренняя часть (под стопора) JCB 450/10215', '&lt;p&gt;Шестерня полуоси JCB 450/10215 для задних мостов экскаваторов-погрузчиков JCB.Оригинальное название: Carrier Brake PlateАртикул: 450/10215Представляем вам каталог запчастей JCB онлайн, где вы можете заказать нужные детали для английских экскаваторов-погрузчиков.В этом разделе представлена шестерня полуоси внутренняя под стопора JCB 450/10215. Это зубчатое колесо со шлицами, которое фиксируется к вращающейся оси моста погрузчика JCB. Полуось от дифференциала проходит через чулок заднего моста, входит в поворотную цапфу и одевается в центральную солнечную шестерню редуктора, приводя в действие бортовую передачу, на которую одевается колесо.Шестерни полуоси 450/10215 требуют срочной замены в случае износа и откалывания зубцов, поломки шлицов шестерни.Вы можете приобрести любые запчасти JCB с доставкой или забрать самовывозом.&lt;/p&gt;', '', 'Шестерня полуоси внутренняя часть (под стопора) JCB 450/10215', '', ''),
(931, 1, 'Шестерня центральная бортовой передачи JCB 450/12403', '&lt;p&gt;В этом разделе представлена шестерня бортовой передачи, подходящая для экскаватора-погрузчика от английского производителя JCB. Вы можете применять этот товар для моделей 3CX и 4CX.Промежуточная шестерня относится к запчастям ходовой части – основного сектора спецтехники. Любая поломка ходовой части требует своевременного решения, ведь при неполадке в этой системе автотранспорт часто невозможно эксплуатировать.Шестерня коробки передач есть в наличии на нашем собственном складе. Вы можете приобрести ее в любом количестве, с доставкой на дом или на объект. Возможна установка на месте.&lt;/p&gt;', '', 'Шестерня центральная бортовой передачи JCB 450/12403', '', ''),
(932, 1, 'Шестерня планетарная бортовой передачи JCB 450/10206', '&lt;p&gt;Предлагаем вам купить планетарные шестерни бортовой передачи. Этот товар подходит для моделей 3СХ и 4СХ, произведенных английской компанией JCB. Если вам требуется шестерня планетарная передачи для экскаватора-погрузчика, обращайтесь к нашим специалистам или сразу добавляйте товар в Корзину в требуемом количестве.&lt;/p&gt;', '', 'Шестерня планетарная бортовой передачи JCB 450/10206', '', ''),
(933, 1, 'Шестерня солнечная полуоси редуктора 454/07401', '&lt;p&gt;Шестерня центральная солнечная полуоси бортового редуктора 454/07401представляет собой широкое кольцо с отверстием внутри и зазубринами по внешнему краю. Она зацепляется выделяющимися зубцами с другой запчастью JCB, передавая устройство крутящий момент. Благодаря этому вращается колесо.Для изготовления детали выбран качественный материал, обладающий высокой прочностью и стойкостью к износу. Это подтверждают сертификаты международного образца. Они есть у всех товаров, представленных в каталоге запчастей спецтехники онлайн. Чтобы сделать заказ, пройдите регистрацию на сайте и добавьте выбранный товар в Корзину.&lt;/p&gt;', '', 'Шестерня солнечная полуоси редуктора 454/07401', '', ''),
(934, 1, 'Шестерня бортовой передачи с внутренним зацеплением JCB 450/10205', '&lt;p&gt;Шестерня бортового редуктора с внутренним зацеплением 450/10205 для JCB 3CX, 4CX.В этом разделе нашего онлайн-каталога представлена бортовая шестерня с внутренним зацеплением. Она изготавливается из прочнейшей стали и способна прослужить вам в течение долгого времени. Мы поставляем шестерни бортового редуктора и другие запчасти только от проверенных производителей, заслуживших отменную репутацию.Прямые поставки без посредников и перекупщиков позволяют нам устанавливать на товары доступную цену. Шестерня бортовой передачи доступна для заказа в любом количестве. Также вы можете заказать у наших специалистов диагностику, техническое обслуживание вашей спецтехники и установку заказанных запчастей.&lt;/p&gt;', '', 'Шестерня бортовой передачи с внутренним зацеплением JCB 450/10205', '', ''),
(935, 1, 'Прижимная плата шестерни JCB 453/08203, 458/10770', '&lt;p&gt;Предлагаем вам купить запчасти на спецтехнику в Москве. Товары из нашего каталога можно заказать онлайн, зарегистрировавшись на нашем сайте. В ассортименте есть и оригинальные детали, и неоригинальные, произведенные сторонними компаниями. Все товары имеют гарантию качества от изготовителя, они безопасны и долговечны. Для оптовых покупателей подготовлены особые условия и специальные цены.В большом количестве представлены ходовые части погрузчика. Например, в этом разделе для заказа доступна прижимная плата шестерни JCB 453/08203. Если вы сомневаетесь в выборе, позвоните нашим менеджерам. Они помогут вам выбрать детали.&lt;/p&gt;', '', 'Прижимная плата шестерни JCB 453/08203, 458/10770', '', ''),
(936, 1, 'Шестерня солнечная полуоси редуктора на JCB 454/07401', 'Шестерня солнечная полуоси редуктора на JCB 3CX, 4CX. Артикул: 454/07401', '', 'Шестерня солнечная полуоси редуктора на JCB 454/07401', '', ''),
(937, 1, 'Флянец хвостовика переднего моста 459/70138', '&lt;p&gt;Фланец КПП JCB 459/70138 является важным элементом ходовой части экскаватора. Для его изготовления используется качественный металл, который не боится износа, ржавчины, негативного воздействия влаги. Надежное и долговечное кольцо с отверстиями для фиксации используется для прочного соединения двух деталей коробки передач погрузчика. Оно также обеспечивает герметизацию в местах стыков.Мы занимаемся продажей запчастей JCB оптом и в розницу. Чтобы заказать товар, нужно зарегистрироваться на нашем сайте и добавить его в Корзину. Покупку можно приобрести с доставкой или забрать самовывозом.&lt;/p&gt;', '', 'Флянец хвостовика переднего моста 459/70138', '', ''),
(938, 1, 'Флянец КПП передний JCB 445/10703', '&lt;p&gt;Фланец КПП передний JCB 445/10703 представляет собой метизную деталь. Он является частью коробки передач и ходовой погрузчика. Товар предназначен для качественного и надежного соединения двух элементов, обеспечения герметизации в местах фиксации. По своей форме эта деталь напоминает кольцо со специальными отверстиями для крепежа. Она изготовлена из прочного и долговечного металла, не боится влаги, коррозии и износа.Товар можно заказать из каталога запчастей JCB онлайн, с доставкой или самовывозом из наших магазинов. Если у вас возникли вопросы, свяжитесь с менеджерами нашей компании&lt;/p&gt;', '', 'Флянец КПП передний JCB 445/10703', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(939, 1, 'Фланец кардана помпы плоская часть JCB 914/35001', '&lt;p&gt;Предлагаем вам элементы ходовой части на экскаватор. Товары от известных производителей доступны для заказа оптом и в розницу, с доставкой в любой город страны.В этом разделе представлен фланец кардана помпы 28 мм (плоская часть) JCB 914/35001. Такой товар следует менять регулярно, не допуская износа и полного выхода их строя. Необходимо вовремя проверять запчасти на экскаваторе-погрузчике JCB, осматривая их визуально, тестируя затяжку болтов. Частыми причинами повреждений таких элементов являются: превышение нагрузок, неправильная установка, постоянное истирающее воздействие.&lt;/p&gt;', '', 'Фланец кардана помпы плоская часть JCB 914/35001', '', ''),
(940, 1, 'Фланец кардана помпы 28мм (шпонка) JCB 123/00269', '&lt;p&gt;Фланец кардана помпы 28 мм (шпонка) JCB 123/00269, представленный в этом разделе, соответствует самым высоким требованиям покупателей. Этот элемент ходовой части экскаватора отличается значительной прочностью и долговечностью. Он имеет идеальное центрирование к контактным деталям, соответствует размерам и выполнен с геометрической точностью. Важно не допускать износ этого изделия, так как это может привести к появлению неисправностей шарнира.Чтобы заказать запчасти в магазине JCB, обратитесь к нашим менеджерам или зарегистрируйтесь на сайте и добавьте товар в Корзину.&lt;/p&gt;', '', 'Фланец кардана помпы 28мм (шпонка) JCB 123/00269', '', ''),
(941, 1, 'Фланец кардана помпы JCB 914/70045', '&lt;p&gt;Предлагаем вам приобрести в Москве запчасти ходовой погрузчика JCB. Все товары доступны для заказа онлайн, как оптом, так и в розницу.Фланец кардана помпы 25 мм (шпонка) JCB 914/70045 имеет идеальное центрирование к контактным элементам. Он выполнен с высокой точностью и соответствием размеров, отличается прочностью и надежностью. Распространенная проблема, возникающая при неправильной или длительной эксплуатации деталей – это износ. Изношенный товар следует менять при обнаружении первых неисправностей. Чем быстрее вы устраните проблему, тем больших проблем избежите в будущем.&lt;/p&gt;', '', 'Фланец кардана помпы JCB 914/70045', '', ''),
(942, 1, 'Фланец кардана помпы JCB', '&lt;p&gt;Фланец кардана помпы (шлицов) JCB 914/54201 представляет собой деталь для присоединения узла. Этот товар обладает множеством положительных качеств – он прочный, надежный, имеет геометрическую точность и размерное соответствие, а также правильно центрирован к контактным элементам.Вы можете купить фланец кардана в случае, когда старая деталь подверглась износу. Распространенной причиной являются следующие негативные факторы: постоянное истирающее воздействие, превышение нагрузок и случайные удары. Если это произошло, обращайтесь к нам, чтобы купить новые запчасти на погрузчик.&lt;/p&gt;', '', 'Фланец кардана помпы JCB', '', ''),
(943, 1, 'Фланец хвостовика JCB 450/27200', '&lt;p&gt;Предлагаем вам приобрести запчасти JCB в Москве с доставкой или самовывозом из наших магазинов. Товары доступны для оптового и розничного заказа. Если у вас возникли вопросы, свяжитесь с менеджерами нашей компании.Фланец хвостовика JCB 450/27200 является важным элементом ходовой части экскаватора от английского бренда. Он представляет собой метиз детали коленвала, которая служит для установки шкивов, демпфера, звездочки. Изделие создано из прочной и качественной стали, которая не боится повышенного износа или сложных условий эксплуатации. Оно прослужит вам действительно долго.&lt;/p&gt;', '', 'Фланец хвостовика JCB 450/27200', '', ''),
(944, 1, 'Фланец КПП JCB 459/70133', '&lt;p&gt;Флянец JCB трансмиссии коробки переключения передач 459/70133 для экскаваторов-погрузчиков JCB 3CX, 4CX.Оригинальное название: Yoke coupling, 1480Флянец КПП JCB 459/70133 предназначен для трансмиссии коробки переключения передач экскаватора-погрузчика. Оригинальное название: Yoke coupling, 1480. В нашем онлайн-каталоге запчастей для экскаватора-погрузчика JCB представлены детали для в широком ассортименте по самым оптимальным ценам от мировых производителей.Купить детали для спецтехники вы можете, сделав заказ через телефон или оформив заявку на сайте. Все товары имеют сертификат соответствия и гарантийные сроки. Каждая запчасть изготовлена в строгом соответствии с международными требованиями к качеству и безопасности продукции.&lt;/p&gt;', '', 'Фланец КПП JCB 459/70133', '', ''),
(945, 1, 'Флянец хвостовика переднего моста 458/20814, 454/13100', '&lt;p&gt;&lt;b&gt;Флянец хвостовика переднего моста 458/20814, 454/13100&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 458/20814, 454/13100&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Флянец хвостовика переднего моста 458/20814, 454/13100', '', ''),
(946, 1, 'Прокладка коробки JCB 813/50022', '&lt;p&gt;Прокладка коробки JCB 813/50022 – это уплотнительный элемент, созданный для герметичности механизма. Также она предотвращает проникновение излишней влаги или грязи, удерживает рабочую среду. Благодаря этой детали для спецтехники все швы остаются сухими и чистыми. Еще одно свойство прокладки, которое относится не к основным, а к дополнительным – это выравнивание рельефа изделия. Она скрадывает неровные и шершавые места поверхности внешнего слоя, принимая форму механизма.Чтобы приобрести запчасти на экскаватор-погрузчик JCB, пройдите регистрацию на сайте и добавьте продукцию в Корзину. Менеджеры помогут вам сделать заказ онлайн.&lt;/p&gt;', '', 'Прокладка коробки JCB 813/50022', '', ''),
(947, 1, 'Сальник насоса КПП новая модель JCB  20/900401', '&lt;p&gt;Предлагаем вам купить запчасти на погрузчик. В ассортименте вы найдете огромное количество оригинальных и неоригинальных товаров от разных производителей.В этом разделе представлен сальник насоса КПП новая модель JCB 20/900401. Изделие состоит из корпуса в виде воротника, дополненного специальной набивкой (асбестовой, резиновой, резинотканевой или другой). Оно устанавливается на вал узла и поджимается накидной гайкой или анкерным болтом. С помощью прокладки JCB обеспечивается полная герметизация, препятствующая выходу смазочной жидкости за пределы своего корпуса.&lt;/p&gt;', '', 'Сальник насоса КПП новая модель JCB  20/900401', '', ''),
(948, 1, 'Сальник насоса КПП JCB 904/20226', '&lt;p&gt;Сальник насоса коробки передач JCB 904/20226 – незаменимая деталь рабочего механизма спецтехники: экскаватора и погрузчика. Он предназначен для герметизации зазоров между ходовой и неподвижной частью оборудования. Благодаря своей эргономичной форме она способна защитить устройство от потери масла.Прокладка насоса спецтехники изготовляется из особого вида резины, которая отличается высокой прочностью и износоустойчивостью. Данный материал предназначен для работы в агрессивных условиях, поэтому способен прослужить длительное время. Купить сальник насоса кпп 904/20226 можно в нашем магазине по низким ценам.&lt;/p&gt;', '', 'Сальник насоса КПП JCB 904/20226', '', ''),
(949, 1, 'Cальник на палец крепления переднего моста JCB 3CX/4CX 904/06500', '&lt;p&gt;Предлагаем вам купить в Москве сальники, обладающие высоким качеством компонентов и долговечностью. Чтобы заказать их, просмотрите каталог запасных частей JCB.Такие товары представляют собой кольца с мягкой внутренней и жесткой внешней сторонами. Их главная задача – препятствовать течи смазочной жидкости. Сальник JCB 904/06500 устанавливается во многих элементах транспортного средства, из которых выходит ось или вал. Его следует менять через каждые сто-сто пятьдесят километров пробега или каждые три года использования погрузчика. Поводом для замены является появление трещин, сколов, разрывов.&lt;/p&gt;', '', 'Cальник на палец крепления переднего моста JCB 3CX/4CX 904/06500', '', ''),
(950, 1, 'Сальник КПП заднего флянца JCB 04/20281', '&lt;p&gt;Сальник заднего фланца спецтехники JCB 904/20281 – специальная деталь, предназначенная для герметизации элементов коробки передач. Она может понадобиться для замены при естественном износе прокладки, выработке рабочей поверхности фланца или люфте в подшипниках дифференциала.Сальник кпп заднего фланца JCB изготовляют на высокотехнологическом оборудовании с применением прочных и износоустойчивых материалов. Изделия предназначены для погрузчиков-экскаваторов моделей 3CX и 4CX. В нашем интернет-магазине прокладка коробки передач заднего фланца представлена по доступным ценам.&lt;/p&gt;', '', 'Сальник КПП заднего флянца JCB 04/20281', '', ''),
(951, 1, 'Сальник КПП JCB 904/05100', '&lt;p&gt;Сальник коробки передач JCB 904/05100 – качественная деталь, обладающая защитными свойствами. Она выступает в качестве уплотнителя, задача которого заключается в герметизации зазоров между подвижными и статичными деталями. Подходит сальник кпп для JCB 3CX и 4CX.Он выполнен из высокопрочного материала резинового материала, обладающего превосходной стойкостью к износу и истиранию. Изделие поможет эффективно предотвратить потерю масла в коробке передач. Купить сальник кпп JCB 4CX можно оптом и розницу по доступным ценам.&lt;/p&gt;', '', 'Сальник КПП JCB 904/05100', '', ''),
(952, 1, 'Уплотнение насоса КПП JCB', '&lt;p&gt;Представляем вам большой каталог деталей для JCB 3CX, 4CX. Продукция обладает впечатляющим качеством, что подтверждают международные сертификаты. В ассортименте есть товары от ведущих производителей, как оригинальные, так и неоригинальные.В данном разделе можно заказать уплотнение насоса КПП JCB 813/50041. Оно защищает элемент от проникновения элемент от влаги, грязи и пыли, а также от преждевременного износа.Чтобы приобрести запасные части для погрузчиков, зарегистрируйтесь на сайте. Возникли вопросы по продукции, ассортименту или акциям для оптовиков? Звоните менеджерам компании.&lt;/p&gt;', '', 'Уплотнение насоса КПП JCB', '', ''),
(953, 1, 'Сальник хвостовика JCB 904/20172', '&lt;p&gt;Сальник хвостовика JCB 904/20172 представляет собой прокладку, изготовленную из инновационных материалов, имеющую продолжительный срок службы и высокие характеристики износостойкости. В нашем онлайн-каталоге запчастей для JCB представлен большой ассортимент деталей и комплектующих для спецтехники.Запчасти для экскаваторов-погрузчиков реализуются по цене от производителя. Все изделия сопровождаются сертификатами качества и соответствия, имеют гарантийный срок, что дает вам дополнительную уверенность в их качестве. Приобретайте запчасти и дополнительные детали только в нашем интернет-магазине!&lt;/p&gt;', '', 'Сальник хвостовика JCB 904/20172', '', ''),
(954, 1, 'Прокладка КПП JCB 813/50027', '&lt;p&gt;Прокладка КПП JCB 813/50027 является важной запасной частью фронтального погрузчика. Она делается из мягкого, податливого материала, благодаря которому плотно прилегает к поверхности и принимает форму основного устройства. Такое изделие имеет несколько функций:уменьшение шероховатостей верхнего слоя,обеспечение герметичного закрытия, уплотнение,удерживание рабочей среды,защита устройства от пыли, грязи и влаги.Таких деталей JCB огромное множество. Они отличаются формами, размерами, толщиной, назначением. Все они доступны для заказа онлайн, оптом и в розницу.&lt;/p&gt;', '', 'Прокладка КПП JCB 813/50027', '', ''),
(955, 1, 'Сальник хвостовика моста JCB 904/50023', '&lt;p&gt;Сальник хвостовика моста JCB 904/50023 – оригинальная запасная часть для специального транспорта. Он представлен в виде уплотнителя, который размещается с внутренней стороны полуосевого подшипника.Сальник хвостовика спецтехники имеет основную задачу – герметизировать зазоры в редукторе заднего моста и предотвратить оттуда утечку трансмиссионного масла. Заменить данную прокладку можно самостоятельно или обратившись в сервис за профессиональной помощью. Наша компания предлагает не только сальники для спецтехники в широком ассортименте, но и высококвалифицированные услуги по ремонту и техническому обслуживанию погрузчиков и экскаваторов JCB 3CX и 4CX.&lt;/p&gt;', '', 'Сальник хвостовика моста JCB 904/50023', '', ''),
(956, 1, 'Сальник полуоси JCB 904/50047', '&lt;p&gt;Сальник полуоси JCB 904/50047 – качественная и многофункциональная деталь для спецтехники (погрузчиков и экскаваторов). Она обладает эргономичной формой и превосходными эксплуатационными характеристиками. Прокладка JCB выполнена из высококачественных и износоустойчивых материалов.Предназначена для осуществления герметизации зазоров в местах соединения подвижных и неподвижных элементов механизма. Купить сальник полуоси для спецтехники JCB можно оптом и розницу. Наша компания предлагает широкий ассортимент запчастей по доступным ценам.&lt;/p&gt;', '', 'Сальник полуоси JCB 904/50047', '', ''),
(957, 1, 'Сальник полуоси моста JCB', '&lt;p&gt;Предлагаем вам купить сальник полуоси переднего моста с установкой на спецтехнику. Данный товар имеет недорогую стоимость, но при этом обладает великолепным качеством и надежностью. Наши специалисты установят для вас сальник полуоси переднего моста, а также (по вашему желанию) произведут диагностику, техническое и сервисное обслуживание, ремонт тракторов британского бренда.Все работники компании имеют большой опыт и высокую квалификацию. Качественный сальник полуоси переднего моста JCB поставляется напрямую от производителей. Мы не сотрудничаем с перекупщиками и посредниками.&lt;/p&gt;', '', 'Сальник полуоси моста JCB', '', ''),
(958, 1, 'Сальник бортового редуктора 904/50025', '&lt;p&gt;Ступичный сальник бортового редуктора 904/50025 является специальным уплотнением в погрузчике, которое применяется при герметизации зазоров. Он имеет следующие параметры: 127*160*15/5*17/5 миллиметров. Данный предмет обеспечивает герметизацию элементов, защищает их от попадания влаги и грязи.Цены на запчасти JCB зависят от вида изделий и их количества. Продукцию можно приобрести онлайн, как оптом, так и в розницу. Возможна оперативная доставка и самовывоз. Чтобы сделать заказ, выберите товар из каталога запасных частей погрузчика, добавьте его в Корзину и оформите покупку.&lt;/p&gt;', '', 'Сальник бортового редуктора 904/50025', '', ''),
(959, 1, 'Сальник полушкворней JC 904/06700', '&lt;p&gt;Сальник полушкворней JCB 904/06700 – незаменимая деталь для транспорта специального назначения. Она предназначена для герметизации зазоров между соединяющими частями переднего или заднего моста экскаваторов JCB 3CX и 4CX.Сальники на погрузчик любой из вышеуказанных моделей изготовляют по особой технологии с применением высококачественных материалов. В основе прокладки лежит металлический корпус и резиновая внутренняя часть. Запчасти данного производителя отличаются надежностью и долговечностью эксплуатации. В нашем интернет-магазине вы сможете купить сальник полушкворней JCB 3CX и 4CX по низким ценам.&lt;/p&gt;', '', 'Сальник полушкворней JC 904/06700', '', ''),
(960, 1, 'Сальник полуоси чулка моста JCB', '&lt;p&gt;Сальник полуоси моста (внутренняя сторона) JCB 904/50040 представляет собой специальное уплотнение в экскаваторе. Оно используется для надежной герметизации щелей и представляет собой воротник или манжет. Сальник устанавливается на вал полуоси погрузчика и имеет особую набивку (из асбеста, фторопласта, графита или резины). Его главная задача – уплотнять подвижное соединение узла. Набивка укладывается в сальниковую коробку.Чтобы заказать запчасти JCB оптом, зарегистрируйтесь на нашем сайте. Менеджеры помогут вам сделать покупку онлайн. Забрать ее вы сможете с доставкой или самовывозом.&lt;/p&gt;', '', 'Сальник полуоси чулка моста JCB', '', ''),
(961, 1, 'Сальник ступицы JC 904/50033, 904/М6779М', '&lt;p&gt;В нашем интернет-магазине вы можете не только купить сальник ступицы большой, но и заказать оперативную установку или замену детали на вашей спецтехнике, силами специалистов компании. Наши мастера также готовы произвести диагностику экскаватора или погрузчика, сервисное и техническое обслуживание, любой ремонт.Сальник ступицы JCB 3CX является деталью, относящей к ходовой части спецтехники. Очень важно, чтобы все запчасти обладали высоким качеством. Мы предлагаем вам сальник ступицы JCB 4CX от надежных и проверенных производителей напрямую, с доставкой на объект в любой регион страны.&lt;/p&gt;', '', 'Сальник ступицы JC 904/50033, 904/М6779М', '', ''),
(962, 1, 'Кольцо уплотнительное КПП JCB (39.7X3.53) 828/00224', '&lt;p&gt;Кольцо уплотнительное КПП JCB (39.7X3.53) 828/00224.&lt;/p&gt;', '', 'Кольцо уплотнительное КПП JCB (39.7X3.53) 828/00224', '', ''),
(963, 1, 'Крышка сальника ступицы на JCB 458/20403', 'Крышка сальника ступицы на спецтехнику JCB 3CX, 4CX. Артикул: 458/20403', '', 'Крышка сальника ступицы на JCB 458/20403', '', ''),
(964, 1, 'Уплотнительное кольцо сальник муфты КПП JCB 904/14300', '&lt;p&gt;&lt;b&gt;Уплотнительное кольцо сальник муфты КПП JCB 904/14300&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 904/14300&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Уплотнительное кольцо сальник муфты КПП JCB 904/14300', '', ''),
(965, 1, 'Уплотнительное кольцо сальник муфты КПП JCB 828/00414', '&lt;p&gt;&lt;b&gt;Уплотнительное кольцо сальник муфты КПП JCB 828/00414&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 828/0041&lt;/&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p', '', 'Уплотнительное кольцо сальник муфты КПП JCB 828/00414', '', ''),
(966, 1, 'Полушкворня (цапфа) JCB 448/03902', '&lt;p&gt;Полушкворня (цапфа) JCB 448/03902 представляет собой часть специального стержня шарнира. Ее главная задача – обеспечение поворотного соединения частей автомобилей. Другими словами, эта деталь из каталога запасных частей погрузчика является осью поворота регулируемого колеса.Эту продукцию можно заказать онлайн, воспользовавшись удобной формой на сайте. Доступна доставка по столице и в другие города страны. Возможен самовывоз из наших магазинов в Москве. В каталоге запчастей экскаватора JCB вы найдете и оригинальные товары, и от сторонних производителей. Все они отличаются высоким качеством.&lt;/p&gt;', '', 'Полушкворня (цапфа) JCB 448/03902', '', ''),
(967, 1, 'Карданный вал JCB задний 914/60167', '&lt;p&gt;Задний карданный вал JCB 914 – качественная деталь для ходовой части спецтехники всемирно известной британской компании. Она имеет сложную конструкцию, отвечающую нормам европейского стандарта. Карданный вал экскаватора JCB выполнен из прочного и износоустойчивого металла, не деформирующегося при эксплуатации.Запасная часть предназначена для транспорта специального назначения, а именно моделей экскаваторов-погрузчиков 3CX/4CX. Купить карданный вал погрузчика JCB можно на нашем сайте с возможностью осуществления профессиональной замены детали.&lt;/p&gt;', '', 'Карданный вал JCB задний 914/60167', '', ''),
(968, 1, 'Карданный вал задний JCB 914/60183', '&lt;p&gt;Предлагаем вам купить запчасти на погрузчик. Чтобы сделать заказ, зарегистрируйтесь на нашем сайте и добавьте выбранный товар в Корзину.В этом разделе представлен кардан задний новая модель JCB 914/60183 – это важная составляющая трансмиссии. Причин, по которым эта деталь выходит из строя, всего две. Во-первых, такой элемент ходовой части JCB вынужден испытывать постоянные огромные нагрузки, намного большие, чем выдерживают передние карданы. Во-вторых, на него регулярно попадает грязь и влага при передвижении транспортного средства. Все это приводит к преждевременному износу.&lt;/p&gt;', '', 'Карданный вал задний JCB 914/60183', '', ''),
(969, 1, 'Карданный вал задний JCB (35х106) 914/36900', '&lt;p&gt;Кардан задний 3 CX, 4CX 35х106 JCB 914/36900 представляет собой вал, работающий на крайнюю заднюю пару колес. Он является важным элементом ходовой части спецтехники. На него оказывается сильная нагрузка, которая часто приводит к преждевременному износу. Кроме того, деталь может выходить из строя из-за воздействия грязи и влаги, которая неизбежно попадает на нее при движении. Если вы заметили, что предмет изношен, нужно заменить его как можно скорее.Чтобы заказать запчасти JCB в Москве, обратитесь к менеджерам нашей компании или зарегистрируйтесь на сайте и добавьте товары в Корзину.&lt;/p&gt;', '', 'Карданный вал задний JCB (35х106) 914/36900', '', ''),
(970, 1, 'Карданный вал задний JCB в сборе 914/38100', '&lt;p&gt;Если вам требуется заменить задний карданный вал JCB, обращайтесь к нам! Наши специалисты не только предоставят вам качественные запчасти от ведущих мировых производителей, но и установят их на ваш экскаватор-погрузчик.В этом разделе представлен карданный вал в сборе, который создан для передачи вращения от движка к редукторам. Запчасть создается из высококлассных материалов, что обуславливает ее долгий срок службы, надежность и устойчивость к значительным нагрузкам. Чтобы купить задний кардан для спецтехники, добавьте товар в Корзину, выбрав нужное количество, а затем оформите заказ.&lt;/p&gt;', '', 'Карданный вал задний JCB в сборе 914/38100', '', ''),
(971, 1, 'Карданный вал гидронасоса JCB 914/60041', '&lt;p&gt;Карданный вал гидронасоса JCB 914/60041, представленный в этом разделе, представляет собой полую трубку с тонкими стенками. На одной стороне есть шлицевое соединение и двигающаяся вилка шарнира, на втором – недвигающаяся. Карданный вал погрузчика создан для того, чтобы транспортировать вращающий момент от мотора к редукторам. Для этого используется работа коробки передач. Предмет устойчив к большим нагрузкам и прост в обслуживании.Цены на запчасти JCB указываются на страницах товаров за единицу. Чтобы оформить заказ, зарегистрируйтесь на нашем сайте и добавьте выбранный товар в Корзину.&lt;/p&gt;', '', 'Карданный вал гидронасоса JCB 914/60041', '', ''),
(972, 1, 'Карданный задний JCB в сборе 914/60255', '&lt;p&gt;Задний карданный вал JCB состоит из трубы с тонкими стенками. Он является запчастью ходовой части спецтранспорта. Вы можете купить задний кардан с крестовинами и скобами, чтобы он передавал крутящий момент от коробки передач к редуктору.Из всех деталей спецтехники именно карданный вал является одним из наиболее ремонтопригодных. Если данный элемент вышел из строя, его просто снять с авто и отремонтировать. Чтобы починить задний карданный вал в сборе, необходимо заменить крестовину и подвесной подшипник. Вы также можете обратиться к нашим мастерам, которые заменят деталь на вашем объекте.&lt;/p&gt;', '', 'Карданный задний JCB в сборе 914/60255', '', ''),
(973, 1, 'Вал карданный JCB передний 914/60181', '&lt;p&gt;Карданный вал передний JCB 914 – оригинальная запасная часть привода спецтехники. Она предназначена для своевременной замены износившейся детали в моделях 3CX/4CX. Изделие имеет сложную конструкцию, состоящую из скользящей вилки, крестовины с шарнирами, трубки со шлицевой втулки и двух концевых вилок. Карданный вал экскаватора изготовлен из качественного металла, отличающегося высокой прочностью, стойкостью к износу, повреждению и коррозии.Чтобы своевременно предотвратить поломку данного элемента, необходимо проводить тщательное техническое обслуживание. В нашем магазине купить карданный вал погрузчика можно по выгодной и доступной цене.&lt;/p&gt;', '', 'Вал карданный JCB передний 914/60181', '', ''),
(974, 1, 'Карданный вал JCB 914/60117', '&lt;p&gt;Хотите купить в Москве карданный вал? Предлагаем вам качественные товары от известных производителей! В ассортименте вы найдете и оригинальные, и неоригинальные изделия.В этом разделе представлен передний карданный вал в сборе JCB 914/60117. Это механизм, состоящий из подвесного подшипника, двойного шарнира, скользящей вилки, уплотнений и элементов крепежа. Такая запчасть необходима спецтехнике JCB для передачи вращающего момента от двигателя к редукторам моста. Данная работа выполняется в транспортном средстве с помощью коробки передач. Также механизм является опорой для других узлов погрузчика.&lt;/p&gt;', '', 'Карданный вал JCB 914/60117', '', ''),
(975, 1, 'Карданный вал JCB 914/56400', '&lt;p&gt;Карданный вал передний с крестовинами и скобами является деталью трансмиссии любых автомобилей с задним или передним приводом. Экскаватор от английского бренда не исключение. У нас вы можете купить передний кардан JCB, который будет передавать крутящий момент от коробки передач к редуктору. Эту запчасть легко снимать и ремонтировать.Цена переднего кардана для спецтехники указана на странице данного товара. Предлагаем вам сделать заказ оптом или в розницу, с доставкой или самовывозом. Данная деталь состоит из вала, крестовин, скользящей вилки, уплотнений, креплений и других элементов.&lt;/p&gt;', '', 'Карданный вал JCB 914/56400', '', ''),
(976, 1, 'Кардан задний JCB в сборе 914/60265', '&lt;p&gt;Представляем вам кардан в сборе, предназначенный для экскаваторов и погрузчиков. Карданный вал подает крутящий момент от движка к редукторам. Он являет собой тонкостенную полую трубу, сделанную из качественной стали. В данном разделе вы можете купить задний кардан, относящийся к одной из секций такого устройства.Мы поставляем товары только от специализированных компаний, обладающих хорошей репутацией. Купив кардан в сборе на JCB, вы будете довольны его качеством, надежностью, прочностью и долгим сроком службы. Этот товар предоставляется по доступной цене, так как мы получаем запчасти напрямую.&lt;/p&gt;', '', 'Кардан задний JCB в сборе 914/60265', '', ''),
(977, 1, 'Карданный вал JCB 914/60263', '&lt;p&gt;Карданный вал JCB 914/60263.&lt;/p&gt;', '', 'Карданный вал JCB 914/60263', '', ''),
(978, 1, 'Карданный вал JCB 914/60264', '&lt;p&gt;Карданный вал JCB 914/60264.&lt;/p&gt;', '', 'Карданный вал JCB 914/60264', '', ''),
(979, 1, 'Шкворень поворотного кулака 448/42402, 453/30401, 458/20061, 453/00304', '&lt;p&gt;Шкворень поворотного кулака (цапфы) 448/42402, 453/30401 верхний/нижний устанавливается на мост моделей 3СХ и 4СХ.&lt;/p&gt;', '', 'Шкворень поворотного кулака 448/42402, 453/30401, 458/20061, 453/00304', '', ''),
(980, 1, 'Поворотный кулак цапфа JCB 4CX 453/25202, 458/20040, 458/20041', 'Поворотный кулак цапфа JCB 4CX 453/25202, 458/20040, 458/2004', '', 'Поворотный кулак цапфа JCB 4CX 453/25202, 458/20040, 458/20041', '', ''),
(981, 1, 'Поворотный кулак левый 4CX JCB 453/30702', '&lt;p&gt;Кулак поворотный левый – это деталь переднего моста спецтранспорта. Его основная задача – брать на себя и сдерживать силу от ударов шин о неровную трассу. Также он образует угол поворота для шин, с помощью которых производится управление транспортом.Товар является деталью высокой точности. Его замена требуется, если деталь повреждена или имеет дефект. Если вам требуется купить левый поворотный кулак, обращайтесь к нам! Наши специалисты помогут вам сделать заказ и выбрать подходящий способ оплаты/доставки. Кулак поворотный левый JCB делается из высокопрочной стали.&lt;/p&gt;', '', 'Поворотный кулак левый 4CX JCB 453/30702', '', ''),
(982, 1, 'Поворотный кулак правый JCB 4CX JCB 453/30712', '&lt;p&gt;Кулак поворотный правый JCB – это деталь передней подвески. Как и любая запчасть, кулак должен быть исправен. Любые дефекты приводят к затруднению управления транспортом. Необходимо приобрести новый кулак поворотный правый в сборе, если старая запчасть имеет поврежденную резьбу, на поверхности появились трещины, крепежные отверстия износились и так далее. Значительные нагрузки и усталость металла вызывают подобные проблемы, приводящие к поломке.Если вам нужно купить правый поворотный кулак для спецтехники, обращайтесь к нашим менеджерам за консультацией или добавляйте товар в Корзину.&lt;/p&gt;', '', 'Поворотный кулак правый JCB 4CX JCB 453/30712', '', ''),
(983, 1, 'Кулак поворотный 3СХ левый JCB 448/42602', '&lt;p&gt;В этом разделе представлен кулак поворотный 3CX левый JCB 448/42602. Он представляет собой стальную литую деталь, которая не ремонтируется, а только меняется. Такая запчасть для экскаватора JCB выполняет сразу несколько задач – она удерживает ступицу колеса, выступая несущей конструкцией, соединяет шину с деталями подвески. Также она является частью системы рулевого управления, обеспечивая возможность поворота колеса на требуемый угол.Поворотный кулак на погрузчик также используется как основа для колесного тормозного механизма. Этот товар должен быть прочным, надежным, иметь точные параметры.&lt;/p&gt;', '', 'Кулак поворотный 3СХ левый JCB 448/42602', '', ''),
(984, 1, 'Кулак поворотный 3СХ правый 448/42703', '&lt;p&gt;Кулак поворотный 3CX правый JCB 448/42703, представленный в этом разделе, доступен для заказа онлайн. На него надевается колесный тормозной механизм. Также кулак поворотный выполняет сразу три функции. Во-первых, он дарит системе возможность поворачивать колесо на желаемый угол. Во-вторых, он соединяет шину с деталями подвески JCB, являясь несущей конструкцией. В-третьих, он удерживает ступицу колеса.Чтобы быть уверенным в качестве этой литой запчасти из стали, заказывайте ее только у проверенных компаний. Мы предлагаем вам прочные и надежные товары с точнейшими размерами.&lt;/p&gt;', '', 'Кулак поворотный 3СХ правый 448/42703', '', ''),
(985, 1, 'Болт скобы карданного вала JCB 826/00892', '&lt;p&gt;Болт скобы карданного вала JCB 826/00892 для элементов ходовой части спецтехники JCB&lt;br /&gt;Оригинальное название: Screw Special 3/8UNF X 3/4&lt;/p&gt;', '', 'Болт скобы карданного вала JCB 826/00892', '', ''),
(986, 1, 'Карданный вал гидравлического насоса на JCB 914/37400', 'Карданный вал гидравлического насоса на спецтехнику JCB 3CX, 4CX. Артикул: 914/37400', '', 'Карданный вал гидравлического насоса на JCB 914/37400', '', ''),
(987, 1, 'Карданный вал на JCB 914/42300', 'Карданный вал на спецтехнику JCB 3CX, 4CX. Артикул: 914/42300', '', 'Карданный вал на JCB 914/42300', '', ''),
(988, 1, 'Вал переднего моста на JCB 914/84501', 'Вал переднего моста на спецтехнику JCB 3CX, 4CX. Артикул: 914/8450', '', 'Вал переднего моста на JCB 914/84501', '', ''),
(989, 1, 'Главная пара 13/38 JCB 458/70037', '&lt;p&gt;Оригинальное название: Gear crown wheel &amp; pinion 13T/38T see GEN209Артикул: 458/70037Главная пара (оригинальное наименование - gear crown wheel &amp; pinion 13T / 18T) предназначена для моста погрузчика JCB. Передаточное число венцов 13/38 - для корректной работы проверяйте совместимость со своей моделью экскаватора. Для заказа доступен артикул 458/70037. Вы можете купить оригинальную деталь от производителя с доставкой в любой регион или самовывозом. Если вы находитесь в Москве, наш интернет-магазин предлагает провести замену этой комплектующей ходовой части, а также других запчастей с регулировкой. При необходимости предоставляем периодическое обслуживание спецтехники JCB.&lt;/p&gt;', '', 'Главная пара 13/38 JCB 458/70037', '', ''),
(990, 1, 'Главная пара 41/11 JCB 451/02500', '&lt;p&gt;Главная пара моста JCB 451/02500 с передаточным числом венцов 41/11.Оригинальное название: Gear crownwheel/pinion 41T/11Артикул: 451/02500Ищете по-настоящему качественные товары для вашего экскаватора? Просмотрите наш каталог запчастей спецтехники. В этом разделе представлена важная деталь ходовой части погрузчика – главная пара 51/11 JCB 451/02500. Она является основным валом коробки передач. Ее использование очень важно для динамики специальной техники. С помощью нового установленного элемента, отличающегося по своим характеристикам, легко изменить длину передач, наибольшую скорость и разгон. Основная задача такого товара – уменьшение оборотов, которые передаются от двигателя, примерно в четыре раза.&lt;/p&gt;', '', 'Главная пара 41/11 JCB 451/02500', '', ''),
(991, 1, 'Главная пара 11/37 JCB 458/70035, 453/00900', '&lt;p&gt;Оригинальное название: Gear crown wheel &amp; pinion 11T/37T see TI GEN209Артикул: 458/70035, 453/00900Замена главной пары - довольно частый случай даже на такой мощной технике, как JCB, поскольку на мост, при его сравнительно небольшом весе, приходится значительная динамическая и статическая нагрузка. На данной странице каталога вы найдете деталь 11/37, артикулы - 458/70035, 453/00900. Выбирайте подходящие запчасти для вашего погрузчика и заказывайте с доставкой или самовывозом. Наш магазин не только реализует запасные части для английских экскаваторов, но и предлагает консультации, установку, комплексные ремонтные работы, обслуживание спецтехники JCB.&lt;/p&gt;', '', 'Главная пара 11/37 JCB 458/70035, 453/00900', '', ''),
(992, 1, 'Главная пара 8/37 JCB 458/70242, 458/70039, 453/02000', '&lt;p&gt;Главная пара моста JCB 458/70242 с передаточным числом венцов 8/37.Оригинальное название: Gear Crownwheel &amp; Pinnion 8/37Артикул: 458/70242, 458/70039, 453/02000Хотите купить запчасти на погрузчик, но не знаете, какие именно вам нужны? Обращайтесь к нашим менеджерам! Специалисты помогут вам выбрать различные детали, например, главную пару 8/37 JCB 458/70242. О. Такой элемент предназначен для уменьшения количества оборотов, которые поступают на передачу моста от трансмиссии. Также он меняет длину передач, разгон и скорость. Запасные части JCB, представленные в нашем каталоге, обладают великолепными эксплуатационными характеристиками и долгим сроком службы.&lt;/p&gt;', '', 'Главная пара 8/37 JCB 458/70242, 458/70039, 453/02000', '', ''),
(993, 1, 'Главная пара 13/38 JCB 450/10701, 450/10702, 458/70249, 458/702', '&lt;p&gt;Оригинальная главная пара JCB 13/38 458/70249 для мостов спецтехники JCB с гипоидной передачей, в том числе экскаваторов-погрузчиков JCB 3CX, 4CX.Оригинальное название: Gear crownwheel/pinion RH spiral, 13T/38T, M30Артикул: 450/10701, 450/10702, 458/70249, 458/702Передаточное отношение: хвостовик - 13, планетарная передача - 38.&lt;/p&gt;', '', 'Главная пара 13/38 JCB 450/10701, 450/10702, 458/70249, 458/702', '', ''),
(994, 1, 'Главная пара 13/33 JCB 458/70246', '&lt;p&gt;Главная пара моста JCB 458/70246 с передаточным числом венцов 13/33.Оригинальное название: Gear Crown Wheel and Pinion, 13T/33TАртикул: 458/70246Предлагаем вам приобрести запчасти JCB оптом и в розницу. В ассортименте представлены и оригинальные, и неоригинальные товары от проверенных производителей. В этом разделе располагается главная пара 13/33 JCB 458/70246. Такой товар необходим для обеспечения высокого крутящего момента. Он обладает великолепными эксплуатационными характеристиками, долгим сроком службы и отличным качеством. Цена на главную пару указана на странице товара за единицу. Вы можете заказать монтаж деталей в нашей компании. Специалисты в краткие сроки установят новые взамен штатных, без каких-либо доработок.&lt;/p&gt;', '', 'Главная пара 13/33 JCB 458/70246', '', ''),
(995, 1, 'Главная пара 13/33 JCB 458/70140', '&lt;p&gt;Главная пара моста JCB 458/70140 с передаточным числом венцов 13/33.Оригинальное название: Gear crown wheel &amp; pinion 13T/33TАртикул: 458/70140В нашем магазине JCB вас ждут качественные запчасти от различных производителей. Ассортимент впечатляет высоким качеством и приемлемой стоимостью. В этом разделе представлена главная пара 13/33 JCB 458/70140. Такой элемент являет собой основной вал коробки передач. Эта деталь снижает количество оборотов примерно в четыре раза. Меняя эту деталь, вы можете значительно изменить длину передач, а значит, наибольшую скорость и разгон. Цена на главную пару указана на странице товара за единицу. Данное изделие обладает точными размерами, высокой эффективностью и долгим сроком службы.&lt;/p&gt;', '', 'Главная пара 13/33 JCB 458/70140', '', ''),
(996, 1, 'Главная пара 9/32 458/70029  448/05500', '&lt;p&gt;Главная пара моста JCB 448/05500, 458/70029с передаточным числом венцов 9/32.Оригинальное название: Gear c/wheel &amp; pinion 9/32T NLA see TI GEN232Артикул: 448/05500, 458/70029Представляем вам каталог запасных частей JCB. Мы собрали для вас огромное количество деталей от известных мировых производителей. В этом разделе вы можете купить главную пару. Данный элемент представляет собой основную передачу или наиболее важный вал коробки. Используя его, вы можете снизить количество оборотов, поступаемых от двигателя, примерно в четыре раза. Обычный параметр передаточного числа главной пары 9/32 JCB 448/05500 – 3,8. Меняя эту деталь, вы можете значительно поменять длину передач, наибольшую скорость и разгон. Менеджеры помогут вам выбрать подходящий товар.&lt;/p&gt;', '', 'Главная пара 9/32 458/70029  448/05500', '', ''),
(997, 1, 'Главная пара 13/38 JCB 450/14400', '&lt;p&gt;В этом разделе вы можете купить главную пару JCB по доступной стоимости. Оформляйте заказ онлайн, воспользовавшись удобной системой покупки. Если вам интересует, сколько стоит главная пара для спецтехники с доставкой в другой регион страны, то вам необходим индивидуальный расчет.Обратитесь к нашим специалистам, и они помогут вам выбрать надежную транспортную компанию, которая доставит вам выбранную деталь. Стоимость рассчитывается по удаленности пункта от столицы. Тем покупателям, кто находится в Москве, шестерня главной пары доступна для самовывоза. Мы предлагаем вам и установку детали на месте.&lt;/p&gt;', '', 'Главная пара 13/38 JCB 450/14400', '', ''),
(998, 1, 'Главная пара 11/37 JCB 458/20672, 453/00900', '&lt;p&gt;Главная пара моста JCB 458/20672, 453/00900 с передаточным числом венцов 11/37.Оригинальное название: Gear crown wheel &amp; pinion 11/37TВ каталоге запчастей JCB вы можете онлайн приобрести различные товары от ведущих производителей мира. Мы предлагаем вам только качественную продукцию, выпущенную надежными компаниями. В этом разделе вас ждет такой товар для экскаватора, как главная пара 11/37 JCB 458/20672. Это важный элемент внутреннего механизма любого транспорта. Он используется для четырехкратного уменьшения оборотов, которые передаются с двигателя на колеса. Запчасть располагается в мосту или в коробке передач. Главная пара редуктора доступна для заказа оптом и в розницу, с доставкой или самовывозом.&lt;/p&gt;', '', 'Главная пара 11/37 JCB 458/20672, 453/00900', '', ''),
(999, 1, 'Главная пара 13/38 JCB 450/10700', '&lt;p&gt;Главная пара моста JCB 450/10700 с передаточным числом венцов 13/38.Оригинальное название: Gear crownwheel/pinion 13T/38TАртикул: 450/10700Если вам требуется купить главную пару для тяжелого строительного оборудования, изготовленного английским брендом, обращайтесь в наш интернет-магазин! Вы можете заказать комплект шестерен по приемлемой цене, в любом интересующем вас количестве! Интересует вопрос, сколько стоит главная пара?Просмотрите информацию на этой странице. Цена на главную пару указана за единицу. При доставке транспортными компаниями в другой регион страны, стоимость рассчитывается индивидуально. Покупатели также могут приобрести товар самовывозом и/или заказать его установку на спецтехнику на месте.&lt;/p&gt;', '', 'Главная пара 13/38 JCB 450/10700', '', ''),
(1000, 1, 'Главная пара переднего дифференциала или Гипойдная пара 458/M1350', '&lt;p&gt;&lt;b&gt;Главная пара переднего дифференциала или Гипойдная пара 458/M1350&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 458/M1350&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;&lt;p&gt;&lt;b&gt;Производитель:&lt;/b&gt; Hatve &lt;/p&gt;', '', 'Главная пара переднего дифференциала или Гипойдная пара 458/M1350', '', ''),
(1001, 1, 'Главная пара 13/38 JCB 458/70189', 'Главная пара передаточным числом венцов 13/38 на спецтехнику JCB. Артикул: 458/7018', '', 'Главная пара 13/38 JCB 458/70189', '', ''),
(1002, 1, 'Дифференциал заднего моста JCB 450/10900', '&lt;p&gt;Дифференциал заднего моста JCB 450/10900.&lt;/p&gt;', '', 'Дифференциал заднего моста JCB 450/10900', '', ''),
(1003, 1, 'Сателлиты дифференциала JCB 450/11000', '&lt;p&gt;Предлагаем вам купить сателлиты дифференциала JCB. Они подойдут для экскаватора-погрузчика, произведенного английской компанией, специализирующейся на подобной технике. Сателлит дифференциала заднего моста JCB соответствует моделям 3СХ и 4СХ.Данный товар можно заказать в любом количестве, как оптом, так и в розницу. Для наших клиентов возможна и дополнительная установка любой купленной запчасти на спецтехнику. Купив сателлиты дифференциала JCB, вы легко сэкономите время на замене детали, ремонте, диагностике и сервисном обслуживании, заказав все эти услуги в нашей компании.&lt;/p&gt;', '', 'Сателлиты дифференциала JCB 450/11000', '', ''),
(1004, 1, 'Главная пара 13/33 на JCB 458/20670', 'Главная пара 13/33 на спецтехнику JCB 3CX, 4CX. Артикул: 458/20670', '', 'Главная пара 13/33 на JCB 458/20670', '', ''),
(1005, 1, 'Крестовина карданного вала JCB (35*106,4) 914/56401, 914/35401, 914/30901', '&lt;p&gt;Крестовина переднего моста JCB – важная деталь в механизме спецтехники. Она предназначена для эффективной и качественной работы трансмиссии. Именно от этой запчасти зависит срок эксплуатации карданного вала. Крестовина карданного вала спецтехники предназначена для обеспечения подвижного соединения с изменением угла при движении по неровной дороге.Для изготовления элемента используются сверхпрочные материалы, устойчивые к коррозии и механическим повреждениям. Крестовина JCB 3CX в нашем магазине представлена по выгодной цене с возможностью профессиональной замены.&lt;/p&gt;', '', 'Крестовина карданного вала JCB (35*106,4) 914/56401, 914/35401, 914/30901', '', ''),
(1006, 1, 'Крестовина карданного вала заднего моста JCB  (35*126) 914/45301, 914/10804, 998/10361', '&lt;p&gt;Крестовина погрузчика карданного вала заднего моста JCB 914/4530 – неотъемлемая часть механизма трансмиссии машин специального назначения. Она предназначена для передачи крутящего момента от коробки передач к мосту, с учетом изменения угла во время движения транспорта.Крестовина заднего моста погрузчика имеет сложную конструкцию, детали которой выполнены из высококачественных материалов, отличающихся высокой прочностью и износоустойчивостью. Такая деталь подходит к спецтехнике моделей 3CX и 4CX. Крестовина карданного вала JCB представлена в интернет-магазине по выгодной цене.&lt;/p&gt;', '', 'Крестовина карданного вала заднего моста JCB  (35*126) 914/45301, 914/10804, 998/10361', '', ''),
(1007, 1, 'Крестовина кардана привода гидронасоса JCB  (27*82) Oymak 914/10803, 914/36201', '&lt;p&gt;Крестовина привода гидронасоса JCB – многофункциональная деталь механизма транспортного средства. Она имеет сложную конструкцию, состоящую из игольчатых и упорных подшипников, тыльника, манжетного уплотнителя, стопорного кольца и стакана игольчатого подшипника. Крестовина JCB выполнена из высококачественных нержавеющих материалов, относительно устойчивых к износу и механическим повреждениям.Основная задача данной детали заключается в передачи крутящего момента от кпп к функционирующему узлу транспорта. Крестовина гидронасоса спецтехники представлена в интернет-магазине jcbprof по низким ценам.&lt;/p&gt;', '', 'Крестовина кардана привода гидронасоса JCB  (27*82) Oymak 914/10803, 914/36201', '', ''),
(1008, 1, 'Крестовина передней/задней полуоси (35*92) JCB 914/23201, 914/86601 Oymak', '&lt;p&gt;Крестовина передней и задней полуоси 914/23201, 914/86601 (35*93) для экскаватора-погрузчика JCB 3CX, 4CX.&lt;/p&gt;', '', 'Крестовина передней/задней полуоси (35*92) JCB 914/23201, 914/86601 Oymak', '', ''),
(1009, 1, 'Крестовина универсальная 30*106 JCB 914/80207, 333/G3318 Oymak', '&lt;p&gt;Представляем вам крестовину JCB 3CX. Это специальный шарнир, выполненный в форме креста. К его четырем концам фиксируют вилки шарнира с кольчатыми подшипниками, провоцирующими их движение. Деталь предназначена для обеспечения соосности валов механизма, обладающих способностью взаимного углового передвижения. Крестовина универсальная 30х82 JCB 914/80207 регулярно испытывает значительные нагрузки, так что она часто выходит из строя. Если вы заметили признаки износа, загляните в наш каталог запчастей спецтехники. Здесь вы можете приобрести товары на замену и заказать установку на погрузчик у мастеров компании.&lt;/p&gt;', '', 'Крестовина универсальная 30*106 JCB 914/80207, 333/G3318 Oymak', '', ''),
(1010, 1, 'Крестовина передней/задней полуоси JCB (30*82) Oymak', '&lt;p&gt;Крестовина задней полуоси погрузчика JCB модели 914/86202 – надежная и качественная деталь на технику специального назначения. Она является неотъемлемой частью карданного вала. Её основная задача заключается в передаче силы от коробки переключения передач к ведущему мосту.Крестовина передней полуоси спецтехники выполнена из высокопрочного металла, отличающегося стойкостью к износу и механическим воздействиям. В нашем интернет-магазине представлена крестовина JCB от ведущего европейского производителя. Купить запасные детали на спецтехнику можно оптом и в розницу.&lt;/p&gt;', '', 'Крестовина передней/задней полуоси JCB (30*82) Oymak', '', ''),
(1011, 1, 'Крестовина карданного вала 914/82201, 914/80303, 914/82103, 914/82603', 'Крестовина карданного вала 914/82201, 914/80303, 914/82103, 914/8260', '', 'Крестовина карданного вала 914/82201, 914/80303, 914/82103, 914/82603', '', ''),
(1012, 1, 'Тормозной диск комплект (задний мост) JCB 450/10211-12', '&lt;p&gt;Интересуют запчасти для спецтехники от английского бренда JCB и цены на них? Загляните на наш сайт! В каталоге запасных частей экскаватора вы найдете оригинальные и неоригинальные товары от ведущих производителей со всего мира.В этом разделе представлен тормозной диск комплект на задний мост JCB 450/10211-12. Он создан из металла, который выбран за прочность, долговечность и износостойкость. Предмет необходим для того, чтобы машина могла быстро и плавно тормозить.Рекомендуем вам покупать только надежные товары от проверенных брендов. Именно такие доступны для заказа в интернет-магазине.&lt;/p&gt;', '', 'Тормозной диск комплект (задний мост) JCB 450/10211-12', '', ''),
(1013, 1, 'Диск фрикционный КПП JCB 445/30011', '&lt;p&gt;Диск фрикционный КПП JCB 445/30011, представленный в этом разделе, используется для передачи тяги. Он является неотъемлемым элементом автоматической коробки передач. Фрикционный диск сцепления состоит из металлической основы и накладки. Его необходимо менять при износе, выходе из строя или при замене автоматической коробки передач (у узла и у детали одинаковый срок службы). Недостаток масла – это наиболее распространенная причина, по которой данная деталь изнашивается.&lt;/p&gt;', '', 'Диск фрикционный КПП JCB 445/30011', '', ''),
(1014, 1, 'Диск металлический дифференциала JCB 450/20403', '&lt;p&gt;Диск металлический дифференциала JCB 450/20403 является частью механизма, который передает мощность от двигателя на ведущие колеса. Также он помогает основным шинам двигаться с разными угловыми скоростями. В основе дифференциала неизменно имеется планетарная передача. В корпусе находится несколько дисков.&lt;/p&gt;', '', 'Диск металлический дифференциала JCB 450/20403', '', ''),
(1015, 1, 'Диск фрикционный дифференциала JCB 50/20402', '&lt;p&gt;В нашем каталоге запчастей спецтехники вы найдете большое количество оригинальных и неоригинальных товаров. Вся продукция изготовлена надежными и проверенными производителями, дающими гарантию на свои детали.Если вам нужно купить фрикционные диски, присмотритесь к этому товару. Он является важной частью автоматической коробки передач. Его главная задача – передача тяги. Главная причина, по которой вам требуется приобрести новый диск фрикционный дифференциала JCB 450/20402 – износ старой детали. Многие элементы такого типа сгорают из-за масляного голода или не выносят слишком длительной эксплуатации.&lt;/p&gt;', '', 'Диск фрикционный дифференциала JCB 50/20402', '', ''),
(1016, 1, 'Диск фрикционный КПП JCB 445/03205', '&lt;p&gt;Предлагаем вам купить фрикционные диски сцепления. Этот товар следует менять, если вы устанавливаете новую автоматическую коробку передач. Общий узел и деталь имеют одинаковый срок службы, поэтому нельзя ставить новую коробку и оставлять старый фрикционный диск КПП JCB 445/03205. Иногда такие товары выходят из строя гораздо быстрее. Распространенная причина – недостаток масла. Он возникает при течи из картера или в случае, когда мастер наливает слишком мало жидкости при замене масла.Если вы хотите приобрести запчасти JCB оптом, добавьте нужное количество товаров в Корзину и оформите заказ.&lt;/p&gt;', '', 'Диск фрикционный КПП JCB 445/03205', '', ''),
(1017, 1, 'Диск сцепления КПП JCB 331/16520', '&lt;p&gt;В этом разделе вы можете приобрести элемент, который используется для отсоединения мотора от возможности движения и его плавного соединения. Диск сцепления КПП JCB 331/16520 снижает колебания деталей и позволяет продолжать путь, даже если допустимые нормы превышены. В узле несколько таких элементов. Их устанавливают между коробкой передач и двигателем.&lt;/p&gt;', '', 'Диск сцепления КПП JCB 331/16520', '', ''),
(1018, 1, 'Диск сцепления КПП JCB 331/16516', '&lt;p&gt;Диск сцепления КПП JCB 331/16516, представленный в этом разделе, обладает простым устройством, доступной стоимостью, высоким качеством, износостойкостью, надежностью, компактностью и долгим сроком службы. Его просто обслуживать и ремонтировать. Цена диска сцепления указана на странице товара за единицу. Эти запасные части JCB делятся на нажимные и ведомые. Они располагаются на своих валах и работают через трение между собой. Товар предназначен для соединения и разъединения коленвала и трансмиссии. Такие действия отправляют крутящий момент на шины или останавливают передачу.&lt;/p&gt;', '', 'Диск сцепления КПП JCB 331/16516', '', ''),
(1019, 1, 'Диск сцепления КПП JCB 445/12307', '&lt;p&gt;Представляем вам разнообразные запчасти на экскаватор погрузчик JCB. В ассортименте есть и оригинальные, и неоригинальные товары. В этом разделе вы можете купить диск сцепления, который необходим для передачи крутящего момент на шины или остановки передачи. Для этого детали, установленные каждый на своем валу, двигаются, касаясь друг друга. Их работа позволяет соединять и разъединять коленчатый вал и трансмиссию.Диск сцепления КПП JCB 445/12307 имеет простую конструкцию и доступную стоимость. Он качественный, надежный, износостойкий и долговечный, его легко чинить и обслуживать.&lt;/p&gt;', '', 'Диск сцепления КПП JCB 445/12307', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(1020, 1, 'Крышка бортовой передачи JCB 450/10216', '&lt;p&gt;Крышка бортовой передачи JCB 450/10216 является одним из элементов этого механизма. Она гарантирует его герметичность и позволяет добраться к отдельным частям. Вместе с картером крышка устанавливается в расточке борта корпуса. В ней имеется прилив для монтажа червяка привода спидометра и отверстие, которое закрывается пробкой. Через него можно заправлять масло и контролировать его расход.В нашем каталоге вы можете купить запчасти на погрузчик, из которых можно собрать бортовую передачу целиком: ведущий и ведомый вал, картер, планетарный редуктор. Все детали JCB имеют гарантию качества от производителя.&lt;/p&gt;', '', 'Крышка бортовой передачи JCB 450/10216', '', ''),
(1021, 1, 'Бортовая передача (редуктор) JCB в сборе 450/12401', '&lt;p&gt;Комплект поставки: крышка редуктора, большая шестерня с внутренним зацеплением, солнечная центральная шестерня, средние шестерни (3 шт.), подшипники под средние шестерни (3 шт.), сливная пробка бортовой передачиВ этом разделе представлен бортовой редуктор экскаватора (бортовая передача) в сборе. Заказав данный товар, вы получите все необходимые детали, составляющие запасную часть ходовой части.Редуктор JCB включает в себя крышку, большую шестерню с внутренним зацеплением и солнечную центральную, три средние шестерни и подшипники для них, сливную пробку. Стоимость всего набора указана на странице товара. Вы можете заказать редукторы на спецтехники не только оптом, но и в розницу. Возможна доставка транспортной компанией в любой регион страны или самовывоз из наших московских магазинов.&lt;/p&gt;', '', 'Бортовая передача (редуктор) JCB в сборе 450/12401', '', ''),
(1022, 1, 'Крышка бортовой передачи внешняя (редуктора) JCB 450/12401, 450/12401А, 450/12416, 458/M4230', '&lt;p&gt;Крышка редуктора внешняя является корпусной деталью, имеющей достаточно сложную конфигурацию. Она защищает внутренние элементы от попадания грязи и пыли.В нашем онлайн-каталоге вы можете купить крышку редуктора по доступной цене, с доставкой или самовывозом. Наши специалисты также могут установить для вас высококачественные оригинальные и неоригинальные запчасти от производителя на экскаватор и погрузчик, как на нашей базе, так и у вас на объекте. Возможна не только замена крышки редуктора JCB, но и ремонт, диагностика, сервисное и техническое обслуживание спецтехники.&lt;/p&gt;', '', 'Крышка бортовой передачи внешняя (редуктора) JCB 450/12401, 450/12401А, 450/12416, 458/M4230', '', ''),
(1023, 1, 'Корпус бортового редуктора JCB 458/20446', '&lt;p&gt;Корпус бортового редуктора ступица JCB 458/20446 является основой детали, позволяющей расположить ось вращения шины ниже оси привода или сделать больше передаточные параметры. В коробку устанавливаются четыре шестерни – запчасти для экскаватора, передающие импульс привода шине. Данный товар отличается прочностью, долговечностью и ударостойкостью. Он долго прослужит вам.Чтобы установить запчасти JCB в Москве, обратитесь к нашим специалистам. Мастера компании на месте проведут ремонт, замену старой детали на новую, сделают современную диагностику и полный технический осмотр погрузчика.&lt;/p&gt;', '', 'Корпус бортового редуктора JCB 458/20446', '', ''),
(1024, 1, 'Крышка бортовой передачи внутренняя редуктора JCB 450/10221, 448/20446', '&lt;p&gt;Ступица редуктора моста 450/10221Крышка бортового редуктора JCB – эргономичная и практичная составляющая корпуса важного механизма спецтехники, предназначенного для передачи крутящего момента на ведущую ходовую ось. Изделие выполнено из прочного и износоустойчивого металла, отличающегося стойкостью к коррозии и деформации. Крышка бортовой передачи может использоваться на экскаваторах-погрузчиках JCB 3CX/4CX.Запасная часть имеет небольшой вес и 5 отверстий для крепления болтами. Купить крышку редуктора JCB можно на нашем сайте по низкой цене.&lt;/p&gt;', '', 'Крышка бортовой передачи внутренняя редуктора JCB 450/10221, 448/20446', '', ''),
(1025, 1, 'Ступица на JCB 450/10203', 'Ступица на JCB 3CX, 4CX. Артикулы: 450/10203, 450/111000', '', 'Ступица на JCB 450/10203', '', ''),
(1026, 1, 'Сапун заднего моста JCB 32/925678', 'Сапун заднего моста. Артикул: 32/925678', '', 'Сапун заднего моста JCB 32/925678', '', ''),
(1027, 1, 'Сапун заднего моста JCB 450/13301', '&lt;p&gt;&lt;b&gt;Сапун заднего моста JCB 450/13301&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 450/13301&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Сапун заднего моста JCB 450/13301', '', ''),
(1028, 1, 'Заглушка бортовой передачи JCB 826/00425', '&lt;p&gt;&lt;b&gt;Заглушка бортовой передачи JCB 826/00425&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 826/00425&lt;/&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p', '', 'Заглушка бортовой передачи JCB 826/00425', '', ''),
(1029, 1, 'Муфта коробки передач 459/10120', '&lt;p&gt;&lt;b&gt;Муфта коробки передач 459/10120&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 459/10120&lt;/&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p', '', 'Муфта коробки передач 459/10120', '', ''),
(1030, 1, 'Болт скобы карданного вала JCB 826/00892', '&lt;p&gt;Болт скобы карданного вала JCB 826/00892 для элементов ходовой части спецтехники JCB&lt;br /&gt;Оригинальное название: Screw Special 3/8UNF X 3/4&lt;/p&gt;', '', 'Болт скобы карданного вала JCB 826/00892', '', ''),
(1031, 1, 'Набор регулировочных шайб хвостовика JCB 921/01900', '&lt;p&gt;Оригинальное название: Kit-shimНабор регулировочных шайб хвостовика JCB 921/01900 предназначен для экскаватора-погрузчика JCB 3CX, 4CX, 5CX. Оригинальное название: Kit-shim. В каталоге запасных частей для экскаваторов нашего интернет-магазина вы можете найти все необходимые для ремонта и восстановления вашей техники комплектующие.Изделия в магазине JCB запчастей представлены в оригинале от производителя. Каждая деталь изготовлена в строгом соответствии мировым стандартам качества. Запчасти сопровождаются сертификатами соответствия и гарантийными обязательствами, что дает нашим клиентам дополнительную уверенность в их качестве.&lt;/p&gt;', '', 'Набор регулировочных шайб хвостовика JCB 921/01900', '', ''),
(1032, 1, 'Шестеренчатый вал КПП JCB 445/03014', '&lt;p&gt;Шестеренчатый вал КПП JCB 445/03014 представляет собой шестеренку, объединенную с валом. Он изготовлен из прочного и долговечного металла, который не боится износа и коррозии. Форма запасной части JCB цилиндрическая. Такой стержень вращается на опорах и передает движение другим частям механизма, связанных с ним конструктивно. Его можно эксплуатировать даже в сложных условиях.Этот и другие товары вы можете приобрести в нашем каталоге запчастей спецтехники. Чтобы сделать заказ, зарегистрируйтесь на нашем сайте и добавьте товар в Корзину. Менеджеры компании помогут вам купить продукцию оптом или в розницу.&lt;/p&gt;', '', 'Шестеренчатый вал КПП JCB 445/03014', '', ''),
(1033, 1, 'Промежуточный вал сцепления JCB 459/10093', '&lt;p&gt;Предлагаем вам качественные запасные части JCB, изготовленные известными производителями со всего мира. В этом разделе вы можете приобрести промежуточный вал по доступной цене. Стоимость указана на странице товара за единицу.Промежуточный вал (сцепление) JCB 459/10093 является частью трехвальной коробки передач. Он передает вращающий момент с первичного на вторичный. Устройство использует для этого несколько шестеренок, которые жестко закреплены на нем. Зубчатые колеса изготавливаются косозубыми – это позволяет уменьшить износ и компенсировать постоянную нагрузку.&lt;/p&gt;', '', 'Промежуточный вал сцепления JCB 459/10093', '', ''),
(1034, 1, 'Подшипник КПП JCB 917/51400', '&lt;p&gt;Подшипник КПП JCB 917/51400 – это деталь, поддерживающая подвижное сооружение. Она обеспечивает движение с минимальным сопротивлением. Чтобы понять, что элемент разрушается, выходит из строя и требует срочной замены, обратите внимание на ряд признаков. Изношенный подшипник вала КПП свистит, воет или стучит во время движения, отказывается включать или выключать механизм. В таком случае деталь нужно заменить как можно скорее, не дожидаясь полной поломки.Все представленные товары можно заказать в каталоге запчастей JCB онлайн, оптом или в розницу, с доставкой или самовывозом.&lt;/p&gt;', '', 'Подшипник КПП JCB 917/51400', '', ''),
(1035, 1, 'Кулиса JCB 445/05501_03', '&lt;p&gt;Кулиса JCB 445/05501_03, представленная в этом разделе, является многосоставным механизмом коробки передач. Она предназначена для соединения рычага переключения передачи и штока, подводящего к коробке. Этот элемент устанавливается под днищем погрузчика. Запчасть довольно прочная, она имеет долгий срок службы и хорошую износостойкость. Но она может выйти из строя при попадании в систему влаги, пыли и грязи, применения некачественной смазки или по другим факторам. Цена на кулису указана на странице товара за единицу. Если старая деталь вышла из строя, закажите новую в каталоге запасных частей JCB.&lt;/p&gt;', '', 'Кулиса JCB 445/05501_03', '', ''),
(1036, 1, 'Кольцо стопорное на промежуточную шестерню JCB 821/00494', '&lt;p&gt;Кольцо стопорное на промежуточную шестерню JCB 821/00494 представляет собой незамкнутый диск. Оно изготовлено из углеродистой стали. Главная задача товара – фиксировать детали на валу в определенном положении. В каталоге запасных частей JCB вы также можете приобрести и другие товары, образующие общую систему или узел. Например, в других разделах представлены шестеренки, подшипники, шайбы и не только.Чтобы заказать запчасти JCB оптом, зарегистрируйтесь на нашем сайте и добавьте выбранный товар в Корзину, в нужном вам количестве. Менеджеры компании помогут вам определиться с покупкой.&lt;/p&gt;', '', 'Кольцо стопорное на промежуточную шестерню JCB 821/00494', '', ''),
(1037, 1, 'Кольцо стопорное бортовой передачи (фиксатор подшипника) JCB 821/00209', '&lt;p&gt;Представляем вам впечатляющий каталог запчастей для спецтехники от английского бренда. В ассортименте огромное количество оригинальных деталей высокого качества. Также в продаже есть товары от сторонних производителей. Мы работаем только с надежными и проверенными компаниями.В этом разделе представлено кольцо стопорное бортовой передачи (фиксатор подшипника) JCB 821/00209. Это прочный элемент, закрепляющий сборочный узел в необходимом положении. Он позволяет подшипнику удерживать подвижную конструкцию с заданной жесткостью. Другие детали ходовой части JCB представлены в этом разделе.&lt;/p&gt;', '', 'Кольцо стопорное бортовой передачи (фиксатор подшипника) JCB 821/00209', '', ''),
(1038, 1, 'Зубчатая рейка JCB 120/13014', '&lt;p&gt;Предлагаем вам купить зубчатую рейку и другие запасные части JCB. В ассортименте вы найдете множество качественных товаров от сторонних производителей. Но большую часть каталога занимает оригинальная продукция. Чтобы сделать заказ оптом или в розницу, зарегистрируйтесь на нашем сайте и добавьте товар в Корзину.Зубчатая рейка JCB 120/13014, представленная в этом разделе, является планкой с несколькими зубьями. Она превращает вращательное усилие в поступательное и наоборот, передает угловую скорость и крутящий момент. Данная деталь цепляется к шестеренке (колесу с зубьями).&lt;/p&gt;', '', 'Зубчатая рейка JCB 120/13014', '', ''),
(1039, 1, 'Гайка рулевой тяги 4СХ JCB 826/01819', '&lt;p&gt;Гайка рулевой тяги 4СХ JCB 826/01819 является небольшим, но важным крепежным элементом ходовой части экскаватора. Самая распространенная причина, по которой ей требуется замена – это «прикипание» детали к соответствующему узлу. Обычно это происходит спустя несколько лет интенсивной эксплуатации. Ее можно снять, воспользовавшись перепадом температур, специальным составом или просто приложив силу.Наша компания занимается не только продажей запчастей JCB, но и заменой старых деталей на новые, ремонтом, диагностикой и техническим осмотром погрузчиков. Если вас заинтересовали эти услуги, свяжитесь с менеджерами.&lt;/p&gt;', '', 'Гайка рулевой тяги 4СХ JCB 826/01819', '', ''),
(1040, 1, 'Гайка рулевой тяги 3СХ JCB', '&lt;p&gt;Гайка рулевой тяги 3СХ JCB 826/01372 требует замены в случае, когда старая деталь «прикипела» к узлу после длительной эксплуатации и не снимается ключом. Тогда ее нагревают горелкой, остужают водой и отвинчивают. Так как металл из-за такой процедуры становится хрупким, оставлять старую гайку нельзя. Еще один способ снять прикипевшую деталь JCB – несколько раз нанести на нее WD40. После того следует купить новые запчасти на погрузчик для их незамедлительной замены. Если вы хотите, чтобы заказанный товар был установлен как можно скорее, обращайтесь к нашим специалистам. Мастера выполнят все работы.&lt;/p&gt;', '', 'Гайка рулевой тяги 3СХ JCB', '', ''),
(1041, 1, 'Гидроусилитель руля JCB 35/409300, 35/410900, 816/17072', '&lt;p&gt;Предлагаем вам качественные и эффективные запчасти для экскаватора JCB. В этом разделе вы можете купить ГУР в Москве, заказав его с доставкой или самовывозом. Гидроусилитель руля JCB 35/409300 – это часть рулевого механизма, которая используется для того, чтобы облегчить управление транспортом. При этом применение позволяет сохранить требуемую «обратную связь», обеспечивающую устойчивость траектории, которую задает оператор. Данный товар работает даже при отказе усилителя. Он уменьшает усилия, которые тратятся при повороте рулевого колеса, а также делает удары от колес при движении мягче.&lt;/p&gt;', '', 'Гидроусилитель руля JCB 35/409300, 35/410900, 816/17072', '', ''),
(1042, 1, 'Вал с шестерней задней стрелы JCB', '&lt;p&gt;Если вы ищете качественные запчасти JCB в Москве, обращайтесь к нашим специалистам. Менеджеры проконсультируют вас по предложенному ассортименту и помогут выбрать детали для ходовой части экскаватора.В этом разделе вы найдете вал с шестерней задней стрелы JCB 121/39800. Этот товар является важным элементом коробки передач. Он располагается в подшипниках, установленных в картере. Вал вращается, передавая крутящий момент на соответствующие детали. Шестерни в нем отличаются разным количеством зубьев и их формой. Сейчас чаще всего используются косозубые, так как они предотвращают преждевременный износ.&lt;/p&gt;', '', 'Вал с шестерней задней стрелы JCB', '', ''),
(1043, 1, 'Вал промежуточный КПП JCB', '&lt;p&gt;Предлагаем вам купить промежуточный вал от надежного производителя. Товар является посредником в передаче крутящего момента с первичного элемента на вторичный. Для этого вал промежуточный КПП JCB 445/70401 использует набор шестеренок с зубьями разных размеров, которые надежно закреплены на узле. Современные шестерни имеют косозубую форму, позволяющую существенно снизить износ.Наш интернет-магазин занимается продажей запчастей JCB и их установкой на специальную технику клиента. Также мы можем предложить вам технический осмотр, диагностику и ремонт экскаватора-погрузчика.&lt;/p&gt;', '', 'Вал промежуточный КПП JCB', '', ''),
(1044, 1, 'Вал КПП JCB 59/10119', '&lt;p&gt;Предлагаем вам купить запчасти на спецтехнику в Москве. Большим спросом пользуются элементы ходовой части погрузчика. К примеру, в этом разделе вы можете приобрести вал КПП JCB 459/10119. Такой товар является важной частью коробки передач. Через него происходит передача крутящего момента. Вал дополняется шестернями с различным числом зубьев. Он бывает первичным, вторичным, промежуточным, дополнительным. Сама деталь вращается в подшипниках, которые установлены в картере. Для эффективной работы механизмов важно, чтобы установленный товар был качественным, надежным и долговечным.&lt;/p&gt;', '', 'Вал КПП JCB 59/10119', '', ''),
(1045, 1, 'Крестовина карданного вала JCB  (35*106) Oymak 914/30901', '&lt;p&gt;В этом разделе представлена крестовина карданного вала 35х106,4 JCB 914/30901. Это основной и центральный элемент передачи кардана – системы, транспортирующий вращающий момент между валами, от коробки передач к редукторам моста. Он предназначен для уравновешивания колебания механизмов и подвижного соединения элементов, которые движутся под разными углами. Крестовина погрузчика представляет собой крестообразный шарнир, обеспечивающий соосность всех вращающихся частей.Чтобы приобрести детали для ходовой части экскаватора, зарегистрируйтесь на нашем сайте и добавьте нужный товар в Корзину.&lt;/p&gt;', '', 'Крестовина карданного вала JCB  (35*106) Oymak 914/30901', '', ''),
(1046, 1, 'Гайка хвостовика М24 JCB 826/01483', '&lt;p&gt;В специальной технике важна каждая, даже самая минимальная деталь. В этом разделе вы можете приобрести малую по размеру, но имеющую большое значение запчасть. Гайки М24 хвостовика, представленные у нас, изготовлены из качественной стали. Они способны выдержать значительные нагрузки и долго прослужат вам.Гайка хвостовика JCB для спецтехники произведена надежным производителем и обладает отличным качеством. Она является необходимой деталью ходовой части экскаватора. Цена на гайку М24 указана на странице товара. Здесь вы можете заказать этот товар онлайн, с доставкой или самовывозом.&lt;/p&gt;', '', 'Гайка хвостовика М24 JCB 826/01483', '', ''),
(1047, 1, 'Пробка сливная JCB 816/80012', '&lt;p&gt;Пробка сливная JCB 816/80012, представленная в этом разделе, является важной частью ходовой спецтехники. От ее исправности зависит уровень масла в картере силового агрегата погрузчика. Изделие изготовлено из металла и пластика синего цвета с рельефной резьбой, облегчающей откручивание и закручивание. На верху детали расположен объемный параметр «3/4». Предмет устанавливается на отверстие, которое используется для слива отработанного моторного масла. Этот товар доступен для заказа из каталога запасных частей JCB. Вы можете приобрести его оптом или в розницу, с доставкой или самовывозом.&lt;/p&gt;', '', 'Пробка сливная JCB 816/80012', '', ''),
(1048, 1, 'Заглушка бортовой передачи JCB 826/00425', '&lt;p&gt;&lt;b&gt;Заглушка бортовой передачи JCB 826/00425&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 826/00425&lt;/&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p', '', 'Заглушка бортовой передачи JCB 826/00425', '', ''),
(1049, 1, 'Крестовина кардана привода гидронасоса JCB  (27*82) Oymak 914/10803, 914/36201', '&lt;p&gt;Крестовина привода гидронасоса JCB – многофункциональная деталь механизма транспортного средства. Она имеет сложную конструкцию, состоящую из игольчатых и упорных подшипников, тыльника, манжетного уплотнителя, стопорного кольца и стакана игольчатого подшипника. Крестовина JCB выполнена из высококачественных нержавеющих материалов, относительно устойчивых к износу и механическим повреждениям.Основная задача данной детали заключается в передачи крутящего момента от кпп к функционирующему узлу транспорта. Крестовина гидронасоса спецтехники представлена в интернет-магазине jcbprof по низким ценам.&lt;/p&gt;', '', 'Крестовина кардана привода гидронасоса JCB  (27*82) Oymak 914/10803, 914/36201', '', ''),
(1050, 1, 'Болт главной пары JCB  826/01080', '&lt;p&gt;Болт главной пары JCB 826/01080 – это товар, доступный для заказа из каталога запасных частей погрузчика. Продукцию можно приобрести онлайн, оптом и в розницу, с доставкой во все города страны или самовывозом из магазинов в Москве.Такая запчасть JCB представляет собой цилиндрический стержень с наружной резьбой. На одном его конце имеется шестигранная головка под гаечный ключ. Такой товар является крепежным изделием. Его использование позволяет соединять детали при помощи гайки или прочего резьбового отверстия. Для изготовления товара используется прочная сталь, способная выдерживать серьезные нагрузки.&lt;/p&gt;', '', 'Болт главной пары JCB  826/01080', '', ''),
(1051, 1, 'Болт дифференциала JCB 1315/3418D', '&lt;p&gt;Болт дифференциала JCB1315/3418D, доступный для заказа в интернет-магазине запчастей для спецтехники, является качественным и долговечным крепежным изделием. Его форма цилиндрическая. Стержень имеет внешнюю резьбу и шестигранную головку, предназначенную для закручивания гаечным ключом. Чтобы использовать это изделие, нужно воспользоваться гайкой или другим резьбовым отверстием.Хотите приобрести запчасти на погрузчик JCB? Просмотрите каталог, зарегистрируйтесь на сайте и добавьте продукцию в Корзину. Менеджеры помогут вам сделать заказ и оформить покупку онлайн.&lt;/p&gt;', '', 'Болт дифференциала JCB 1315/3418D', '', ''),
(1052, 1, 'Втулка полуоси JCB 921/50000', '&lt;p&gt;Оригинальное название: Spacer 32mm longВтулка полуоси (оригинальное наименование - spacer 32 mm long) предназначена для вала полуоси на передний и задний мост экскаватора-погрузчика JCB. Выполнена из стали. В наличии артикул 921/50000. Соблюдайте размеры, подходящие для вашей модели, и применяйте только оригинальные комплектующие, в противном случае может пострадать полуось. На данной странице каталога вы можете заказать эту запчасть для JCB онлайн. В нашем интернет-магазине доступны эти и другие оригинальные детали для спецтехники - их приобретают с доставкой или на условиях самовывоза.&lt;/p&gt;', '', 'Втулка полуоси JCB 921/50000', '', ''),
(1053, 1, 'Сапун заднего моста JCB 450/13301', '&lt;p&gt;Сапун заднего моста JCB 450/13301 предназначен для установки на картер, выполняет функцию фиксации. Результатом его поломки может стать подтекание масла. В нашем интернет-магазине представлены запасные части на экскаватор-погрузчик JCB в широком ассортименте по самым оптимальным ценам от мировых производителей.У нас вы можете купить запчасти на экскаватор-погрузчик, комплектующие, расходники и детали для погрузчиков разных модификаций. Все товары имеют сертификат соответствия и гарантийные сроки. Каждая запчасть изготовлена в строгом соответствии с международными требованиями к качеству и безопасности продукции.&lt;/p&gt;', '', 'Сапун заднего моста JCB 450/13301', '', ''),
(1054, 1, 'Шайба дифференциала JCB 808/00209', '&lt;p&gt;Шайба дифференциала JCB 808/00209 изготовлена из качественного, инновационного материала на новейшем оборудовании. Наш интернет-магазин предлагает запчасти для спецтехники JCB в оригинальном варианте. Каждая деталь изготовлена в соответствии с мировыми стандартами.Запчасти для JCB в каталоге нашей компании представлены в широком ассортименте для всех видов экскаваторов-погрузчиков от данного производителя и другой спецтехники. Купить расходники и другие детали вы можете от производителя по самым приемлемым ценам. Все запчасти сопровождаются сертификатами качества и имеют гарантийный срок.&lt;/p&gt;', '', 'Шайба дифференциала JCB 808/00209', '', ''),
(1055, 1, 'Шайба дифференциала JCB 808/00210', '&lt;p&gt;Шайба дифференциала JCB 808/00210 позволяет выставить нужный преднатяг в винтовом дифференциале. Этот важный момент настройки играет большую роль для безотказной работы спецтехники. Каталог запасных деталей для экскаватора в нашем интернет-магазине предлагает широкий выбор деталей для экскаватора от ведущих мировых брендов.Магазин JCB запчасти предлагает только оригинального производства и по очень привлекательным ценам. Каждая деталь изготовлена в соответствии с мировыми стандартами качества и требованиями по технике безопасности. Кроме того, сопровождается сертификатами и гарантийными сроками.&lt;/p&gt;', '', 'Шайба дифференциала JCB 808/00210', '', ''),
(1056, 1, 'Втулка шестерни бортового редуктора JCB 450/12703, 450/10214', '&lt;p&gt;Оригинальное название: Dowel hollowВтулка шестерни бортового редуктора JCB 450/12703, 450/12703 предназначена для замены аналогичной детали на экскаваторе-погрузчике JCB. В нашем интернет-магазине представлен каталог запчастей экскаватора JCB, деталей для спецтехники, изготовленных из высококачественных материалов с использованием новейших технологий. Доставка осуществляется во все регионы России по розничным и оптовым ценам.Мы реализуем детали погрузчика, изготовленные в строгом соответствии с мировыми стандартами качества. Наши детали сопровождаются сертификатами, имеют гарантийный срок эксплуатации и гарантию безопасности.&lt;/p&gt;', '', 'Втулка шестерни бортового редуктора JCB 450/12703, 450/10214', '', ''),
(1057, 1, 'Комплект шестерен дифференциала JCB 450/20600', '&lt;p&gt;Артикул: 450/20600Оригинальное название: Gear set differentialНазначение: Шестерни сателлиты дифференциала равномерно распределяют нагрузку по осям дифференциала и оказывают необходимое воздействие на ходовую и  тормозную системы моста экскаватора-погрузчика JCB.Комплект шестерен дифференциала JCB 450/20600 предназначены для равномерного распределения нагрузки по осям дифференциала и оказания необходимого воздействия на ходовую и тормозную систему моста экскаватора-погрузчика JCB. Запасные части для JCB в нашем интернет-магазине представлены в большом разнообразии модификаций и предназначены для всего модельного ряда техники от данного производителя.Купить запчасти на экскаватор-погрузчик JCB вы можете по самой привлекательной цене от производителя. Каждая деталь сопровождается сертификатом соответствия мировым стандартам и гарантией.&lt;/p&gt;', '', 'Комплект шестерен дифференциала JCB 450/20600', '', ''),
(1058, 1, 'Насос КПП JCB 20/925552', '&lt;p&gt;Ищете запчасти для спецтехники в интернете? Загляните в наш магазин запчастей JCB. В ассортименте представлены качественные товары, как оригинальные, так и от сторонних производителей.Насос КПП JCB 20/925552, доступный для заказа онлайн, относится к трансмиссионным товарам. Он является частью коробки переключения передач. Предмет совместим с такими моделями английских погрузчиков, как 3CX и 4CX. Это гидравлическое устройство прокачивает специальную жидкость через трансмиссию и ее систему охлаждения. Кроме того, оно создает давление, нужное для функционирования узла.&lt;/p&gt;', '', 'Насос КПП JCB 20/925552', '', ''),
(1059, 1, 'Гайка хвостовика моста (М 30) JCB  826/01551', '&lt;p&gt;В онлайн-каталоге запчастей для JCB представлен большой выбор товаров, которые могут потребовать замены. Например, гайка хвостовика заднего моста, которая считается практически «одноразовой». Один раз плотно закрутите ее – и снять деталь будет непросто. Часто такие предметы буквально «прикипают» к поверхности, а при попытках снять теряют резьбу и становятся хрупкими. Если в вашем погрузчике произошла такая неприятность, закажите в этом разделе гайку хвостовика моста (М 30) JCB 826/01551. Вы можете заменить старую запчасть на новую самостоятельно, а можете обратиться к нашим мастерам.&lt;/p&gt;', '', 'Гайка хвостовика моста (М 30) JCB  826/01551', '', ''),
(1060, 1, 'Полуось JCB 3CX левая длинная 914/87800', '&lt;p&gt;Полуось JCB 3CX левая в сборе 914/87800 для трансмиссии экскаватора-погрузчика JCB.&lt;/p&gt;&lt;p&gt;Оригинальное название: Shaft drive assembly 1240.1mm long&lt;/p&gt;', '', 'Полуось JCB 3CX левая длинная 914/87800', '', ''),
(1061, 1, 'Комплект тормозных и фрикционных дисков JCB', '&lt;p&gt;Оригинальное название: Kit 12 x drive plate &amp; 12 x friction plate 4WD clutchКомплект тормозных и фрикционных дисков JCB 998/M5385 предназначен для замены изношенных аналогов в автоматической коробке передач и системе тормоза. Состоит фрикционная модель из диска, изготовленного из стали, на который наклеена фрикционная накладка. Тормозные диски изготовлены из высокопрочной стали.Это одни из самых популярных у покупателей элементов из онлайн-каталога запчастей JCB, потому что считаются расходниками, замена которых должна проводиться регулярно. Данные элементы постоянно подвергаются давлению и силе трения подвижных деталей погрузчика. В каталоге нашего интернет-магазина есть ремкомплекты для JCB 3CX, JCB 4CX.&lt;/p&gt;', '', 'Комплект тормозных и фрикционных дисков JCB', '', ''),
(1062, 1, 'Пробка сливная заднего моста JCB 816/M3848', '&lt;p&gt;В этом разделе представлена пробка слива трансмиссионного масла из заднего моста 816/M3848. Запчасть с магнитом предназначена под ключ шестигранник. Она обычно используется для моделей экскаваторов 3СХ и 4СХ.Пробка сливная заднего моста для спецтехники – это неотъемлемая деталь ходовой части погрузчика от английского бренда. Она может требовать замены при механическом повреждении. В нашей компании вы можете не только купить пробку слива масла JCB, но и заказать ее установку на вашу специальную технику. Опытные специалисты произведут замену деталей и диагностику, а также техническое обслуживание.&lt;/p&gt;', '', 'Пробка сливная заднего моста JCB 816/M3848', '', ''),
(1063, 1, 'Болт стремяночный крепления заднего моста JCB 826/01712', '&lt;p&gt;Болт стремяночный крепления заднего моста JCB 826/01712 изготавливается методом холодной или горячей высадки и накатки резьбы на особых автоматах. После этого их обрабатывают термически и наносят покрытие. Товар из каталога запчастей экскаватора JCB являет собой стержень вытянутой цилиндрической формы с внешней резьбой и головкой с шестью гранями. Для закручивания в резьбовое отверстие используется гаечный ключ.Чтобы приобрести эти и другие запчасти на погрузчик, нужно добавить интересующий товар в Корзину и оформить покупку онлайн. В ассортименте есть и оригинальные, и неоригинальные изделия.&lt;/p&gt;', '', 'Болт стремяночный крепления заднего моста JCB 826/01712', '', ''),
(1064, 1, 'Болт стремяночный крепления заднего моста JCB 826/01665', '&lt;p&gt;Болт стремяночный крепления заднего моста к раме JCB 826/01665. Являет собой крепежный элемент с наружной резьбой и шестигранной головкой. Он закручивается с помощью гаечного ключа. Данная деталь погрузчика позволяет создать соединение с помощью резьбового отверстия. Стоимость продукции указана на странице товара за единицу.В каталоге запчастей JCB можно заказать различные товары онлайн, как оптом, так и в розницу. Для оптовиков подготовлены особые условия. Каждый товар в ассортименте, как оригинальный, так и аналог, имеет международные сертификаты, подтверждающие высокое качество.&lt;/p&gt;', '', 'Болт стремяночный крепления заднего моста JCB 826/01665', '', ''),
(1065, 1, 'Скоба карданного вала JCB 116/00525', '&lt;p&gt;В этом разделе представлена скоба карданного вала JCB 116/00525. Это предохранительная деталь, которая устанавливается на данный элемент в нескольких местах. Данный товар отличается прочностью, надежностью и долговечностью. Но повышенная нагрузка, которую испытывают различные запасные части JCB, часто приводит к преждевременному износу и даже выходу элемента из строя. Если вы заметили признаки повреждения при регулярном осмотре, как можно скорее установите взамен новый элемент.&lt;/p&gt;', '', 'Скоба карданного вала JCB 116/00525', '', ''),
(1066, 1, 'Полуось 3СХ задняя JCB 450/10209, 914/60103, 914/M4448', '&lt;p&gt;Полуось прямая для заднего моста экскаватора-погрузчика JCB 3CX.Производитель: OYMACАртикул: 450/10209, 914/M7404Для эксплуатации специальной техники необходимо, чтобы все запчасти были исправны. И если задняя полуось в вашем погрузчике требует замены, вы можете заказать ее в нашем интернет-магазине. Предлагаем вам купить заднюю полуось оптом или в розницу. Чтобы забрать купленный товар, приезжайте в наши розничные магазины или оформляйте доставку с помощью транспортной компании.Также возможна установка данной запчасти на экскаватор клиента, силами наших специалистов. Задняя полуось JCB 3CX будет установлена на вашем объекте или на базе нашей компании. Возможно проведение диагностики спецтехники.&lt;/p&gt;', '', 'Полуось 3СХ задняя JCB 450/10209, 914/60103, 914/M4448', '', ''),
(1067, 1, 'Гайка регулировочная дифференциала JCB 450/10403', '&lt;p&gt;В этом разделе представлена регулировочная гайка дифференциала JCB 450/10403. Она является частью  устройства, который переводит поток мощности от мотора к прочим элементам трансмиссии. Данная деталь крепежа позволяет отрегулировать положение подшипников. Чтобы сделать эту процедуру, нужно равномерно с обеих сторон затягивать их до увеличения расстояния между крышками на 0,1 – 0,2 миллиметра.&lt;/p&gt;', '', 'Гайка регулировочная дифференциала JCB 450/10403', '', ''),
(1068, 1, 'Карданный вал JCB', '&lt;p&gt;Если вы хотите купить запчасти на погрузчик, присмотритесь к нашему каталогу! В ассортименте представлено огромное количество деталей, как оригинальных, так и от сторонних производителей.Карданный вал передний JCB 914/39000А является механизмом, передающим вращающий момент от движка к редукторам. Кроме того, на него опираются различные узлы и элементы транспортного средства. Этот предмет изготовлен из качественной стали и дополнен высококлассными компонентами, уплотнениями, крепежом.Чтобы купить карданный вал, нужно зарегистрироваться на нашем сайте и добавить товар в Корзину.&lt;/p&gt;', '', 'Карданный вал JCB', '', ''),
(1069, 1, 'Корпус дифференциала заднего моста JCB 450/10800', '&lt;p&gt;Корпус дифференциала JCB, представленный в этом разделе, доступен для заказа оптом и в розницу. Его стоимость и артикул указаны на странице товара. Чтобы купить корпус дифференциала JCB, выберите соответствующую онлайн-форму: добавьте товар в Корзину и оформите заказ, следуя подсказкам, или же выберите «Купить в один клик», указав свой номер телефона, по которому наш менеджер свяжется с вами. Оба этих варианта не займут у вас много времени!Корпус дифференциала заднего моста JCB является важной запасной деталью ходовой части экскаватора-погрузчика, относящегося к линейкам 3СХ и 4СХ.&lt;/p&gt;', '', 'Корпус дифференциала заднего моста JCB 450/10800', '', ''),
(1070, 1, 'Корпус дифференциала заднего моста JCB 453/30601', '&lt;p&gt;Корпус дифференциала заднего моста JCB 453/30601, представленный в каталоге запасных частей экскаватора, имеет классическую расцветку английского погрузчика. Товар изготовлен из прочного металла, он надежно защитит внутренний механизм от внешних повреждений и случайных ударов. В него помещается дифференциал заднего моста. Обычно такой товар имеет разъемную конструкцию, он вращается в двух цилиндрических подшипниках.В магазине JCB вы можете заказать эти и другие запчасти онлайн, с оперативной доставкой на объект. Возможна установка новых товаров силами мастеров компании.&lt;/p&gt;', '', 'Корпус дифференциала заднего моста JCB 453/30601', '', ''),
(1071, 1, 'Подшипник игольчатый полуоси (ARB) 907/50200', '&lt;p&gt;Подшипник ступицы роликовый игольчатый обладает стандартной конфигурацией и подходит для погрузчиков, экскаваторов от известной английской компании.Этот высококачественный товар относится к деталям ходовой части автотранспорта.Предлагаем вам купить игольчатый подшипник по приемлемой цене, с доставкой на дом или объект. Для заказа достаточно просто добавить товар в Корзину и оформить покупку на сайте. У вас возникли вопросы или предложения? Позвоните нашим специалистам! Если запасная часть вышла из строя, то вы легко можете купить игольчатые подшипники в Москве онлайн.&lt;/p&gt;', '', 'Подшипник игольчатый полуоси (ARB) 907/50200', '', ''),
(1072, 1, 'Шестерня бортового редуктора 86/89 4cx JCB 450/10204', '&lt;p&gt;Наш каталог запчастей спецтехники заинтересует тех, кто хочет приобрести качественные детали для своего экскаватора-погрузчика от английского бренда. Задняя бортовая шестерня 86/89 4CX JCB 450/10204, представленная в этом разделе, доступна для заказа. Это диск с определенным количеством зубьев, который прикрепляется к вращающейся оси. Поверхность зубчатого колеса бывает конической или цилиндрической.Для замены шестерни из-за износа вы можете обратиться к нашим специалистам. Мастера установят купленные вами детали, проведут технический осмотр, диагностику и ремонт.&lt;/p&gt;', '', 'Шестерня бортового редуктора 86/89 4cx JCB 450/10204', '', ''),
(1073, 1, 'Шестерня планетарная бортовой передачи JCB 450/10206', '&lt;p&gt;Предлагаем вам купить планетарные шестерни бортовой передачи. Этот товар подходит для моделей 3СХ и 4СХ, произведенных английской компанией JCB. Если вам требуется шестерня планетарная передачи для экскаватора-погрузчика, обращайтесь к нашим специалистам или сразу добавляйте товар в Корзину в требуемом количестве.&lt;/p&gt;', '', 'Шестерня планетарная бортовой передачи JCB 450/10206', '', ''),
(1074, 1, 'Шарнир наконечник рулевой тяги JCB 3СХ 123/07855', '&lt;p&gt;Шарнир наконечник рулевой тяги JCB 3СХ 123/07855 со стороны колеса представляет собой наконечник наружной части, который вставляется в поворотную цапфу-кулак JCB и обеспечивает поворот передних колес.&lt;p', '', 'Шарнир наконечник рулевой тяги JCB 3СХ 123/07855', '', ''),
(1075, 1, 'Рулевая тяга передние колеса 3CX 126/02253, 126/01946', '&lt;p&gt;Предлагаем вам купить рулевую тягу JCB в сборе с гранатой и пыльниками на передние колеса спецтехники 3СХ. Она обеспечивает передачу усилия от поворота руля на поворотные кулаки колес. Заказ можете оформить на нашем сайте оставив телефон через форму обратной связи. &lt;/p&gt;', '', 'Рулевая тяга передние колеса 3CX 126/02253, 126/01946', '', ''),
(1076, 1, 'Главная пара 13/33 JCB 458/70246', '&lt;p&gt;Главная пара моста JCB 458/70246 с передаточным числом венцов 13/33.Оригинальное название: Gear Crown Wheel and Pinion, 13T/33TАртикул: 458/70246Предлагаем вам приобрести запчасти JCB оптом и в розницу. В ассортименте представлены и оригинальные, и неоригинальные товары от проверенных производителей. В этом разделе располагается главная пара 13/33 JCB 458/70246. Такой товар необходим для обеспечения высокого крутящего момента. Он обладает великолепными эксплуатационными характеристиками, долгим сроком службы и отличным качеством. Цена на главную пару указана на странице товара за единицу. Вы можете заказать монтаж деталей в нашей компании. Специалисты в краткие сроки установят новые взамен штатных, без каких-либо доработок.&lt;/p&gt;', '', 'Главная пара 13/33 JCB 458/70246', '', ''),
(1077, 1, 'Трос ручного тормоза JCB 910/47000', '&lt;p&gt;Предлагаем вам купить трос стояночного тормоза оптом или в розницу. Данный товар можно использовать для специальной техники (экскаваторов и погрузчиков). Заказав трос стояночного тормоза, выберите способ получения – самовывозом из наших розничных магазинов или доставкой любой транспортной компанией по всей стране.Кроме того, клиенты нашей компании могут заказать установку выбранной детали на автотранспорт. Наши специалисты оперативно установят для вас трос стояночного тормоза JCB на спецтехнику, а также произведут ее ремонт и диагностику, сервисное и техническое обслуживание.&lt;/p&gt;', '', 'Трос ручного тормоза JCB 910/47000', '', ''),
(1078, 1, 'Трос ручного тормоза JCB', '&lt;p&gt;Трос ручного тормоза JCB 332/C9365 – это деталь, предназначенная для нормального функционирования тормозной системы экскаватора-погрузчика JCB 3CX, JCB 4CX с 2010 год выпуска по 2017 год. Трос передает усилие от ручного рычага тормоза, расположенного в салоне техники к тормозному механизму.В онлайн-каталоге запчастей спецтехники нашего интернет-магазина вы можете найти полный спектр запчастей для JCB по ценам от производителя для погрузчиков, экскаваторов и других специализированных машин. В том числе JCB 3CX, JCB 4CX, агрегатов сельскохозяйственного назначения, предназначенных для дорожно-ремонтных работ и т.д. Мы реализуем только оригинальные детали для спецтехники.&lt;/p&gt;', '', 'Трос ручного тормоза JCB', '', ''),
(1079, 1, 'Втулка хвостовика моста JCB (регулировочная)', '&lt;p&gt;Предлагаем вам приобрести запчасти для погрузчика JCB в Москве. Все представленные предметы, в том числе и втулку хвостовика заднего моста, можно заказать онлайн, с оперативной доставкой. Возможна и крупная, и розничная покупка . Особенности предложений для оптовиков узнавайте у наших менеджеров.Регулировочная втулка хвостовика моста JCB 445/03005 представляет собой деталь механизма, имеющую осевое отверстие. С ее помощью вы можете менять положение хвостовика. Чтобы установить запчасть, отремонтировать или продиагностировать ваш экскаватор, обратитесь к нашим специалистам.&lt;/p&gt;', '', 'Втулка хвостовика моста JCB (регулировочная)', '', ''),
(1080, 1, 'Рулевая тяга передние колеса 3CX 126/02253, 126/01946', '&lt;p&gt;Предлагаем вам купить рулевую тягу JCB в сборе с гранатой и пыльниками на передние колеса спецтехники 3СХ. Она обеспечивает передачу усилия от поворота руля на поворотные кулаки колес. Заказ можете оформить на нашем сайте оставив телефон через форму обратной связи. &lt;/p&gt;', '', 'Рулевая тяга передние колеса 3CX 126/02253, 126/01946', '', ''),
(1081, 1, 'Шарнир рулевой тяги JCB 4CX 331/23193', '&lt;p&gt;В этом разделе представлена рулевая тяга JCB 4CX граната 331/23193, а именно, внутренняя часть. Она представляет собой сочленение, которое нивелирует пульсирующие нагрузки, передающиеся на основные колеса рычагами подвески. Другое название детали - шарниры равных угловых скоростей. Рулевые тяги экскаваторов являются соединителем между рулем и управляющей системой, они передают усилия от заворота на поворотные кулаки шин.&lt;/p&gt;', '', 'Шарнир рулевой тяги JCB 4CX 331/23193', '', ''),
(1082, 1, 'Рулевая тяга в сборе 3CX Super, 4CX 126/02419, 128/13949, 126/01947, 2602419', '&lt;p&gt;В этом разделе можно приобрести рулевую тягу в сборе 3CX Super, 4CX 126/02419, 126/01947. Она используется для моделей с равновеликими колесами. Такой товар является связующим элементом между рулем и системой управления. Обычно требует замены вследствие поломки и деформации, разрушения резиновых вкладышей шарниров, попадания пыли и грязи.&lt;/p&gt;', '', 'Рулевая тяга в сборе 3CX Super, 4CX 126/02419, 128/13949, 126/01947, 2602419', '', ''),
(1083, 1, 'Шестерня промежуточная бортовой передачи JCB 450/12702', '&lt;p&gt;В этом разделе представлена шестерня промежуточная бортовой передачи JCB 450/12702. Она выполнена из прочного металла, способного выдержать серьезную ежедневную нагрузку. Его качество и точность подтверждаются сертификатами международного образца. Форма изделия специальная. Оно представляет собой вогнутый диск с отверстиями по центру и по всему внутреннему периметру. Внешняя кромка имеет зазубрины, за которые цепляются другие аналогичные шестеренки.&lt;/p&gt;', '', 'Шестерня промежуточная бортовой передачи JCB 450/12702', '', ''),
(1084, 1, 'Диск фрикционный КПП JCB 445/30011', '&lt;p&gt;Диск фрикционный КПП JCB 445/30011, представленный в этом разделе, используется для передачи тяги. Он является неотъемлемым элементом автоматической коробки передач. Фрикционный диск сцепления состоит из металлической основы и накладки. Его необходимо менять при износе, выходе из строя или при замене автоматической коробки передач (у узла и у детали одинаковый срок службы). Недостаток масла – это наиболее распространенная причина, по которой данная деталь изнашивается.&lt;/p&gt;', '', 'Диск фрикционный КПП JCB 445/30011', '', ''),
(1085, 1, 'Шестерня планетарная бортовой передачи JCB 450/10206', '&lt;p&gt;Предлагаем вам купить планетарные шестерни бортовой передачи. Этот товар подходит для моделей 3СХ и 4СХ, произведенных английской компанией JCB. Если вам требуется шестерня планетарная передачи для экскаватора-погрузчика, обращайтесь к нашим специалистам или сразу добавляйте товар в Корзину в требуемом количестве.&lt;/p&gt;', '', 'Шестерня планетарная бортовой передачи JCB 450/10206', '', ''),
(1086, 1, 'Прижимная шестерня бортового редуктора 453/04402', '&lt;p&gt;Прижимная шестерня бортового редуктора 453/04402 подходит для моделей 3СХ и 4СХ. Она представляет собой диск особой вогнутой формы, с зазубринами по краям и отверстиями внутри. Задача этой детали погрузчика – фиксировать бортовой редуктор в нужном положении. Она надевается на шлицы стандартного привода, а промежуточные и ведомые шестеренки приводят колесо в движение.&lt;/p&gt;', '', 'Прижимная шестерня бортового редуктора 453/04402', '', ''),
(1087, 1, 'Болт крепления моста JCB 826/11352', '&lt;p&gt;Болт стремянка крепления заднего моста 826/01713.&lt;/p&gt;', '', 'Болт крепления моста JCB 826/11352', '', ''),
(1088, 1, 'Болт стремянка крепления заднего моста 826/01713', '', '', 'Болт стремянка крепления заднего моста 826/01713', '', ''),
(1089, 1, 'Распределитель рулевой колонки 35/410900', '&lt;p&gt;Распределитель рулевой колонки 35/410900.&lt;/p&gt;', '', 'Распределитель рулевой колонки 35/410900', '', ''),
(1090, 1, 'Главная пара переднего дифференциала или Гипойдная пара 458/M1350', '&lt;p&gt;&lt;b&gt;Главная пара переднего дифференциала или Гипойдная пара 458/M1350&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 458/M1350&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;&lt;p&gt;&lt;b&gt;Производитель:&lt;/b&gt; Hatve &lt;/p&gt;', '', 'Главная пара переднего дифференциала или Гипойдная пара 458/M1350', '', ''),
(1091, 1, 'Главная пара 13/38 JCB 458/70189', 'Главная пара передаточным числом венцов 13/38 на спецтехнику JCB. Артикул: 458/7018', '', 'Главная пара 13/38 JCB 458/70189', '', ''),
(1092, 1, 'Шайба полуоси JCB 450/10208', '&lt;p&gt;Шайба полуоси JCB 450/10208, представленная в этом разделе, относится к наиболее простым видам крепежных изделий. Она напоминает плоское кольцо с отверстием внутри. Ее устанавливают между полуосью и крепежом, далее гайку плотно закручивают. Использование такой детали погрузчика увеличивает площадь опорной поверхности, обеспечивает большее усилие затяжки и лучшее уплотнение элемента с прокладкой, препятствует самопроизвольному раскручиванию. В результате, фиксация происходит более надежно.&lt;/p&gt;', '', 'Шайба полуоси JCB 450/10208', '', ''),
(1093, 1, 'Шпилька шкворня на JCB 826/01363', 'Шпилька шкворня на спецтехнику JCB. Артикул: 826/01363', '', 'Шпилька шкворня на JCB 826/01363', '', ''),
(1094, 1, 'Сапун JCB 448/56282', '&lt;p&gt;&lt;b&gt;Сапун JCB 448/56282&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 448/56282&lt;/&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p', '', 'Сапун JCB 448/56282', '', ''),
(1095, 1, 'Шайба верхнего рычага переключения передач на JCB 445/10802', 'Шайба верхнего рычага переключения передач на JCB 3CX, 4CX. Артикул: 445/10802', '', 'Шайба верхнего рычага переключения передач на JCB 445/10802', '', ''),
(1096, 1, 'Трос на JCB 332/D2730', 'Трос на спецтехнику JCB 3CX, 4CX. Артикул: 332/D2730', '', 'Трос на JCB 332/D2730', '', ''),
(1097, 1, 'Гайка M20 на JCB 1370/0702Z', 'Гайка M20 на спецтехнику JCB 3CX, 4CX. Артикул: 1370/0702Z', '', 'Гайка M20 на JCB 1370/0702Z', '', ''),
(1098, 1, 'Болт М20 на JCB 1315/0811Z', 'Болт М20 на спецтехнику JCB 3CX, 4CX. Артикул: 1315/0811Z', '', 'Болт М20 на JCB 1315/0811Z', '', ''),
(1099, 1, 'Соединение на JCB 331/36009, 45/905400', 'Соединение на спецтехнику JCB 3CX, 4CX. Артикул: 331/36009, 45/90540', '', 'Соединение на JCB 331/36009, 45/905400', '', ''),
(1100, 1, 'Болт М8 х 50 02/291109', '&lt;p&gt;&lt;b&gt;Болт М8 х 50 02/291109&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 02/291109&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Болт М8 х 50 02/291109', '', ''),
(1101, 1, 'Насос трансмиссии КПП ORIGINAL JCB (ОРИГИНАЛ) 20/925327', '&lt;p&gt;&lt;b&gt;Насос трансмиссии КПП ORIGINAL JCB (ОРИГИНАЛ) 20/925327 &lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 20/925327&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Made in Great Britan&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Производитель:&lt;/b&gt; ORIGINAL JCB &lt;/p&gt;', '', 'Насос трансмиссии КПП ORIGINAL JCB (ОРИГИНАЛ) 20/925327', '', ''),
(1102, 1, 'Болт крепления шкворня JCB 1321/0509', '&lt;p&gt;&lt;b&gt;Болт крепления шкворня JCB 1321/0509&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера: &lt;/b&gt;1321/0509&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с: &lt;/b&gt;JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-Производитель: &lt;/b&gt;Турция &lt;/p&gt;', '', 'Болт крепления шкворня JCB 1321/0509', '', ''),
(1103, 1, 'Крышка гидрозамка каретки на JCB 331/42846', '&lt;p&gt;Название: HYDRA-CLAMP CYLINDER HYDRA-CLAMP CYLINDER.&lt;/p&gt;&lt;p&gt;Артикул: 331/42846, 334/L3100&lt;/p&gt;&lt;p&gt;Крышка гидрозамка каретки.&lt;/p&gt;', '', 'Крышка гидрозамка каретки на JCB 331/42846', '', ''),
(1104, 1, 'Бампер передний противовес JCB 332/G5547', '&lt;p&gt;Передний бампер противовес JCB 332/G5547 является обязательным элементом кузова, его замена в случае необходимости обеспечит безопасную работу водителю.&lt;/p&gt;', '', 'Бампер передний противовес JCB 332/G5547', '', ''),
(1105, 1, 'Газовый микролифт амортизатор капота JCB 331/66784', '&lt;p&gt;Газовый микролифт амортизатор капота JCB 331/66784 предназначен для поднятия капота, закрывающего моторный отсек погрузчика JCB 3CX, JCB 4CX. Деталь изготовлена из инновационных материалов, имеет отличные качественные характеристики и длительный срок службы. Наш интернет-магазин предлагает целый онлайн-каталог запчастей для JCB, в котором есть детали для любых модификаций техники от данного производителя.&lt;/p&gt;', '', 'Газовый микролифт амортизатор капота JCB 331/66784', '', ''),
(1106, 1, 'Газовый микролифт амортизатор капота JCB 331/37268', '&lt;p&gt;Газовый микролифт амортизатор капота JCB 331/37268 предназначен для поднятия капота, закрывающего моторный отсек погрузчика JCB 3CX, JCB 4CX. Деталь изготовлена из инновационных материалов, имеет отличные качественные характеристики и длительный срок службы. Наш интернет-магазин запчастей для JCB предлагает детали для любых модификаций техники от данного производителя.&lt;/p&gt;', '', 'Газовый микролифт амортизатор капота JCB 331/37268', '', ''),
(1107, 1, 'Ручка дверная внешняя старая модель JCB 123/04067', '&lt;p&gt;Ручка дверная внешняя старой модели JCB 123/04067 предназначена для экскаваторов-погрузчиков JCB.&lt;/p&gt;&lt;p&gt;Изготовлена из инновационных материалов, имеет отличные качественные характеристики и длительный срок службы.&lt;/p&gt;', '', 'Ручка дверная внешняя старая модель JCB 123/04067', '', ''),
(1108, 1, 'Кронштейн крыла левый передний 128/D0026', '&lt;p&gt;Кронштейн крыла левый передний 128/D0026 предназначен для экскаваторов-погрузчиков JCB 3CX, JCB 4CX.&lt;/p&gt;', '', 'Кронштейн крыла левый передний 128/D0026', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(1109, 1, 'Кронштейн крыла правый передний 128/D0027', '&lt;p&gt;Кронштейн крыла правый передний 128/D0027 предназначен для экскаваторов-погрузчиков JCB 3CX, JCB 4CX.&lt;/p&gt;', '', 'Кронштейн крыла правый передний 128/D0027', '', ''),
(1110, 1, 'Решетка радиатора JCB 3CX Super, 4CX 128/H9703, 128/F9250', '&lt;p&gt;Оригинальное название: Assembly assembly AWS, Grille assembly AWS&lt;/p&gt;&lt;p&gt;Комплектация: металлическая решетка, эмблема - логотип JCB, замок.&lt;/p&gt;&lt;p&gt;Цвет: черный.&lt;/p&gt;&lt;p&gt;Решетка радиатора JCB 3CX Super, 4CX 128/H9703, 128/F9250 – устройство, обеспечивающее приток воздуха к радиатору и являющееся одним из важнейших элементов системы охлаждения двигателя.&lt;/p&gt; &lt;p&gt;Деталь предназначена для установки на экскаватор-погрузчик JCB 3CX Super, JCB 4CX нового образца для моделей с 2011 год выпуска по 2017 год.&lt;/p&gt;', '', 'Решетка радиатора JCB 3CX Super, 4CX 128/H9703, 128/F9250', '', ''),
(1111, 1, 'Трапеция передней стрелы JCB 125/35100', '&lt;p&gt;Трапеция передней фронтальной стрелы JCB 125/35100 для экскаватора-погрузчика JCB 3CX, 4CX.&lt;/p&gt;&lt;p&gt;Оригинальное название: Link crowd 670mm long.&lt;/p&gt;', '', 'Трапеция передней стрелы JCB 125/35100', '', ''),
(1112, 1, 'Трапеция перекладина передней стрелы JCB 331/43840, 331/43844', '&lt;p&gt;Трапеция перекладина передней стрелы на спецтехнику JCB. Артикул: 331/43840, 331/43844. Является необходимым элементом погрузчика, используемого во время строительных и уборочных работ.&lt;/p&gt;', '', 'Трапеция перекладина передней стрелы JCB 331/43840, 331/43844', '', ''),
(1113, 1, 'Фартук правый желтый JCB 331/25650', '&lt;p&gt;Фартук правый желтый JCB 331/25650. Защитный элемент, выполненный в классической расцветке английских погрузчиков. Обладает высоким качеством и прочностью.&lt;/p&gt;', '', 'Фартук правый желтый JCB 331/25650', '', ''),
(1114, 1, 'Фартук левый желтый JCB 331/25649  331/37826', '&lt;p&gt;Фартук левый желтый JCB 331/25649. Защитный элемент, сделанный из износостойкого пластика. Форма изделия специальная, конструктивная.&lt;/p&gt;', '', 'Фартук левый желтый JCB 331/25649  331/37826', '', ''),
(1115, 1, 'Решетка радиатора JCB 335/08180', '&lt;p&gt;Решетка защитная переднияя металлическая JCB 335/08180 радиатора и аккумулятороного отсека экскаватора-погрузчика JCB.&lt;/p&gt;&lt;p&gt;Оригинальное название: Grille front black.&lt;/p&gt;&lt;p&gt;Артикул: 335/08180&lt;/p&gt;&lt;p&gt;Комплектация: металлическая решетка, эмблема, замок.&lt;/p&gt;&lt;p&gt;Решетка радиатора JCB 335/08180 СК предназначена для закрытия радиаторного и аккумуляторного отсека на экскаваторах-погрузчиках JCB. Оригинальное название данной запчасти Grille front black.&lt;/p&gt; &lt;p&gt;В комплект входят: решетка, замыкающее устройство и эмблема фирмы.&lt;/p&gt;', '', 'Решетка радиатора JCB 335/08180', '', ''),
(1116, 1, 'Защитный кожух задний правый JCB 332/E0830', '&lt;p&gt;Защитный кожух задний правый JCB 332/E0830 предназначен для экскаваторов-погрузчиков JCB 3CX, JCB 4CX.&lt;/p&gt;', '', 'Защитный кожух задний правый JCB 332/E0830', '', ''),
(1117, 1, 'Защитный кожух задний левый JCB 332/E0833', '&lt;p&gt;Защитный кожух задний левый JCB 332/E0833 предназначен для экскаваторов-погрузчиков JCB 3CX, JCB 4CX.&lt;/p&gt;', '', 'Защитный кожух задний левый JCB 332/E0833', '', ''),
(1118, 1, 'Фартук правый черный JCB 331/27639', '&lt;p&gt;Фартук правый черный JCB 331/27639. Изготовлен из прочного материала. Цвет изделия – черный, форма сложная, соответствует изгибам конструкции.&lt;/p&gt;&lt;p&gt;Задача данного предмета – защита частей погрузчика от внешних повреждений. Кроме того, он выполняет эстетическую функцию.&lt;/p&gt;', '', 'Фартук правый черный JCB 331/27639', '', ''),
(1119, 1, 'Фартук левый черный JCB 331/27638', '&lt;p&gt;Фартук левый черный JCB 331/27638. Выполнен из прочного, износостойкого пластика. Задача элемента – защищать части техники. Изделие имеет специальную форму.&lt;/p&gt;', '', 'Фартук левый черный JCB 331/27638', '', ''),
(1120, 1, 'Уголок капота правый (горизонтальный) JCB 332/P5292', '&lt;p&gt;Уголок капота правый горизонтальный JCB 332/P5292 имеет специальную форму с отверстиями для крепления, выполнен из материала.&lt;/p&gt;', '', 'Уголок капота правый (горизонтальный) JCB 332/P5292', '', ''),
(1121, 1, 'Уголок капота правый (вертикальный) JCB 332/P5260, 346/00564', '&lt;p&gt;Уголок капота правый вертикальный JCB 332/P5260 (346/00564). Относится к элементам кузова. Изготовлен из прочного и долговечного материала желтого цвета, классического оттенка для погрузчиков от английского бренда.&lt;/p&gt;', '', 'Уголок капота правый (вертикальный) JCB 332/P5260, 346/00564', '', ''),
(1122, 1, 'Уголок капота левый (горизонтальный) JCB 332/P5275, 346/00565', '&lt;p&gt;Уголок капота левый горизонтальный JCB 332/P5275 (346/00565). Имеет защитную функцию, оберегающую элемент кузова от внешних факторов и механических повреждений. Материал прочный, долговечный, стойкий к износу.&lt;/p&gt;', '', 'Уголок капота левый (горизонтальный) JCB 332/P5275, 346/00565', '', ''),
(1123, 1, 'Уголок капота левый (вертикальный) JCB 332/P5245, 346/00563', '&lt;p&gt;Уголок капота левый вертикальный JCB 332/P5245 (346/00563). Относится к элементам кузова. Деталь выполнена из прочного материала желтого цвета.&lt;/p&gt;', '', 'Уголок капота левый (вертикальный) JCB 332/P5245, 346/00563', '', ''),
(1124, 1, 'Ручка правой двери наружная новая модель JCB 332/A3731, 331/31710', '&lt;p&gt;Ручка правой двери наружная, новая модель JCB 331/31710, 332/A3732. Изготовлена из прочного, износостойкого и долговечного материала черного цвета. Выдержит постоянную нагрузку при открывании и закрывании двери.&lt;/p&gt;', '', 'Ручка правой двери наружная новая модель JCB 332/A3731, 331/31710', '', ''),
(1125, 1, 'Ручка левой двери наружная новая модель JCB 331/31709, 331/43118', '&lt;p&gt;Ручка левой двери наружная новой модели JCB 331/31709, 331/43118. Подходит для техники 3СХ и 4СХ. Имеет соответствующие размеры и удобную форму, позволяющую с легкостью открывать и закрывать дверь. Специальный материал легко выдержит постоянную нагрузку.&lt;/p&gt;', '', 'Ручка левой двери наружная новая модель JCB 331/31709, 331/43118', '', ''),
(1126, 1, 'Ручка заднего стекла правая JCB 331/28235', '&lt;p&gt;Ручка заднего стекла правая JCB 331/28235. Изделие создано из прочного и долговечного материала, который выдержит большую нагрузку при постоянной эксплуатации.&lt;/p&gt;', '', 'Ручка заднего стекла правая JCB 331/28235', '', ''),
(1127, 1, 'Ручка заднего стекла левая JCB 331/28233', '&lt;p&gt;Ручка заднего стекла левая JCB 331/28233 изготовлена из прочного материала, легко выдержит постоянные нагрузки при опускании и поднятии прозрачного элемента.&lt;/p&gt;', '', 'Ручка заднего стекла левая JCB 331/28233', '', ''),
(1128, 1, 'Крышка каретки правая JCB 123/07178', '&lt;p&gt;Крышка каретки правая JCB 123/07178, имеет соответствующую конструктивную форму. Изготовлена из прочного материала.&lt;/p&gt;', '', 'Крышка каретки правая JCB 123/07178', '', ''),
(1129, 1, 'Крышка каретки левая JCB 123/07177', '&lt;p&gt;Крышка каретки левая JCB 123/07177, имеет соответствующую задаче конструктивную форму. Изготовлена из прочного износостойкого материала черного цвета.&lt;/p&gt;', '', 'Крышка каретки левая JCB 123/07177', '', ''),
(1130, 1, 'Крыло переднее правое 4СХ JCB 162/03847', '&lt;p&gt;Крыло переднее правое 4СХ JCB 162/03847. Имеет черный цвет, выполнено из прочного качественного материала. Используется для защиты техники от загрязнений и повреждений. Ставится над колесом. Во время движения оно не дает грязи, земле и камням из-под шин попадать на корпус машины.&lt;/p&gt;', '', 'Крыло переднее правое 4СХ JCB 162/03847', '', ''),
(1131, 1, 'Крыло переднее левое черное (малое) 343мм ст.м. JCB 123/03874', '&lt;p&gt;Крыло переднее левое черное малое 343 мм ст.м. JCB 123/03874. Деталь изготавлена из стойкого к износу материала. Устанавливается над колесом, не дает грязи, земле и камням из-под шин попадать на корпус спецтехники. Его основная функция – защита от загрязнений и повреждений.&lt;/p&gt;', '', 'Крыло переднее левое черное (малое) 343мм ст.м. JCB 123/03874', '', ''),
(1132, 1, 'Крыло переднее левое 4СХ JCB 162/03848', '&lt;p&gt;Крыло переднее левое 4СХ JCB 162/03848. Главная задача – защищать экскаватор-погрузчик от загрязнений и повреждений. Выполнено из качественного материала.&lt;/p&gt;', '', 'Крыло переднее левое 4СХ JCB 162/03848', '', ''),
(1133, 1, 'Крыло переднее черное 325мм н.м. JCB 332/G7024', '&lt;p&gt;Крыло переднее черное 325 мм н.м. JCB 332/G7024. Устанавливается над колесом для защиты спецтехники от пыли, грязи, комков земли и вылетающих из-под шин камней. Выполнено из стойкого к износу материала.&lt;/p&gt;', '', 'Крыло переднее черное 325мм н.м. JCB 332/G7024', '', ''),
(1134, 1, 'Крыло заднее правое желтое ст.м 3СХ JCB 123/02470', '&lt;p&gt;Крыло заднее правое желтое ст.м 3СХ JCB 123/02470. Деталь является специальным покрытием, которое располагается над колесом, оберегает кузов от внешних воздействий.&lt;/p&gt;', '', 'Крыло заднее правое желтое ст.м 3СХ JCB 123/02470', '', ''),
(1135, 1, 'Крыло заднее правое желтое ст.м 3СХ JCB 331/25645', '&lt;p&gt;Крыло заднее правое желтое ст.м 3СХ JCB 331/25645. Деталь является специальным покрытием, которое располагается над колесом, оберегает кузов от внешних воздействий.&lt;/p&gt;', '', 'Крыло заднее правое желтое ст.м 3СХ JCB 331/25645', '', ''),
(1136, 1, 'Крыло заднее правое 4СХ с.м. JCB 123/02299', '&lt;p&gt;Крыло заднее правое 4СХ с.м. JCB 123/02299. Деталь является специальным покрытием, которое располагается над колесом, оберегает кузов от внешних воздействий.&lt;/p&gt;', '', 'Крыло заднее правое 4СХ с.м. JCB 123/02299', '', ''),
(1137, 1, 'Крыло заднее левое желтое ст.м. 3СХ JCB 123/02469', '&lt;p&gt;Крыло заднее левое желтое ст.м. 3СХ JCB 123/02469. Деталь является специальным покрытием, которое располагается над колесом, оберегает кузов от внешних воздействий.&lt;/p&gt;', '', 'Крыло заднее левое желтое ст.м. 3СХ JCB 123/02469', '', ''),
(1138, 1, 'Крыло заднее левое желтое ст.м 3СХ JCB 331/25644', '&lt;p&gt;Крыло заднее левое желтое ст.м 3СХ JCB 331/25644. Деталь является специальным покрытием, которое располагается над колесом, оберегает кузов от внешних воздействий.&lt;/p&gt;', '', 'Крыло заднее левое желтое ст.м 3СХ JCB 331/25644', '', ''),
(1139, 1, 'Крыло заднее левое 4СХ с.м. JCB 123/02298', '&lt;p&gt;Заднее левое крыло 4СХ с.м. JCB 123/02298. Деталь является специальным покрытием, которое располагается над колесом, оберегает кузов от внешних воздействий.&lt;/p&gt;', '', 'Крыло заднее левое 4СХ с.м. JCB 123/02298', '', ''),
(1140, 1, 'Крыло 4сх переднее правое желтое 420мм ст.м JCB 123/02951', '&lt;p&gt;Крыло 4CX переднее правое желтое 420мм ст.м JCB 123/02951. Товар изготовлен из прочного и легкого материала, выкрашенного в цвет, соответствующий модели английской специальной техники. Главная задача этой запчасти для экскаватора-погрузчика – защита машины от грязи, комков земли и камней, которые попадают в нее во время движения.&lt;/p&gt;', '', 'Крыло 4сх переднее правое желтое 420мм ст.м JCB 123/02951', '', ''),
(1141, 1, 'Крыло 4сх переднее левое желтое 420мм ст.м JCB 123/02950', '&lt;p&gt;Крыло 4CX переднее левое желтое 420мм ст.м JCB 123/02950. Изделие особой формы выкрашено в цвет специальной техники, оно выполнено из прочного и легкого материала. Основная задача элемента – уберечь погрузчик от повреждений камнями и загрязнений во время движения по трассе или бездорожью.&lt;/p&gt;', '', 'Крыло 4сх переднее левое желтое 420мм ст.м JCB 123/02950', '', ''),
(1142, 1, 'Крыло 3сх переднее правое черное 343мм ст.м. JCB 331/31575', '&lt;p&gt;Крыло 3CX переднее правое черное 343мм ст.м. JCB 331/31575. Качественное изделие имеет защитную функцию. Оно не дает грязи и камням, которые разбрасываются колесами во время движения автомобиля, повреждать корпус специальной техники.&lt;/p&gt;', '', 'Крыло 3сх переднее правое черное 343мм ст.м. JCB 331/31575', '', ''),
(1143, 1, 'Толкатель штанги JCB 320/03524', '&lt;p&gt;Толкатель штанги JCB 320/03524 для двигателей DieselMax 444 экскаваторов-погрузчиков JCB.Оригинальное название: Tappet valveАртикул: 320/03524Толкатель штанги JCB 320/03524 для двигателей экскаватора-погрузчика является важной деталью нормального функционирования спецтехники в целом. От исправности этой запчасти зависит безотказная работа двигателя. Магазин JCB предлагает широкий ассортимент оригинальных запчастей от брендов с мировым именем по очень приятным ценам.Детали для спецтехники произведены в соответствии с мировыми стандартами качества и соответствия безопасности. Сопроводительные документы с сертификатами и гарантийными обязательствами позволяют нашему интернет-магазину быть надежным партнером для каждого покупателя.&lt;/p&gt;', '', 'Толкатель штанги JCB 320/03524', '', ''),
(1144, 1, 'Крыло 3сх переднее левое черное 343мм ст.м. JCB 331/31574', '&lt;p&gt;Крыло 3сх переднее левое черное 343мм ст.м. JCB&lt;/p&gt;', '', 'Крыло 3сх переднее левое черное 343мм ст.м. JCB 331/31574', '', ''),
(1145, 1, 'Крыло 3сх переднее левое желтое 343мм ст.м. JCB 123/03523', '&lt;p&gt;Крыло 3CX переднее левое желтое 343мм ст.м. JCB 123/03523. Это ограждающее покрытие над колесом экскаватора. Оно используется для защиты машины и оператора от грязи и камней, которые разбрасываются колесами. Соответствует основному цвету погрузчика.&lt;/p&gt;', '', 'Крыло 3сх переднее левое желтое 343мм ст.м. JCB 123/03523', '', ''),
(1146, 1, 'Кронштейн правого крыла 4СХ JCB 123/02955', '&lt;p&gt;Кронштейн правого крыла 4СХ JCB 123/02955. Деталь используется для установки на вертикальной плоскости машины. Она является консольной опорной конструкцией, работающей по механическому принципу, при котором сопротивление происходит на скол и сдвиг. Предмет представляет собой самостоятельное изделие, с помощью которого на правом крыле можно крепить выступающие горизонтально элементы погрузчика.&lt;/p&gt;', '', 'Кронштейн правого крыла 4СХ JCB 123/02955', '', ''),
(1147, 1, 'Кронштейн левого крыла 4СХ JCB 123/02954', '&lt;p&gt;Кронштейн левого крыла 4СХ JCB 123/02954. Является консольной опорной конструкцией. Устанавливается на вертикальной плоскости левого крыла.&lt;/p&gt;', '', 'Кронштейн левого крыла 4СХ JCB 123/02954', '', ''),
(1148, 1, 'Крепление кронштейна (уголок) крыла правого JCB 123/02953', '&lt;p&gt;Крепление кронштейна (уголок) крыла правого JCB 123/02953. Элемент используется для плотной фиксации консольной опорной конструкции. Кронштейшн имеет механический метод работы — сопротивление изделия на скол и сдвиг. Он ставится на правое крыло.&lt;/p&gt;', '', 'Крепление кронштейна (уголок) крыла правого JCB 123/02953', '', ''),
(1149, 1, 'Боковина капота моторного отсека JCB нов.мод правая JCB 331/30537', '&lt;p&gt;Боковина капота моторного отсека JCB новая модель правая 331/30537. Элемент кузовной детали, которая оберегает двигатель от негативных внешних факторов. Изготовлена из высококлассного материала, обладающего особой прочностью.&lt;/p&gt;', '', 'Боковина капота моторного отсека JCB нов.мод правая JCB 331/30537', '', ''),
(1150, 1, 'Боковина капота моторного отсека JCB нов.мод левая JCB 331/30538', '&lt;p&gt;Боковина капота моторного отсека JCB новая модель левая 331/30538. Деталь сделана из высококачественного материала.&lt;/p&gt;', '', 'Боковина капота моторного отсека JCB нов.мод левая JCB 331/30538', '', ''),
(1151, 1, 'Капот передний JCB 2139, 128/G2288', '&lt;p&gt;Капот пластиковый (стекловолокно) передний с боковинами на JCB 3CX, JCB 4CX.&lt;/p&gt;', '', 'Капот передний JCB 2139, 128/G2288', '', ''),
(1152, 1, 'Подножка нижняя 410 мм JCB 331/27034', '&lt;p&gt;Подножка нижняя 410 мм JCB 331/27034. Крепится с помощью элементов крепежа (болтов). Удерживает вес оператора и облегчает подъем в кабину. Имеет специальную форму с зазубринами, обеспечивающими удобство даже во время дождя или гололеда.&lt;/p&gt;', '', 'Подножка нижняя 410 мм JCB 331/27034', '', ''),
(1153, 1, 'Эмблема на решетку радиатора JCB (новая модель) 817/04436B', '&lt;p&gt;Эмблема на решетку радиатора JCB (новая модель) 817/04436B&lt;/p&gt;', '', 'Эмблема на решетку радиатора JCB (новая модель) 817/04436B', '', ''),
(1154, 1, 'Трос открытия капота JCB 910/60199', '&lt;p&gt;Трос открытия капота JCB 910/60199. Предназначен для использования в моделях экскаваторов и погрузчиков. Выполнен из сверхпрочного металла, который обеспечивает надежное и многоразовое использование детали.&lt;/p&gt;', '', 'Трос открытия капота JCB 910/60199', '', ''),
(1155, 1, 'Зеркало JCB 121/59400', '&lt;p&gt;Боковое зеркало для JCB 121/59400. Обеспечит отличный обзор. Чистое зеркальное стекло без погрешностей имеет противоударное обрамление.&lt;/p&gt;', '', 'Зеркало JCB 121/59400', '', ''),
(1156, 1, 'Подножка верхняя 616 мм JCB 331/39996, 331/48582', '&lt;p&gt;Подножка верхняя 616 мм JCB 331/39996. Изготовлена из металла и имеет особую форму с отверстиями и зазубринами. На нее удобно ставить ногу для подъема в кабину оператора, даже во время дождя или гололеда. Деталь крепится с помощью элементов крепежа (болтов). При надежной фиксации выдерживают большую нагрузку.&lt;/p&gt;', '', 'Подножка верхняя 616 мм JCB 331/39996, 331/48582', '', ''),
(1157, 1, 'Решетка радиатора JCB 3CX 331/27955', '&lt;p&gt;Решетка защитная переднияя металлическая JCB 331/27955 радиатора и аккумулятороного отсека экскаватора-погрузчика JCB.&lt;/p&gt;&lt;p&gt;Оригинальное название: Grille front black.&lt;/p&gt;&lt;p&gt;Комплектация: металлическая решетка, треугольная эмблема, замок&lt;/p&gt;', '', 'Решетка радиатора JCB 3CX 331/27955', '', ''),
(1158, 1, 'Замок решетки радиатора JCB 333/C3140', '&lt;p&gt;Замок решетки радиатора JCB 333/C3140. Изготовлен из надежного пластика и стали.&lt;/p&gt;', '', 'Замок решетки радиатора JCB 333/C3140', '', ''),
(1159, 1, 'Передний бампер противовес JCB нового образца 331/46249', '&lt;p&gt;Передний бампер противовес JCB нового образца 331/46249&lt;/p&gt;', '', 'Передний бампер противовес JCB нового образца 331/46249', '', ''),
(1160, 1, 'Крыло JCB заднее черное пластиковое правое 332/D4972', '&lt;p&gt;Крыло оригинальное заднее черное пластиковое правое 332/D4972 для экскаватора-погрузчика JCB 3CX, 4CX, 5CX&lt;/p&gt;', '', 'Крыло JCB заднее черное пластиковое правое 332/D4972', '', ''),
(1161, 1, 'Крыло JCB заднее черное пластиковое левое 332/D4871', '&lt;p&gt;Крыло оригинальное заднее черное пластиковое левое 332/D4871 для экскаватора-погрузчика JCB 3CX, 4CX, 5CX&lt;/p&gt;', '', 'Крыло JCB заднее черное пластиковое левое 332/D4871', '', ''),
(1162, 1, 'Решетка радиатора JCB 3CX 128/Н9642', '&lt;p&gt;Решетка защитная переднияя металлическая JCB 128/H9642 радиатора и аккумулятороного отсека экскаватора-погрузчика JCB нового образца 2011-2017 года выпуска.&lt;/p&gt;&lt;p&gt;Оригинальное название: Grille front black.&lt;/p&gt;&lt;p&gt;Комплектация: металлическая решетка, эмблема, замок&lt;/p&gt;', '', 'Решетка радиатора JCB 3CX 128/Н9642', '', ''),
(1163, 1, 'Эмблема на решетку радиатора (старая модель) JCB', '&lt;p&gt;Эмблема решетки радиатора (старая модель)&lt;/p&gt;', '', 'Эмблема на решетку радиатора (старая модель) JCB', '', ''),
(1164, 1, 'Защитная решетка задних фонарей с логотипом JCB 700/50020', '&lt;p&gt;Защитная решетка задних фонарей изготовлена из стали, имеет гладкую фактуру. Устанавливается на стандартные крепления задних стоп-сигналов, дополнительные отверстия не нужны.Обеспечивает защиту задних фонарей от ударов, наезда на снег, грунт, бетонные плиты и т.д.&lt;/p&gt;', '', 'Защитная решетка задних фонарей с логотипом JCB 700/50020', '', ''),
(1165, 1, 'Глазок уровня масла гидравлического бака JCB 123/08053', '&lt;p&gt;Глазок-окошко уровня гидравлического масла.&lt;/p&gt;&lt;p&gt;Устанавливается во внешней части гидравлического бака закручиваясь по резьбе с уплотнительным сальником.&lt;/p&gt;&lt;p&gt;Производитель: Италия&lt;/p&gt;', '', 'Глазок уровня масла гидравлического бака JCB 123/08053', '', ''),
(1166, 1, 'Передний бампер противовес JCB 128/15285', '&lt;p&gt;Передний бампер противовес 128/15285 для JCB 3CX, JCB 4CX на модели до 2005 г.в.&lt;/p&gt; &lt;p&gt;Назначение: защита моторного отсека и аккумулятора от наездов, ударов и столкновений.&lt;/p&gt;&lt;p&gt;Расположение: в передней центральной части экскаватора-погрузчика под решеткой защиты радиатора&lt;/p&gt;', '', 'Передний бампер противовес JCB 128/15285', '', ''),
(1167, 1, 'Крепление кронштейна левого крыла на JCB 123/02952', 'Крепление кронштейна (уголок) левого крыла на спецтехнику JCB. Артикул: 123/02952', '', 'Крепление кронштейна левого крыла на JCB 123/02952', '', ''),
(1168, 1, 'Боковина капота левая на JCB 331/30536', 'Боковина капота левая на спецтехнику JCB. Артикул: 331/30536', '', 'Боковина капота левая на JCB 331/30536', '', ''),
(1169, 1, 'Боковина капота правая моторного отсека на JCB 123/04216', 'Боковина капота правая моторного отсека на спецтехнику JCB (новая модель). Артикул: 123/0421', '', 'Боковина капота правая моторного отсека на JCB 123/04216', '', ''),
