(1179, 1, 'Газовый микролифт амортизатор капота JCB 331/66785, 331/47026', '&lt;p&gt;Оригинальное название: Strut gas 335-585&lt;/p&gt;&lt;p&gt;Размеры: 335*585 мм&lt;/p&gt;&lt;p&gt;Газовый амортизатор капота JCB 331/47026 (микролифт). Предназначен для поднятия капота, закрывающего моторный отсек погрузчика JCB 3CX, JCB 4CX.&lt;/p&gt; &lt;p&gt;Деталь изготовлена из инновационных материалов, имеет отличные качественные характеристики и длительный срок службы.&lt;/p&gt;', '', 'Газовый микролифт амортизатор капота JCB 331/66785, 331/47026', '', ''),
(1180, 1, 'Газовый амортизатор заднего окна на JCB 331/28215', 'Газовый амортизатор заднего окна на JCB 3CX, 4CX. Артикул: 331/28215', '', 'Газовый амортизатор заднего окна на JCB 331/28215', '', ''),
