(1192, 1, 'Крыло переднее левое черное (малое) 343мм JCB 123/03874', '&lt;p&gt;&lt;b&gt;Крыло переднее левое черное (малое) 343мм JCB 123/03874&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера:&lt;/b&gt; 123/03874&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с:&lt;/b&gt; JCB&lt;/p&gt;&lt;p&gt;Страна-произвдитель: Турция&lt;p&gt;', '', 'Крыло переднее левое черное (малое) 343мм JCB 123/03874', '', ''),
