(1194, 1, 'Рама правой двери JCB 335/07626', '&lt;p&gt;&lt;b&gt;Рама правой двери JCB 335/07626&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера: 335/07626&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с: &lt;/b&gt;JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-Производитель: &lt;/b&gt;Турция &lt;/p&gt;', '', 'Рама правой двери JCB 335/07626', '', ''),
(1195, 1, 'Рама левой двери JCB 335/07625', '&lt;p&gt;&lt;b&gt;Рама левой двери JCB 335/07625&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Кросс-номера: 335/07625&lt;/b&gt;&lt;/p&gt;&lt;p&gt;&lt;b&gt;Совместимость с: &lt;/b&gt;JCB&lt;/p&gt;&lt;p&gt;&lt;b&gt;Страна-Производитель: &lt;/b&gt;Турция &lt;/p&gt;', '', 'Рама левой двери JCB 335/07625', '', ''),
(1196, 1, 'Гидравлический насос JCB оригинальный Parker 333/G5393', '&lt;p&gt;Гидравлический насос JCB оригинальный Parker 333/G5393.&lt;/p&gt;', '', 'Гидравлический насос JCB оригинальный Parker 333/G5393', '', ''),
(1197, 1, 'Гидравлический насос HEMA для JCB 919/72400', '&lt;p&gt;Предлагаем вам качественные детали для спецтехники, как оригинальные, так и от сторонних производителей. В этом разделе представлен гидравлический насос JCB 919/72400, 919/27100.Основное изделие имеет две секции под шпонку. Модель выполнена по стандартам старого образца и подходит для специальной техники 3CX и 4CX, выпущенной до 2005 года. Главная задача устройства – преобразовывать гидравлическую энергию в механическую, перегоняя жидкость из одного поршня в другой.Чтобы приобрести запчасти на экскаватор-погрузчик JCB, зарегистрируйтесь на нашем сайте и добавьте товар в Корзину.&lt;/p&gt;', '', 'Гидравлический насос HEMA для JCB 919/72400', '', ''),
(1198, 1, 'Гидравлический насос JCB 20/902900 оригинальный Parker', '&lt;p&gt;В этом разделе каталога запасных частей экскаватора представлен гидравлический насос JCB 20/902900 основной. Модель соответствует старому образцу под шпонку. Товар относится к оригинальным, что гарантирует его высокое качество и долгий срок службы. Он подходит для моделей 3СХ и 4СХ от английского бренда, выпущенных до 2006 года. Основная задача этого устройства – превращать гидравлическую энергию в механическую.Цена на запчасти JCB указывается на страницах товаров. Если актуальная стоимость отсутствует, свяжитесь с менеджерами компании, они подробно проконсультируют вас.&lt;/p&gt;', '', 'Гидравлический насос JCB 20/902900 оригинальный Parker', '', ''),
(1199, 1, 'Гидравлический насос JCB 20/903200 оригинальный Parker', '&lt;p&gt;Интернет-магазин запчастей для спецтехники представляет большой ассортимент товаров для экскаваторов-погрузчиков от английского бренда. Все изделия имеют гарантию качества и международные сертификаты.В этом разделе представлен гидравлический насос JCB 20/903200 на два болта под шпонку. Его оригинальное название: Pump main hydraulic 41/29ccr code 4071. Такая запчасть для экскаваторов JCB используется для превращения гидравлической энергии в механическую, за счет перегонки жидкостей. Она имеет простую, но эффективную конструкцию и делается из долговечных, износостойких материалов.&lt;/p&gt;', '', 'Гидравлический насос JCB 20/903200 оригинальный Parker', '', ''),
(1200, 1, 'Гидравлический насос JCB 20/903300 оригинальный Parker', 'Оригинальный основной двухсекционный шестеренчатый гидравлический насос JCB 20/903300 под четыре крепежных болта для экскаваторов-погрузчиков JCB 3CX, JCB 4CX. Оригинальное название: Pump main hydraulic 16/14gpm. Производитель: Parker, GERMANY', '', 'Гидравлический насос JCB 20/903300 оригинальный Parker', '', ''),
(1201, 1, 'Гидравлический насос JCB 332/G7135 оригинальный Parker', '&lt;p&gt;Основной гидравлический насос оригинальный для JCB 3CX, JCB 4CX&lt;/p&gt;Вид: шестеренчатый двухсекционный.Производитель: Parker (use for J.C.Bamford).Страна производства: Germany', '', 'Гидравлический насос JCB 332/G7135 оригинальный Parker', '', ''),
(1202, 1, 'Гидравлический насос JCB 20/912800 оригинальный Parker', '&lt;p&gt;Гидравлический насос основной оригинальный для экскаватора-погрузчика JCB 3CX, 4CX старого образца 1992 - 2004 года выпуска.&lt;/p&gt;&lt;p&gt;Вид: двухсекционный, под шпонку.&lt;/p&gt;&lt;p&gt;Производитель: Parker (use for J.C.Bamford).&lt;/p&gt;&lt;p&gt;Страна: Germany.&lt;/p&gt;', '', 'Гидравлический насос JCB 20/912800 оригинальный Parker', '', ''),
(1203, 1, 'Гидравлический насос JCB 332/F9030 оригинальный Parker', '&lt;p&gt;Гидравлический насос JCB 332/F9030 для экскаватора-погрузчика JCB 3CX/4CX&lt;/p&gt;&lt;p&gt;Основной гидравлический насос оригинальный 332/F9030 (360/290 куб.мм) для JCB 3CX, JCB 4CX&lt;/p&gt;&lt;p&gt;Вид: шестеренчатый двухсекционный.&lt;/p&gt;&lt;p&gt;Производитель: Parker (use for J.C.Bamford).&lt;/p&gt;&lt;p&gt;Страна производства: Germany.&lt;/p&gt;', '', 'Гидравлический насос JCB 332/F9030 оригинальный Parker', '', ''),
(1204, 1, 'Гидравлический насос JCB 20/925340 аналог HEMA', 'Основной гидравлический насос оригинальный 20/925340 (410/260 куб.мм) для JCB 3CX, JCB 4CX. Вид: шестеренчатый двухсекционный высокопроизводительный. Оригинальное название: Pump main hydraulic 41/26 cc rev. Производитель: HEMA. Страна производства: Турция', '', 'Гидравлический насос JCB 20/925340 аналог HEMA', '', ''),
(1205, 1, 'Гидравлический насос JCB 333/G5391 оригинальный Parker', '&lt;p&gt;Основной гидравлический насос оригинальный (370/330 куб.мм) для JCB 3CX, JCB 4CX&lt;/p&gt;&lt;p&gt;Вид: шестеренчатый двухсекционный.&lt;/p&gt;&lt;p&gt;Производитель: PARKER.&lt;/p&gt;&lt;p&gt;Страна производства: Germany.&lt;/p&gt;', '', 'Гидравлический насос JCB 333/G5391 оригинальный Parker', '', ''),
(1206, 1, 'Гидравлический насос JCB 333/G5390 оригинальный Parker', '&lt;p&gt;Основной гидравлический насос JCB оригинальный (360/290 куб.мм) для JCB 3CX, JCB 4CX&lt;/p&gt;&lt;p&gt;Вид: шестеренчатый двухсекционный.&lt;/p&gt;&lt;p&gt;Производитель: PARKER.&lt;/p&gt;&lt;p&gt;Страна производства: Germany.&lt;/p&gt;', '', 'Гидравлический насос JCB 333/G5390 оригинальный Parker', '', ''),
(1207, 1, 'Гидравлический насос JCB 20/925339 оригинальный Parker', '&lt;p&gt;Производитель: ParkerСтрана производства: GermanyГидравлический насос JCB 20/925339, представленный в этом разделе, является основным элементом. Подходит для моделей 3СХ и 4Сх. Его вид: шестеренчатый двухсекционный. Производительность каждой секции: 360 литров в минуту / 260 литров в минуту. Товар изготовлен немецкой компанией Parker. Он имеет международный сертификат, подтверждающий высокое качество.Оригинальное название этой детали для погрузчика: Pump main hydraulic 36/26 cc rev.В каталоге запчастей спецтехники вы также найдете и другие элементы, как оригинальные, так и неоригинальные. Все они доступны для заказа с доставкой и самовывозом.&lt;/p&gt;', '', 'Гидравлический насос JCB 20/925339 оригинальный Parker', '', ''),
(1208, 1, 'Гидравлический насос JCB 332/F9031, 20/925581 оригинальный Parker', '&lt;p&gt;Гидравлический насос 332/F9031 (20/925581) для экскаватора-погрузчика JCB 3CX/4CX&lt;/p&gt;&lt;p&gt;Основной гидравлический насос оригинальный 332/F9031, 20/925581 (370/330 куб.мм) для JCB 3CX, JCB 4CX&lt;/p&gt;&lt;p&gt;Вид: шестеренчатый двухсекционный.&lt;/p&gt;&lt;p&gt;Производитель: Parker (use for J.C.Bamford).&lt;/p&gt;&lt;p&gt;Страна производства: Germany.&lt;/p&gt;', '', 'Гидравлический насос JCB 332/F9031, 20/925581 оригинальный Parker', '', ''),
(1209, 1, 'Гидравлический насос JCB 332/F9029, 20/925579 оригинальный Parker', '&lt;p&gt;Основной гидравлический насос JCB оригинальный 332/F9029, 20/925579 (360/260 куб.мм) для JCB 3CX, JCB 4CX&lt;/p&gt;&lt;p&gt;Вид: шестеренчатый двухсекционный.&lt;/p&gt;&lt;p&gt;Производитель: Parker (use for J.C.Bamford).&lt;/p&gt;&lt;p&gt;Страна производства: Germany.&lt;/p&gt;', '', 'Гидравлический насос JCB 332/F9029, 20/925579 оригинальный Parker', '', ''),
(1210, 1, 'Гидравлический насос JCB 332/F9030 оригинальный Parker', '&lt;p&gt;Гидравлический насос JCB 332/F9030 для экскаватора-погрузчика JCB 3CX/4CX&lt;/p&gt;&lt;p&gt;Основной гидравлический насос оригинальный 332/F9030 (360/290 куб.мм) для JCB 3CX, JCB 4CX&lt;/p&gt;&lt;p&gt;Вид: шестеренчатый двухсекционный.&lt;/p&gt;&lt;p&gt;Производитель: Parker (use for J.C.Bamford).&lt;/p&gt;&lt;p&gt;Страна производства: Germany.&lt;/p&gt;', '', 'Гидравлический насос JCB 332/F9030 оригинальный Parker', '', ''),
(1211, 1, 'Гидрораспределитель телескопа JCB 25/221919', '&lt;p&gt;Распределительный клапан  JCB 25/221919 телескопической рукояти задней стрелы экскватора-погрузчика JCB 3CX, JCB 4CX.Оригинальное название: Valve 1 Spool, Auxiliary BlackАртикул: 25/221919Назначение: гидрораспределитель телескопа и поворота задней стрелы 25/221919 предназначен для распределения потоков рабочей гидравлической жидкости в системе экскаватора-погрузчика JCB, позволяя оператору управлять задней стрелой техники, в том числе поворотом стрелы. С помощью встроенных в распределитель 25/221919 электромагнитных клапанов и соленоидов перекрываются потоки, тем самым позволяя приводить в действие рукоять с помощью рычагов управления непосредственно из кабины.Гидрораспределитель телескопа JCB 25/221919 служит важным узлом, позволяющим управлять на спецтехнике задней стрелой, приводя ее в движение. Это позволяет использовать машину в широком диапазоне применения и производить манипуляции, свойственные определенным видам техники. Запчасти для экскаваторов в Москве и по всем регионам России наш магазин предлагает по выгодным ценам в оригинальном исполнении.Все запчасти имеют сертификат соответствия и гарантийные сроки. Простая форма заказа и быстрая доставка дает возможность нашим покупателям производить качественный ремонт в короткие сроки.&lt;/p&gt;', '', 'Гидрораспределитель телескопа JCB 25/221919', '', ''),
(1212, 1, 'Гидрораспределитель передний JCB 332/F8152 оригинальный Husco с джойстиковым управлением', '&lt;p&gt;Оригинальное название: Valve Loader, 3Spool  Float &amp; ResetПроизводитель: HUSCOГидрораспределитель передний JCB 332/F8152 – это устройство, управляющее гидравлическими потоками в механизмах при помощи подачи сигналов (внешнего воздействия). Эта деталь для спецтехники разработана для установки на гидравлические системы экскаваторов-погрузчиков JCB 3CX, JCB 4CX с 2010 года выпуска по 2017 год.В онлайн-каталоге запчастей экскаватора JCB вы можете найти все необходимые детали и элементы для любого узла агрегата. В интернет-магазине представлены запасные части для любой техники от производителя по самым оптимальным ценам. Детали для JCB погрузчиков, экскаваторов и других видов спецмашин реализуются только оригинальные.&lt;/p&gt;', '', 'Гидрораспределитель передний JCB 332/F8152 оригинальный Husco с джойстиковым управлением', '', ''),
(1213, 1, 'Гидрораспределитель задний JCB 332/F6665 оригинальный Husco', '&lt;p&gt;Гидравлический распределитель задний JCB 332/F6665 для гидравлической системы экскаватора-погрузчика JCB 3CX, JCB 4CX.&lt;/p&gt;Оригинальное название: Valve excavator 6 spool sideshift JCB./SAE.&lt;p&gt;Артикул: 332/F6665.&lt;/p&gt;&lt;p&gt;Производитель: HUSCO.&lt;/p&gt;', '', 'Гидрораспределитель задний JCB 332/F6665 оригинальный Husco', '', ''),
(1214, 1, 'Гидрораспределитель JCB 25/624300 оригинальный Husco', '&lt;p&gt;Гидрораспределитель задний  25/624300 для экскаваторов-погрузчиков JCB 3CX, JCB 4CX&lt;/p&gt;&lt;p&gt;Оригинальное название: Valve excavator sideshift.&lt;/p&gt;&lt;p&gt;Производство: England (HUSCO).&lt;/p&gt;', '', 'Гидрораспределитель JCB 25/624300 оригинальный Husco', '', ''),
(1215, 1, 'Гидрораспределитель задний JCB 25/222930, 25/222931 оригинальный Husco', '&lt;p&gt;Рапределитель 25/222930 на JCB 3CX, JCB 4CX D08C156 6600 f85B для управления гидравлическими потоками в системе.&lt;/p&gt;', '', 'Гидрораспределитель задний JCB 25/222930, 25/222931 оригинальный Husco', '', ''),
(1216, 1, 'Прокладка боковой крышки гидробака JCB 123/09018', '&lt;p&gt;Прокладка боковой крышки гидробака JCB 123/09018 имеет овальную форму с отверстиями для крепежа. Она выполнена из прочного и качественного материала, обеспечивающего герметичность и уплотнение деталей. Цвет изделия синий. Цена на запчасти JCB 3CX указана на странице товара за единицу. Вы также можете приобрести товар оптом. Уточняйте условия оптовой покупки у специалистов. Позвоните или закажите обратный звонок. Менеджеры ответят на все вопросы и подробно проконсультируют вас.Чтобы заказать запасные части для экскаваторов, зарегистрируйтесь на сайте компании и добавьте товар в Корзину.&lt;/p&gt;', '', 'Прокладка боковой крышки гидробака JCB 123/09018', '', ''),
(1217, 1, 'Гидрораспределитель передний JCB 25/624000, 25/222578', '&lt;p&gt;Гидравлический распределитель передний JCB 25/624000 для гидравлической системы экскаватора-погрузчика JCB 3CX, JCB 4CX.&lt;/p&gt;&lt;p&gt;Оригинальное название: Valve 3 spool loader with foat &amp; reset.&lt;/p&gt;&lt;p&gt;Артикул: 25/624000, 25/624000R.&lt;/p&gt;&lt;p&gt;Производитель: HUSCO.&lt;/p&gt;', '', 'Гидрораспределитель передний JCB 25/624000, 25/222578', '', ''),
(1218, 1, 'Гидрораспределитель передний JCB 25/222579 оригинальный Husco', '&lt;p&gt;Гидравлический распределитель передний JCB 25/222579 для гидравлической системы экскаватора-погрузчика JCB 3CX, JCB 4CX.&lt;/p&gt;&lt;p&gt;Оригинальное название: Valve 3 spool loader float and reset.&lt;/p&gt;&lt;p&gt;Артикул: 25/222579.&lt;/p&gt;&lt;p&gt;Производитель: HUSCO.&lt;/p&gt;', '', 'Гидрораспределитель передний JCB 25/222579 оригинальный Husco', '', ''),
(1219, 1, 'Клапан гидросистемы MRV ORIGINAL HUSCO (Оригинал) JCB 25/974602', '&lt;p&gt;Клапан гидросистемы MRV JCB 25/974602.&lt;/p&gt;', '', 'Клапан гидросистемы MRV ORIGINAL HUSCO (Оригинал) JCB 25/974602', '', ''),
(1220, 1, 'Клапан разгрузочный пилотный JCB 25/974643, 25/612826', '&lt;p&gt;Предлагаем вам приобрести клапаны для погрузчика JCB. В ассортименте вы найдете множество товаров отменного качества, как оригинальных, так и неоригинальных. В этом разделе представлен клапан разгрузочный пилотный JCB 25/974643, 25/612826. Он представляет собой гидравлический аппарат, который сбрасывает давление за транспортом после его остановки. Также он может уменьшать производительность погрузчика при отсутствии расхода спецжидкости. Товар состоит из электромагнитного и обратного элементов. Все компоненты отличаются высоким качеством, эффективностью и долговечностью.&lt;/p&gt;', '', 'Клапан разгрузочный пилотный JCB 25/974643, 25/612826', '', ''),
(1221, 1, 'Клапан MRV переднего распределителя JCB 25/222659', '&lt;p&gt;Предлагаем вам приобрести запчасти для экскаватора JCB в Москве. Мы подготовили для вас огромный ассортимент товаров от проверенных производителей со всего мира. В этом разделе вы можете заказать клапан MRV переднего распределителя JCB 25/222659. Он является одним из элементов гидравлической системы. В распределителе используется несколько клапанов. Когда они открываются и закрываются, потоки жидкости перенаправляются. Этим процессом управляет оператор. При необходимости перераспределить каналы, он передвигает ручку управления, кинематически связанную с кольцом стержня.&lt;/p&gt;', '', 'Клапан MRV переднего распределителя JCB 25/222659', '', ''),
(1222, 1, 'Клапан MRV JCB 25/618901', '&lt;p&gt;Клапан на передний распределитель MRV JCB 25/618901 оригинал – это часть гидравлической системы. Данная деталь используется для перенаправления потока спецжидкостей. Когда клапан открывается или закрывается, жидкость поступает дальше или прекращает движение, соответственно. Такие запасные части способны работать при значительных давлениях, однако они обладают большой массой и весом. Из-за резкой посадки возможно возникновение гидроударов и выход детали из строя. Если вы заметили неисправность, закажите новые запчасти JCB в Москве, зарегистрировавшись в нашем интернет-магазине.&lt;/p&gt;', '', 'Клапан MRV JCB 25/618901', '', ''),
(1223, 1, 'Крышка гидравлического бака JCB 32/925421', '&lt;p&gt;Крышка гидравлического бака с замком для JCB 3CX, JCB 4CXВ этом разделе представлен небольшой, но важный элемент кузова – крышка гидравлического бака. Она подходит для моделей экскаваторов-погрузчиков 3СХ и 4СХ.Модель оснащена надежным замком. Крышка гидравлического бака JCB обладает стопором, который управляется ключом зажигания / дверей. И снимая, и устанавливая колпачок, следите, чтобы ключ находился в детали. Чтобы установить его, необходимо вставить ключ и прокрутить, плотно завинтив колпачок. Если использовать крышку гидравлического бака с замком без ключа, то колпачок просто будет проворачиваться, без возможности снять.&lt;/p&gt;', '', 'Крышка гидравлического бака JCB 32/925421', '', ''),
(1224, 1, 'Кожух защитный для РВД JCB 332/09619', '&lt;p&gt;Кожух защитный для РВД JCB 332/09619 обладает высоким качеством, прочностью и стойкостью к износу. Он используется, чтобы оберегать от внешних повреждений рукав высокого давления. Для изготовления детали JCB используются различные материалы – полимеры, углеродистая, оцинкованная и нержавеющая сталь. Устройство представляет собой сплошную твердую оболочку, которая эффективно защищает РВД от негативного воздействия окружающей среды и продлевает его срок службы.Товары из каталога запасных частей для погрузчика можно заказать онлайн, оптом и в розницу, с оперативной доставкой.&lt;/p&gt;', '', 'Кожух защитный для РВД JCB 332/09619', '', ''),
(1225, 1, 'Кожух защитный для РВД JCB 123/08014', '&lt;p&gt;Ищете высококлассные запчасти для экскаваторов в Москве? Заказывайте продукцию онлайн, оптом и в розницу, самовывозом или с доставкой в любую точку страны. Все товары имеют международные сертификаты качества и гарантию на определенные сроки. В этом разделе представлен защитный кожух для РВД JCB 123/08014. Это сплошная твердая оболочка, предназначенная для защиты от повреждений и для обеспечения безопасности рукава высокого давления. Такая деталь погрузчика является частью гибкого трубопровода, транспортирующего специальные моторные жидкости под давлением, передающим рабочее усилие.&lt;/p&gt;', '', 'Кожух защитный для РВД JCB 123/08014', '', ''),
(1226, 1, 'Прокладка гидробака JCB 813/00360', '&lt;p&gt;Прокладка гидробака JCB 813/00360, представленная в этом разделе, являет собой плоское кольцо с несколькими отверстиями по периметру и с большим центральным отверстием. Данная деталь для спецтехники используется для упрочнения области фиксации. Она обеспечивает герметичность механизма, защищает его от пропускания излишней влаги, грязи и пыли. Благодаря ей, устройство сохраняется сухим и чистым. Такие запчасти на экскаватор-погрузчик JCB изготавливаются из мягкого и гибкого материала. Как правило, это резина. Они легко принимают нужную форму, заполняя все щели и стыки между элементами.&lt;/p&gt;', '', 'Прокладка гидробака JCB 813/00360', '', ''),
(1227, 1, 'Прокладка гидробака JCB 813/00375', '&lt;p&gt;Представляем вам каталог запчастей JCB, каждую из которых можно купить онлайн, с доставкой на дом или самовывозом из магазинов. Каждая деталь имеет международный сертификат качества, подтверждающий высокий класс, прочность и надежность изделия.В этом разделе представлена прокладка гидробака JCB 813/00375. Это специальная уплотнительная запчасть для экскаватора-погрузчика. Она используется для герметизации элементов и для защиты их от влаги, грязи, пыли. Форма изделия круглая, имеются отверстия для крепления. Предмет изготовлен из прочного и долговечного материала.&lt;/p&gt;', '', 'Прокладка гидробака JCB 813/00375', '', ''),
(1228, 1, 'Пробка гидробака смотровая малая JCB 265/01289', '&lt;p&gt;Ищете качественные оригинальные или неоригинальные запчасти на экскаватор-погрузчик JCB 3CX? На нашем сайте вы найдете множество товаров от различных производителей со всего мира. В этом разделе представлена пробка гидробака смотровая малая JCB 265/01289. Она изготовлена из прочного металла серебристого цвета и имеет удобную форму, позволяющую закручивать и раскручивать ее.Чтобы добавлять товары из каталога запчастей погрузчика себе в Корзину и оформлять заказ, зарегистрируйтесь на сайте компании. Для оптовых покупателей особые условия! Узнавайте об этом у менеджеров компании.&lt;/p&gt;', '', 'Пробка гидробака смотровая малая JCB 265/01289', '', ''),
(1229, 1, 'Манжета гидрозамка каретки JCB 904/09400', '&lt;p&gt;Предлагаем вам приобрести детали для JCB онлайн, оптом или в розницу, с оперативной доставкой или самовывозом. Все товары доступны для заказа, а большая часть продукции уже находится на складе и в магазинах в Москве, готовая к отправке.Манжета гидрозамка каретки JCB 904/09400, представленная в этом разделе каталога запасных частей погрузчика, выполнена в виде кольца с центральным отверстием. Она изготовлена из двух материалов черного и желтого цветов. Это уплотнительное устройство, оберегающее систему от утечки специальных жидкостей через щели, при резких перепадах давления.&lt;/p&gt;', '', 'Манжета гидрозамка каретки JCB 904/09400', '', ''),
(1230, 1, 'Ремкоплект гидрозамка каретки 904/20140', '&lt;p&gt;Ремкоплект (манжеты) гидрозамка каретки для экскаватора - погрузчика JCB 3CX - 4CX&lt;/p&gt;', '', 'Ремкоплект гидрозамка каретки 904/20140', '', ''),
(1231, 1, 'Ремкомплект гидрозамка каретки JCB 904/20336', '&lt;p&gt;Предлагаем вам приобрести запасные части для погрузчиков от ведущих производителей мира.Ремкомплект гидрозамка каретки JCB 904/20336, представленный в этом разделе, включает в себя набор манжет для гидравлического замка крепления каретки. Этот товар необходим, если вам нужно срочно осуществить починку элемента, отвечающего за запирание рабочей жидкости в поршнях цилиндров. Распространенная причина для проведения ремонта - самопроизвольное втягивание гидроцилиндров вывешивания крана.Чтобы сделать заказ из каталога деталей JCB 3CX, воспользуйтесь удобной онлайн-формой на сайте.&lt;/p&gt;', '', 'Ремкомплект гидрозамка каретки JCB 904/20336', '', ''),
(1232, 1, 'Тройник адаптер JCB 332/E6693', '&lt;p&gt;Тройник адаптер JCB 332/E669 – комплектующая для спецтехники JCB. Модель изготовлена из высококачественной закаленной стали, имеет 3 разъема разного диаметра с резьбой и гарантии от производителя, продается в свободном доступе. Изделие предназначено для замены аналогичной запчасти на спецтехнике JCB, полностью соответствует размерам, указанным в карточке товара.Наш интернет-магазин предлагает своим клиентам купить оригинальные запчасти для экскаваторов JCB от производителя. Детали для спецтехники сопровождаются сертификатами качества и гарантийными обязательствами.&lt;/p&gt;', '', 'Тройник адаптер JCB 332/E6693', '', ''),
(1233, 1, 'Клапан приоритета JCB 332/G3778', '&lt;p&gt;Оригинальное название: Valve steer priority/chargeАртикул: 332/G3778Клапан приоритета (оригинальное наименование - valve steer priority/charge) подходит для техники JCB моделей 3СХ, 4СХ и 5 СХ. Эта деталь обеспечит перенаправление потока в одной из секций гидравлического насоса на рулевое управление и тормозную систему во время работы погрузчика. Эти и другие комплектующие на JCB вы найдете онлайн в структурированном каталоге запчастей. Наш интернет-магазин предлагает оригинальные товары от английского изготовителя, произведенные из материалов высокого качества.&lt;/p&gt;', '', 'Клапан приоритета JCB 332/G3778', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(1234, 1, 'Клапан приоритетный JCB 35/901800', '&lt;p&gt;Клапан приоритетный JCB 35/901800, представленный в этом разделе, подготовлен специально для экскаватора от английского бренда. Такая деталь самостоятельно разделяет и перенаправляет спецжидкость в нужную систему – рулевую или тормозную. Клапан для погрузчика имеет входной канал, к которому подведен поток от питающего насоса. В начальном положении оба типа давления одинаковы. При изменении движения спецжидкость подается в определенный канал. Соответственно, она переходит в рулевую систему или в тормозную.Предлагаем вам заказать эти запчасти на спецтехнику JCB с доставкой или самовывозом.&lt;/p&gt;', '', 'Клапан приоритетный JCB 35/901800', '', ''),
(1235, 1, 'Болт планерной шестерни бортовой передачи JCB 826/01060', '&lt;p&gt;Болт планерной шестерни бортовой передачи JCB 826/01060.&lt;/p&gt;', '', 'Болт планерной шестерни бортовой передачи JCB 826/01060', '', ''),
(1236, 1, 'Патрубок гидравлический JCB 834/00633', '&lt;p&gt;Патрубок гидравлический JCB 834/00633, представленный в данном разделе, являет собой отрезок трубы, согнутый под углом девяносто градусов. Он изготовлен из прочного и долговечного материала черного цвета. Такая запчасть для спецтехники JCB отличается диаметром, толщиной стенок, формой и назначением. Ее главная задача – соединять гидравлическую конструкцию с основным резервуаром.Заказывайте оригинальные или неоригинальные запчасти для погрузчиков в Москве, самовывозом из магазинов или с доставкой во все города страны. Менеджеры ответят на все вопросы и подробно проконсультируют вас.&lt;/p&gt;', '', 'Патрубок гидравлический JCB 834/00633', '', ''),
(1237, 1, 'Патрубок гидравлический шланг гидронасоса от бака JCB 333/F3125', '&lt;p&gt;Патрубок гидравлический шланг гидронасоса от бака JCB 333/F3125.&lt;/p&gt;', '', 'Патрубок гидравлический шланг гидронасоса от бака JCB 333/F3125', '', ''),
(1238, 1, 'Болт ограничительный JCB 559/90056', '&lt;p&gt;Болт ограничительный JCB 559/90056 представляет собой крепежное изделие, сделанное из стали. Оно не дает болту завинчиваться дальше, чем это требуется. Его форма цилиндрическая – стержень с наружной резьбой с головкой с шестью гранями, предназначенными для завинчивания с помощью гаечного ключа. Такие запчасти для спецтехники позволяют соединять детали, применяя резьбовое отверстие.Каталог запчастей JCB позволяет заказать товары онлайн, оптом и в розницу, с оперативной доставкой в любой город страны. Менеджеры помогут вам выбрать продукцию и оформить покупку. Возможна установка любых изделий силами работников нашей компании.&lt;/p&gt;', '', 'Болт ограничительный JCB 559/90056', '', ''),
(1239, 1, 'Гидрораспределитель задний JCB 25/222960', '&lt;p&gt;Гидрораспределитель задний JCB 25/222960.&lt;/p&gt;', '', 'Гидрораспределитель задний JCB 25/222960', '', ''),
(1240, 1, 'Манжета гидрораспределителя JCB 25/975703, 25/221208', '&lt;p&gt;Предлагаем вам купить запчасти на экскаватор-погрузчик онлайн, оптом и в розницу, с доставкой или самовывозом из магазинов компании.В этом разделе представлена манжета гидрораспределителя JCB 25/221208, которая также называется сальником. Данная деталь – это специальное уплотнительное устройство. Предмет изготовлен из качественного материала, отличающегося стойкостью к износу и долговечностью. Такая запасная часть JCB не боится резких изменений температуры, хорошо совмещается с конструкционными материалами и специальной жидкостью. Кроме того, ее легко устанавливать и демонтировать.&lt;/p&gt;', '', 'Манжета гидрораспределителя JCB 25/975703, 25/221208', '', ''),
(1241, 1, 'Манжета гидрораспределителя JCB 25/606103', '&lt;p&gt;Предлагаем вам заказать запчасти JCB по доступной цене. Товары можно приобрести оптом и в розницу, с доставкой или самовывозом.В этом разделе представлена манжета гидрораспределителя JCB 25/606103. Она также известна под названием «сальник». Предмет является уплотнительным приспособлением. Такие детали для спецтехники должны обладать впечатляющими характеристиками. В данном случае, высокое качество подтверждено международными сертификатами. Этот товар стоек к износу, устойчив к перепадам температуры, совместим с конструкционными материалами и спецжидкостью, прост в установке и демонтаже.&lt;/p&gt;', '', 'Манжета гидрораспределителя JCB 25/606103', '', ''),
(1242, 1, 'Манжета гидрораспределителя JCB 25/222661', '&lt;p&gt;В этом разделе представлена манжета гидрораспределителя JCB 25/222661, которая также известна как сальник. Она являет собой уплотнительное устройство. Такая запасная часть для погрузчиков используется для устранения утечек спецжидкости через щели между соединяемыми деталями элементов гидравлического привода. Перетечки могут вызываться перепадом давлений.Если вы хотите заказать запчасти для JCB 3CX или узнать цены на них, свяжитесь с менеджерами компании. Специалисты помогут вам сделать покупку, проконсультируют по стоимости, ответят на все интересующие вопросы по ассортименту.&lt;/p&gt;', '', 'Манжета гидрораспределителя JCB 25/222661', '', ''),
(1243, 1, 'Энергоаккумулятор плавающего ковша SRS 32/925870', '&lt;p&gt;Оригинальное название: Accumulator dischargedАртикул: 32/925870В нашем каталоге запчастей для спецтехники представлен энергоаккумулятор (он же гидроаккумулятор) плавающего ковша для системы амортизации стрелы SRS. В баллон заправляется сухой азот, в аккумуляторе находится гидравлическое масло. Все это обеспечивает оптимальное поглощение ударов при работе гидравлической системы, стабилизирует полный ковш, в том числе при движении погрузчика по сложному покрытию, препятствуя частичной или полной потере груза. В продаже имеется деталь с артикулом 32/925870. Закажите ее с доставкой или возможностью самовывоза.&lt;/p&gt;', '', 'Энергоаккумулятор плавающего ковша SRS 32/925870', '', ''),
(1244, 1, 'Шток переднего гидрораспределителя', '&lt;p&gt;Шток переднего гидрораспределителя относится к кинематическим элементам гидравлической системы специальной техники. Такие запчасти для экскаваторов Москве используют для транспортировки поступательного усилия от привода к запирающему устройству. Деталь соединяет собой ползун и поршень.В каких случаях нужно купить запчасти JCB для замены? Если вы заметили поломку, которую невозможно исправить с помощью обычного ремкомплекта. К таким относится возникновение механических повреждений, например, царапин и сколов.Вы можете обратиться для ремонта к нашим специалистам.&lt;/p&gt;', '', 'Шток переднего гидрораспределителя', '', ''),
(1245, 1, 'Шток заднего гидрораспределителя', '&lt;p&gt;Шток заднего гидрораспределителя является частью гидравлической системы и кинематическим элементом. Главная задача такой запчасти JCB – передача поступательного усилия от привода к запирающему устройству. Он требует замены в случае поломки и возникновения механических повреждений, например, царапин и сколов. Если их нет, то в большинстве случаев достаточно заменить ремкомплект. Вы также можете приобрести его в каталоге запчастей спецтехники онлайн.Товары доступны для заказа оптом и в розницу. Возможна оперативная доставка в любую точку страны, с помощью транспортных компаний.&lt;/p&gt;', '', 'Шток заднего гидрораспределителя', '', ''),
(1246, 1, 'Кран гидролинии 1/2 BSP 2 выхода JCB 25/976300', '&lt;p&gt;Кран гидролинии 1/2 BSP 2 выхода JCB 25/976300 является частью гидравлической системы погрузчика. Он используется для регулировки гидроразводки, в которую также входят шланги, патрубки, дополнительные секции распределителя, быстроразрывные соединения, крепежные детали, скоба и адаптер. Все эти детали для спецтехники образуют гидравлическую линию, которая используется для транспортировки спецжидкости во время обычной работы гидропривода. Она состоит из всасывающей линии, напора и слива, иногда управления и дренажа.Товары можно заказать из каталога запчастей JCB онлайн. Производство: Турция. Завод: FER-RO.&lt;/p&gt;', '', 'Кран гидролинии 1/2 BSP 2 выхода JCB 25/976300', '', ''),
(1247, 1, 'Кран гидролинии 3/4 BSP 2 выхода JCB 25/981200', '&lt;p&gt;В этом разделе представлен кран гидролинии 3/4 BSP 2 выхода JCB 25/981200. Эта деталь погрузчика относится к гидравлической системе. Данный товар применяется для регулировки напора, включения и выключения рабочей жидкости при транспортировки во время работы гидропривода. Привод, в свою очередь, включает в себя несколько линий: всасывающую, напора и слива, редко – управления и дренажа. Кран является частью гидроразводки, в которую также входят шланги, патрубки, дополнительные секции распределителя, быстроразрывные соединения, крепежные детали, скоба и адаптер. Эти элементы можно заказать в каталоге запчастей экскаватора JCB. Производство: Турция. Завод: FER-RO.&lt;/p&gt;', '', 'Кран гидролинии 3/4 BSP 2 выхода JCB 25/981200', '', ''),
(1248, 1, 'Патрубок гидравлического бака к гидронасосу JCB 128/C2447', '&lt;p&gt;Патрубок гидравлического бака к гидронасосу JCB 128/C2447.&lt;/p&gt;', '', 'Патрубок гидравлического бака к гидронасосу JCB 128/C2447', '', ''),
(1249, 1, 'Быстроразъемное соединение БРС 3/4 комплект мама/папа 45/908400, 45/910300', '&lt;p&gt;Оригинальное название: coupling 3/4 bsp female/male quick release typeРасположение: на гидроразводке задней стрелы слева по ходу движенияПроизводство: Турция. Завод: FER-RO.Артикул: 45/908400оединение БРС 3/4 комплект мама/папа 45/908400, 45/910300 или муфта предназначена для подключения к гидроразводке задней стрелы экскаватора-погрузчика JCB 3CX, JCB 4CX навесного оборудования (гидромолот, гидробур). Изделие обеспечивает бесперебойную подачу гидравлического масла в инструмент, быстрое подсоединение инструмента. Детали для спецтехники, представленные в каталоге нашего интернет-магазина, реализуются по ценам от производителя.В онлайн-каталоге запчастей JCB вы можете найти любые комплектующие и детали для вашей техники от данного производителя с сертификатами качества и гарантией.&lt;/p&gt;', '', 'Быстроразъемное соединение БРС 3/4 комплект мама/папа 45/908400, 45/910300', '', ''),
(1250, 1, 'Быстроразъемное соединение комплект 1 (дюйм) мама/папа БРС на спецтехнику JCB 45/904600, 45/910200, 45/904500, 45/910100', 'Быстроразъемное соединение (мама/папа) БРС на спецтехнику JCB 45/904600 быстроразъемное соединение (муфта папа/мама) 1 (дюйм) для подключения к гидроразводке задней стрелы экскаватора-погрузчика JCB 3CX, JCB 4CX навесного оборудования (гидромолот, гидробур).Мама: 45/904500, 45/910100 (coupling 1 bsp female quick release)Папа: 45/904600, 45/910200 (coupling 1 bsp male quick release). Производство: Турция. Завод: FER-RO.', '', 'Быстроразъемное соединение комплект 1 (дюйм) мама/папа БРС на спецтехнику JCB 45/904600, 45/910200, 45/904500, 45/910100', '', ''),
(1251, 1, 'Быстроразъемное соединение БРС комплект (3/8) мама/папа JCB 45/910700, 45/902200, 45/910600, 45/902300', '&lt;p&gt;Быстроразъемное соединение БРС комплект (3/8) мама/папа JCB 45/910700, 45/902200, 45/910600, 45/902300 – это качественный гидравлический механизм, который позволяет моментально фиксировать и разъединять навесные запчасти на экскаваторе-погрузчике. Для подсоединения оборудования оператору не нужно покидать кабину, что значительно экономит время на выполнение работ. Элементы крепятся прочно и надежно, без зазоров. Они изготовлены из качественного материала, способного выдержать высокие нагрузки на разрыв.Товары из каталога деталей JCB 3CX можно заказать онлайн, оптом и в розницу, самовывозом и с доставкой в любую точку страны. Производство: Турция. Завод: FER-RO.&lt;/p&gt;', '', 'Быстроразъемное соединение БРС комплект (3/8) мама/папа JCB 45/910700, 45/902200, 45/910600, 45/902300', '', ''),
(1252, 1, 'Быстроразъемное соединение БРС (1/4) JCB комплект мама/папа 45/902100, 45/916200', '&lt;p&gt;В этом разделе представлено быстроразъемное соединение БРС (1/4) JCB 45/902100. Это элемент фиксации деталей погрузчика, позволяющий в минимальный период времени разъединить их. Такой предмет обеспечивает высокую степень безопасности. Фиксация производится механически, контроль над процессом электронный и гидравлический. С помощью этой запчасти для спецтехники JCB можно сократить время на подготовку к работе и менять навесное оборудование, не покидая кабину оператора. Конструкция изготовлена из высокопрочного и износостойкого материала, способного выдержать серьезные нагрузки на разрыв. Производство: Турция. Завод: FER-RO.&lt;/p&gt;', '', 'Быстроразъемное соединение БРС (1/4) JCB комплект мама/папа 45/902100, 45/916200', '', ''),
(1253, 1, 'Быстроразъемное соединение JCB БРС мама (1/2) JCB 45/910400', '&lt;p&gt;Быстроразъемное соединение JCB БРС (1/2) JCB 45/910400 позволяет надежно фиксировать ковши и другие запасные части экскаватора из каталога, а также моментально разъединять их. Оно представляет собой гидравлическое приспособление, которое играет большую роль в обеспечении безопасности труда на площадке. Такая запчасть для экскаваторов JCB обладает большой надежностью и высокой стойкостью к износу. Она работает как шариковый шарнир между навесным оборудованием и стрелой погрузчика. Товар изготовлен из прочного материала, имеет международный сертификат, подтверждающий качество. Производство: Турция. Завод: FER-RO.&lt;/p&gt;', '', 'Быстроразъемное соединение JCB БРС мама (1/2) JCB 45/910400', '', ''),
(1254, 1, 'Быстроразъемное соединение БРС 1 (дюйм) папа 45/904600, 45/910200', '&lt;p&gt;Оригинальное быстроразъемное соединение (муфта папа/мама) 1 (дюйм) для подключения к гидроразводке задней стрелы экскаватора-погрузчика JCB 3CX, JCB 4CX навесного оборудования (гидромолот, гидробур).&lt;/p&gt;&lt;p&gt;Мама: 45/904500, 45/910100 (coupling 1 bsp female quick release).&lt;/p&gt;&lt;p&gt;Папа: 45/904600, 45/910200 (coupling 1 bsp male quick release).&lt;/p&gt;&lt;p&gt;Мама: 332/e4161, 45/920143.&lt;/p&gt;&lt;p&gt;Мама: 45/920047 (coupling 1-1/16 12 unf female quick release).&lt;/p&gt;&lt;p&gt;Назначение: обеспечивает бесперебойный слив гидравлического масла из инструмента обратно в систему, а также быструю замену инструмента.&lt;/p&gt;', '', 'Быстроразъемное соединение БРС 1 (дюйм) папа 45/904600, 45/910200', '', ''),
(1255, 1, 'Быстроразъемное соединение JCB БРС комплект (1/2) JCB  45/910400 (мама) 45/910500 (папа)', '&lt;p&gt;Быстроразъемное соединение JCB БРС (1/2) JCB 45/910500 – это элемент фиксации различных инструментов и приспособлений. С его помощью вы можете быстро и легко присоединить или отсоединить нужные варианты. Цена и материалы на такие запчасти JCB отличаются. Для изготовления берется алюминий, нержавеющая сталь, латунь, титан, сплавы, пластмассат и не только. Конструктивно подобные запчасти для экскаватора-погрузчика бывают с клапаном на одной и двух сторонах, а также без них.Товары, представленные в этом разделе, выполняются по ISO стандарту и имеют международные сертификаты качества. Производство: Турция. Завод: FER-RO.&lt;/p&gt;', '', 'Быстроразъемное соединение JCB БРС комплект (1/2) JCB  45/910400 (мама) 45/910500 (папа)', '', ''),
(1256, 1, 'Быстроразъемное соединение (мама) БРС 1(дюйм) на спецтехнику JCB 45/904500, 45/910100', 'Быстроразъемное соединение (мама) БРС на спецтехнику JCB 45/904500. Производство: Турция. Завод: FER-RO', '', 'Быстроразъемное соединение (мама) БРС 1(дюйм) на спецтехнику JCB 45/904500, 45/910100', '', ''),
(1257, 1, 'Быстроразъемное соединение (папа) БРС 3/8 на спецтехнику JCB 45/910700', 'Быстроразъемное соединение (папа) БРС на спецтехнику JCB 45/910700. Производство: Турция. Завод: FER-RO', '', 'Быстроразъемное соединение (папа) БРС 3/8 на спецтехнику JCB 45/910700', '', ''),
(1258, 1, 'Быстроразъемное соединение (мама) БРС 3/8 на спецтехнику JCB 45/910600', 'Быстроразъемное соединение (мама) БРС на спецтехнику JCB 45/910600. Производство: Турция. Завод: FER-RO', '', 'Быстроразъемное соединение (мама) БРС 3/8 на спецтехнику JCB 45/910600', '', ''),
(1259, 1, 'Быстроразъемное соединение (папа) 3/4 БРС на спецтехнику JCB 45/910300', 'Быстроразъемное соединение (папа) БРС на спецтехнику JCB 45/910300. Производство: Турция. Завод: FER-RO', '', 'Быстроразъемное соединение (папа) 3/4 БРС на спецтехнику JCB 45/910300', '', ''),
