(1261, 1, 'Шланг поворотного цилиндра JCB 612/26500', 'Шланг поворотного цилиндра JCB 612/26500 предназначен для замены аналогичной детали на спецтехнике JCB. Наш интернет-магазин предлагает запчасти на экскаватор-погрузчик JCB в широком ассортименте по самым оптимальным ценам от мировых производителей.', '', 'Шланг поворотного цилиндра JCB 612/26500', '', ''),
