(1267, 1, 'Распределитель джойстика на JCB 128/G5234', 'Распределитель джойстика на гидрораспределитель от JCB 3CX, 4CX. Артикул: 128/G5234', '', 'Распределитель джойстика на JCB 128/G5234', '', ''),
