(1269, 1, 'Пластина фиксации гидравлических шлангов в основании картеки на JCB 331/64231', 'Пластина фиксации гидравлических шлангов в основании картеки на спецтехнику JCB 3CX, 4CX. Артикул: 331/6423', '', 'Пластина фиксации гидравлических шлангов в основании картеки на JCB 331/64231', '', ''),
(1270, 1, 'Адаптер гидравлического насоса на JCB 903/20774', 'Адаптер гидравлического насоса на JCB 3CX, 4CX. Артикул: 903/2077', '', 'Адаптер гидравлического насоса на JCB 903/20774', '', ''),
(1271, 1, 'Гидравлический насос на JCB. Артикулы: 20/925732, 7049532007', 'Гидравлический насос на спецтехнику JCB. Артикулы: 20/925732, 7049532007', '', 'Гидравлический насос на JCB. Артикулы: 20/925732, 7049532007', '', ''),
(1272, 1, 'Кран гидролинии 1/2, 3 выхода на JCB', 'Кран гидролинии 1/2 BSPL. 3 выхода на JCB. Давление: 500 BAR', '', 'Кран гидролинии 1/2, 3 выхода на JCB', '', ''),
(1273, 1, 'Гидроцилиндр челюсти JCB', '&lt;p&gt;Предлагаем вам гидроцилиндр челюсти в сборе 40х70 длинный шток JCB 556/60051. Такой товар выдерживает наибольшую нагрузку среди остальных деталей. Чтобы он не изнашивался преждевременно, нужно выбрать качественный, прочный и надежный компонент от проверенного производителя. Мы предлагаем вам продажу запчастей JCB, которые прослужат действительно долго. Стоимость таких товаров вас приятно удивит.Гидравлический цилиндр в Москве также стоит купить владельцам различной строительной техники, например, экскаваторов, погрузчиков, тракторов, самосвалов, автокранов и вышек.&lt;/p&gt;', '', 'Гидроцилиндр челюсти JCB', '', ''),
(1274, 1, 'Гидроцилиндр челюсти JCB 556/60367', '&lt;p&gt;Представляем вам гидроцилиндр челюсти в сборе 40х70 короткий шток JCB 556/60367. В качестве движущей силы в таком устройстве используется соответствующая жидкость. Такие детали приводят в движение манипуляторы и навесное оборудование. Стоимость гидроцилиндра указана на странице товара за единицу.Эти элементы бывают односторонними (работают только в одном направлении) и двухсторонними (больше по мощности, работают в двух направлениях). Еще один вид – телескопические. Они обеспечивают большой ход штока.Магазин JCB предлагает вам качественные запчасти для экскаваторов-погрузчиков.&lt;/p&gt;', '', 'Гидроцилиндр челюсти JCB 556/60367', '', ''),
(1275, 1, 'Гидроцилиндр челюсти 556/60331, 556/60077, 556/60234, 556/60401, 556/60459', '&lt;p&gt;Гидроцилиндр челюсти (в сборе) 556/60459.&lt;/p&gt;', '', 'Гидроцилиндр челюсти 556/60331, 556/60077, 556/60234, 556/60401, 556/60459', '', ''),
(1276, 1, 'Гидроцилиндр челюсти 556/60331, 556/60077, 556/60234, 556/60401, 556/60459', '&lt;p&gt;Гидроцилиндр челюсти 556/60331.&lt;/p&gt;', '', 'Гидроцилиндр челюсти 556/60331, 556/60077, 556/60234, 556/60401, 556/60459', '', ''),
(1277, 1, 'Гидроцилиндр опрокидывания переднего ковша в сборе 556/60421 556/60422, 556/60362', '&lt;p&gt;&lt;/p&gt;', '', 'Гидроцилиндр опрокидывания переднего ковша в сборе 556/60421 556/60422, 556/60362', '', ''),
(1278, 1, 'Гидроцилиндр разворота переднего ковша JCB 556/60360', '&lt;p&gt;Гидроцилиндр разворота переднего ковша JCB 556/60360 обладает высоким качеством, долгим сроком службы и износостойкостью. Такие детали создаются из комплектующих ведущих производителей и дополняются высококлассными уплотнителями. При этом стоимость гидроцилиндра достаточно доступна. Она указана на странице товара за единицу. Вы можете не только приобрести запчасти для экскаватора JCB, но и заказать их установку на специальную технику. Также мастера нашей компании могут произвести технический осмотр машины, диагностику и ремонт. Больше подробностей узнавайте у менеджеров. Звоните или заказывайте обратный звонок.&lt;/p&gt;', '', 'Гидроцилиндр разворота переднего ковша JCB 556/60360', '', ''),
(1279, 1, 'Гидроцилиндр подъема переднего ковша JCB 576/60124', '&lt;p&gt;В нашем интернет-магазине вы можете купить запчасти на погрузчик, созданные известными и надежными производителями. Например, в этом разделе представлен гидроцилиндр для подъема переднего ковша 50х80 JCB. Для создания используются хонингованные трубы и хромированные прутки высочайшего качества, которые гарантируют длительный срок эксплуатации и износостойкость. Вы можете не только приобрести запчасти на экскаватор-погрузчик JCB 3CX, но и заказать его установку на вашу технику. Мастера нашей компании могут провести ремонт и техническое обслуживание любых рабочих машин.&lt;/p&gt;', '', 'Гидроцилиндр подъема переднего ковша JCB 576/60124', '', ''),
(1280, 1, 'Гидроцилиндр подъема переднего ковша JCB в сборе 557/60078, 557/60141, 557/60237', '&lt;p&gt;&lt;/p&gt;', '', 'Гидроцилиндр подъема переднего ковша JCB в сборе 557/60078, 557/60141, 557/60237', '', ''),
(1281, 1, 'Гидроцилиндр заднего ковша JCB 557/60210', '&lt;p&gt;Гидроцилиндр заднего ковша JCB (новая модель) 557/60210, 557/60061.&lt;/p&gt;&lt;p&gt;Размеры: 90*105*915 мм.&lt;/p&gt;&lt;p&gt;Транспортировочный вес: 71 кг.&lt;/p&gt;', '', 'Гидроцилиндр заднего ковша JCB 557/60210', '', ''),
(1282, 1, 'Гидроцилиндр заднего ковша JCB 559/60024', '&lt;p&gt;Гидроцилиндр заднего ковша 60х90 JCB, представленный в каталоге нашего сайта, обладает впечатляющим качеством и значительным сроком службы. Товар отвечает за передвижения части оснащения экскаватора-погрузчика. Такая деталь совмещает в себе шток с поршнем и цапфой, а также трубку. Если вы хотите купить в Москве гидравлический цилиндр, зарегистрируйтесь в нашем интернет-магазине. Менеджеры помогут вам определиться с выбором, подобрать подходящий способ оплаты и получения заказа. Если у вас возникли вопросы, позвоните нам или закажите обратный звонок. Цена на запчасти JCB указана на странице товара.&lt;/p&gt;', '', 'Гидроцилиндр заднего ковша JCB 559/60024', '', ''),
(1283, 1, 'Гидроцилиндр заднего ковша JCB 557/60215', '&lt;p&gt;Предлагаем вам гидроцилиндр заднего ковша 60х90 JCB. Этот товар осуществляет привод рабочих органов экскаватора-погрузчика. В данном случае, запчасти спецтехники JCB предназначены для поднятия и опускания заднего ковша. Также такие детали применяются в других видах машин, предназначенных для строительства, рытья земли, подъема грузов.Цилиндр для гидравлики бывает выдвижным и дифференциальным. Такой элемент может иметь одностороннее или двустороннее действие. Модели второго типа обладают большей мощностью, потому что в них усилие жидкости происходит при прямом и обратном ходе штока.&lt;/p&gt;', '', 'Гидроцилиндр заднего ковша JCB 557/60215', '', ''),
(1284, 1, 'Гидроцилиндр заднего ковша в сборе 557/60061', '&lt;p&gt;&lt;/p&gt;', '', 'Гидроцилиндр заднего ковша в сборе 557/60061', '', ''),
(1285, 1, 'Гидроцилиндр заднего ковша в сборе  557/60030', '&lt;p&gt;&lt;/p&gt;', '', 'Гидроцилиндр заднего ковша в сборе  557/60030', '', ''),
(1286, 1, 'Гидроцилиндр задних опор аутригера в сборе 556/60386, 556/60348, 556/60380, 556/60402', '&lt;p&gt;&lt;/p&gt;', '', 'Гидроцилиндр задних опор аутригера в сборе 556/60386, 556/60348, 556/60380, 556/60402', '', ''),
(1287, 1, 'Гидроцилиндр задней опоры аутригера 556/60386, 556/60348, 556/60380, 556/60402, 556/60078', '&lt;p&gt;Представляем вам гидроцилиндр задней опоры в сборе 40х70 JCB. Этот предмет напоминает по принципу действия пневмоцилиндр, но в качестве движущей силы использована жидкость. Он необходим для эффективной работы современной специальной техники. Такой товар должен быть износостойким и надежным, ведь он вынужден испытывать большую нагрузку и может изнашиваться очень быстро. Если вы хотите купить гидравлический цилиндр, выбирайте качественный товар от проверенного производителя.Чтобы приобрести интересующие вас запчасти JCB в Москве, обращайтесь к нашим специалистам.&lt;/p&gt;', '', 'Гидроцилиндр задней опоры аутригера 556/60386, 556/60348, 556/60380, 556/60402, 556/60078', '', ''),
(1288, 1, 'Датчик давления масла КПП 3/8 BSP серый JCB 701/43700', '&lt;p&gt;Предлагаем вам качественные запчасти JCB по приемлемым ценам. В каталоге вы найдете разнообразные товары для моделей 3СХ и 4СХ, как оригинальные, так и неоригинальные. Менеджеры помогут вам определиться с выбором.В этом разделе представлен серый датчик давления масла КПП 3/8 BSP JCB. Он позволяет определить указанный параметр и информирует об этом оператору с помощью специальной стрелочной шкалы на приборной панели. Датчики на погрузчик может быть электронным (или аварийным) и механическим. Первый показывает, не пропало ли давление масла в двигателе, но не дает точных показателей.&lt;/p&gt;', '', 'Датчик давления масла КПП 3/8 BSP серый JCB 701/43700', '', ''),
(1289, 1, 'Гайка (горловина) ГЦ задней опоры JCB 594/10017', '&lt;p&gt;Гайка (горловина) ГЦ задней опоры JCB 594/10017.&lt;/p&gt;', '', 'Гайка (горловина) ГЦ задней опоры JCB 594/10017', '', ''),
(1290, 1, 'Гидроцилиндр задней стрелы JCB 561/60089', '&lt;p&gt;Гидроцилиндр задней стрелы JCB, представленный в этом разделе, напоминает пневмоцилиндр по принципу работы. Такие товары могут быть телескопическими и дифференциальными. По способу действия они делятся на односторонние и двусторонние.В магазине JCB представлены запчасти различных типов, которые позволяют осуществить эффективный подъем и опускание задней стрелы и других рабочих органов специальной техники.Если вы хотите купить гидравлический цилиндр, обратитесь к нашим менеджерам. Специалисты помогут вам выбрать нужную деталь и приобрести ее с доставкой или самовывозом.&lt;/p&gt;', '', 'Гидроцилиндр задней стрелы JCB 561/60089', '', ''),
(1291, 1, 'Гидроцилиндр поворота заднего ковша JCB 559/60155', '&lt;p&gt;Гидроцилиндр (поворот заднего ковша) 60х100 JCB необходим для этой специальной техники. С его помощью ковш приводится в движение, поворачиваясь в заданную оператором сторону. Без подобных деталей манипуляция рабочими органами невозможна. Если вам требуются эти важные запчасти на экскаватор погрузчик JCB, обращайтесь к нашим специалистам. Они помогут вам оформить заказ.В ассортименте в Москве представлено множество гидроцилиндров по доступной цене. Существуют цилиндры одностороннего и двустороннего действия (вторые более мощные), телескопические и дифференциальные.&lt;/p&gt;', '', 'Гидроцилиндр поворота заднего ковша JCB 559/60155', '', ''),
(1292, 1, 'Гидроцилиндр поворота задней стрелы в сборе 590/60192', '&lt;p&gt;&lt;/p&gt;', '', 'Гидроцилиндр поворота задней стрелы в сборе 590/60192', '', ''),
(1293, 1, 'Гильза гидроцилиндра опрокидывания переднего ковша 556/70337, 556/70338, 556/70361', '&lt;p&gt;&lt;/p&gt;', '', 'Гильза гидроцилиндра опрокидывания переднего ковша 556/70337, 556/70338, 556/70361', '', ''),
(1294, 1, 'Гильза гидроцилиндра заднего ковша JCB 557/70006', '&lt;p&gt;Размеры: 90*105*915 ммВес изделия: 24 кгТранспортировочный вес: 28 кгВ этом разделе представлен гильза гидроцилиндра заднего ковша. Его размеры следующие: 90 на 105 на 915 миллиметров. Вес изделия равен двадцати четырем килограммам, а его транспортировочный вес – двадцати восьми килограммам.Цена на цилиндр гидравлический указана на странице товара. Вы можете купить его на нашем сайте для моделей JCB 3CX и 4CX. Товар предназначен для моделей старого поколения. Их главное отличие в диаметре выдвижного штока – он равен пятидесяти миллиметрам.Чтобы купить запчасти оригиналы на JCB оптом, обращайтесь к нашим менеджерам. Они помогут вам оформить заказ.&lt;/p&gt;', '', 'Гильза гидроцилиндра заднего ковша JCB 557/70006', '', ''),
(1295, 1, 'Гидроцилиндр подъема задней стрелы в сборе 563/60084, 561/60274, 561/60273', '&lt;p&gt;&lt;/p&gt;', '', 'Гидроцилиндр подъема задней стрелы в сборе 563/60084, 561/60274, 561/60273', '', ''),
(1296, 1, 'Гильза гидроцилиндра челюсти JCB 556/70345', '&lt;p&gt;Размеры: 70*85*430 ммВес изделия: 9,5 кгТранспортировочный вес: 17 кгПредставляем вам гильзу гидроцилиндра челюсти. Его обычный вес девять с половиной килограмм, транспортировочный равен семнадцати. Размеры товара следующие: 7 ширина, 8,5 высота, 43 сантиметра длина.Такие гидроцилиндры подходят для спецтехники от английского производителя. Они устанавливаются в задней части переднего лобового ковша с правой и с левой стороны. Эта деталь способствует открыванию и закрыванию челюсти экскаватора-погрузчика.Цена на запчасти JCB 3 СХ и 4CX указывается на странице товара. Если у вас возникли вопросы по товару, свяжитесь с нашими менеджерами.&lt;/p&gt;', '', 'Гильза гидроцилиндра челюсти JCB 556/70345', '', ''),
(1297, 1, 'Гильза гидроцилиндра челюсти JCB 556/70366', '&lt;p&gt;Размеры: 70*85*395 ммВес изделия: 8,5 кгТранспортировочный вес: 17,5 кгПредставляем вам гильзу гидроцилиндра челюсти в сборе. Он предназначен для экскаватора-погрузчика от английского бренда, моделей 3СХ и 4СХ. Деталь помещают в задней части лобового ковша с правой и с левой стороны. Использование товара способствует эффективному открытию и закрытию челюсти.Если вы решите купить гидравлический цилиндр с доставкой по Москве и другим городам, вам важно знать его транспортировочный вес. Он равен семнадцати с половиной килограммам. Обычный вес – восемь с половиной.Чтобы заказать запчасти JCB оптом, зарегистрируйте на нашем сайте и добавьте товар в Корзину.&lt;/p&gt;', '', 'Гильза гидроцилиндра челюсти JCB 556/70366', '', ''),
(1298, 1, 'Гильза гидроцилиндра задних опор JCB 556/70380, 556/70348', '&lt;p&gt;Размеры: 70*85*795 ммВес изделия: 15 кгТранспортировочный вес: 20 кгПредставляем вам гильзу гидроцилиндра задних опор аутригера. Его стандартный вес – пятнадцать килограмм. Для доставки важно знать и транспортировочный вес – он равен двадцати килограммам.Мы занимаемся продажей запчастей JCB, обладающих высоким качеством и надежностью. Такой эффективный товар позволит вам без отказов выдвигать задние лапы, чтобы обеспечивать максимальную устойчивость погрузчику во время копания. Данное изделие устанавливают внутрь опор аутригера экскаватора.Чтобы приобрести другие детали к JCB, просмотрите каталог запчастей спецтехники на нашем сайте.&lt;/p&gt;', '', 'Гильза гидроцилиндра задних опор JCB 556/70380, 556/70348', '', ''),
(1299, 1, 'Гильза гидроцилиндра опрокидывания переднего ковша JCB 556/70359', '&lt;p&gt;Размеры: 70*85*880 ммВес изделия: 17,5 кгТранспортировочный вес: 22 кгПредставляем вам качественный и долговечный элемент - гильза гидроцилиндра опрокидывания переднего ковша. Гидроцилиндр отвечает за передвижение вверх-вниз фронтальной части экскаватора-погрузчика. Такие детали JCB устанавливают на верх передней стрелы, располагая их над капотом и радиаторной решеткой. Его обычный вес семнадцать с половиной килограмм, а транспортировочный соответствует двадцати двум килограммам. Размеры детали: 70 на 85 на 880 миллиметров.Цена на запчасти JCB 3CX и 4CX указана на странице товара за единицу. Если вас интересуют специальные предложения, обращайтесь к менеджерам компании.&lt;/p&gt;', '', 'Гильза гидроцилиндра опрокидывания переднего ковша JCB 556/70359', '', ''),
(1300, 1, 'Гильза гидроцилиндр подъема переднего ковша JCB 557/70077', '&lt;p&gt;Размеры: 90*105*915 ммВес изделия: 26 кгТранспортировочный вес: 31 кгВ этом разделе представлена гильза гидроцилиндра подъема переднего ковша в сборе. Он устанавливается с правой и левой стороны передней стрелы над топливным и гидравлическим баками.Параметры этой запчасти JCB следующие: 90 на 015 на 915 миллиметров. Вы можете заказать такие товары в Москве с оперативной доставкой. Для этого необходимо знать не только обычный вес (двадцать шесть килограмм), но и транспортировочный (он равен тридцати одному килограмму).Гидроцилиндры поднятия переднего фронтального ковша предназначены для спецтехники JCB 3CX и 4CX. Вы можете заказать их в любую точку России.&lt;/p&gt;', '', 'Гильза гидроцилиндр подъема переднего ковша JCB 557/70077', '', ''),
(1301, 1, 'Гильза гидроцилиндра телескопа JCB 556/70339', '&lt;p&gt;Размеры: 70*85*1300 ммВес изделия: 24 кгТранспортировочный вес: 30 кгПредставляем вам гильзу гидроцилиндра телескопа. Он предназначен для экскаваторов-погрузчиков от английского бренда JCB. Это приспособление устанавливается внутри задней стрелы на высоте направляющих полозьев. Изделие отвечает за передвижение выдвижного механизма заднего копательного ковша. Его стандартный вес – двадцать четыре килограмма, а транспортировочный равен тридцати килограммам.Чтобы купить гидравлический цилиндр, необходимо зарегистрироваться на нашем сайте и добавить товар в Корзину.&lt;/p&gt;', '', 'Гильза гидроцилиндра телескопа JCB 556/70339', '', ''),
(1302, 1, 'Гильза гидроцилиндра заднего ковша JCB 557/70006', '&lt;p&gt;Размеры: 90*105*915 ммВес изделия: 24 кгТранспортировочный вес: 28 кгВ этом разделе представлен гильза гидроцилиндра заднего ковша. Его размеры следующие: 90 на 105 на 915 миллиметров. Вес изделия равен двадцати четырем килограммам, а его транспортировочный вес – двадцати восьми килограммам.Цена на цилиндр гидравлический указана на странице товара. Вы можете купить его на нашем сайте для моделей JCB 3CX и 4CX. Товар предназначен для моделей старого поколения. Их главное отличие в диаметре выдвижного штока – он равен пятидесяти миллиметрам.Чтобы купить запчасти оригиналы на JCB оптом, обращайтесь к нашим менеджерам. Они помогут вам оформить заказ.&lt;/p&gt;', '', 'Гильза гидроцилиндра заднего ковша JCB 557/70006', '', ''),
(1303, 1, 'Поршень гидроцилиндра опрокидывания переднего ковша 595/10027', '&lt;p&gt;Размеры: 40*70*50Вес изделия: 1 кгТранспортировочный вес: 1,5 кгВ этом разделе представлен поршень гайка гидроцилиндра опрокидывания переднего ковша, челюсти, аутригеров и телескопа. Он предназначен для экскаватора-погрузчика от английского производителя JCB. Параметры такого товара следующие: сорок на семьдесят на пятьдесят миллиметров. Вес этой детали для спецтехники один килограмм, а транспортировочный вес равен полутора килограммам. Данный товар отличается высоким качеством, надежностью и долгим сроком службы.Если вас интересуют запчасти JCB, вы можете заказать их с доставкой по Москве или в другие города страны. Менеджеры помогут вам выбрать подходящие товары.&lt;/p&gt;', '', 'Поршень гидроцилиндра опрокидывания переднего ковша 595/10027', '', ''),
(1304, 1, 'Гильза гидроцилиндра подъема задней стрелы JCB 563/70102', '&lt;p&gt;Размеры: 120*140*1221 ммВес изделия: 42 кгТранспортировочный вес: 50 кгПредставляем вам гильзу гидроцилиндра подъема задней стрелы, предназначенный для двух моделей английской спецтехники. Это качественный и надежный механизм, который долго прослужит вам. При эксплуатации особенно важно следить за рабочим состоянием приспособления.Такие запчасти устанавливаются на погрузчик JCB 4CX и JCB 3CX. Товар обеспечивает плавный и эффективный подъем/опускание задней стрелы экскаватора.Параметры изделия следующие: 12 на 12 на 122,1 сантиметр. Цилиндр для гидравлики весит сорок два килограмма, а его транспортировочный вес пятьдесят килограмм. Именно по этому весу будет рассчитываться стоимость доставки.&lt;/p&gt;', '', 'Гильза гидроцилиндра подъема задней стрелы JCB 563/70102', '', ''),
(1305, 1, 'Гильза гидроцилиндра телескопа рукояти JCB 556/70057', '&lt;p&gt;Гильза гидроцилиндра телескопа рукояти 70х40 JCB 556/70057, представленная в этом разделе, обладает высоким качеством. Так как этот товар вынужден выдерживать значительную нагрузку и противостоять интенсивным коррозийным воздействиям, к нему предъявляются особенные требования. Такие запчасти для экскаватора JCB должны иметь прочные и жесткие стенки, посадочные пояски. Если вы решили купить гильзы для блока цилиндров, выбирайте износостойкие изделия от проверенных производителей. Важно, чтобы товары имели простую конструкцию, а все стыки и сопряжения были полностью герметичны.&lt;/p&gt;', '', 'Гильза гидроцилиндра телескопа рукояти JCB 556/70057', '', ''),
(1306, 1, 'Гильза гидроцилиндра рукояти задней стрелы JCB 559/70177', '&lt;p&gt;Размеры: 100*120*980 ммВес изделия: 30 кгТранспортировочный вес: 37 кгПредставляем вам гильзу гидроцилиндра рукояти задней стрелы. Он гарантирует надежность вашей специальной техники в течение долгих лет. Для создания товаров, представленных в каталоге запчастей JCB 4CX, используются передовые европейские технологии.Размеры изделия следующие: 10 сантиметров ширина, 12 высота, 98 сантиметров длина. Стандартный вес – тридцать килограмм. В цену гидроцилиндра при покупке за пределами Москвы не входит расчет доставки (ее точную стоимость узнавайте у менеджеров). Для такого расчета необходимо указать транспортировочный вес. Данный параметр равен тридцати семи килограммам.&lt;/p&gt;', '', 'Гильза гидроцилиндра рукояти задней стрелы JCB 559/70177', '', ''),
(1307, 1, 'Гильза гидроцилиндра заднего ковша JCB', '&lt;p&gt;Гильза цилиндра заднего ковша 100х60 JCB, представленная в этом разделе, является направляющей втулкой передвигающейся детали. Именно этот элемент выдерживает огромное количество нагрузки. Поэтому к такому предмету предъявляются особые требования. Именно поэтому, решив купить гильзу цилиндра, важно выбрать наиболее качественный и износостойкий товар от проверенного производителя. Только такие изделия выдержат длительную эксплуатацию без механических повреждений и возникновения коррозийных процессов.Цена на запчасти JCB указывается на странице товара за единицу.&lt;/p&gt;', '', 'Гильза гидроцилиндра заднего ковша JCB', '', ''),
(1308, 1, 'Гильза гидроцилиндра опрокидывания переднего ковша 556/70337, 556/70338, 556/70361', '&lt;p&gt;&lt;/p&gt;', '', 'Гильза гидроцилиндра опрокидывания переднего ковша 556/70337, 556/70338, 556/70361', '', ''),
(1309, 1, 'Гильза гидроцилиндра рукояти задней стрелы JCB 559/70229', '&lt;p&gt;Размеры: 100*120*960 ммВес изделия: 26 кгТранспортировочный вес: 31 кгПредставляем вам гильзу гидроцилиндра рукояти задней стрелы. Его стандартный вес двадцать шесть килограмм. Если вы хотите заказать приспособление с доставкой в другой регион, вам важно знать другой параметр – транспортировочный вес. Он равен тридцати одному килограмму. Размеры следующие: ширина 10, высота 12, длина 96 сантиметров.Такие запчасти устанавливают на экскаватор погрузчик JCB. Они обеспечивают поворот рукояти задней стрелы.Стоимость идроцилиндра указана на странице за единицу. Вы можете заказать его онлайн, добавив товар в Корзину в нужном количестве.&lt;/p&gt;', '', 'Гильза гидроцилиндра рукояти задней стрелы JCB 559/70229', '', ''),
(1310, 1, 'Гильза гидроцилиндра рукояти задней стрелы JCB 559/70177', '&lt;p&gt;Размеры: 100*120*980 ммВес изделия: 30 кгТранспортировочный вес: 37 кгПредставляем вам гильзу гидроцилиндра рукояти задней стрелы. Он гарантирует надежность вашей специальной техники в течение долгих лет. Для создания товаров, представленных в каталоге запчастей JCB 4CX, используются передовые европейские технологии.Размеры изделия следующие: 10 сантиметров ширина, 12 высота, 98 сантиметров длина. Стандартный вес – тридцать килограмм. В цену гидроцилиндра при покупке за пределами Москвы не входит расчет доставки (ее точную стоимость узнавайте у менеджеров). Для такого расчета необходимо указать транспортировочный вес. Данный параметр равен тридцати семи килограммам.&lt;/p&gt;', '', 'Гильза гидроцилиндра рукояти задней стрелы JCB 559/70177', '', ''),
(1311, 1, 'Гайка гидроцилиндра JCB 594/10019', '&lt;p&gt;Гайка гидроцилиндра JCB 594/10019.&lt;/p&gt;', '', 'Гайка гидроцилиндра JCB 594/10019', '', ''),
(1312, 1, 'Шток рулевого гидроцилиндра 50mm JCB 4CX 590/40215, 590/40512', '&lt;p&gt;Шток рулевого гидроцилиндра 50mm JCB 4CX 590/40215.&lt;/p&gt;', '', 'Шток рулевого гидроцилиндра 50mm JCB 4CX 590/40215, 590/40512', '', ''),
(1313, 1, 'Шток челюсти JCB 590/40111', '&lt;p&gt;Артикул: 590/40111Размер-1 (короткий): 40*300 ммРазмер-2 (длинный): 40*400 ммВес изделия: 5,5 кгТранспортировочный вес: 10,5 кгПредставляем вам шток гидроцилиндра челюсти переднего фронтального ковша. Он относится к необходимым деталям JCB, а точнее, к элементам экскаваторов-погрузчиков моделей 3CX и 4CX.Приспособление устанавливают на заднюю часть переднего фронтального ковша с правой и с левой стороны. Качественное изделие обеспечивает эффективное и своевременное открытие и закрытие челюсти. Его вес – пять с половиной килограмм. Транспортировочный вес равен десяти с половиной килограммам.В каталоге запчастей JCB представлено множество необходимых изделий от ведущих производителей. Все они доступны для заказа онлайн.&lt;/p&gt;', '', 'Шток челюсти JCB 590/40111', '', ''),
(1314, 1, 'Шток гидроцилиндра челюсти  590/40825', '&lt;p&gt;&lt;/p&gt;', '', 'Шток гидроцилиндра челюсти  590/40825', '', ''),
(1315, 1, 'Шток опрокидывания переднего ковша JCB 590/31200', '&lt;p&gt;Артикул: 590/31200Размеры: 40*1000 ммВес изделия: 12,5 кгТранспортировочный вес: 17 кгПредставляем вам шток опрокидывания переднего ковша. Его ширина четыре сантиметра, а длина – сто сантиметров. Вес изделия – двенадцать с половиной килограмм. Транспортировочный или таксационный вес равен семнадцати килограммам. Товар относится к ассортименту запчастей JCB. Строители в Москве часто используют на стройплощадках модели экскаваторов-погрузчиков JCB 3CX, JCB 4CX, изготовленные английским брендом. Шток устанавливают на верху фронтальной стрелы, над капотом и радиаторной решеткой.Такие детали для спецтехники обеспечивают эффективное опрокидывание ковша.&lt;/p&gt;', '', 'Шток опрокидывания переднего ковша JCB 590/31200', '', ''),
(1316, 1, 'Шток разворота переднего ковша JCB 590/40526', '&lt;p&gt;Шток гидроцилиндра разворота переднего ковша JCB необходим для эффективной работы гидроцилиндра. Главным недостатком такой системы является герметичность, которой сложно добиться конструкторам. Гидросистемы являются основным типом силовых систем множества видов техники. Чтобы завершить сбор системы, позволяющей разворачивать передний ковш, необходимо купить в Москве штоки высокого качества. Такие детали, представленные в каталоге, обладают долгим сроком службы.Наш интернет-магазин также занимается продажей других запчастей для экскаваторов-погрузчиков JCB.&lt;/p&gt;', '', 'Шток разворота переднего ковша JCB 590/40526', '', ''),
(1317, 1, 'Шток подъема переднего ковша JCB 590/40581', '&lt;p&gt;Размеры: 50*935 мм&lt;/p&gt;&lt;p&gt;Представляем вам шток подъема переднего ковша. Он отличается  высоким качеством, подтвержденным экспертами. Этот товар, изготовленный по передовым европейским технологиям, обеспечивает эффективное поднятие и опускание лобового ковша.Изделие относится к широкой линейке деталей для погрузчиков и экскаваторов JCB 3CX, JCB 4CX. Его диаметр 50 миллиметров, а длина 935 миллиметров. Вес четырнадцать килограммов.Чтобы купить запчасти JCB с доставкой в другой регион страны, необходимо рассчитать ее стоимость по транспортировочному весу. У этого изделия он равен девятнадцати килограммам.&lt;/p&gt;', '', 'Шток подъема переднего ковша JCB 590/40581', '', ''),
(1318, 1, 'Шток задних опор аутригера JCB 590/40231', '&lt;p&gt;Артикул: 590/40231&lt;/p&gt;&lt;p&gt;Часть задних стоек устанавливают внутри опор аутригера. Такое приспособление обеспечивает быстро и эффективное выдвижение задних лап. Оно необходимо для работы с гидромолотом и в время копки, чтобы спецтехника не опрокинулась.&lt;/p&gt;', '', 'Шток задних опор аутригера JCB 590/40231', '', ''),
(1319, 1, 'Шток задней опоры JCB 590/40112', '&lt;p&gt;Шток цилиндра задней опоры JCB является неотъемлемой частью гидросистемы экскаватора. В нем на одном конце имеется поршень, а на другом конце – цапфа. Той стороной, где фиксируется поршень, деталь вставлена в трубку. С торцевой части трубка глухая, в нее установлен резьбовой штуцер. Зона, которой шток вставляется в цилиндр, заглушается так, что между заглушкой, цапфой, и деталью получается полностью герметичное соединение.Если вы хотите обеспечить эффективную работу механизмов, вам необходимо найти магазин, занимающийся продажей штоков для гидроцилиндров. Вы можете заказать запчасти на погрузчик JCB 3CX в нашем интернет-магазине.&lt;/p&gt;', '', 'Шток задней опоры JCB 590/40112', '', ''),
(1320, 1, 'Шток заднего ковша JCB 590/40317', '&lt;p&gt;Размеры: 60*1040 ммВес: 24 кгТранспортировочный вес: 28 кгПредставляем вам шток заднего ковша с диаметром 60 мм. Он предназначен для обновленной линейки специальной техники от английского бренда. Такие запчасти устанавливают на экскаватор погрузчик JCB 3CX, JCB 4CX.Размеры товара следующие: длина сто четыре сантиметра, ширина шесть сантиметров. Обычный вес изделия – двадцать четыре килограмма, а транспортировочный равен двадцати восьми килограммам. Этот параметр важен для расчета стоимости доставки в другие города страны.Если вас интересует продажа штоков для гидроцилиндров, обращайтесь к нашим специалистам. Они помогут вам оформить заказ.&lt;/p&gt;', '', 'Шток заднего ковша JCB 590/40317', '', ''),
(1321, 1, 'Шток заднего ковша JCB 590/40119', '&lt;p&gt;Размеры: 50*1040 ммВес: 19 кгТранспортировочный вес: 23 кгПредставляем вам шток заднего ковша с диаметром 50 мм. Его длина 1040 миллиметров. Стандартный вес изделия – девятнадцать килограмм. Приспособление устанавливают на экскаватор-погрузчик старого образца (для нового требуется изделие другого размера). Такие запчасти подходят для экскаватора JCB 3CX, JCB 4CX.Транспортировочный вес товара – двадцать три килограмма. Этот параметр важен для расчета стоимости доставки.Шток гидравлического цилиндра обеспечивает надежность и эффективную эксплуатацию вашей спецтехники на долгие годы. Его высокое качество подтверждено экспертами.&lt;/p&gt;', '', 'Шток заднего ковша JCB 590/40119', '', ''),
(1322, 1, 'Шток рукояти задней стрелы JCB  590/40583 590/40599 590/40771', '&lt;p&gt;Размеры: 60*1040 ммВес изделия: 23 кгТранспортировочный вес: 28 кгВ этом разделе представлен шток гидроцилиндра рукояти задней стрелы. Его устанавливают на модель экскаватора-погрузчика. Его ширина шесть сантиметров, а длина сто четыре сантиметра.Обычный вес такой запчасти для JCB 3CX и 4СХ равен двадцати трем килограммам. Если вы хотите заказать его в Москве, вам важно знать транспортировочный вес. Он соответствует двадцати восьми килограммам.Если вас интересует продажа штоков для гидроцилиндров, обращайтесь к нашим специалистам. Они помогут вам выбрать подходящие варианты и оформить заказ на сайте. Также возможна установка деталей на погрузчик.&lt;/p&gt;', '', 'Шток рукояти задней стрелы JCB  590/40583 590/40599 590/40771', '', ''),
(1323, 1, 'Шток рукояти задней стрелы JCB 590/40599 590/40583 590/40771', '&lt;p&gt;Размеры: 60*1045 ммВес изделия: 25 кгТранспортировочный вес: 30 кгВ этом разделе представлена важная деталь для экскаватора-погрузчика – шток гидроцилиндра рукояти задней стрелы. Его длина 104 с половиной сантиметра, а ширина шесть сантиметров. Вес изделия равен двадцати пяти килограммам, а транспортировочный – тридцати килограммам.В каталоге запчастей JCB есть и другие оригинальные детали. Они точно соответствуют моделям и их параметрам. Чтобы установить такие изделия на погрузчик, вы можете обратиться к нашим специалистам. Они оперативно поставят их, проведут ремонт или диагностику.Предлагаем вам купить шток в Москве с доставкой по столице или в другие города страны.&lt;/p&gt;', '', 'Шток рукояти задней стрелы JCB 590/40599 590/40583 590/40771', '', ''),
(1324, 1, 'Шток рукояти задней стрелы JCB 590/40155', '&lt;p&gt;Шток цилиндра рукояти задней стрелы 60 мм JCB, представленный в этом разделе, является частью гидравлического цилиндра, установленного внутри погрузчика. Деталь обеспечивает эффективное и качественное передвижение ручки стрелы. Чтобы собрать правильную конструкцию основного типа исполнительных блоков, стоит купить шток цилиндра с присоединенным поршнем и цапфой по обоим концам. Вы можете приобрести в нашем интернет-магазине высококачественные товары от известных производителей. Каталог запчастей спецтехники на сайте поражает разнообразием. Детали обладают долгим сроком службы.&lt;/p&gt;', '', 'Шток рукояти задней стрелы JCB 590/40155', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(1325, 1, 'Шток рукояти задней стрелы JCB 590/40155', '&lt;p&gt;Шток цилиндра рукояти задней стрелы 60 мм JCB, представленный в этом разделе, является частью гидравлического цилиндра, установленного внутри погрузчика. Деталь обеспечивает эффективное и качественное передвижение ручки стрелы. Чтобы собрать правильную конструкцию основного типа исполнительных блоков, стоит купить шток цилиндра с присоединенным поршнем и цапфой по обоим концам. Вы можете приобрести в нашем интернет-магазине высококачественные товары от известных производителей. Каталог запчастей спецтехники на сайте поражает разнообразием. Детали обладают долгим сроком службы.&lt;/p&gt;', '', 'Шток рукояти задней стрелы JCB 590/40155', '', ''),
(1326, 1, 'Шток рукояти задней стрелы 590/40771', '&lt;p&gt;&lt;/p&gt;', '', 'Шток рукояти задней стрелы 590/40771', '', ''),
(1327, 1, 'Генератор Perkins JCB 714/32200, 714/40152, 714/40153, 714/40154', '&lt;p&gt;Производитель: KRAUF&lt;/p&gt;&lt;p&gt;Страна-произвоитель: Германия&lt;/p&gt;&lt;p&gt;Серийный номер JCB: 714/32200, 714/40152, 714/40153, 714/40154&lt;/p&gt;&lt;p&gt;Предлагаем вам купить запчасти на погрузчик. В этом разделе представлен генератор 113763 100А JCB 714/40154, заряжающий аккумулятор транспорта. Эта запасная часть обеспечивает эффективную и безотказную работу двигателя внутреннего сгорания в течение всего срока его эксплуатации.Данное устройство приводится в действие путем ременной передачи. Соответственно, при обрыве ремня оно требует своевременной замены. У нас вы можете приобрести генератор фронтального погрузчика и заказать его установку на вашу спецтехнику. Мастера выполнят все работы в короткий срок.&lt;/p&gt;', '', 'Генератор Perkins JCB 714/32200, 714/40152, 714/40153, 714/40154', '', ''),
(1328, 1, 'Шток подъема задней стрелы JCB 590/40156', '&lt;p&gt;Размеры: 66*1260 ммВес изделия: 35 кгТранспортировочный вес: 42 кгВ этом разделе представлен качественный и надежный шток подъема задней стрелы. Вес изделия тридцать пять килограмм. Транспортировочный вес равен сорока двум килограммам.Шток гидравлического цилиндра имеет следующие параметры: ширина 66 миллиметров, а длина 1260 миллиметров. Он обеспечивает эффективный подъем и опускание задней стрелы в специальной технике от английского бренда.В нашем каталоге вы найдете различные запчасти на экскаватор погрузчик JCB. Менеджеры помогут вам выбрать их и сделать заказ онлайн. Детали, произведенные проверенными компаниями, долго прослужат вам.&lt;/p&gt;', '', 'Шток подъема задней стрелы JCB 590/40156', '', ''),
(1329, 1, 'Шток поворота задней стрелы JCB 590/40228', '&lt;p&gt;Размеры: 60*408 ммВес изделия: 12 кгТранспортировочный вес: 17 кгПредставляем вам шток гидроцилиндра поворота задней стрелы. Это приспособление весом двенадцать килограмм. Его транспортировочный вес равен семнадцати килограммам. Размеры товара следующие: ширина 6 сантиметров, длина 40,8 сантиметров.Он подойдет тем, кто желает выгодно купить в Москве запчасти JCB, отличающиеся высоким качеством. Приспособление устанавливают сзади корпуса на каретке. Оно предназначено для перемещения задней стрелы в правую и левую стороны относительно корпуса спецтехники.Другие запчасти для спецтехники широко представлены в нашем интернет магазине.&lt;/p&gt;', '', 'Шток поворота задней стрелы JCB 590/40228', '', ''),
(1330, 1, 'Шток телескопа JCB 590/40118', '&lt;p&gt;Размеры: 40*1380 ммВес изделия: 16 кгТранспортировочный вес: 21 кгВ этом разделе представлен шток телескопа. Это качественное устройство имеет вес шестнадцать килограмм. Что касается его транспортировочного веса, то он равен двадцати одному килограмму. Этот параметр важен тем, кто хочет купить запчасти JCB в Москве или в других городах России.Такой шток гидроцилиндра обеспечивает выдвижение телескопического механизма, расположенного на заднем копательном ковше. Его устанавливают на современные модели экскаваторов 3CX, 4CX от английского бренда.Детали для погрузчиков ставят внутрь задней стрелы на высоте направляющих полозьев.&lt;/p&gt;', '', 'Шток телескопа JCB 590/40118', '', ''),
(1331, 1, 'Шток гидроцилиндра передней стрелы JCB 590/40585', '&lt;p&gt;Шток цилиндра передней стрелы JCB – неотъемлемая часть классического гидроцилиндра. Его конструкция достаточно проста. Кроме штока гидроцилиндра с присоединенным поршнем, понадобится купить саму трубку. Эта деталь передвигается по цилиндру, перемещая поршень. После сбора всей конструкции с штоком, резьбовым штуцером и цапфой, систему заполняют жидкостью, даже пока давление отсутствует.Товар отличается великолепным качеством и долгим сроком службы. Чтобы приобрести запчасти для JCB 3CX в Москве, следует зарегистрироваться на сайте, выбрать изделие и добавить деталь в Корзину.&lt;/p&gt;', '', 'Шток гидроцилиндра передней стрелы JCB 590/40585', '', ''),
(1332, 1, 'Гайка гидроцилиндра поворота задней стрелы 594/14260', '&lt;p&gt;&lt;/p&gt;', '', 'Гайка гидроцилиндра поворота задней стрелы 594/14260', '', ''),
(1333, 1, 'Поршень гидроцилиндра подъема переднего ковша 595/10037', '&lt;p&gt;&lt;/p&gt;', '', 'Поршень гидроцилиндра подъема переднего ковша 595/10037', '', ''),
(1334, 1, 'Поршень гидроцилиндра поворота задней стрелы JCB 595/10048', '&lt;p&gt;Размеры: 60*100*75 ммВес изделия: 2,5 кгТранспортировочный вес: 4 кгВ этом разделе представлен поршень гидроцилиндра поворота задней стрелы. Он обеспечивает эффективное движение оборудования в левую и в правую стороны. Вес поршня JCB равен двум с половиной килограммам. Транспортировочный вес (параметр, который важен для доставки в другие города) соответствует четырем килограммам. Размеры изделия следующие: 60 на 100 на 75 миллиметров.Цена на запчасти JCB 3CX указывается на странице товара за единицу. Вы можете приобрести их оптом и в розницу. Если у вас возникли вопросы, свяжитесь с нашими менеджерами. Они помогут вам выбрать подходящие товары и заказать их.&lt;/p&gt;', '', 'Поршень гидроцилиндра поворота задней стрелы JCB 595/10048', '', ''),
(1335, 1, 'Поршень гидроцилиндра подъема переднего ковша JCB 595/10035', '&lt;p&gt;Размеры: 50*80*65Вес изделия: 1,6 кгТранспортировочный вес: 2,5 кгВ этом разделе представлен гайка поршень гидроцилиндра подъема переднего ковша. Он предназначен для моделей специальной техники, произведенных английским брендом. Приспособление устанавливается на копательный ковш.Вы можете не только приобрести эти и другие запчасти на экскаватор погрузчик JCB 3CX и JCB 4CX, но и заказать их установку на месте. Наши специалисты приедут к вам на площадку в столице и отремонтируют, проведут техосмотр и произведут монтаж деталей.В каталоге запчастей спецтехники представлено огромное количество оригинальных товаров от ведущих производителей.&lt;/p&gt;', '', 'Поршень гидроцилиндра подъема переднего ковша JCB 595/10035', '', ''),
(1336, 1, 'Поршень рукояти задней стрелы JCB 595/10057', '&lt;p&gt;Размеры: 60*100*100 ммВес изделия: 6 кгТранспортировочный вес: 8 кгВ этом разделе вы можете заказать поршень рукояти задней стрелы. Его параметры следующие: 60 на 100 на 100 миллиметров. Его стандартный вес шесть килограмм, а транспортировочный равен восьми килограммам.Полное название этой запчасти на погрузчик JCB – поршень гайка гидроцилиндра управления рукоятью. С помощью такого товара вы легко сможете передвигать ручку экскаватора. Данные приспособления отличаются высоким качеством и долгим сроком эксплуатации.Вы можете приобрести эти и другие запчасти для спецтехники в нашем интернет магазине. Такой товар доступен для заказа прямо сейчас.&lt;/p&gt;', '', 'Поршень рукояти задней стрелы JCB 595/10057', '', ''),
(1337, 1, 'Поршень рукояти задней стрелы 595/10062 (4CX)', '&lt;p&gt;Размеры: 60*110*100 ммВес изделия: 6,5 кгТранспортировочный вес: 9 кгВ этом разделе вы можете приобрести поршень рукояти задней стрелы на JCB. Он обеспечивает эффективное управление ручкой. Его вес равен шести с половиной килограммам. Если вы хотите приобрести запчасти JCB оптом, с доставкой в другой город страны, вам важно знать его транспортировочный вес. Он соответствует девяти килограммам. Такой параметр нужен при расчете стоимости транспортировки.Полное наименование этого товара – поршень гайка гидроцилиндра управления рукоятью погрузчика. Изделие обладает высоким качеством, длительным сроком эксплуатации и впечатляющей надежностью.&lt;/p&gt;', '', 'Поршень рукояти задней стрелы 595/10062 (4CX)', '', ''),
(1338, 1, 'Поршень гидроцилиндра подъема задней стрелы JCB 595/10047', '&lt;p&gt;Размеры: 65*120*87 ммВес изделия: 4,5 кгТранспортировочный вес: 6 кгВ этом разделе представлен поршень гидроцилиндра подъема задней стрелы. Он обеспечивает плавное, надежное и эффективное поднимание и опускание оборудования. Такие запчасти для спецтехники JCB отличаются долгим сроком эксплуатации.Параметры поршня гайки гидравлического цилиндра следующие: 65 на 120 на 87 миллиметров. Что касается веса, то обычный соответствует четырем с половиной килограммам, а транспортировочный – шести килограммам. Второй параметр важен для расчета стоимости доставки.Если вас интересуют другие товары, просмотрите наши каталоги запчастей погрузчиков.&lt;/p&gt;', '', 'Поршень гидроцилиндра подъема задней стрелы JCB 595/10047', '', ''),
(1339, 1, 'Поршень гидроцилиндра заднего ковша JCB 595/10061', '&lt;p&gt;Размеры: 60*90*65Вес изделия: 1,5 кгТранспортировочный вес: 2 кгВ этом разделе представлен поршень гайка гидроцилиндра заднего ковша. Его параметры следующие: 60 на 90 на 65 миллиметров. Вес детали полтора килограмма, а транспортировочный соответствует двум килограммам.Вы также можете купить в Москве гидравлический цилиндр заднего копательного ковша, который легко установить на экскаватор-погрузчик современных моделей, имеющих диаметр штока шестьдесят миллиметров. Для этого обращайтесь к нашим мастерам. Специалисты быстро и качественно поставят запчасть, проведут диагностику.Цена на запчасти JCB указывается на странице товара за единицу.&lt;/p&gt;', '', 'Поршень гидроцилиндра заднего ковша JCB 595/10061', '', ''),
(1340, 1, 'Поршень гидроцилиндра поворота задней стрелы 595/10069', '&lt;p&gt;&lt;/p&gt;', '', 'Поршень гидроцилиндра поворота задней стрелы 595/10069', '', ''),
(1341, 1, 'Поршень гидроцилиндра подъема переднего ковша 595/10037', '&lt;p&gt;&lt;/p&gt;', '', 'Поршень гидроцилиндра подъема переднего ковша 595/10037', '', ''),
(1342, 1, 'Гайка гидроцилиндра задних опор аутригера 594/00120 594/14300', '&lt;p&gt;&lt;/p&gt;', '', 'Гайка гидроцилиндра задних опор аутригера 594/00120 594/14300', '', ''),
(1343, 1, 'Гайка гидравлического цилиндра JCB 332/D4842, 594/00017, 594/14130, 594/00120, 594/14047', '&lt;p&gt;В каталоге запчастей для погрузчика вы найдете огромное количество товаров великолепного качества. Мы выбрали самых надежных производителей, которые изготавливают изделия из лучших компонентов и материалов.В этом разделе можно заказать гайку гидравлического цилиндра 40х70 JCB 594/00017. Это специальная крепежная деталь для спецтехники, которая обеспечивают приложение усилий, требуемых для монтажа элементов. Такой предмет отличается типоразмерами и имеет специальную резьбу. Он находится в сопряжении с болтом. Устройство сочетает в себе обычную гайку и инструмент для ее затяжки.&lt;/p&gt;', '', 'Гайка гидравлического цилиндра JCB 332/D4842, 594/00017, 594/14130, 594/00120, 594/14047', '', ''),
(1344, 1, 'Гайка гидравлического цилиндра (60х90 заднего ковша) JCB 594/14053', '&lt;p&gt;Чтобы приобрести запчасти JCB онлайн, просмотрите наш каталог. Оригинальные и неоригинальные товары обладают впечатляющим качеством, которое подтверждают международные сертификаты и гарантия на определенные сроки.В этом разделе представлена гайка гидравлического цилиндра заднего ковша JCB 594/14053. Это устройство сочетает в себе стандартный крепеж и инструмент для его затяжки. Она является деталью для спецтехники, подходящей для объемного гидродвигателя возвратно-поступательного движения, который имеет одно- и двустороннее действие. Используется для качественной фиксации.&lt;/p&gt;', '', 'Гайка гидравлического цилиндра (60х90 заднего ковша) JCB 594/14053', '', ''),
