(1350, 1, 'Гидроцилиндр телескопа JCB 556/60340', '&lt;p&gt;Гидроцилиндр (телескопа) JCB 556/60340 необходим, чтобы осуществлять привод выдвижного рабочего органа специальной техники. Такие запчасти на экскаватор-погрузчик обладают впечатляющим качеством, долговечностью и стойкостью к износу. Гидравлические цилиндры также используются в ряде видов техники, предназначенной для строительства, подъема грузов и их транспортировки, для рытья ям и котлованов.&lt;/p&gt;', '', 'Гидроцилиндр телескопа JCB 556/60340', '', ''),
(1351, 1, 'Гидроцилиндр поворота колес 3 CX JCB 573/10061, 573/10032, 128/10644', '&lt;p&gt;Гидроцилиндр поворота колес 3 CX JCB 573/10061, 573/10032, 128/10644, 590/40208.&lt;/p&gt;', '', 'Гидроцилиндр поворота колес 3 CX JCB 573/10061, 573/10032, 128/10644', '', ''),
