(1362, 1, 'Гайка гидроцилиндра на JCB 332/G3980', 'Гайка гидроцилиндра на спецтехнику JCB 3CX, 4CX. Размер: 65*120 мм. Артикул: 332/G3980', '', 'Гайка гидроцилиндра на JCB 332/G3980', '', ''),
