(1503, 1, 'Шайба балки балансира переднего моста JCB 5.5 мм. 819/00137', 'Шайба балки балансира переднего моста. Толщина: 5.5 мм. Артикул: 819/00137', '', 'Шайба балки балансира переднего моста JCB 5.5 мм. 819/00137', '', ''),
(1504, 1, 'Масло трансмиссионное Meguin TDL Hypoid-Getriebeoil R 80W-90 GL-4/5 (10 л)', '&lt;p&gt;Масло трансмиссионное Meguin TDL Hypoid-Getriebeoil R 80W-90 GL-4/5 200 л разработано для обеспечения защиты коробки передач, редукторов, мостов от быстрого износа при высокой температуре. Основным преимуществом этого продукта является возможность жидкости создавать тонкий слой, способный выдержать колоссальную нагрузку в контакте деталей. Купить трансмиссионное масло можно в Москве и других регионах страны.Масло для трансмиссии по привлекательной цене предлагает интернет-магазин. Простая форма заявки и быстрая доставка сохранят рабочие характеристики спецмашины.&lt;/p&gt;', '', 'Масло трансмиссионное Meguin TDL Hypoid-Getriebeoil R 80W-90 GL-4/5 (10 л)', '', ''),
(1505, 1, 'LIQUI MOLY. Растворитель ржавчины 39014', 'Для быстрого и эффективного растворения ржавчины. Отлично решает проблему приржавевших болтов и гаек и прочих резьбовых соединений. Средство может применяться в самых широких областях: на станциях технического обслуживания, в быту, в промышленности. После применения обеспечивает защиту от коррозии. Оптимальная увеличенная упаковка по выгодной цене', '', 'LIQUI MOLY. Растворитель ржавчины 39014', '', ''),
(1506, 1, 'Жидкий ключ 18238', 'Жидкий ключ 1823', '', 'Жидкий ключ 18238', '', ''),
(1507, 1, 'Смазка электроконтактов 16525', 'Смазка электроконтактов 1652', '', 'Смазка электроконтактов 16525', '', ''),
(1508, 1, 'Масло моторное синтетическое Meguin Super Leichtlauf FAMO R 15w-40 (10 л)', '&lt;p&gt;HC-синтетическое моторное масло Super Leichtlauf FAMO R SAE 10W-40 для дизельных турбированных двигателей строительной, сельскохозяйственной, специальной техники, грузовых автомобилей, автобусов, тягачей и т.д., в том числе работающих в тяжелых условиях.Фасовка: 5 л, 20 л, 200 лПроизводитель: LIQUI MOLY (Germany)Допуски и разрешения:Класс API CI4ACEA A3/B4-07, E7-07 API SL/CI-4MAN M 3275 MB-Freigaben 228.3 229.1Volvo VDS-3 Deutz DQC III-05Global DHD-1 Mack EO-M PlusCAT ECF-1-a ECF-2Cummins CES 20071/ 72/ 76/ 77/ 78Renault RVI RLD RLD-2&lt;/p&gt;', '', 'Масло моторное синтетическое Meguin Super Leichtlauf FAMO R 15w-40 (10 л)', '', ''),
(1509, 1, 'Масло моторное JCB Oil Synth 5w-40 (5 л)', '&lt;p&gt;Масло моторное JCB Oil Synth 5w-40 обладает впечатляющим качеством. Оно соответствует современным нормам и требованиям, которые предъявляются к эксплуатации тяжелой техники.Масло в двигатель JCB также поставляется в объемах – пять, десять, двадцать или двести литров. Оно необходимо для использования в сложных условиях при минусовой температуре воздуха. Обычно товар эксплуатируют в северных районах и на других территориях с холодным климатом.Полностью синтетическое моторное масло можно приобрести в нашей компании по выгодной цене. Подробности узнавайте у менеджеров компании.&lt;/p&gt;', '', 'Масло моторное JCB Oil Synth 5w-40 (5 л)', '', ''),
(1510, 1, 'Смазка для клемм 16524', 'Смазка для клемм 1652', '', 'Смазка для клемм 16524', '', ''),
(1511, 1, 'Медная смазка высокотемпературная 16495N', 'Медная смазка высокотемпературная 16495', '', 'Медная смазка высокотемпературная 16495N', '', ''),
(1512, 1, 'Смазка многоцелевая синяя в тубах JCB Special HP Grease 4003/2017', '&lt;p&gt;Описание: смазка в патронах литиевая многоцелевая JCB Special HP GreaseПолное название: JCB Special Higt Perfomance Extreme Pressure Grease Назначение: смазывание прессмасленок и тавотниц всех видов пальцев, опор, падшипников, карданов, крестовин, шкворней, рабочего инструмента (включая ударные механизмы)Применение: шприц плунжерный под стандартный европатронАртикул: 4003/2017Цвет: синийФасовка: туба 400 г.Смазка многоцелевая синяя в тубах JCB Special HP Grease является прекрасным смазочным материалом для подшипников, карданов, ударных механизмов, опор, рабочего инструмента и перемасленок. Вещество обладает высокой степенью пластичности и идеально подходит для экскаватора и его деталей. Особенно важным является применение подобных материалов в подшипниках в условиях высоких температур.Расходники JCB и аксессуары вы можете заказать в нашем интернет-магазине по самой оптимальной цене. Качественные запчасти и смазка для экскаватора позволят сделать быстрый и основательный ремонт вашей техники.&lt;/p&gt;', '', 'Смазка многоцелевая синяя в тубах JCB Special HP Grease 4003/2017', '', ''),
(1513, 1, 'Масло моторное Meguin Motorenoil Universal R 15W-40 (5 л)', '&lt;p&gt;Универсальное моторное масло. Предназначено для тяжелой спецтехники, рекомендуется и для автопарков коммерческого направления. Оптимальное сочетание базовых масел и активных ингредиентов этого минерального моторного масла предназначено для использования в различные сезоны. Отличается высокой производительностью и отвечает современным требованиям. Meguin Motorenoil Universal R 15W-40 (реализуется в объеме 5 л) необходимо использовать в соответствии с рекомендациями изготовителей дизельных двигателей.&lt;/p&gt;', '', 'Масло моторное Meguin Motorenoil Universal R 15W-40 (5 л)', '', ''),
(1514, 1, 'Масло JCB Transmission EP SAE30 (1 л)', '&lt;p&gt;Масло оригинальное JCB Transmission EP SAE30 соответствует последним требованиям, предъявляемым к смазкам трансмиссий коробок переключения передач. Вязкость особенно стабильна, а защитные свойства увеличены.Трансмиссионное масло в коробку JCB также может применяться к КПП и других производителей. Необходимо только, чтобы их спецификация соответствовала использованию материала категории ТО4, без фрикционных свойств Dexron II или III.Чтобы заказать масло КПП JCB, обратитесь к нашим специалистам. Они помогут вам оформить заказ и получить товар в кратчайшие сроки.&lt;/p&gt;', '', 'Масло JCB Transmission EP SAE30 (1 л)', '', ''),
(1515, 1, 'Грязеотталкивающая смазка для замков и петель 16482N', 'Грязеотталкивающая смазка для замков и петель 16482', '', 'Грязеотталкивающая смазка для замков и петель 16482N', '', ''),
(1516, 1, 'Алюминевая смазка (аэрозоль) 16473', 'Алюминевая смазка (аэрозоль) 1647', '', 'Алюминевая смазка (аэрозоль) 16473', '', ''),
(1517, 1, 'Селиконовая смазка аэрозоль 16367', 'Селиконовая смазка аэрозоль 1636', '', 'Селиконовая смазка аэрозоль 16367', '', ''),
(1518, 1, 'Масло моторное синтетическое Meguin Super Leichtlauf FAMO R 10w-40 (5 л)', '&lt;p&gt;HC-синтетическое моторное масло Super Leichtlauf FAMO R SAE 10W-40 для дизельных турбированных двигателей строительной, сельскохозяйственной, специальной техники, грузовых автомобилей, автобусов, тягачей и т.д., в том числе работающих в тяжелых условиях.Фасовка: 5 л, 20 л, 200 лПроизводитель: LIQUI MOLY (Germany)Допуски и разрешения:Класс API CI4ACEA A3/B4-07, E7-07 API SL/CI-4MAN M 3275 MB-Freigaben 228.3 229.1Volvo VDS-3 Deutz DQC III-05Global DHD-1 Mack EO-M PlusCAT ECF-1-a ECF-2Cummins CES 20071/ 72/ 76/ 77/ 78Renault RVI RLD RLD-2&lt;/p&gt;', '', 'Масло моторное синтетическое Meguin Super Leichtlauf FAMO R 10w-40 (5 л)', '', ''),
(1519, 1, 'Масло моторное Meguin Motorenoil Universal R 15W-40 (20 л)', '&lt;p&gt;Масло моторное Meguin Motorenoil Universal R 15W-40 представляет собой качественный продукт в этом сегменте. Его используют в качестве рабочей жидкости в одной из самых важных систем машины. Моторное масло по цене от производителя можно купить в Москве и других регионах страны. Данный продукт применяется как рабочая жидкость для всех узлов спецтехники.Моторное масло в высоком качестве для двигателя вы можете приобрести в интернет-магазине. Простая форма заказа и быстрая доставка как по Москве, так и по другим регионам страны позволят сохранить характеристики спецмашины.&lt;/p&gt;', '', 'Масло моторное Meguin Motorenoil Universal R 15W-40 (20 л)', '', ''),
(1520, 1, 'Универсальное средство 16237N', 'Универсальное средство 16237', '', 'Универсальное средство 16237N', '', ''),
(1521, 1, 'LIQUI MOLY. Средство для фиксации винтов 8060', 'Применяется для предотвращения самоотвинчивания крепежа из-за повышенных нагрузок и вибрации, а также для герметизации резьбы или тонких зазоров и для защиты от коррозии. Подходит для любых резьбовых соединений двигателя, трансмиссии, ходовой части автомобилей, мотоциклов, силовой техники и в промышленности. Работает в том числе на замасленных поверхностях. На производстве флакон заполняется продуктом не более, чем наполовину, чтобы иметь гарантированный контакт состава с воздухом', '', 'LIQUI MOLY. Средство для фиксации винтов 8060', '', ''),
(1522, 1, 'Тормозная жидкость JCB HP15 Oil Light Hyd (1 л) 4002/0501', '&lt;p&gt;Тормозная жидкость JCB HP15 Light Hyd 1 л 4002/0501 поставляется в объемных канистрах, удобных для использования. Она предназначена для применения во множестве типов гидросистем и контуров сцепления. Изготовлено масло тормозное для JCB, но также может применяться для различных грузовых и сельскохозяйственных автомобилей. В основном его приобретают для экскаваторов-погрузчиков от этого английского бренда.Тормозная жидкость 4002/0501 JCB 3CX доступна для заказа онлайн по выгодной цене. Чтобы заказать товар, необходимо добавить его в Корзину и оформить покупку на нашей сайте.&lt;/p&gt;', '', 'Тормозная жидкость JCB HP15 Oil Light Hyd (1 л) 4002/0501', '', ''),
(1523, 1, 'Масло JCB Transmission EP 10W (1л)', '&lt;p&gt;Масло JCB Transmission EP 10W известно гораздо более высокими защитными свойствами по сравнению с аналогами. Его вязкость стабильна. Трансмиссионное масло JCB имеет следующие классификации использования: CATERPILLAR TO-4. ALLISON C-4. Данный смазочный материал коробки передач может быть использован и в моторах другой техники. Чтобы он подошел для автотранспорта, нужно учесть спецификацию (она должна учитывать использования жидкости категории TO4). Также следует обратить внимание на фрикционные свойства Dexron II или III (они не должны быть предусмотрены).Температурный режим масла до -35 С, что позволяет его использовать в трансмиссии JCB 3CX, JCB 4CX в зимнее время.Предлагаем вам приобрести масло для погрузчиков JCB.&lt;/p&gt;', '', 'Масло JCB Transmission EP 10W (1л)', '', ''),
(1524, 1, 'LIQUI MOLY. Силиконовый герметик черный 6185', 'LIQUI MOLY.Применяется для уплотнения соединений и как формирователь прокладок при ремонте и обслуживании автомобильной, промышленной и другой техники, а также в быту. Для ремонта двигателя (герметизации различных стыков и соединений, таких как: плоскость разъема клапанной крышки, поддона, водяного насоса), для герметизации и ремонта автомобильных фар, устранения утечек в трубопроводах и многого другого. Может использоваться как универсальный герметик для автомобилей европейского рынка', '', 'LIQUI MOLY. Силиконовый герметик черный 6185', '', ''),
(1525, 1, 'Масло трансмиссионное Meguin TDL Hypoid-Getriebeoil R 80W-90 GL-4/5 (20 л)', '&lt;p&gt;Масло трансмиссионное Meguin TDL Hypoid-Getriebeoil R 80W-90 GL-4/5 20 л представляет собой состав для смазки коробки передач, рулевого механизма, а также редукторов всех видов. Масло трансмиссионное по приемлемой цене можно купить в Москве и в других регионах страны. Простая форма заказа и быстрая доставка обеспечат защиту от износа под воздействием высоких температур.Масло в высоком качестве для трансмиссии предлагает интернет-магазин. Важным преимуществом этого продукта является его способность создавать тонкую масляную пленку, выдерживающую большую нагрузку в узлах трения деталей.&lt;/p&gt;', '', 'Масло трансмиссионное Meguin TDL Hypoid-Getriebeoil R 80W-90 GL-4/5 (20 л)', '', ''),
(1526, 1, 'Масло JCB Transmission HP Gear Oil 90 (1 л)', '&lt;p&gt;Масло JCB Transmission HP Gear Oil 90 является универсальным видом смазочного материала. Оно предназначено для использования в тяжелейших условиях. Его можно применять для ряда передач при использовании до ста пятидесяти градусов. Масло КПП JCB отличается великолепной стойкостью к износу при высоких скоростях и крутящем моменте, легко выдерживает ударные нагрузки. Эти особенности обеспечивают противозадирные присадки.Масло трансмиссии JCB поставляется в объеме 5, 10, 20 и 200 литров. Информацию о цене вы найдете на странице товара. Заказать его можно онлайн, по доступной цене.&lt;/p&gt;', '', 'Масло JCB Transmission HP Gear Oil 90 (1 л)', '', ''),
(1527, 1, 'LIQUI MOLY. Очиститель контактов 7510', 'Очиститель контактов 751', '', 'LIQUI MOLY. Очиститель контактов 7510', '', ''),
(1528, 1, 'LIQUI MOLY.Секундный клей 7557', 'Для быстрой склейки деталей из металлов, пластмасс, стекла, резины и дерева. Кроме олефиновых пластиков', '', 'LIQUI MOLY.Секундный клей 7557', '', ''),
(1529, 1, 'Масло JCB Transmission Special Gear Plus (1 л)', '&lt;p&gt;Масло трансмиссионное JCB Transmission Special Gear Plus для использования в задних ведущих мостах с мокрыми тормозами экскаваторов-погрузчиков JCB 3CX, 4CX, 5CX.Масло JCB Transmission Special Gear Plus предназначено для маслопогруженных тормозных систем, когда тормозные и фрикционные диски погружены в масляную ванну, имеет высокую стабильность показателей вязкости, улучшенный температурный режим работы в тормозной системе JCB. Это позволяет защитить все трущиеся элементы системы во время их работы, предотвратить преждевременный износ фрикционов, дисков, саттелитов, подшипников, шестерен и осей даже в условиях жесткой эксплуатации.Трансмиссионное масло JCB Transmission Special Gear Plus в задний мост экскаватора-погрузчика JCB соответствует классификациям применения: API GL-4, APL 220 и может применяться в различном интерервале рабочих температур круглый год - не вспениваясь летом, и не загустевая в зимний период.&lt;/p&gt;', '', 'Масло JCB Transmission Special Gear Plus (1 л)', '', ''),
(1530, 1, 'LIQUI MOLY. Средство для фиксации винтов 7653', 'Применяется для предотвращения самоотвинчивания крепежа из-за повышенных нагрузок и вибрации, а также для герметизации резьбы или тонких зазоров и для защиты от коррозии. Подходит для любых резьбовых соединений двигателя, трансмиссии, ходовой части автомобилей, мотоциклов, силовой техники и в промышленности. Работает в том числе на замасленных поверхностях. На производстве флакон заполняется продуктом не более, чем наполовину, чтобы иметь гарантированный контакт состава с воздухом', '', 'LIQUI MOLY. Средство для фиксации винтов 7653', '', ''),
(1531, 1, 'LIQUI MOLY. Спрей для электропроводки 8047', 'Средство для предотвращения образования коррозии в разъемах электрооборудования автомобиля. Смазывает контакты, убирает окислы и надежно защищает от коррозии. Повышает надежность работы электрооборудования автомобиля. Средство безопасно для пластиков, резины и лаковых покрытий', '', 'LIQUI MOLY. Спрей для электропроводки 8047', '', ''),
(1532, 1, 'Масло гидравлическое Meguin Hydraulikoil HLP R46 (20 л)', '&lt;p&gt;Масло гидравлическое Meguin Hydraulikoil HLP R46 20 л – это специальная смазочная основа для передачи энергии. Продукт используют в качестве рабочей жидкости в одной из самых важных систем машины. Масла в высоком качестве в гидравлику экскаваторов можно приобрести в интернет-магазине. Качество смазочных жидкостей подтверждено необходимой документацией.Гидравлическое масло JCB от производителя можно купить в Москве и других регионах страны. Большой ассортимент товара, простая форма заказа и быстрая доставка позволят обеспечить специализированную среду для механизмов машины.&lt;/p&gt;', '', 'Масло гидравлическое Meguin Hydraulikoil HLP R46 (20 л)', '', ''),
(1533, 1, 'Масло JCB Transmission HP Universal ATF (1 л)', '&lt;p&gt;Масло JCB Transmission HP Universal ATF  является универсальной смазочной жидкостью. Его можно применять практически во всех типах систем, которые нуждаются в материале для автоматических коробок передач с модификаторами трения. Возможно применение масла для АКПП JCB в качестве смазки для гидроусилителей рулевого управления.Оно обладает рядом преимуществ. Например, такая жидкость действительно экономична. Если вы используете это масло для трансмиссии, у вас нет шансов случайно залить масло ATF неверной спецификации.Предлагаем вам приобрести этот товар по доступной цене.&lt;/p&gt;', '', 'Масло JCB Transmission HP Universal ATF (1 л)', '', '');
INSERT INTO `oc_product_description` (`product_id`, `language_id`, `name`, `description`, `tag`, `meta_title`, `meta_description`, `meta_keyword`) VALUES
(1534, 1, 'LIQUI MOLY. Универсальное средство LM-40 8049', 'Универсальное средство, обладающее комплексным действием в отношении трущихся металлических деталей: очищает от загрязнений, коррозии и обеспечивает длительное смазывающее действие. Отлично подходит для смазывания петель дверей, резьбовых соединений, шарниров, замков, задвижек, тяг, автомобильных антенн и пр. Средство вытесняет воду из самых труднодоступных мест. Также LM 40 улучшает электрическую проводимость на контактах и устраняет грязь, следы масла и густой смазки.Средство рекомендуется для применения в самых различных сферах: при уходе за автомобилем, на станциях сервисного обслуживания, в быту, в промышленности', '', 'LIQUI MOLY. Универсальное средство LM-40 8049', '', ''),
(1535, 1, 'Безцветная смазка-силикон 3955', 'Смазка для различных контактных зон, где присутствуют пластиковые и/или резиновые детали, таких как стык резиновых уплотнителей дверей и кузова автомобиля, направляющих сидений, соединений шлангов с пластиковыми и/или резиновыми элементами и т.п. Устраняет скрипы контактирующих пластиков. Защищает резиновые и пластиковые детали от высыхания и воздействия ультрафиолета', '', 'Безцветная смазка-силикон 3955', '', ''),
(1536, 1, 'Средство для фиксации винтов (средней фиксации) 3802', 'Применяется для предотвращения самоотвинчивания крепежа из-за повышенных нагрузок и вибрации, а также для герметизации резьбы или тонких зазоров и для защиты от коррозии. Подходит для любых резьбовых соединений двигателя, трансмиссии, ходовой части автомобилей, мотоциклов, силовой техники и в промышленности. Работает в том числе на замасленных поверхностях. На производстве флакон заполняется продуктом не более, чем наполовину, чтобы иметь гарантированный контакт состава с воздухом', '', 'Средство для фиксации винтов (средней фиксации) 3802', '', ''),
(1537, 1, 'Масло гидравлическое JCB НР-32 (10 л)', '&lt;p&gt;Масло гидравлическое JCB НР-32 является специализированной жидкостью, которая создается методом экстракционной очистки основных масел, в которые добавляют присадки высокого качества. Данный товар способен снизить скорость изнашиваемости различных элементов системы. Также JCB масло в гидравлику прекрасно выполняет свои основные обязанности. Жидкость великолепно защищает от ржавчины и предотвращает усталость металла. Также она обладает отличными фильтрационными качествами.Вы можете купить гидравлическое масло, чтобы значительно продлить срок службы вашего транспорта.&lt;/p&gt;', '', 'Масло гидравлическое JCB НР-32 (10 л)', '', ''),
(1538, 1, 'Быстрый очиститель 1900', 'Для быстрого обезжиривания и очистки различных деталей автомобиля. Используется для очистки от масляных и жировых загрязнений деталей тормозной системы, коробки передач, сцепления и т. п. Быстро испаряется, не оставляет следов. Хорошо удаляет остатки смол и смазок. Обладает отличным проникающим действием. Не оставляет следов. Не содержит ацетона и хлора', '', 'Быстрый очиститель 1900', '', ''),
(1539, 1, 'Дизельный антигель концентрат 3900', 'Дизельный антигель концентрат 390', '', 'Дизельный антигель концентрат 3900', '', ''),
(1540, 1, 'Масло гидравлическое HP32 (20 л.) 4002/1045', 'Масло гидравлическое HP32 (20 л.) 4002/104', '', 'Масло гидравлическое HP32 (20 л.) 4002/1045', '', ''),
(1541, 1, 'Масло гидравлическое JCB НР-46 (20 л)', '&lt;p&gt;Масло гидравлическое JCB НР-46 обладает впечатляющим качеством. Для его создания используется метод малого содержания цинка. Такое масло для гидравлики имеет особые свойства. Оно уменьшает степень и скорость износа элементов системы, в том числе и двигателя. Фильтрационные качества этого смазочного материала также на высоте, как во влажном, так и в сухом климате. Срок его службы достаточно высок.Жидкость включает в себя высококлассное базовое масло селективной очистки и дополнительные присадки. JCB масло в гидравлику эффективно защищает от ржавчины и усталости металла.&lt;/p&gt;', '', 'Масло гидравлическое JCB НР-46 (20 л)', '', ''),
(1542, 1, 'Дизельный антигель концентрат 1878', 'Средство предназначено для поддержания топлива в жидком состоянии при низких температурах до -31 °C. Используется для самых современных дизельных систем - присадка разработана по высочайшим стандартам как в отношении безопасности для самих систем автомобиля, так и в отношении экологических норм', '', 'Дизельный антигель концентрат 1878', '', ''),
(1543, 1, 'Антифриз на JCB оригинал 20 литров 4006/1103', 'Антифриз на JCB оригинал. Канистра 20л, 4006/110', '', 'Антифриз на JCB оригинал 20 литров 4006/1103', '', ''),
(1544, 1, 'Смазка JCB графитовая для гидромолота 4003/1119', '&lt;p&gt;Смазка пластичная консистентная в тубах JCB графитовая для гидромолота 4003/1119Цвет: серыйФасовка: евротубаВес: 400 гСмазка JCB графитовая для гидромолота 4003/1119 – это специальное вещество, обладающее высокой степенью пластичности. В состав смазки входят специальные загустители, усиленные твердыми смазочными включениями. Благодаря этому, вещество обладает высокой влагостойкостью, устойчивостью к воздействию температур и липкостью. Все эти качества необходимы для обеспечения минимального трения узлов гидромолота.В нашем интернет-магазине запчастей для спецтехники вы можете купить товары по самым оптимальным ценам от производителя. В каталоге представлены запчасти на экскаватор-погрузчик JCB и для других видов техники от компании любого модельного ряда.&lt;/p&gt;', '', 'Смазка JCB графитовая для гидромолота 4003/1119', '', ''),
(1545, 1, 'Шприц плунжерный для смазки Kaizer Germany JCB 992/11300', '&lt;p&gt;Шприц плунжерный для смазки Kaizer Germany JCB 992/11300 применяется для более качественной смазки узлов и деталей техники. Разные модели отличаются по силе давления, по показателю скорости подачи смазочного материала, а также по весу приспособления. Профессиональный плунжерный шприц позволяет максимально доставлять смазочный материал в агрегаты с повышенной вероятностью износа.Запчасти спецтехники JCB наш интернет-магазин предлагает в широком ассортименте и по самым оптимальным ценам. Качественные детали от производителя позволят сделать быстрый и эффективный ремонт.&lt;/p&gt;', '', 'Шприц плунжерный для смазки Kaizer Germany JCB 992/11300', '', ''),
(1546, 1, 'Антифриз на JCB оригинал  10 литров 4006/1103', 'Антифриз на JCB оригинал. Канистра 10л, 4006/110', '', 'Антифриз на JCB оригинал  10 литров 4006/1103', '', ''),
(1547, 1, 'Тормозная жидкость JCB HP15 Oil Light Hyd оригинальная 4002/0503E', 'Тормозная жидкость JCB HP15 Oil Light Hyd оригинальная. 4002/0503E, 4002/0503', '', 'Тормозная жидкость JCB HP15 Oil Light Hyd оригинальная 4002/0503E', '', ''),
(1548, 1, 'Масло трансмиссионное GEAR OIL (20 л.) 4000/2245', 'Масло трансмиссионное GEAR OIL (20 л.)  10W 4000/2245', '', 'Масло трансмиссионное GEAR OIL (20 л.) 4000/2245', '', ''),
(1549, 1, 'Масло трансмиссионное GEAR OIL (20 л.) 4000/2545', 'Масло трансмиссионное GEAR OIL (20 л.)  10W 4000/2545', '', 'Масло трансмиссионное GEAR OIL (20 л.) 4000/2545', '', ''),
(1550, 1, 'Масло трансмиссионное GEAR OIL (10 л.) 4000/2245', 'Масло трансмиссионное GEAR OIL (10 л.)  4000/224', '', 'Масло трансмиссионное GEAR OIL (10 л.) 4000/2245', '', ''),
(1551, 1, 'Масло трансмиссионное GEAR OIL (10 л.) 4000/2545', 'Масло трансмиссионное GEAR OIL (10 л.) 10W 4000/254', '', 'Масло трансмиссионное GEAR OIL (10 л.) 4000/2545', '', ''),
(1552, 1, 'JCB Oil Synth 5W-40 (10 л.) 4001/2745', 'Масло моторное JCB Oil Synth 5w-40 (10 л.) 4001/2745', '', 'JCB Oil Synth 5W-40 (10 л.) 4001/2745', '', ''),
(1553, 1, 'JCB Oil Synth 5W-40 (20 л.) 4001/2745', 'Масло моторное JCB Oil Synth 5W-40 (20 л.) 4001/2745', '', 'JCB Oil Synth 5W-40 (20 л.) 4001/2745', '', ''),
